B.Jp=A.b(s([" - Ya\u015famlar\u0131nda ger\xe7ek a\u015fk\u0131n sadece mant\u0131k s\xfczgecinden ge\xe7ti\u011fine inand\u0131klar\u0131 i\xe7in, isteklerine kavu\u015fmak i\xe7in idealleri i\xe7in ya\u015farlar.\n\n - \u0130stemeseler de \xf6n yarg\u0131l\u0131 olmaktan kendilerini alamazlar.\n\n - Birlikte oldu\u011fu ki\u015fi s\xfcrekli m\xfckemmel g\xf6rmek istedikleri i\xe7in, partnerlerini tenkitleriyle ya\u015famlar\u0131ndan bezdirebilirler. \n\n - Y\xfcksek standartlar\u0131 zamanla kendileriniz de rahats\u0131z eder Ya\u015fam\u0131 ve a\u015fk\u0131 ciddiye alan, ender ki\u015filerdendir. \n\n - Romantizmde bile ger\xe7eklerden fazla uzakla\u015fmaz ve duygular\u0131n\u0131 herkesten daha ger\xe7ek\xe7i ya\u015farlar G\xfcvendikleri ki\u015filere yard\u0131m etmeyi sevmelerine ra\u011fmen, inanmad\u0131klar\u0131 ve tembel olduklar\u0131n\u0131 bildikleri ki\u015filere kar\u015f\u0131 so\u011fuk davran\u0131rlar.\n\n - Ya\u015famlar\u0131 boyunca dinlenmeden \xe7al\u0131\u015f\u0131rlar.\n\n"," - Ketum ve ciddi tav\u0131rlar\u0131 ile tan\u0131nan bir O\u011flak erke\u011finin yumu\u015fac\u0131k bir kalbi vard\u0131r.\n\n - D\u0131\u015fardan g\xf6r\xfclen g\xf6r\xfcnt\xfcs\xfcn\xfcn alt\u0131nda \xe7ekingen ve duygusal bir ki\u015filik yatar.\n\n - Akl\u0131 ba\u015f\u0131nda ve g\xfcvenilirdir.\xc7evresinde olup bitenleri, mant\u0131k \xe7er\xe7evesinde g\xf6zlemler.\n\n - Sert bir mant\u0131kla yakla\u015f\u0131r ve sonu\xe7 her zaman do\u011frudur.Sakin ve sade ki\u015filerdir.\n\n - Olaylar\u0131 abartmad\u0131klar\u0131 i\xe7in de baz\u0131 ki\u015filere renkli gelmeyebilirler.\n\n - Aile kavramlar\u0131 \xe7ok \xf6nemlidir ve klasik bir anlay\u0131\u015flar\u0131 vard\u0131r Se\xe7tikleri e\u015f toplumsal ve geleneksel kurallara uygundur.\n\n - \u0130yi bir babad\u0131rlar. Fakat so\u011fuk bir yakla\u015f\u0131m tarzlar\u0131 oldu\u011fu i\xe7in, daima \xe7ocuklar\u0131 ile aralar\u0131nda belli bir mesafe vard\u0131r.\n\n - Onlar\u0131 ya\u015fama erken \xf6\u011fretmek i\xe7in \xe7abalarlar.\n\n - A\u015f\u0131r\u0131 bir \u015fekilde ku\u015fkuculard\u0131r, kolay inanmazlar ama inand\u0131klar\u0131 bir konuyu da sonuna kadar inatla savunurlar.\n\n - \xc7al\u0131\u015fmalar\u0131nda sab\u0131r ve \xf6zenle \xe7al\u0131\u015f\u0131rlarken, g\xf6steri\u015ften uzak bir \u015fekilde i\u015flerini yaparlar\n\n"," - Duygular\u0131n\u0131 ne kadar kontrol alt\u0131nda tutsan da, sevgi dolu bir yap\u0131n var.\n\n - A\u015fk\u0131n zaman i\xe7inde olgunla\u015facak ve co\u015facakt\u0131r. Zor bir k\u0131zs\u0131n.\n\n - Senin kalbine girmek o kadar kolay de\u011fildir. \u0130lk g\xf6r\xfc\u015fte a\u015f\u0131k olanlardan de\u011filsin. \xdcstelik \xe7ok zor be\u011fenirsin. \n\n - Kriterlerin \xe7ok y\xfcksektir. Ya\u015fama \xe7ok farkl\u0131 bakars\u0131n. \xc7ocuksu erkeklere tahamm\xfcl\xfcn yoktur.\n\n  - Seni kazanacak ki\u015finin \xf6ncelikle olgun olmas\u0131 gerekiyor. \n\n - \u0130steklerini her ne kadar dile getirmek istemesen de, hep \xfcst d\xfczeyde bir a\u015fk\u0131n hayalini kurars\u0131n. \n\n - O\u011flaklar\u0131n genelde a\u015fklar\u0131n ya\u015f fark\u0131 fazlad\u0131r. \n\n  - Kar\u015f\u0131s\u0131ndaki ki\u015filerin tarz\u0131na hayran olduklar\u0131 i\xe7in, a\u015fk\u0131 da sayg\u0131 \xe7er\xe7evesi i\xe7inde ya\u015famak isterler.\n\n"," - O\u011eLAK KIZI Minyon bir yap\u0131n var. V\xfccut hatlar\u0131n ince ve bi\xe7imlidir. G\xf6zlerin h\xfcz\xfcnl\xfcd\xfcr.\n\n - \xc7evrene melankolik bakars\u0131n. G\xfc\xe7l\xfc ve gururlusun. Sana bakt\u0131k\xe7a ke\u015ffedilecek g\xfczelliklerin ortaya \xe7\u0131kar. \n\n - Sevgini g\xf6stermesini bilemedi\u011fin i\xe7i, ma\u011frur ve kibirlilikle su\xe7lanabilirsiniz. Do\u011fal ve sakin bir g\xfczelli\u011fin vard\u0131r. - \u0130nsanlar senin y\xfcz\xfcne bakt\u0131klar\u0131 zaman, nedenini bilmezler. Garip bir \xe7ekicili\u011fin vard\u0131r.\n\n - Bazen \xe7evrende buzlar krali\xe7esi olarak adland\u0131r\u0131labilirsin. \n\n - \xc7ocukluk ve gen\xe7lik y\u0131llar\u0131nda ya\u015fam\u0131 o kadar ciddiye al\u0131rs\u0131n ki, b\xfcy\xfcd\xfck\xe7e ve hayat\u0131 tan\u0131d\u0131k\xe7a, kendine k\u0131zar ve art\u0131k ya\u015fama daha rahat bakars\u0131n.\n\n - \u0130\u015fte o zaman, y\xfcz hatlar\u0131n yumu\u015far ve art\u0131k eskisi kadar her \u015feyi dert etmemeye \xe7al\u0131\u015f\u0131rs\u0131n. \n\n - Fotojenik oldu\u011fun i\xe7in, senin burcundan bir\xe7ok manken ve foto model \xe7\u0131kacakt\u0131r. \n\n - \xd6zellikle bacaklar\u0131n ince uzun oldu\u011fu i\xe7in, k\u0131sa mini etekleri \xe7ok g\xfczel ta\u015f\u0131rs\u0131n.\n\n - \xc7evrene o kadar ciddi bak\u0131yorsun ki, l\xfctfen biraz daha g\xfcl. Y\xfcz\xfcn ayd\u0131nland\u0131\u011f\u0131 zaman inan\u0131lmaz \xe7ekicisin.\n\n - O\u011eLAK KIZI PART\u0130 HAVASINDA Siz ciddi ve sistemli O\u011flaklar, iyi organize edilmi\u015f partilerden ho\u015flan\u0131yorsun. \n\n - Bulundu\u011fun ortamda her \u015fey m\xfckemmel olmal\u0131. En k\xfc\xe7\xfck aksilik bile seni \xe7ileden \xe7\u0131kartabilir.  - En uygun ki\u015fileri bir araya getirme sava\u015f\u0131 verirken, olay\u0131 abart\u0131r ve partiyi bir i\u015f toplant\u0131s\u0131 haline getirebilirsin.\n\n - Kat\u0131laca\u011f\u0131n partide \xf6nce kalite ararken, abart\u0131s\u0131z giyinirsin. \n\n - En pahal\u0131 bir \u015feyi bile g\xf6steri\u015fsiz ve ola\u011fan bir \u015fekilde \xfczerinde ta\u015f\u0131rken, k\u0131yafetin hakk\u0131n\u0131 da verirsin. \n\n - K\xfc\xe7\xfck p\u0131rlantalar ve beyaz alt\u0131n vazge\xe7emedi\u011fin tak\u0131lar\u0131nd\u0131r. \n\n - Spor ceketler ve \u015f\u0131k ve sade ayakkab\u0131lar\u0131 tercih edersin. \n\n - Gidece\u011fin partide ciddi bir Bo\u011fa ile sohbet edebilir, Ba\u015fakla ciddi planlar yapar, Akrep\u2019in gizemli bak\u0131\u015flar\u0131ndan etkilenebilirsin.\n\n - Bal\u0131kla sakinle\u015ftirici konu\u015fmalar yaparken, Yenge\xe7\u2019le payla\u015facak ortak \xe7ok \u015fey bulursun.\n\n"," - Ebru \u015eall\u0131, \xc7a\u011fla \u015eikel, Mustafa Sandal, Seda Sayan, \u0130brahim Tatl\u0131ses Benjamin Franklin, Henry Miller, Moliere, Isaac Newton, Elvis Presley, Joan Baez, Marlene Diet Rich, Ava Gardner, Hz. \u0130sa, Filiz Ak\u0131n, Semra \xd6zal, Federico Fellini, Rudyard Kipling, Richard Nixon, Simone De Beauvoir, Martin Luther King, Mao Tsetung. Ebru \u015eall\u0131, \xc7a\u011fla \u015eikel, Mustafa Sandal, Cem Uzan, Seda Sayan, \u0130brahim Tatl\u0131ses\n\n"," - Bir o\u011flak \xe7ocu\u011fuyla asla s\u0131radan bir \xe7ocuk muamelesi yapamazs\u0131n\u0131z. \n\n - Sizi \xf6ylesine k\xfc\xe7\xfck d\xfc\u015f\xfcr\xfcr ki, onun yan\u0131nda acemili\u011finize \u015fa\u015f\u0131r\u0131rs\u0131n\u0131z.\n\n - Zevklerinde azimli ve \u0131srarc\u0131d\u0131r.\n\n - Ger\xe7ekten istedi\u011fi bir \u015fey varsa kesinlikle elde edecektir Grup arkada\u015fl\u0131klar\u0131ndan \xe7ok, \xf6zel sevdi\u011fi tek arkada\u015f\u0131 tercih edecek, t\xfcm zaman\u0131n\u0131 onunla ge\xe7irecektir.. \n\n - Oyuncaklar\u0131n\u0131 belli bir yere koyacak ve siz yerini de\u011fi\u015ftirirseniz k\u0131yametleri koparacakt\u0131r. \n\n - \u0130nat\xe7\u0131 yap\u0131s\u0131 yemek saatlerinin de\u011fi\u015fmesine izin vermeyecek,al\u0131\u015ft\u0131\u011f\u0131 bir e\u015fyas\u0131 eskise bile ondan vazge\xe7meyecektir.\n\n - \xc7ok sevdi\u011fi bir pantolonunu eskimi\u015f haliyle giyecektir. \n\n - Ona alaca\u011f\u0131n\u0131z \u015feyleri \xe7ift almaya \xf6zen g\xf6stermelisiniz. \n\n - Al\u0131\u015f veri\u015f zevki \xe7ok gariptir. Koleksiyon merak\u0131 vard\u0131r. \n\n - \xd6zellikle kalem, anahtarl\u0131k, de\u011fi\u015fik logosu olan e\u015fyalar\u0131 biriktirebilir. \n\n - Foto\u011fraf makinesi, d\xfcrb\xfcn, mikroskop, sat\u0131n almak istedi\u011fi \u015feylerdir. Deri klasik okul \xe7antas\u0131 veya c\xfczdan, kol saatinden de ho\u015flan\u0131r. \n\n - \u0130lgin\xe7 ara\u015ft\u0131rma kitaplar\u0131na ve al\u0131\u015f\u0131lm\u0131\u015f\u0131n d\u0131\u015f\u0131nda m\xfczik aletlerine merakl\u0131d\u0131r.\n\n"," - \u0130\u015fkolik, disiplinli, titiz, inat\xe7\u0131 ve \xe7al\u0131\u015fkan O\u011flaklara \xe7al\u0131\u015fma hayat\u0131na y\xf6nelik bir hediye se\xe7ebilirsiniz.\n\n - \xc7al\u0131\u015fan bir O\u011flak kad\u0131n\u0131na markal\u0131 giysiler, saks\u0131 ve canl\u0131 \xe7i\xe7ekler, ah\u015fap dekorasyon malzemeleri, evrak \xe7antas\u0131, ajanda, veya kalem alabilirsiniz.\n\n - O\u011flak kad\u0131n\u0131na alabilece\u011finiz en uygun hediye tek ta\u015f y\xfcz\xfckt\xfcr. Kolye ve tak\u0131 setleri de uygun di\u011fer hediyelerdendir.\n\n - Romantik o\u011flak erke\u011fi i\xe7in ise \xf6zel kalem ve defter seti, kravat, kol d\xfc\u011fmeleri, deri c\xfczdan, spor ve trekking malzemeleri, pahal\u0131 bir \u015fi\u015fe \u015farap, \u0130sve\xe7 \xe7ak\u0131s\u0131 ve \xe7anta hediye edebilirsiniz.\n\n"," - So\u011fukkanl\u0131d\u0131r. Yap\u0131lmas\u0131 gereken her \u015feyi, sorumluluklar\u0131n\u0131n bilincinde olarak yapar.\n\n - \xc7al\u0131\u015f\u0131rken g\xf6z\xfc hi\xe7bir \u015fey g\xf6rmez. \u0130\u015f ortam\u0131nda insani ili\u015fkileri kuvvetlidir.\n\n - Rekabet duygusu yo\u011fun oldu\u011fu i\xe7in sevilmeyen ki\u015fiyi oynayabilir. \n\n - \u0130dareci ve lider vasf\u0131n\u0131 tam ta\u015f\u0131d\u0131\u011f\u0131 i\xe7in, organizasyonlar\u0131n vazge\xe7ilmez ismidir.\n\n - Madde ile yak\u0131n ba\u011f\u0131 olan bu ki\u015finin ekonomi y\xf6n\xfc olduk\xe7a g\xfc\xe7l\xfcd\xfcr. Kaliteli bir ya\u015fam\u0131 sever. \n\n - Dikkatli ve planl\u0131 bir \u015fekilde hedeflerine ad\u0131m ad\u0131m yakla\u015f\u0131r. \xc7evresinde ki\u015filerle olan mesafesini korur.\n\n"," - Tutucu ve geleneksel yap\u0131n ile g\xfc\xe7l\xfc bir irade sergilersin..\xc7evrendeki herkesin sayg\u0131s\u0131n\u0131 kolayca kazan\u0131rs\u0131n.\n\n - Ya\u015fam\u0131nda hi\xe7bir \u015feyi \u015fansa b\u0131rakmad\u0131\u011f\u0131n i\xe7in, hesap\xe7\u0131l\u0131\u011f\u0131nla ile tan\u0131n\u0131rs\u0131n. Geli\u015fig\xfczel bir d\xfczen sizi rahats\u0131z eder.\n\n - Sab\u0131rl\u0131 oldu\u011fun i\xe7in uzun m\xfcddet sonra hastal\u0131klar\u0131n bir anda \xe7\u0131kar. O\u011flaklar k\xfc\xe7\xfck ya\u015flarda diren\xe7sizdirler. \n\n - Fakat \xe7ocukluk hastal\u0131klar\u0131n\u0131 atlatt\u0131ktan sonra, v\xfccutlar\u0131 daha diren\xe7li olurlar.\n\n - \xd6l\xe7\xfcl\xfc ve disiplinli oldu\u011funuz i\xe7in, fazla yemek yemezsin.. Hastalanaca\u011f\u0131n\u0131 anlad\u0131\u011f\u0131n zaman, kendine \xf6zen g\xf6sterirsin.\n\n - Doktor ve ila\xe7la aran\u0131 hi\xe7 iyi de\u011fildir. Kendi kendinin doktoru oldu\u011fun i\xe7in sa\u011fl\u0131\u011f\u0131na \xf6zen g\xf6steren ender ki\u015filerdensin..\n\n - Ger\xe7ekten hasta oldu\u011funda mant\u0131kl\u0131 ve disiplinli bir davran\u0131\u015f g\xf6sterip, iyi bir hasta olur ve doktorun t\xfcm isteklerini yerine getirirsin..\n\n - Ac\u0131lara yak\u0131nmadan dayan\u0131r, kar\u015f\u0131ndaki ki\u015fileri \xfczmek istemedi\u011fin i\xe7in, hi\xe7 kimse sizin \xe7ekti\u011finiz ac\u0131lar\u0131 bilmezler.\n\n - Kemiklerin zay\u0131f olur. Romatizmal hastal\u0131klara yatk\u0131n olursun. \n\n - Sinirsel rahats\u0131zl\u0131klara ve melankolik olmaya meyillisin.. Yaln\u0131zl\u0131k duygular\u0131 sizi karamsar yapar.\n\n"," - Y\xfckselen burcu O\u011flak olanlar\u0131n ne kadar ciddi olabilece\u011fini kestirmek biraz zordur. \n\n - Ancak bilinmesi gereken en \xf6nemli nokta ise, asla ciddiyetlerini kaybetmeyecekleridir. \n\n - Her konuda olduk\xe7a sab\u0131rl\u0131 davran\u0131r ve acele hareket etmekten nefret eder. \n\n - \u0130stedi\u011fi her \u015feyi daha \xf6nce d\xfc\u015f\xfcnm\xfc\u015f ve planlam\u0131\u015ft\u0131r. \n\n - Bundan dolay\u0131 y\xfckseleni O\u011flak olan insanlar i\xe7in, ne istedi\u011fini bilen ki\u015filer diyebiliriz. \n\n - Pek ne\u015feli olduklar\u0131 s\xf6ylenemez, y\xfczleri genel olarak as\u0131kt\u0131r. Melankolikli\u011fe gidebilecek ruh halleri vard\u0131r.\n\n - \u0130nsanlar\u0131 ele\u015ftirmeyi \xe7ok severler ve bu davran\u0131\u015flar\u0131na engel olamazlar. \n\n - Bunun sonucunda insanlar ile aralar\u0131nda bir tak\u0131m sorunlar ya\u015fanabilir. \n\n - Davran\u0131\u015flar\u0131, konu\u015fmalar\u0131 \xe7ekingendir. Her ne kadar ele\u015ftirici olduklar\u0131n\u0131 s\xf6ylesek te bu durum utanga\xe7 olduklar\u0131n\u0131 gizleyemez. \n\n - \xd6zellikle ikili ili\u015fkiler konusunda olduk\xe7a utanga\xe7 tav\u0131rlar\u0131 vard\u0131r. \n\n - Bir di\u011fer \xf6zellikleri ise, h\u0131rsl\u0131 olmalar\u0131. Hayatlar\u0131n\u0131n hemen, hemen her alana yans\u0131m\u0131\u015ft\u0131r h\u0131rslar\u0131. \n\n - Bu \xf6zellikleri hem olumlu hem de olumsuz diyebiliriz. \n\n - H\u0131rslar\u0131 hayatlar\u0131ndaki \xf6nemli olan bir\xe7ok \u015feyin \xf6n\xfcne ge\xe7ebilir.\n\n"]),t.s)
