B.Ke=A.b(s([" - Ortak \xf6zellikleri i\xe7inde en \xf6nemlisi duygusall\u0131kt\u0131r.\n\n - Hassas, \xe7abuk de\u011fi\u015fen, i\xe7e d\xf6n\xfck kimselerdir.\n\n - Bir de, do\u011fal ihtiya\xe7lar\u0131 a\u011f\u0131r basar. \n\n - Yani yemeye, i\xe7meye, rahat etmeye, sekse d\xfc\u015fk\xfcnd\xfcrler. Susmay\u0131 da pek ba\u015faramazlar. \n\n - Duygular\u0131n\u0131 kontrol edememe ve haks\u0131zl\u0131\u011fa u\u011frad\u0131klar\u0131n\u0131 d\xfc\u015f\xfcnmeleri y\xfcz\xfcnden \xf6fkeli ve k\u0131r\u0131c\u0131 olurlar.\n\n - K\xfcsme, somurtma ve k\u0131skan\xe7l\u0131klar\u0131 vard\u0131r.\n\n - Merhametli ve yard\u0131msever olurlar. Ba\u015fkalar\u0131n\u0131n ihtiya\xe7lar\u0131n\u0131 hisseder ve yard\u0131m ederler. \n\n - Sezgi y\xf6nleri \xe7ok kuvvetlidir. Mistik, felsefi, dini konulara yatk\u0131nd\u0131rlar. \n\n - Ak\u0131l ve mant\u0131ktan ziyade hayal d\xfcnyalar\u0131n\u0131n zenginli\u011fi, sezgileri ve hissettikleri do\u011frultusunda ya\u015farlar.\n\n"," - Bur\xe7lar\u0131n\u0131n ortak \xf6zelli\u011fi havai olmalar\u0131d\u0131r.\n\n - Bir konuya \xe7abuk adapte olur ama \xe7abuk b\u0131kar ve b\u0131rak\u0131rlar.\n\n - Sab\u0131r g\xf6steremezler, sahiplenmeye niyetli de\u011filseler anlamaya bile zahmet etmezler.\n\n - \u0130stikrars\u0131zd\u0131rlar, \xe7ok s\u0131k karar de\u011fi\u015ftirirler. Bu \xf6zellikleri y\xfcz\xfcnden, yalanc\u0131 olduklar\u0131n\u0131 d\xfc\u015f\xfcnenler olabilir.\n\n - Her \u015feye, her konuya a\xe7\u0131kt\u0131rlar ama \xe7abuk b\u0131karlar. Bu y\xfczden hedefe ula\u015fmalar\u0131 zor olur.\n\n - \xc7ok y\xf6nl\xfcd\xfcrler, parlak ve pratik bir zekaya sahiptirler. \xc7ok hareketlidirler. \n\n - Ne zaman, nerede, ne yapacaklar\u0131n\u0131 takip etmek \xe7ok zordur. Asla b\u0131rakt\u0131\u011f\u0131n\u0131z yerde durmazlar. \n\n - Orijinallik ve yarat\u0131c\u0131l\u0131kta \xe7ok ba\u015far\u0131l\u0131d\u0131rlar. D\u0131\u015fa d\xf6n\xfckt\xfcrler. Bencil olmay\u0131p, etraflar\u0131n\u0131 d\xfc\u015f\xfcnen ve onlara faydal\u0131 olabilen kimselerdir.\n\n"," - \u015eartlanmalar al\u0131\u015fkanl\u0131klar ve maddecilik birinci planda gelir. Son derece sabit fikirli olup, yeniliklere kapal\u0131d\u0131rlar.\n\n - Riskler ve ani de\u011fi\u015fikliklerden ho\u015flanmazlar.\n\n - Paralar\u0131n\u0131n hesab\u0131n\u0131 iyi bilirler. Hareketleri, d\xfc\u015f\xfcnmeleri, karar vermeleri, konu\u015fmalar\u0131 a\u011f\u0131rd\u0131r.\n\n - \u0130yice emin olmadan harekete ge\xe7mezler. Mant\u0131kl\u0131, disiplinli ve d\xfczenli davran\u0131rlar. \n\n - Son derece m\xfctevazidirler, g\xf6steri\u015f yapmazlar, Pratik ve g\xfcvenli hareket ederler.\n\n - Yalandan, sululuk ve iki y\xfczl\xfcl\xfckten ho\u015flanmazlar. Arzu ve istekleri genellikle maddi plandad\u0131r. \n\n - \xc7ok konu\u015fmazlar, laubalilik istemezler. \n\n - Yeni bir \u015feye adapte olmada, yapmada zorlan\u0131rlar; ama bir kere ak\u0131llar\u0131na yat\u0131p ba\u011flan\u0131rlarsa da art\u0131k ondan kolay kolay sapmaz, geri d\xf6nmezler.\n\n"," - Ate\u015f yap\u0131s\u0131n\u0131n en \xf6nemli \xf6zelli\u011fi benlik duygusunun \xe7ok kuvvetli olmas\u0131d\u0131r. Kendileri daima birinci plandad\u0131r.\n\n - Canlar\u0131n\u0131n istedi\u011fine sahip olmak, ak\u0131llar\u0131na esen her \u015feyi hemen yapmak isterler. \n\n - Beklemeye tahamm\xfclleri yoktur. Kendilerini \xe7ok be\u011fenirler, \xf6zg\xfcvenleri fazlad\u0131r ve daima \xe7evrelerine h\xfckmetmek isterler.\n\n - D\xfcnyan\u0131n kendi eksenleri etraf\u0131nda d\xf6nd\xfc\u011f\xfcne inan\u0131rlar. Ba\u015fkalar\u0131n\u0131n onlara g\u0131pta etti\u011fini d\xfc\u015f\xfcn\xfcrler.\n\n - Daima zirveye taliptirler, ikinci adam olmak istemezler. Yarat\u0131c\u0131, c\xf6mert, s\u0131cak ve \xe7ekicidirler.\n\n - Hayat enerjileri, ya\u015fama sevincim \xe7oktur. Devaml\u0131 aktif olmak, hayat\u0131 dolu dolu ya\u015famak, sevgiyi hissetmek isterler.\n\n - Yaln\u0131z kal\u0131rlar ve terk edilirlerse d\xfcnya ba\u015flar\u0131na y\u0131k\u0131l\u0131r, \xe7ok mutsuz olurlar.\n\n"]),t.s)
