B.L6=A.b(s(["D\u0131\u015fa d\xf6n\xfck ve hareketli bu iki ki\u015finin ili\u015fkisi \xe7ok yo\u011fun ve ate\u015fli olakt\u0131r. \u0130ki Ko\xe7 bir araya geldi\u011finde etrafa k\u0131v\u0131lc\u0131mlar yay\u0131labilir. \u0130kisi de \xf6nderlik ruhu ta\u015f\u0131d\u0131\u011f\u0131 i\xe7in ili\u015fkide \xfcst\xfcnl\xfcklerini kabul ettirmeye \xe7al\u0131\u015facakt\u0131r ve bu aralar\u0131nda sorun yaratabilir. E\u011fer iki taraf da anlay\u0131\u015fl\u0131 davranmazsa ili\u015fki \xe7ok uzun soluklu olmayacakt\u0131r. Arar\u0131ndaki g\xfc\xe7 sava\u015f\u0131ndan kurtulabilirlerse birlikte \xe7ok e\u011flenebilirler. Seksue\xfcl anlamda \xe7ok uyumludurlar \xe7\xfcnk\xfc beklentileri hemen hemen ayn\u0131d\u0131r.","Bo\u011fa burcu kad\u0131n\u0131 ile Ko\xe7 burcu erke\u011fi aras\u0131nda baz\u0131 \xf6nemli farkl\u0131l\u0131klar olmas\u0131na ra\u011fmen, uyumlu bir ili\u015fki g\xf6r\xfclebilir. Ko\xe7 burcu yasam g\xfcc\xfcn\xfc ve enerjisini y\xf6netir. Onun i\xe7in her \u015feyden \xf6nce kendisi gelir. Sab\u0131rs\u0131z ve acelecidir, bazen bu y\xfczden ba\u015f\u0131 belaya girer. Bo\u011fa insani ise Ko\xe7'un f\u0131rt\u0131nal\u0131 hayat\u0131nda sakin bir liman gibidir. Ko\xe7 m\xfccadeleci yap\u0131s\u0131 ile zorluklar\u0131n \xfcstesinden gelse de bazen yorulur. Bo\u011fa burcunun sakinle\u015ftirici ses tonu ve yumu\u015fak tav\u0131rlar\u0131 ona iyi gelecektir. Her iki taraf da seks\xfcel a\xe7\u0131dan olduk\xe7a \u015fehvetlidir.","Bo\u011fa erke\u011fi o kadar al\u0131\u015fkanl\u0131klar\u0131na ve ev hayat\u0131na ba\u011fl\u0131d\u0131r ki onu evin d\u0131\u015f\u0131na \xe7\u0131karman\u0131z neredeyse imkans\u0131zd\u0131r. Bu da enerjik ve hareketli Ko\xe7 kad\u0131n\u0131n\u0131 k\u0131sa bir s\xfcre i\xe7inde s\u0131kabilir. Ko\xe7 kad\u0131n\u0131 hi\xe7bir zaman acele etmeyen Bo\u011fa erke\u011fini elinde tutmak i\xe7in al\u0131\u015f\u0131lmam\u0131\u015f derecede sab\u0131rl\u0131 olmak zorundad\u0131r. Bu ili\u015fkide iki taraf\u0131nda ki\u015fili\u011finden taviz vermesi gerekir. Bu da zaman i\xe7inde taraflar\u0131 y\u0131prat\u0131r ve ili\u015fkinin bitmesine sebep olur.",u.X,u.X,"Yenge\xe7 kad\u0131n\u0131 ile Ko\xe7 erke\u011finin \xe7ok uyumlu olmas\u0131 beklenemez. Yenge\xe7 kad\u0131nlar\u0131n\u0131n hassas, duygusal ve romantik yap\u0131s\u0131 ve duygusal derinli\u011fi, Ko\xe7 erke\u011finin hareketli, d\u0131\u015fa d\xf6n\xfck ve \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcn olmas\u0131 ile \xe7at\u0131\u015fabilir. Ko\xe7 burcu erke\u011fi, daha \xe7ok duygular\u0131n\u0131 d\u0131\u015fa vurmaktan ho\u015flanmayan Yenge\xe7 i\xe7in zaman zaman k\u0131r\u0131c\u0131 olabilir. Ko\xe7 burcu seks\xfcel a\xe7\u0131dan arzulu ve tutkuludur, Yenge\xe7'in \xf6nceli\u011finde ise duygusall\u0131k ve romantizm vard\u0131r. \u0130ki bur\xe7 aras\u0131nda yo\u011fun bir a\u015fk olsa da uyumlu bir birliktelik \xe7ok zordur.","Yenge\xe7 erke\u011fi duygusal, romantik ve i\xe7e d\xf6n\xfck yap\u0131ya sahip bir a\u015f\u0131kt\u0131r. Duygular\u0131n\u0131 kolay kolay belli etmez ve yaslanabilece\u011fi sa\u011flam bir omuz arar. Onunla iyi ge\xe7inmek kolaym\u0131\u015f gibi g\xf6r\xfcnse de asl\u0131nda olduk\xe7a zordur. Ko\xe7 kad\u0131n\u0131n fazlas\u0131yla duygusal bu erke\u011fi anlamas\u0131 biraz zor olabilir. Her iki taraf da seks\xfcel anlamda arzuludur ve cinselli\u011fe \xf6nem verir. Ancak ili\u015fkide romantizm daima \xf6n planda olmal\u0131d\u0131r.","Aslan erke\u011fi Ko\xe7 kad\u0131n\u0131n\u0131 b\xfcy\xfcleyebilir! Romantik, y\xfcce g\xf6n\xfcll\xfc ve sizi el \xfcst\xfcnde tutacak bu erkekle \xe7ok iyi anla\u015faca\u011f\u0131n\u0131z kesin. Daha tan\u0131\u015ft\u0131\u011f\u0131n\u0131z ilk anda birbirinizi y\u0131llard\u0131r tan\u0131yormu\u015f gibi hissederseniz sak\u0131n \u015fa\u015f\u0131rmay\u0131n. Hareketli, d\u0131\u015fa d\xf6n\xfck, konu\u015fkan Aslan erke\u011fi ili\u015fkide sadakat ve ilgi bekler ve s\u0131k s\u0131k pohpohlanmaya ihtiya\xe7 duyar. Devaml\u0131 \u015f\u0131mart\u0131lmak isteyen bu erkek i\xe7in zaman zaman ki\u015fili\u011finizden taviz vermeniz gerekebilir.","Son derece dinamik, b\xfcy\xfck enerjiler ortaya \xe7\u0131karabilecek bir birliktelik... Aslan hareketli, ne\u015feli ve giri\u015fken bir kad\u0131nd\u0131r. Ko\xe7 erke\u011fi de dinamik ve kendine g\xfcvenen bir yap\u0131dad\u0131r. Ko\xe7 erke\u011fi zaman zaman ili\u015fkilerinde sadakat problemi ya\u015far. E\u011fer bu durumun \xf6n\xfcne ge\xe7ebilirseniz ili\u015fkiniz arzulu ve tutkulu olacakt\u0131r. Aslan'\u0131n h\xfckmetmeyi seven yap\u0131s\u0131 da bu ili\u015fkide zorlay\u0131c\u0131 bir eken olabilir.","Ko\xe7 ve Ba\u015fak birbirinden \xe7ok farkl\u0131 karakterler \xe7izerler. Ko\xe7 kad\u0131n\u0131 d\u0131\u015fa d\xf6n\xfck, zeki, s\xf6z\xfcn\xfc sak\u0131nmayan, giri\u015fken bir yap\u0131dad\u0131r. Ba\u015fak erke\u011fi ise titiz, detayc\u0131 ve al\u0131\u015fkanl\u0131klar\u0131na ba\u011fl\u0131d\u0131r. Ko\xe7 kad\u0131n\u0131n\u0131n ba\u015f\u0131na buyruk ve akl\u0131na eseni yapan bir tutum i\xe7inde olmas\u0131 Ba\u015fak erke\u011finin ele\u015ftirilerine sebep olur. E\u011fer ortak ilgi alanlar\u0131 bulmay\u0131 ba\u015farabilirseniz o zaman bu ili\u015fki y\xfcr\xfcyebilir. Ama \xe7ok kolay bir ili\u015fki olmayaca\u011f\u0131n\u0131 en ba\u015f\u0131ndan bilmelisiniz.","Ba\u015fak burcu kad\u0131n\u0131 ile Ko\xe7 burcu erke\u011fi aras\u0131nda uyumlu bir ili\u015fki olabilir. Sevecen, zarif ve i\xe7ten tav\u0131rlar\u0131yla Ba\u015fak burcu, Ko\xe7 burcunu derinden etkilemeyi ba\u015far\u0131r. Ba\u015fak ak\u0131ll\u0131, sevecen, iyi niyetli, g\xfcvenilir ve detayc\u0131d\u0131r. Sevdi\u011fine kar\u015f\u0131 ba\u011fl\u0131 ve sad\u0131kt\u0131r. Ancak t\xfcm bu \xf6zellikler onu Ko\xe7 burcuna g\xf6re daha duygusal yapar. Ko\xe7 zeki, giri\u015fken, ne\u015feli, biraz da ayran g\xf6n\xfcll\xfcd\xfcr. Hayat\u0131 dolu dolu ya\u015famay\u0131 sever ve \xf6zg\xfcrl\xfc\u011f\xfcnden de \xf6d\xfcn vermek istemez. Birine ba\u011flanmaktan ka\xe7ar. E\u011fer bu iki tip olumsuz taraflar\u0131n\u0131 t\xf6rp\xfclerse uyumlu ve uzun s\xfcreli bir ili\u015fki olabilir.","Terazi burcu hava grubuna ait bir bur\xe7tur ve de\u011fi\u015fkendir. Terazi erke\u011fi de bir \xf6yle bir b\xf6yledir. Bir g\xfcn size hayat\u0131n\u0131n a\u015fk\u0131 oldu\u011funuzu s\xf6ylerken ertesi g\xfcn ilgisiz tav\u0131rlar\u0131yla sizi \xe7\u0131ld\u0131rtabilir. Bu durum ona kar\u015f\u0131 g\xfcven sorunu ya\u015faman\u0131za sebep olabilir. Ama yine de s\u0131cakkanl\u0131 ve uyumlu tav\u0131rlar\u0131yla Ko\xe7 kad\u0131n\u0131n\u0131 etkisi alt\u0131na almay\u0131 ba\u015faracakt\u0131r. Birbirinize anlay\u0131\u015f g\xf6stermeyi ba\u015farabilirseniz ili\u015fkinizde uyumu yakalayabilirsiniz.","Terazi kad\u0131n\u0131 duygusal, sevecen ve romantiktir. Kar\u015f\u0131 cinse nas\u0131l hitap etmesi gerekti\u011fini de iyi bilir. Ko\xe7 ise ne\u015feli, giri\u015fken ve biraz da ayran g\xf6n\xfcll\xfcd\xfcr. \u0130li\u015fkilerde sadakat problemi ya\u015far ve kolay kolay kimseye ba\u011flanmaz. Bu iki tip birbirinden tamamen farkl\u0131d\u0131r. Kar\u015f\u0131t bur\xe7lar birbirlerini inan\u0131lmaz \xf6l\xe7\xfcde \xe7eker ve \xe7ekici bulurlar. Ko\xe7 ve Terazi de b\xf6yle bir ikilidir. Birbirlerini dengeleyebildikleri \xf6l\xe7\xfcde, g\xfczel bir beraberlik ya\u015fayabilirler.","\u0130\u015fte asla s\u0131k\u0131c\u0131 olmayacak bir ili\u015fki... Ko\xe7 burcu yerinde duramayan yap\u0131s\u0131yla Akrep'i etkiler. Akrep ise do\u011fal \xe7ekicili\u011fiyle Ko\xe7 kad\u0131n\u0131n\u0131 kolayca etkisi alt\u0131na al\u0131r. Her iki taraf da hayat\u0131, ya\u015famay\u0131 ve e\u011flenmeyi sevdi\u011fi i\xe7in ili\u015fkileri olduk\xe7a renkli olur. Akrep seks\xfcel a\xe7\u0131dan kuvvetlidir ve cinselli\u011fe d\xfc\u015fk\xfcnd\xfcr. Ko\xe7 ve Akrep cinsel a\xe7\u0131dan m\xfckemmel bir uyum yakalayabilir. Ama Akrep erke\u011finin son derece k\u0131skan\xe7 olmas\u0131 ve Ko\xe7 kad\u0131n\u0131n k\u0131s\u0131tlanmaktan ho\u015flanmayan yap\u0131s\u0131 ili\u015fkide p\xfcr\xfczlerin ortaya \xe7\u0131kmas\u0131na sebep olabilir.","Akrep burcu ile Ko\xe7 burcu uyumunda her iki taraf da bildi\u011finden \u015fa\u015fmad\u0131\u011f\u0131 i\xe7in hep bir \xfcste \xe7\u0131kma \xe7abas\u0131 i\xe7inde olurlar. Akrep burcu; zor g\xfcvenen, her zaman kendi isteklerinin olmas\u0131n\u0131 isteyen bir bur\xe7 oldu\u011fundan yine ayn\u0131 \xf6zelliklere sahip Ko\xe7 burcu ile anla\u015fmakta biraz zorlan\u0131r. Ko\xe7 zeki, giri\u015fken, ne\u015feli ve biraz da ayran g\xf6n\xfcll\xfcd\xfcr. \xd6zellikle de k\u0131s\u0131tlanmaktan ve y\xf6netilmekten ho\u015flanmaz. \xd6zellikle Ko\xe7 burcunun ikili ili\u015fkilerde sadakat problemi vard\u0131r. Kolay kolay ba\u011flanmaktan ho\u015flanmaz. Akrep ise k\u0131skan\xe7t\u0131r ve h\xfckmetmeyi sever. \xd6zetle bu iki bur\xe7 aras\u0131nda uyum pek s\xf6z konusu de\u011fildir.","Ko\xe7 da, Yay da maceraya bay\u0131ld\u0131\u011f\u0131na g\xf6re \xe7ok e\u011flenceli bir ili\u015fki sizi bekliyor. Siz her a\xe7\u0131dan \xe7ok uyumlu bir \xe7ift olacaks\u0131n\u0131z. Her iki bur\xe7 da ate\u015f grubuna dahil. Yani ikiniz de zeki, giri\u015fken, hareketli insanlars\u0131n\u0131z. Payla\u015f\u0131mc\u0131 yap\u0131n\u0131z, a\xe7\u0131k havada gezmekten ho\u015flanman\u0131z, do\u011fay\u0131 ve hayvanlar\u0131 sevmeniz sizi birbirinize daha da yakla\u015ft\u0131racak. \u0130ki taraf da seks\xfcel a\xe7\u0131dan arzulu ve yarat\u0131c\u0131. Bu y\xfczden Yay erke\u011fi kolay ba\u011flanamayan \xf6zg\xfcr bir karakter gibi g\xf6r\xfcnse de, size kar\u015f\u0131 koyamayacak.","\u0130ki bur\xe7 da Ate\u015f grubuna dahildir. Zeki, giri\u015fken, ne\u015feli ve hareketlidirler. \u0130li\u015fkileri de oldukca renkli olur. \u0130kisi de benzer \xf6zelliklere sahip oldu\u011fu i\xe7in birbirlerini nas\u0131l mutlu edeceklerini bilirler ve anlarlar. Ko\xe7 erke\u011fi k\u0131s\u0131tlay\u0131c\u0131 davranmazsa ili\u015fkileri uzun \xf6m\xfcrl\xfc olabilir. \u0130kisinin de en b\xfcy\xfck korkusu \xf6zg\xfcrl\xfc\u011f\xfc ve bireyselli\u011fi kaybetmek oldu\u011fu i\xe7in evlilik konusunda yava\u015f davran\u0131rlar.","\u0130li\u015fkinizin zor ve ini\u015fli \xe7\u0131k\u0131\u015fl\u0131 olaca\u011f\u0131n\u0131 en ba\u015f\u0131ndan bilmelisiniz. O\u011flak burcu erke\u011fi iddial\u0131d\u0131r ve kolay kolay taviz vermez. Sevdi\u011fi ki\u015fiye kolayca ba\u011flansa da sizin a\u015f\u0131r\u0131 hareketlerinizi anlamas\u0131n\u0131 beklemeyin. Di\u011fer taraftan O\u011flak erke\u011fi ailesine \xe7ok d\xfc\u015fk\xfcnd\xfcr ve \xe7ok tutumludur. Ko\xe7 kad\u0131n\u0131n\u0131n savurganl\u0131\u011f\u0131 kar\u015f\u0131s\u0131nda \u015fa\u015fk\u0131na d\xf6nebilir. Bu ili\u015fkinin y\xfcr\xfcmesinin tek ko\u015fulu taraflardan birinin anlay\u0131\u015fl\u0131 ve \xf6zverili olmas\u0131... E\u011fer mutlu olmak i\xe7in elinizden geleni yaparsan\u0131z ve sayg\u0131n\u0131z\u0131 yitirmezseniz birlikte mutlu olabilirsiniz.","Ko\xe7 erke\u011fi ilk ba\u015fta sizi cezbedebilir. Ama O\u011flak kad\u0131n\u0131 ve Ko\xe7 erke\u011finin ili\u015fkisi olduk\xe7a zorlay\u0131c\u0131 ve y\u0131prat\u0131c\u0131 olur. \xc7\xfcnk\xfc O\u011flak, zor ve iddial\u0131d\u0131r ve kolay kolay ki\u015fili\u011finden taviz vermez. Ko\xe7 erke\u011fi de her zaman kendi yolundan gitmeyi se\xe7er. Bu sebeplerle ikisinin ili\u015fkisinde her iki taraf\u0131n da bolca fedakarl\u0131k yapmas\u0131 gerekir. Her iki taraf da seks\xfcel a\xe7\u0131dan hareketlidir. Ayn\u0131 y\xf6nde hareket etmeyi ba\u015far\u0131r ve birbirlerine olan sayg\u0131lar\u0131n\u0131 yitirmezlerse bir \xf6m\xfcr boyu mutlu olabilirler.","Kova bur\xe7lar\u0131 elde tutulmay\u0131 daha do\u011frusu sevdikleri taraf\u0131ndan s\u0131k\u0131lmay\u0131 hi\xe7 sevmediklerinden en ufak bir ipleri ele alma durumundan rahats\u0131z olurlar. Ko\xe7 burcunda da bulunan bu huy, ikili ili\u015fkilerde taraflar\u0131n birbirlerine m\xfcdahale etmelerini engeller. Kova insan\u0131 duygusal ve bir o kadar da de\u011fi\u015fken bir ki\u015fili\u011fe sahiptir. Ko\xe7 da bir o kadar hareketli, zeki ve giri\u015fkendir. Bu iki tip ba\u015fta birbirlerinden \xe7ok etkilenirler. Fakat ileriki zamanlarda Kova'n\u0131n duygusall\u0131\u011f\u0131 \xf6n plana \xe7\u0131kabilir. Ko\xe7 burcu da bu duygusall\u0131\u011fa yeteri kadar cevap veremeyebilir. Bu durumda birbirlerinden uzakla\u015fabilirler.","Tan\u0131\u015ft\u0131\u011f\u0131n\u0131z anda birbirinizden fazlas\u0131yla etkilenip ilk g\xf6r\xfc\u015fte a\u015f\u0131k olabilirsiniz. Ancak ili\u015fkinin ilerleyen g\xfcnlerinde Kova erke\u011finin duygusall\u0131\u011f\u0131 size fazla gelebilir. \xc7\xfcnk\xfc Kova erkekleri duygusald\u0131r ve genellikle duygular\u0131n\u0131 \xe7ok kolay ifade ederler. Ko\xe7 kad\u0131nlar\u0131 ise konu\u015fmak yerine tav\u0131rlar\u0131yla kendilerini ortaya koymay\u0131 se\xe7erler. Yap\u0131lar\u0131n\u0131z fazlas\u0131yla farkl\u0131 oldu\u011fu i\xe7in birbirinizi anlaman\u0131z kolay olmayacakt\u0131r ve birbirinizin beklentilerine cevap veremeyebilirsiniz.","Son derece mant\u0131kl\u0131 ve ger\xe7ek\xe7i bir kad\u0131n ve hayalperest bir erkek... Ne yaz\u0131k ki aran\u0131zda uyumlu bir ili\u015fkinin olaca\u011f\u0131n\u0131 s\xf6ylemek zor. Bal\u0131k erke\u011fi, sevgilisinin her anlamda kendisine destek olmas\u0131n\u0131 ister. Bekledi\u011fi ilgiyi g\xf6rmezse bile bunu dile getirmez. Kendisini k\u0131rd\u0131\u011f\u0131n\u0131zda da sizi uyarmaz ve geri gelmemek \xfczere size terk eder. \u0130ki bur\xe7 seks\xfcel a\xe7\u0131dan da \xe7ok uyumlu de\u011fildir. Bal\u0131k'\u0131n duygusal y\xf6n\xfc a\u011f\u0131r bast\u0131\u011f\u0131ndan Ko\xe7 kadar aktif olmaz. K\u0131sacas\u0131 uzun vadeli ili\u015fki \u015fanslar\u0131 pek yoktur.","Bal\u0131k burcu hassas ve narindir. Ko\xe7 burcu bal\u0131k burcunun bu \xf6zelliklerini \xe7ok be\u011fenir. Ko\xe7 ise i\xe7e d\xf6n\xfck, aceleci, dikkatsiz ve c\xfcretkard\u0131r. Hayat\u0131 y\xfczeysel ya\u015fama taraftar\u0131d\u0131r. Bal\u0131k ise hayat\u0131 derinden ya\u015famak ister. Bu anlamda birbirlerine z\u0131t d\xfc\u015ferler. D\xfc\u015f\xfcnmeden konu\u015fan Ko\xe7 erke\u011finin s\xf6zleri Bal\u0131k kad\u0131n\u0131n\u0131 derinden etkileyip \xfczer. Ko\xe7 erke\u011fi sizin duygular\u0131n\u0131z\u0131n alt\u0131nda yatan nedenleri anlamak i\xe7in \xe7aba g\xf6stermez. Ko\xe7 burcunun maymun i\u015ftah\u0131 ili\u015fkinin bitmesine neden olabilir. Ko\xe7 erke\u011fi bu konuda kendisine dikkat etmesi gerekir.","\u0130ki Bo\u011fa aras\u0131nda olduk\xe7a uyumlu bir ili\u015fki ya\u015fanabilir. \u0130kisi de ya\u015fam\u0131n zevklerine ve rahatlar\u0131na d\xfc\u015fk\xfcn oldu\u011fundan, hayat\u0131 payla\u015fmak konusunda herhangi bir sorun ya\u015famazlar. Her iki tip de duygusal ve romantiktir. Seks\xfcel y\xf6nden birbirlerini tamamlarlar. \u0130li\u015fkilerinin uyumlu bir evlili\u011fe d\xf6n\xfc\u015fme olas\u0131l\u0131\u011f\u0131 y\xfcksektir. \u0130ki Bo\u011fa da birbirine g\xfcvenebildi\u011fi i\xe7in \xe7ok mutludur. Bo\u011fa burcu hi\xe7 bir zaman sevgilisinin ya da ba\u015fka birinin g\xfcvenini bo\u015fa \xe7\u0131karmay\u0131 hayal bile etmez. Tabii ki ili\u015fkinin s\u0131k\u0131c\u0131 bir birlikteli\u011fe d\xf6n\xfc\u015fme riskini de unutmamak gerekir.","Zodyak'ta her bur\xe7 bir \xf6nceki burcun eksikli\u011fini tamamlar. \u0130kizler burcu Bo\u011fa'dan sonra gelir ve Bo\u011fa'n\u0131n eksikliklerini tamamlar. \u0130kizler kad\u0131n\u0131 pratikli\u011fi ve enerjisiyle Bo\u011fa'y\u0131 destekler. Bo\u011fa erke\u011finin \u0130kizler'in ruhsal duygu de\u011fi\u015fimlerini anlamas\u0131 zor olsa da kar\u015f\u0131l\u0131kl\u0131 anlay\u0131\u015f ile ili\u015fkilerini rahat\xe7a devam ettirebilirler. E\u011fer cinsel a\xe7\u0131dan da uyumu yakalarlarsa bir \xf6m\xfcr boyu mutlu olabilirler. Seks\xfcel a\xe7\u0131dan Bo\u011fa burcu \u0130kizler'deh daha arzuludur. E\u011fer \u0130kizler de onun kadar tutkulu olmazsa ili\u015fkileri tehlikeye girebilir.","Bu iki bur\xe7 aras\u0131nda pek uyumlu bir ili\u015fkinin olmas\u0131 s\xf6z konusu de\u011fildir. \u0130kizler de\u011fi\u015fken yap\u0131s\u0131 nedeniyle s\xfcrekli farkl\u0131 bir yap\u0131ya b\xfcr\xfcn\xfcrken, kendini saplama almak isteyen ve risklerden ho\u015flanmayan Bo\u011fa bu duruma ayak uydurmakta zorlan\u0131r. Bo\u011fa kendini evinde g\xfcvende hissederken, \u0130kizler burcu erke\u011fi s\xfcrekli dola\u015fmak ve yeni yerler ke\u015ffetmek pe\u015findedir. Bo\u011fa, \u0130kizler'in koltukta iki saat uyuduktan sonra bile sabah\u0131n k\xf6r\xfcnde kalk\u0131p yeni i\u015fler pe\u015finde ko\u015fabilmesine ak\u0131l erdiremez. \u0130kizler ise Bo\u011fa`n\u0131n nas\u0131l bu kadar \xe7ok uyku uyuyabildi\u011fine inanamaz. Bu ili\u015fkinin sonu h\xfcsrand\u0131r.","Bu iki bur\xe7 aras\u0131nda uyumlu bir ili\u015fki s\xf6z konusu olabilir. \u0130ki taraf da duygusal derinli\u011fe, kendini g\xfcvende hissetmeye ve sadakate \xf6nem verir. Maddi konularda iki taraf da \xe7al\u0131\u015fkan ve tutumludur. Aralar\u0131nda sorun olabilecek konulardan biri Bo\u011fa erke\u011finin fazlas\u0131yla k\u0131skan\xe7 olmas\u0131d\u0131r. Yenge\xe7 kad\u0131n\u0131 bu durumu anlayamayacak ve \xe7\u0131kan huzursuzluktan rahats\u0131z olacakt\u0131r. Seks\xfcel y\xf6nden iki taraf adeta birbirini tamamlarlar. Uzun ve mutlu bir birliktelikleri olabilir","Bo\u011fa ile Yenge\xe7 aras\u0131nda uyumlu bir ili\u015fki ya\u015fanabilir. Yenge\xe7 ak\u0131ll\u0131, duygusal, romantik ve duyarl\u0131d\u0131r. Ger\xe7ekten birini sevdi\u011finde fedakarl\u0131kta s\u0131n\u0131r tan\u0131maz. Bo\u011fa da tutkulu, zarif ve sevecen tav\u0131rlar\u0131yla Yenge\xe7'in kalbini \xe7alabilir. Yatakta, Bo\u011fa'n\u0131n erotik yap\u0131s\u0131 ve Yenge\xe7`in derin duygusall\u0131\u011f\u0131 birle\u015fince tutkulu bir beraberlik ortaya \xe7\u0131kar. Bu ili\u015fkinin y\xfcr\xfcmemesi i\xe7in hi\xe7bir sebep yoktur. Ba\u015f ba\u015fa kald\u0131\u011f\u0131n\u0131z zaman kucak kuca\u011fa ve yanak yana\u011fa sevgi dolu saatler ge\xe7irebilir; aile, ev, g\xfcvenlik, d\xfczenli bir hayat ve \xe7ocuk hayalinize Yenge\xe7 erke\u011fi ile kavu\u015fabilirsiniz.","Bo\u011fa ile Aslan burcunun aras\u0131nda e\u011fer ger\xe7ek sevgi yakalanabilirse m\xfckemmel bir uyum s\xf6z konusu olabilir. \u0130ki burcun da hayattan beklentileri ayn\u0131d\u0131r. \u015e\u0131k bir restoranda yemek yemek, ilgin\xe7 partilere, k\xfclt\xfcrel aktivitelere kat\u0131lmak, g\xfczel bir eve sahip olmak gibi hayatin ince, g\xfczel, se\xe7kin \u015feylerinden zevk al\u0131rlar. Aslan burcu huzuru ve huzurlu ortamlarda bulunmay\u0131 sever, Bo\u011fa burcu kad\u0131n\u0131 bu anlamda Aslan erke\u011fini b\xfcy\xfcleyebilir. Her iki taraf da seks\xfcel y\xf6nden olduk\xe7a arzuludur, fakat zaman zaman Aslan burcunun bencilli\u011fi \xf6n plana \xe7\u0131kabilir.","Aslan kad\u0131n\u0131 ne\u015feli, giri\u015fken, romantik ve gururludur. Bo\u011fa erke\u011fi de ayn\u0131 \u015fekilde duygusal ve hassas bir yap\u0131dad\u0131r. Bo\u011fa'n\u0131n hareketli ve d\u0131\u015fa d\xf6n\xfck yap\u0131s\u0131 Aslan'\u0131n k\u0131skan\xe7l\u0131k s\u0131n\u0131rlar\u0131n\u0131 zorlayabilir. E\u011fer Bo\u011fa, \xf6vg\xfclerle Aslan'\u0131n gururunu ok\u015far ve onun g\xfcvenini kazanmay\u0131 ba\u015far\u0131rsa ili\u015fkileri uyumlu bir \u015fekilde yol alabilir.","Ba\u015fak ile Bo\u011fa aras\u0131nda uyumlu bir ili\u015fki olmas\u0131 m\xfcmk\xfcn \xe7\xfcnk\xfc her iki taraf\u0131n da beklentileri ve davran\u0131\u015flar\u0131 birbiriyle uyum halde. Ba\u015fak'\u0131n beklentilerini Bo\u011fa fazlas\u0131yla kar\u015f\u0131lar. G\xfcven ve sadakat Bo\u011fa i\xe7in \xe7ok \xf6nemlidir, Ba\u015fak da sevdi\u011fi zaman sad\u0131k ve ba\u011fl\u0131l\u0131\u011f\u0131n\u0131 g\xf6stermekten \xe7ekinmeyen bir e\u015f olacakt\u0131r. Bo\u011fa'n\u0131n hassas ve duygusal taraf\u0131 Ba\u015fak'\u0131n baz\u0131 ele\u015ftirel konu\u015fmalar\u0131 ile rahats\u0131z olsa da, her iki taraf da ki\u015fisel z\u0131tl\u0131klar ya\u015fam\u0131yorsa uzun vadede, mutlu bir beraberlik ya\u015fayabilirler.","Bo\u011fa ve Ba\u015fak aras\u0131nda uyumlu, sayg\u0131 ve sevgiye dayanan bir ili\u015fki olabilir. Bo\u011fa kad\u0131n\u0131n\u0131n sevecen, zarif ve uyumlu yap\u0131s\u0131 Ba\u015fak erke\u011fi i\xe7in olduk\xe7a etkileyici olacakt\u0131r. Ba\u015fak burcunun baz\u0131 tav\u0131rlar\u0131 ve akl\u0131ndan ge\xe7enleri direkt s\xf6ylemesi zaman zaman Bo\u011fa kad\u0131n\u0131n\u0131n k\u0131r\u0131lmas\u0131na neden olabilir. Ama bu onun k\xf6t\xfc niyetinden de\u011fil i\xe7ten olmas\u0131ndan kaynaklan\u0131r. Bo\u011fa ile Ba\u015fak burcundaki insanlar\u0131n birbirine duyduklar\u0131 sevgi cinsel hayatlar\u0131nda da uyumlu olmalar\u0131n\u0131 sa\u011flar.","Her iki bur\xe7 da Ven\xfcs taraf\u0131ndan y\xf6netilir. Bu iki karakterin bir\xe7ok ortak \xf6zelli\u011fi bulunur. Bu y\xfczden de aralar\u0131nda uyumlu bir ili\u015fki olabilir. Bo\u011fa erke\u011fi, sert gibi g\xf6r\xfcnse de k\u0131sa zamanda sert kabu\u011funun alt\u0131nda sakl\u0131 kalan ince ve hassas yap\u0131y\u0131 sevdi\u011fi ki\u015fiye g\xf6sterir. Terazi kad\u0131n\u0131 da duygusal, romantik ve zariftir. Birbirlerini iyi anlarlar ve sadakat konusunda bir problem ya\u015famazlar. Her iki taraf da seks\xfcel y\xf6nden arzulu ve duygusald\u0131r.","\u0130ki bur\xe7 da Ven\xfcs taraf\u0131ndan y\xf6netildi\u011finden aralar\u0131nda uyumlu bir ili\u015fki olma olas\u0131l\u0131\u011f\u0131 y\xfcksektir. \u0130ki karakterin de \xf6zellikleri birbirine benzer. Hayat doludurlar ve ya\u015fad\u0131klar\u0131 her andan keyif almak isterler. \xd6zellikle Terazi duygusal, romantik tav\u0131rlar\u0131 ile Bo\u011fa'y\u0131 derinden etkiler. Terazi'nin sad\u0131k ve uyumlu olmas\u0131 Bo\u011fa'n\u0131n g\xfcven aray\u0131\u015f\u0131n\u0131 olduk\xe7a tatmin eder. \u0130ki taraf da seks\xfcel y\xf6nden arzulu ve duygusald\u0131r. E\u011fer birbirlerine hassas olduklar\u0131 konularda gerekli anlay\u0131\u015f\u0131 g\xf6stermezlerse ili\u015fkileri uzun soluklu olmayabilir.","Akrep burcu ile Bo\u011fa burcu birbiriyle tam bir b\xfct\xfcn olu\u015ftururlar. Her iki bur\xe7 da fazla sosyal olmad\u0131\u011f\u0131ndan ili\u015fkilerine daha fazla vakit ay\u0131rabilirler. Akrep burcu sahiplenici ve k\u0131skan\xe7t\u0131r, bu noktada Bo\u011fa burcu da ayn\u0131 \xf6zellikleri ta\u015f\u0131d\u0131\u011f\u0131ndan birbirlerini anlarlar. Akrep burcunun \xf6fkelendi\u011fi zamanlarda, sab\u0131rl\u0131 olan Bo\u011fa burcu \xf6fkesinin ge\xe7mesini bekler ve onu sakinle\u015ftirir. Bu da bir ili\u015fki i\xe7in \xf6nemli bir detayd\u0131r. Bu ili\u015fki Akrep burcunun \xf6fkesine, Bo\u011fa burcunun ise sabr\u0131na dayanarak uzun \xf6m\xfcrl\xfc bir ili\u015fki olacakt\u0131r.","Bo\u011fa ve Akrep burcu karakter olarak birbirinden \xe7ok farkl\u0131d\u0131r. Z\u0131t kutuplar birbirini \xe7eker s\xf6z\xfc bu iki bur\xe7 i\xe7in ge\xe7erli olabilir. Akrep tutkulu, ak\u0131ll\u0131, duygusal ve a\xe7\u0131k s\xf6zl\xfcd\xfcr. Bo\u011fa'n\u0131n pozitif ve zarif yap\u0131s\u0131 ile Akrep burcunun tutkulu yap\u0131s\u0131 birbirini dengeleyebilirse bir \xf6m\xfcr boyu mutlu bir beraberlik yakalanabilir. Her iki taraf da seks\xfcel y\xf6nden olduk\xe7a tutkuludur. \u0130ki burcun da birbirini \xfczebilecek en olumsuz yan\u0131 ikisinin de olduk\xe7a k\u0131skan\xe7 olmas\u0131d\u0131r.","Bir Bo\u011fa erke\u011fine a\u015f\u0131k olduysan\u0131z, bu beraberli\u011fin \xe7ok kolay olaca\u011f\u0131n\u0131 zannetmeyin. Bo\u011fa erke\u011fi, Yay kad\u0131n\u0131n\u0131n do\u011fas\u0131na ayk\u0131r\u0131d\u0131r. Bo\u011fa erke\u011fi k\u0131s\u0131tlanmaktan ho\u015flanmaz ve ba\u011f\u0131ms\u0131zl\u0131\u011f\u0131na a\u015f\u0131r\u0131 d\xfc\u015fk\xfcnd\xfcr. O sizin fazla karamsar oldu\u011funuzu d\xfc\u015f\xfcn\xfcr, siz ise onu sorumsuz bulursunuz. \u0130ki bur\xe7 aras\u0131nda uyumlu bir ili\u015fki yakalamak zordur. Kendinizi ifade edi\u015f tarzlar\u0131n\u0131z da birbirinden olduk\xe7a farkl\u0131d\u0131r. Ancak kar\u015f\u0131l\u0131kl\u0131 sayg\u0131 ve sevgiyle bu ili\u015fkiyi devam ettirebilirsiniz.","Bo\u011fa ile uzun birliktelik sa\u011flayamayacak bur\xe7lardan bir di\u011feri de Yay'd\u0131r. Yay'\u0131n ele avuca s\u0131\u011fmayan, ba\u011f\u0131ms\u0131zl\u0131\u011f\u0131na d\xfc\u015fk\xfcn, hareketli tav\u0131rlar\u0131, Bo\u011fa'n\u0131n derin duygular\u0131na hitap etmeyecektir. Kendini g\xfcvende hissetmek i\xe7in maddi baz\u0131 gerekliliklere ihtiya\xe7 duyan Bo\u011fa burcu i\xe7in Yay burcunun paray\u0131 idare edememesi olduk\xe7a rahats\u0131z edici olacakt\u0131r. Bu iki burcu \xe7ocuklara d\xfc\u015fk\xfcn olmalar\u0131 yak\u0131nla\u015ft\u0131rsa da temelde pek bir uyum sergilemeleri zordur.","Bo\u011fa burcunun duygusal derinliklerine hitap edebilecek bur\xe7lardan biri de O\u011flak burcudur. O\u011flak duygusal, d\xfc\u015f\xfcnceli ve sab\u0131rl\u0131d\u0131r. Bir kez sevdi\u011fi zaman hayat\u0131n\u0131n sonuna kadar sevdi\u011finden ve ona ba\u011fl\u0131 kalmaktan vazge\xe7meyecektir. \u0130kisi de toplumdaki stat\xfclerine \xf6nem verir, sayg\u0131 duyulmak isterler ve ayk\u0131r\u0131, isyankar hareketlerde bulunmazlar. Birlikte \xe7ok uyumlu bir hayatlar\u0131 olacakt\u0131r. O\u011flak burcu kafas\u0131n\u0131 g\xfcnl\xfck i\u015flerden uzakla\u015ft\u0131r\u0131p rahatlatt\u0131ktan sonra seks\xfcel anlamda Bo\u011fa kadar ate\u015fli ve istekli olabilir.","Bo\u011fa erke\u011fi sorumluluklar\u0131n\u0131n fark\u0131nda, h\u0131rsl\u0131 ve \xe7al\u0131\u015fkand\u0131r. Aran\u0131zda uyumlu bir ili\u015fki ya\u015fanabilir. Bo\u011fa erke\u011finin sevdi\u011fi ki\u015fi i\xe7in yapmayaca\u011f\u0131 fedakarl\u0131k yoktur. Her konuda sevdi\u011fi ki\u015fiye destek olur ve evcimendir. Bu \xf6zellikleriyle her kay\u0131nvalidenin r\xfcyas\u0131d\u0131r. Ancak sevdi\u011fi ki\u015fiyi fazlas\u0131yla sahiplenmesi zaman zaman bunalman\u0131za sebep olabilir. \u0130ki taraf\u0131n ili\u015fkisi seks\xfcel a\xe7\u0131dan da tutkulu olacakt\u0131r.","Kova bur\xe7lar\u0131 ya\u015famlar\u0131n\u0131n hi\xe7bir evresinde birine ait olmak, kendini birine mecbur hissetmek istemezler. Hissettikleri zaman bunu davran\u0131\u015flar\u0131yla belli eder, sizden uzakla\u015f\u0131rlar. Bo\u011fa bur\xe7lar\u0131 ise a\u015fk duygusunu en derine kadar ya\u015famak isterler, sevdiklerini adeta deli gibi k\u0131skan\u0131rlar. Bo\u011fa burcunun bu k\u0131skan\xe7 tav\u0131rlar\u0131 Kova burcu taraf\u0131ndan hi\xe7 tahamm\xfcl edilemeyen bir durum haline gelir. \xc7ok k\u0131sa bir s\xfcre sonra ili\u015fkide sorunlar taraflar\u0131 birbirinden uzakla\u015ft\u0131r\u0131r. Dolay\u0131s\u0131yla b\xf6yle bir ili\u015fki \xe7ok uzun s\xfcrmeyecektir.","Kova'n\u0131n de\u011fi\u015fken yap\u0131s\u0131 Bo\u011fa'y\u0131 rahats\u0131z eder. Ayr\u0131ca g\xfcvenlik konusunda olduk\xe7a hassas olan Bo\u011fa bur\xe7lar\u0131 i\xe7in Kova'n\u0131n sadakat konusunda da pek tutarl\u0131 olmamalar\u0131 kabul edilemez bir durumdur. Kova burcu tek bir ki\u015fiye ba\u011flanmakta zorluk \xe7eker. Bo\u011fa ise bunun tam tersidir. Kova ile Bo\u011fa romantiklik ve duygusall\u0131k a\xe7\u0131s\u0131ndan birbirinden \xe7ok farkl\u0131 beklentileri olan tiplerdir. Ancak birbirlerini \xe7ok severlerse aralar\u0131ndaki ili\u015fki evlili\u011fe d\xf6n\xfc\u015febilir.","Bal\u0131k ve Bo\u011fa aras\u0131nda pek uyumlu bir ili\u015fki olmaz. \xc7\xfcnk\xfc bu iki karakter birbirinden \xe7ok farkl\u0131d\u0131r. Bo\u011fa mant\u0131kl\u0131, sevecen, sa\u011fduyulu ve anlay\u0131\u015fl\u0131d\u0131r. Bal\u0131k ise romantik, duygusal ve hayalperesttir. Bal\u0131k burcunun bu denli derin duygusall\u0131\u011f\u0131n\u0131 Bo\u011fa anlamakta zorluk \xe7eker. Bo\u011fa'n\u0131n hayata bak\u0131\u015f a\xe7\u0131s\u0131 olduk\xe7a ger\xe7ek\xe7idir. Dolay\u0131s\u0131yla Bal\u0131k'\u0131n baz\u0131 konulardaki vurdumduymaz tav\u0131rlar\u0131 Bo\u011fa'y\u0131 \xe7ileden \xe7\u0131kar\u0131r. Bo\u011fa burcunun maddeye fazla \xf6nem vermesini de Bal\u0131k kad\u0131n\u0131 anlayamaz. Bu iki bur\xe7 birbiriyle yatakta da m\xfckemmel bir birliktelik yakalayamazlar.","Bo\u011fa ile Bal\u0131k burcunun ili\u015fkisi birbirlerinden \xe7ok farkl\u0131 olduklar\u0131ndan pek uyumlu olmaz. Bal\u0131k'\u0131n romantik, hayalperest ve a\u015f\u0131r\u0131 duygusall\u0131\u011f\u0131 Bo\u011fa i\xe7in anla\u015f\u0131lmazd\u0131r. Bal\u0131k burcunun baz\u0131 konulardaki vurdumduymazl\u0131\u011f\u0131 Bo\u011fa burcunu olduk\xe7a rahats\u0131z eder. Bal\u0131k'\u0131n ilgili ve duyarl\u0131 olmas\u0131 Bo\u011fa'ya yetmeyecektir. Bal\u0131k i\xe7in hayal edilebilen her \u015feyin ger\xe7ekle\u015fmesi m\xfcmk\xfcnd\xfcr, s\u0131n\u0131r tan\u0131maz. Siz ise dokunulabilen ger\xe7ekleri yarat\u0131r ve kurars\u0131n\u0131z. Bu iki tip birbirine \xe7ekici gelse de ili\u015fkileri uzun \xf6m\xfcrl\xfc olmayacakt\u0131r.","Bu iki karakter birbirine fazlas\u0131yla benzer. \u0130ki taraf da \xe7ok doludur ve zamanlar\u0131 yoktur. Ayr\u0131ca ikisi de sevecen, hareketli ve samimidir. De\u011fi\u015fik ortamlara girmeyi ve yeni insanlarla tan\u0131\u015fmay\u0131 severler. \xd6zg\xfcrl\xfck\xe7\xfc bir bak\u0131\u015f a\xe7\u0131s\u0131na sahip olduklar\u0131 i\xe7in birbirlerine sayg\u0131 duyarlar ve k\u0131s\u0131tlamalar yapmazlar. Bir\xe7ok konuda anla\u015ft\u0131klar\u0131 i\xe7in \xe7ok fazla tart\u0131\u015fma ortam\u0131 olmaz ama bir s\xfcre sonra birbirlerine bu kadar benzemeleri ili\u015fkinin s\u0131k\u0131c\u0131 hale gelmesine neden olabilir.","\u0130kizler burcunun de\u011fi\u015fken yap\u0131s\u0131 ve hareketli olmas\u0131, duygusal ve romantik Yenge\xe7 i\xe7in ilk ba\u015fta ilgi \xe7ekici olsa da uzun vadede bir ili\u015fki kurmas\u0131na en b\xfcy\xfck engel haline gelecektir. Yenge\xe7 burcunun baz\u0131 duygusal taraflar\u0131, kendisi ile bile dalga ge\xe7en \u0130kizler burcuna komik gelecektir. K\xf6t\xfc niyetli olmasa da \u0130kizler'in mant\u0131kl\u0131 taraf\u0131 Yenge\xe7 kad\u0131n\u0131n\u0131n k\u0131r\u0131lgan yap\u0131s\u0131n\u0131 \xf6ne \xe7\u0131kartabilir. Yenge\xe7 kad\u0131n\u0131n\u0131n evinde kendini g\xfcvende hissetmesine kar\u015f\u0131 \u0130kizler erke\u011fi bazen eve girmek istemeyebilir. Di\u011fer yandan seks\xfcel olarak da beklentileri farkl\u0131 olacakt\u0131r.","Yenge\xe7 erke\u011fi i\xe7in \u0130kizler kad\u0131n\u0131 fazlas\u0131yla ne\u015feli ve hareketlidir. O, duygulu, \xe7al\u0131\u015fkan, sorumluluk sahibi ve ba\u015far\u0131ya \xf6nem veren bir yap\u0131dad\u0131r ve bunun d\u0131\u015f\u0131nda evcimendir. Evi adeta onun kalesi gibidir. Kendini evinde rahat ve mutlu hisseder. Sevdi\u011fi ki\u015fiyi ilgisiyle ve sevgisiyle \u015f\u0131martmay\u0131 \xe7ok sever. Ona yeteri kadar ilgi ve zaman ay\u0131rmad\u0131\u011f\u0131n\u0131zda kendisini sevmedi\u011finizi d\xfc\u015f\xfcnebilir. E\u011fer ona sad\u0131k kal\u0131r ve sevginizi yo\u011fun bir \u015fekilde idafe edebilirseniz onunla bir \xf6m\xfcr boyu mutlu olabilirsiniz.","\u0130kizler erke\u011fi tam Aslan kad\u0131n\u0131na g\xf6redir. Konu\u015fkan ve giri\u015fken yap\u0131s\u0131yla kolayca dikkat \xe7eker. Ayr\u0131ca ne\u015feli ve romantiktir. Espirit\xfcel yakla\u015f\u0131m\u0131yla Aslan kad\u0131n\u0131n\u0131 kolayca etkiler. \u0130li\u015fkinin devam edebilmesi i\xe7inse Aslan'\u0131n sahiplenici ve k\u0131skan\xe7 tav\u0131rlar\u0131na ho\u015fg\xf6r\xfcyle yakla\u015fmas\u0131 \u015fartt\u0131r. Seks\xfcel a\xe7\u0131dan iki taraf da arzulu ve isteklidir. Uzun vadede \xe7ok uyumlu ve faal bir birliktelik ya\u015fayabilirler.","Pohpohlanmaya ihtiya\xe7 duyan ve hi\xe7bir zaman geri planda kalmak istemeyen Aslan erke\u011fi, g\xfcvenilir ve sad\u0131k bir sevgilidir. \u0130kizler'in ne\u015feli ve zeki tav\u0131rlar\u0131ndan kolayca etkilenen bu erke\u011fin sevdi\u011fi ki\u015fi i\xe7in yapmayaca\u011f\u0131 fedakarl\u0131k yoktur. Koruma g\xfcd\xfcleri geli\u015fmi\u015f ve \xe7al\u0131\u015fkan Aslan erke\u011fi g\xf6steri\u015fe ve l\xfckse d\xfc\u015fk\xfcnd\xfcr. Aran\u0131zda uyumlu bir ili\u015fki olabilir. Ki\u015filik \xf6zellikleri a\xe7\u0131s\u0131ndan \xf6nemli bir z\u0131tl\u0131k ya\u015famazsan\u0131z onunla birlikte \xe7ok mutlu olabilirsiniz.","\u0130kizler kad\u0131n\u0131 konu\u015fkan ve pratiktir. Ba\u015fak erke\u011fi ise ger\xe7ek\xe7i ve mant\u0131kl\u0131... Olaylara her zaman mant\u0131k \xe7er\xe7evesinden bakan bu erkek ile aran\u0131zda \xe7ok uyumlu bir birliktelik olmaz. Ba\u015fak'\u0131n her \u015feyi planl\u0131 ve programl\u0131 bir \u015fekilde organize etmesi \u0130kizler'i eninde sonunda s\u0131kacakt\u0131r. Bu ikili seks\xfcel a\xe7\u0131dan da uyumlu bir \xe7ift olu\u015fturmaz. \u0130kizler \xe7ok istekli ve tutkuludur, Ba\u015fak erke\u011finin ise \xf6ncelikleri ba\u015fka olabilir.","Bu iki burcun elementleri birbirinden farkl\u0131 olsa da ikisi birlikteyken m\xfcthi\u015f bir uyum yakalayabilirler. Ba\u015fak ak\u0131ll\u0131, sevecen, iyi niyetli, g\xfcvenilir ve detayc\u0131d\u0131r. \u0130kizler burcu Ba\u015fak'\u0131n bu \xf6zelliklerinden etkilenir. \u0130kizler'in zeki, konu\u015fkan, giri\u015fken ve hareketli tavr\u0131, her daim i\xe7inde bir ne\u015fe olmas\u0131 da Ba\u015fak burcunun ilgisini \xe7eker. Arad\u0131\u011f\u0131 hayat enerjisini \u0130kizler'de bulabilir. Ancak \u0130kizler'\u0130n k\u0131skan\xe7 olmas\u0131 ve bunu zaman zaman saklayamamas\u0131 aralar\u0131nda soruna neden olabilir. Bu iki burcun birliktelikleri uzun ve e\u011flenceli olacakt\u0131r.","Terazi kad\u0131n\u0131 ve \u0130kizler erke\u011fi aras\u0131nda uyumlu bir ili\u015fki olabilir. Her iki bur\xe7 da hava grubundand\u0131r ve de\u011fi\u015fkendir. \u0130kizler erke\u011fi Terazi kad\u0131n\u0131na ihtiyac\u0131 olan t\xfcm \xf6zg\xfcrl\xfc\u011f\xfc verir. Kendisi de gece hayat\u0131na ve \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcnd\xfcr. Onunla e\u011flenceli ve tutkulu bir ili\u015fki ya\u015fayabilirsiniz, ama konu evlilikse iki kez d\xfc\u015f\xfcnmeli ve sadakat konusunda problem ya\u015famayaca\u011f\u0131n\u0131zdan emin olmal\u0131s\u0131n\u0131z.","\u0130ki bur\xe7 da hava grubundan oldu\u011fundan aralar\u0131nda uyumlu bir ili\u015fki olabilir. Genel anlamda ikisi de u\xe7ar\u0131 ve de\u011fi\u015fkendir. \u0130kisi de \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcnd\xfcr. Bunun yan\u0131nda Terazi erke\u011fi daha sevecen ve romantiktir. \u0130kizler kad\u0131n\u0131 ise zeki ve konu\u015fkand\u0131r. Bu \xf6zellikleriyle Terazi'yi kolayca etkiler. Terazi detayc\u0131 oldu\u011fundan g\xf6z zevkine hitap edecek bak\u0131ml\u0131 kad\u0131nlardan ho\u015flan\u0131r. \u0130ki taraf da seks\xfcel a\xe7\u0131dan arzulu ve tutkuludur. E\u011fer sadakat konusunda problem ya\u015famazlarsa e\u011flenceli bir birliktelik ya\u015fayabilirler.","Akrep erke\u011finin k\u0131skan\xe7l\u0131\u011f\u0131, \u0130kizler kad\u0131n\u0131n\u0131 \xe7ileden \xe7\u0131karaca\u011f\u0131 i\xe7in ili\u015fki biraz zor olacakt\u0131r. Ancak bu iki tip do\u011fal cazibelerinden dolay\u0131 birbirlerini fazlas\u0131yla \xe7eker. Akrep erke\u011fi duygusal, tutkulu ve \xe7ekicidir. G\xfcven ve sadakat onun i\xe7in \xe7ok \xf6nemlidir. G\xfcveninin suistimal edildi\u011fini hissederse kar\u015f\u0131 tarafa ac\u0131 \xe7ektirmek i\xe7in elinden geleni yapar. Bu ili\u015fkinin y\xfcr\xfcyebilimsei i\xe7in \u0130kizler'in Akrep'in h\xfckmedici tav\u0131rlar\u0131n\u0131dan rahats\u0131zl\u0131k duymamas\u0131 \xe7ok \xf6nemlidir. Aksi halde ili\u015fki k\u0131sa soluklu olabilir.","Akrep burcunun karanl\u0131k ve gizemli taraflar\u0131 ile \u0130kizler burcunun ayd\u0131nl\u0131k ve havai taraflar\u0131n\u0131n bir araya gelmesi zor gibi g\xf6r\xfcnse de imk\xe2ns\u0131z de\u011fildir. Akrep burcu ve \u0130kizler burcu ikilisi hi\xe7bir zaman klasik bir ili\u015fki olmayacakt\u0131r. \u0130kisinin aras\u0131ndaki en b\xfcy\xfck farklardan birisi Akrep burcunun ikizler burcu kadar konu\u015fkan olmamas\u0131d\u0131r. Akrep burcu hi\xe7 kimseyle konu\u015fmadan g\xfcnler ge\xe7irebilirken, bu \u0130kizler burcu i\xe7in neredeyse imk\xe2ns\u0131zd\u0131r. E\u011fer \u0130kizler erke\u011fi, Akrep kad\u0131n\u0131n\u0131n ona h\xfckmetmesinden rahats\u0131zl\u0131k duymaz ve ipleri onun eline verirse m\xfckemmel ve uyumlu bir ili\u015fkileri olabilir.","\u0130kizler kad\u0131n\u0131 pratik zekas\u0131 ve ne\u015feli tav\u0131rlar\u0131yla Yay erke\u011fini kolayca etkiler. Yay erke\u011fi de konu\u015fkan ve d\u0131\u015fa d\xf6n\xfck olu\u015fuyla ele avuca s\u0131\u011fmayan bir karakter \xe7izer. \u0130kizler ve Yay genel anlamda iyi anla\u015f\u0131r ve uyumlu bir ikili olur. Ancak uzun vadede ba\u011f\u0131ms\u0131z ki\u015filiklerinden dolay\u0131 birbirlerinden kopma ihtimalleri \xe7ok y\xfcksektir. \u0130li\u015fkide iki taraf da ba\u011flanmakten korkar. A\u015fk ili\u015fkileri bitse bile dostluklar\u0131 mutlaka devam edecektir.","\u0130kiniz de e\u011flenceyi ve hareketi sevdi\u011finiz i\xe7in aran\u0131zda uyumlu bir ili\u015fki olabilir. \u0130kizler erke\u011fi konu\u015fkan, zeki ve d\u0131\u015fa d\xf6n\xfckt\xfcr. Yay kad\u0131n\u0131 ise g\xfcvenilir, ne\u015feli ve ele avuca s\u0131\u011fmayan bir karakter \xe7izer. Hayat\u0131nda heyecan arayan Yay kad\u0131n\u0131 i\xe7in \u0130kizler isabetli bir se\xe7imdir. \u0130kizler erke\u011finin parayla aras\u0131 iyi de\u011fildir. Bu y\xfczden evlilikten sonra \xe7al\u0131\u015fma karar\u0131 alman\u0131z onu mutlu eder. Seks\xfcel a\xe7\u0131dan ikiniz de arzulu ve istekli oldu\u011funuz i\xe7in sorun ya\u015famazs\u0131n\u0131z.","\u0130kizler erke\u011finin huzursuz ve sinirli yap\u0131s\u0131 O\u011flak kad\u0131n\u0131na hi\xe7 uygun de\u011fildir. \u0130kizler erke\u011fi de O\u011flak'\u0131n k\u0131skan\xe7l\u0131\u011f\u0131 y\xfcz\xfcnden kendini k\u0131s\u0131tlanm\u0131\u015f hissedip mutsuz olabilir. E\u011fer aralar\u0131ndaki a\u015fk tutkulu de\u011filse bu ili\u015fkinin y\xfcr\xfcmesi olduk\xe7a zordur. O\u011flak tam bir g\xfcven insan\u0131d\u0131r ve ili\u015fkide sorumluluklar\u0131n\u0131 fazlas\u0131yla yerine getirir. Ayn\u0131 ilgiyi g\xf6remedi\u011finde ise kar\u015f\u0131 taraf i\xe7in hayat\u0131 \xe7ekilmez hale getirebilir.","\u0130kizler ve O\u011flak aras\u0131nda pek uyumlu bir ili\u015fki s\xf6z konusu olmaz. O\u011flak erke\u011fi, \u0130kizler kad\u0131n\u0131n\u0131 \xe7ekecek \xf6zelliklere sahip de\u011fildir. \xd6zellikle huzursuz ve sinirli yap\u0131s\u0131 \u0130kizler'i fazlas\u0131yla rahats\u0131z edebilir. O\u011flak'\u0131n k\u0131skan\xe7 tav\u0131rlar\u0131 \u0130kizler'in kendini k\u0131s\u0131tlanm\u0131\u015f hissetmesine neden olur. Arkada\u015f olarak \xe7ok iyi anla\u015facak bi ikili, sevgili olunca ancak aralar\u0131ndaki a\u015fk\u0131n \xe7ok kuvvetli olmas\u0131 \u015fart\u0131yla ili\u015fkiyi y\xfcr\xfctebilir. Aksi halde bu ili\u015fki olduk\xe7a zor olacakt\u0131r.","Kova ile \u0130kizler burcunun uyumu m\xfckemmele yak\u0131n olacakt\u0131r. Her iki bur\xe7 da hava gurubundan oldu\u011fu i\xe7in aradaki uyum genelde iyi olur. \u0130kisi de duygusal ve d\xfc\u015f\xfcnsel y\xf6nden yeniliklere kolayca ayak uydururlar. Her ikisi de \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcnd\xfcr ve k\u0131s\u0131tlanmaktan ho\u015flanmaz. Bu nedenle birbirlerinin bireysel \xf6zg\xfcrl\xfcklerine sayg\u0131 duyacaklard\u0131r. Kova burcu ne\u015feli, sevecen ve zeki tav\u0131rlar\u0131yla \xe7evresindeki insanlar\u0131 kendisine hayran b\u0131rak\u0131r. \u0130kizler burcu da kendisine e\u015f olarak zeki ve ne\u015feli birisini arar. Birbirlerini \xe7ok iyi tamamlarlar.","Her iki bur\xe7 da hava grubundand\u0131r ve aralar\u0131nda uyumlu bir ili\u015fki olacakt\u0131r. \u0130kizler kad\u0131n\u0131 gibi Kova erke\u011fi de de\u011fi\u015fken ve ne\u015felidir. Ayr\u0131ca ikisi de \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcnd\xfcr ve k\u0131s\u0131tlanmaktan ho\u015flanmaz. Bu iki tip birbirini olduk\xe7a \xe7ekici bulur ve iyi arkada\u015fl\u0131k kurar. Seks\xfcel a\xe7\u0131dan da olduk\xe7a uyumludurlar. \u0130stek ve arzular\u0131n\u0131 birbirlerine ifade etmekten \xe7ekinmezler.","\u0130lk ba\u015fta hareketli ve heyecan verici bir birliktelik gibi g\xf6r\xfcnse de \u0130kizler ve Bal\u0131k aras\u0131nda pek uyumlu bir ili\u015fki olmaz. \u0130kizler kad\u0131n\u0131, d\u0131\u015fa d\xf6n\xfck ve konu\u015fkand\u0131r. Bal\u0131k erke\u011fi ise romantik, duygusal ve hayalperesttir. Bal\u0131k erke\u011fi, pek konu\u015fkan de\u011fildir ve \u0130kizler burcunun ilgisini \xe7ekebilecek konular hakk\u0131nda konu\u015fmay\u0131 pek beceremez. Seks\xfcel y\xf6nden de birbirlerinin isteklerini kar\u015f\u0131layamazlar.","\u0130kizler burcu canl\u0131 k\u0131p\u0131r k\u0131p\u0131r bir yap\u0131s\u0131 vard\u0131r. Giri\u015fken, sosyal, e\u011flenmeyi seven, tiyatroya sinemaya gitmeyi seven bir ki\u015fili\u011fe sahiptir. Evde oturmaktan nefret eder. Bal\u0131k burcu ise biraz evcimen bir yap\u0131s\u0131 vard\u0131r. \u0130kizler ile Bal\u0131k'\u0131n a\u015fmas\u0131 gereken en \xf6nemli sorun birisi sosyal iken di\u011ferinin asosyal olmas\u0131d\u0131r. Seks\xfcel y\xf6nden ise \u0130kizler burcunun tutkulu yap\u0131s\u0131 yan\u0131nda Bal\u0131k burcunun a\u015f\u0131r\u0131 duygusall\u0131\u011f\u0131 \xf6n plana \xe7\u0131kar. Bal\u0131k erke\u011fine d\xfc\u015fen en \xf6nemli g\xf6rev \u0130kizler'in duygular\u0131n\u0131 ortaya \xe7\u0131karacak ortam\u0131 haz\u0131rlamak olacakt\u0131r.","Yenge\xe7ler aras\u0131nda uyumlu bir ili\u015fki olur. Yenge\xe7 ak\u0131ll\u0131, duygusal, romantik ve sa\u011fduyuludur. Yenge\xe7 kad\u0131n\u0131 kendine bir \xf6m\xfcr boyu rahat ve mutlu hissedece\u011fi bir ortam haz\u0131rlar. Mutlu bir ev hayat\u0131n\u0131n olmas\u0131n\u0131 ister. Birbirine sad\u0131k ve e\u011flenceli birer partner olurlar. Seks\xfcel y\xf6nden iki taraf da arzulu ve tutkuludur. Duygusal a\xe7\u0131dan da birbirlerine hitap ederler. E\u011fer ki\u015fisel problemleri \xf6n plana \xe7\u0131kmazsa birlikte uyumlu ve mutlu bir birliktelik s\xfcrd\xfcrebilirler.","Bu beraberlik klasik anlamda uyumlu say\u0131lmasa da iyi olabilir. Aslan erke\u011fi Yenge\xe7 kad\u0131na g\xf6re olduk\xe7a farkl\u0131l\u0131k g\xf6sterebilir. Aslan hayata tutku ile ba\u011fl\u0131d\u0131r ve istek doludur. Zaman zaman benmerkezci ve egoist de olabilir. Hayran olunmak ve sayg\u0131 duyulmak Aslan'\u0131n en b\xfcy\xfck ihtiyac\u0131d\u0131r. K\xf6t\xfc g\xfcnler i\xe7in bir kenarda para biriktirmek akl\u0131n\u0131n ucundan bile ge\xe7mez. Yenge\xe7 burcu ise paras\u0131n\u0131 gelecek kayg\u0131s\u0131 ile biriktirir hatta istif eder. Aslan'\u0131n ald\u0131\u011f\u0131 pahal\u0131 hediyeler Yenge\xe7 kad\u0131n\u0131n\u0131n ba\u015f\u0131n\u0131 d\xf6nd\xfcrebilir. Seks\xfcel y\xf6nden iki taraf da arzulu ve tutkuludur.","Yenge\xe7 erke\u011finin kendinden emin davran\u0131\u015flar\u0131n\u0131n ard\u0131nda g\xfcvensiz bir ruh yatar. Aslan kad\u0131n\u0131n\u0131n g\xfcvenini kazan\u0131p, onu a\xe7mas\u0131 uzun s\xfcrecektir. Aslan kad\u0131n\u0131 onun kalbini fethetmeyi ba\u015far\u0131rsa, Yenge\xe7 erke\u011fi ona kar\u015f\u0131 i\xe7ten ve sad\u0131k davranacakt\u0131r. Yenge\xe7 erke\u011fi evcimendir, Aslan ise d\u0131\u015fa d\xf6n\xfck ve gezmeyi seven bir tiptir. Sonu\xe7 olarak ili\u015fkinin y\xfcr\xfcmesi i\xe7in birbirlerini \xe7ok iyi anlayabilmeleri ve ho\u015fg\xf6r\xfcl\xfc davranmalar\u0131 gerekir.","Ba\u015fak kad\u0131n\u0131 ile Yenge\xe7 erke\u011fi aras\u0131nda olduk\xe7a uyumlu bir ili\u015fki olabilir. Sakin ve evine ba\u011fl\u0131 olan Yenge\xe7, Ba\u015fak'\u0131n y\xf6netme iste\u011fine uyum sa\u011flayacak, birbirlerini ihtiya\xe7 duyduklar\u0131 konularda dengeleyeceklerdir. Yenge\xe7'in duygusal ve romantik taraf\u0131 Ba\u015fak'\u0131 etkileyecektir. Yenge\xe7 sevdi\u011fi zaman sad\u0131k ve e\u011flenceli bir e\u015f olacakt\u0131r. Seks\xfcel a\xe7\u0131dan her iki taraf da romantik ve arzuludur. Farkl\u0131l\u0131klar rahats\u0131z edici olmad\u0131\u011f\u0131 takdirde bu iki burcun anla\u015famamas\u0131 zordur.","Yenge\xe7 kad\u0131n\u0131 ile Ba\u015fak erke\u011finin pek uyumlu ilerleyen bir birlikteli\u011fi olmayacakt\u0131r. Yenge\xe7 burcunun duygusall\u0131\u011f\u0131na Ba\u015fak burcunun mant\u0131kl\u0131 yakla\u015f\u0131m\u0131 iki taraf\u0131n da beklentilerinin kar\u015f\u0131lanmamas\u0131na neden olabilir. Ba\u015fak burcunun prensipleri ve bu prensiplere olan ba\u011fl\u0131l\u0131\u011f\u0131 Yenge\xe7 kad\u0131n\u0131 i\xe7in zorlay\u0131c\u0131 bir unsurdur. Aralar\u0131nda ya\u015fanacak ileti\u015fim kopukluklar\u0131 geni\u015f zaman diliminde birliktelikleri i\xe7in ciddi sorunlar yaratabilir. Yenge\xe7 burcu kad\u0131n\u0131 her en kadar iyi niyetli davransa da, Ba\u015fak erke\u011finin temposuna ayak uyduramayaca\u011f\u0131 i\xe7in ili\u015fki sonunda mutsuz olabilir.","Yenge\xe7 kad\u0131n\u0131 Terazi erke\u011finin ho\u015f, \xe7ekici ve dayan\u0131lmaz cazibesinin kar\u015f\u0131s\u0131nda kay\u0131ts\u0131z kalamaz. Ancak Terazi`nin s\xfcrekli d\u0131\u015f d\xfcnya ile ili\u015fki i\xe7inde olmas\u0131, Yenge\xe7'in daha i\xe7e d\xf6n\xfck ve ailesine ba\u011fl\u0131 yap\u0131s\u0131 aralar\u0131nda sorun olu\u015fturabilir. Terazi erke\u011finin ise e\u011flenceye ve insanlara ihtiyac\u0131 vard\u0131r. Terazi burcu gelece\u011fini pek d\xfc\u015f\xfcnmez ya da d\xfc\u015f\xfcnd\xfc\u011f\xfc kadar\u0131 Yenge\xe7 kad\u0131n\u0131 i\xe7in yeterli olmayabilir. Uzun vadede \xe7\u0131kan sorunlara ortakla\u015fa \xe7\xf6z\xfcm bulunmazsa bu ili\u015fkinin \xf6mr\xfc k\u0131sa olabilir.","Terazi ve Yenge\xe7 aras\u0131nda pek uyumlu bir birlikteli\u011fin olaca\u011f\u0131 s\xf6ylenemez. Yenge\xe7 erke\u011fi duygusal ve hassast\u0131r. Terazi kad\u0131n\u0131 da ayn\u0131 \u015fekilde romantiktir. Ama iki taraf da duygular\u0131n\u0131 dile getirme konusunda \xe7ekingen davranaca\u011f\u0131ndan s\u0131k\u0131nt\u0131lar ortaya \xe7\u0131kabilir. Seks\xfcel a\xe7\u0131dan Yenge\xe7 olduk\xe7a arzulu ve tutkuludur. Aralar\u0131nda b\xfcy\xfck bir a\u015fk varsa ve ki\u015filik olarak z\u0131tl\u0131klar yoksa ili\u015fki y\xfcr\xfcyebilir.","Akrep ve Yenge\xe7 aras\u0131nda uyumlu bir ili\u015fki olabilir. Her iki bur\xe7 da su grubundand\u0131r. Dolay\u0131s\u0131yla ortak \xf6zellikleri olduk\xe7a fazlad\u0131r. Yenge\xe7 hassas, duygusal ve romantiktir. Akrep ise tutkulu, ak\u0131ll\u0131, duygusal ve a\xe7\u0131k s\xf6zl\xfcd\xfcr. Kendine olduk\xe7a g\xfcvenir. Etkileyici bir d\u0131\u015f g\xf6r\xfcn\xfcm\xfc vard\u0131r. E\u011fer severse tutkulu bir a\u015f\u0131k olacakt\u0131r. Yenge\xe7 burcu olduk\xe7a anlay\u0131\u015fl\u0131 oldu\u011fundan Akrep burcunun \xf6fke n\xf6betlerinin ge\xe7mesini sab\u0131rla bekleyecek ve alttan alacakt\u0131r. \xd6zellikle Akrep kad\u0131n\u0131n\u0131n kar\u015f\u0131 konulmaz bir seks\xfcel cazibesi vard\u0131r. Bu nedenle uyumlu bir ili\u015fki yakalamalar\u0131 m\xfcmk\xfcnd\xfcr.","Yenge\xe7 kad\u0131n\u0131 ile Akrep erke\u011fi aras\u0131nda son derece seksi ve sa\u011flam bir ili\u015fki olabilir. Yenge\xe7 kad\u0131n\u0131n\u0131n korunma ve g\xfcvenilir bir yerde kendini hissetme arzusu kendisini Akrep erke\u011finin kollar\u0131na b\u0131rakmakla sonu\xe7lanacakt\u0131r. Birlikte b\xfct\xfcn bir g\xfcn\xfc yatakta ge\xe7irebilirsiniz! Akrep erke\u011fi ile Yenge\xe7 kad\u0131n\u0131n\u0131n istekleri hemen hemen ayn\u0131d\u0131r: Ev hayat\u0131, kendine ait \xf6zel hayat, \xe7ocuklar ve hayat\u0131n sonuna kadar harika bir seks! Akrep biraz sabit fikirlidir. Onunla bir \xe7ok konuda konu\u015farak sorunlar\u0131n\u0131z\u0131 halledebilirsiniz.","Yenge\xe7 erke\u011fi istikrara ve g\xfcvene ihtiya\xe7 duyar. Ayr\u0131ca hassas, duygusal ve romantiktir. Buna kar\u015f\u0131l\u0131k Yay kad\u0131n\u0131 macera sever ve \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcnd\xfcr. Bu \xf6zellikleriniz onda hayranl\u0131k uyand\u0131rsa da size g\xfcvenmesi zaman alacakt\u0131r. Bu iki tip birbirini anlamakta ve ileti\u015fim kurmakta zorlanabilirler. Ama iki taraf da birbirinin temel \xf6zelliklerine sayg\u0131 g\xf6sterirse uzun vadede uyumlu bir ili\u015fki ya\u015fayabilirler.","Yenge\xe7 kad\u0131n\u0131 ile Yay erke\u011finin bir araya gelmesi asl\u0131nda \xe7ok da iyi bir fikir olmayabilir. Yay, iyi e\u011fitim alm\u0131\u015f, k\xfclt\xfcrl\xfc, de\u011fi\u015fik ilgi alanlar\u0131 olan biridir. Onun ilgi \xe7ekici konu\u015fmas\u0131 Yenge\xe7 kad\u0131n\u0131n\u0131n dikkatini \xe7ekse de gelecekte pek de uyumlu bir birliktelik olmayabilir. Yenge\xe7 burcu sezgilerinize g\xf6re hareket ederken, Yay ak\u0131lc\u0131 ve analitiktir. Yay zaman zaman kibirli, k\xfcstah ve nezaketsiz olabilir. Yatakta ise Yay e\u011flenceli ve atletiktir, Yenge\xe7 kad\u0131n\u0131 ise derin ve duygusald\u0131r. Bu iki bur\xe7 ilk ba\u015fta birbirlerinden etkilenseler de gelecekleri yoktur.","Yenge\xe7 erke\u011finin s\u0131k s\u0131k de\u011fi\u015fen ruh hali sizi \u015fa\u015f\u0131rtsa da onunla birlikte mutlu olabilirsiniz. Yenge\xe7 erke\u011fi hassas, duygusal ve fazlas\u0131yla romantiktir. Bir kez sevdi mi yapmayaca\u011f\u0131 fedakarl\u0131k yoktur. Her konuda sevdi\u011fi ki\u015fiye destek olur. Yaln\u0131z utanga\xe7 bir mizac\u0131 oldu\u011fu i\xe7in kendini ifade etmekte zorluk \xe7ekebilir. \u0130kiniz de evcimen oldu\u011funuz ve kendinizi g\xfcvende hissetmek istedi\u011finiz i\xe7in birbirinize benzersiniz. Seks\xfcel a\xe7\u0131dan iki taraf da arzulu ve tutkuludur. Uzun vadede uyumlu ve g\xfczel bir ili\u015fki ya\u015fayabilirsiniz.","O\u011flak'\u0131n h\u0131rsl\u0131 ve ba\u015far\u0131ya odakl\u0131 yap\u0131s\u0131 Yenge\xe7 bur\xe7lar\u0131 ile iyi anla\u015fmalar\u0131na neden olur. Yenge\xe7ler de bu i\xe7g\xfcd\xfcye sahip oldu\u011fu i\xe7in ili\u015fkileri de verimli ve uzun olur. O\u011flak erkekleri pratik, sa\u011flam ve g\xfcvenilirdir. Kazand\u0131klar\u0131n\u0131 yat\u0131r\u0131mlarla de\u011ferlendirir, Yenge\xe7ler de birikim yapmay\u0131 sevdi\u011finden bu konuda olduk\xe7a iyi anla\u015f\u0131rlar. Yenge\xe7 kad\u0131n\u0131 bu ili\u015fkiye sezgilerini, duygusall\u0131\u011f\u0131n\u0131 katar. Bu iki bur\xe7 yatakta da birbirleriyle \xe7ok uyumludur. O\u011flak erke\u011finin bir\xe7ok hayran\u0131 olsa da ka\xe7amak yapmayacak, ili\u015fkisine sad\u0131k kalacakt\u0131r. Bu da Yenge\xe7 kad\u0131n\u0131n\u0131n ihtiyac\u0131 olan g\xfcven duygusunu yaratacakt\u0131r.","Yenge\xe7 bur\xe7lar\u0131 olduk\xe7a duygusal, hassas ve romantiktirler. Kova bur\xe7lar\u0131 ise duygular\u0131n\u0131 d\u0131\u015fa vurmayan, olaylara daha \xe7ok mant\u0131ksal y\xf6n\xfcyle bakan insanlard\u0131r. Genelde iki taraf aras\u0131 arkada\u015fl\u0131k d\u0131\u015f\u0131nda duygusal bir ili\u015fki s\u0131n\u0131rlar\u0131 zorlar. Yenge\xe7 burcunun \xe7ok ak\u0131ll\u0131 davranmas\u0131 ve Kova kad\u0131n\u0131na y\xf6nlendirildi\u011fini hissettirmemesi gerekir. Her iki taraf da arzulu ve tutkuludur. Fakat Yenge\xe7 insan\u0131n\u0131n duygusall\u0131\u011f\u0131 daha a\u011f\u0131r basar. Kova burcu mant\u0131kl\u0131d\u0131r. Bu durumda Yenge\xe7 duygusal tatminsizlik ya\u015fayabilir. Bu iki tipin uzun vadede uyumlu bir ili\u015fki yakalamas\u0131 zordur.","Yenge\xe7 kad\u0131n\u0131 ile Kova erke\u011fi ayr\u0131 d\xfcnyalar\u0131n insanlar\u0131d\u0131r. Kova insan\u0131, hayat\u0131 ara\u015ft\u0131rmac\u0131 bir bilim adam\u0131 gibi yasar. Verileri toplay\u0131p mant\u0131kl\u0131 sonu\xe7lar \xe7\u0131karmaya \xe7al\u0131\u015f\u0131r. Yenge\xe7 ise kalbinin sesinin onun hep do\u011fru y\xf6ne g\xf6t\xfcrd\xfc\u011f\xfcn\xfc d\xfc\u015f\xfcn\xfcr ve ona g\xf6re hareket eder. Kova erke\u011fi ili\u015fkisinde mesafeli bir tav\u0131r sergileyebilir. Ba\u015fta onun bu ilgisiz havas\u0131 gizemli gelip Yenge\xe7 kad\u0131n\u0131n\u0131 \xe7ekse de zamanla k\u0131r\u0131c\u0131 bir hal alabilir. Kova bireyseldir, bir \xe7ift gibi hissedemez ve d\xfc\u015f\xfcnemez. Bu y\xfczden de ili\u015fkideki verici taraf her zaman Yenge\xe7 olacakt\u0131r. \u0130ki burcun ili\u015fkisi heyecanl\u0131 ba\u015flasa da h\xfcsranla bitebilir.","\u0130ki bur\xe7 da derin duygulara sahiptir. Birbirlerini anlama konusunda hi\xe7bir s\u0131k\u0131nt\u0131 \xe7ekmezler. Yenge\xe7'in aile kurma ve yuva \xf6zlemi Bal\u0131k burcunun \xe7ok ho\u015funa gider. Bal\u0131k ince d\xfc\u015f\xfcn\xfcr ve sevdi\u011fi erke\u011fi mutlu etmek ve \u015f\u0131martmak i\xe7in elinden gelen \xe7abay\u0131 g\xf6sterir. Parasal konularda Bal\u0131k maddiyata \xf6nem vermezken Yenge\xe7 \xe7ok hesapl\u0131d\u0131r. Birikim yapmay\u0131 seven Yenge\xe7 burcu ile gelece\u011finiz g\xfcvence alt\u0131na alm\u0131\u015fs\u0131n\u0131z demektir. Seks\xfcel a\xe7\u0131dan duygusal, romantik ve arzuludurlar. Uzun vadede \xe7ok uyumlu ve mutlu bir ili\u015fkileri olacakt\u0131r.","Bal\u0131k, Yenge\xe7 kad\u0131nlar\u0131n\u0131n en \xe7abuk a\u015f\u0131k oldu\u011fu bur\xe7lardan biridir. Bal\u0131k burcunun sezgileri de Yenge\xe7 burcu kadar geli\u015fmi\u015ftir. Zodyak`\u0131n sonuncu burcu olan Bal\u0131k kendinden \xf6nce gelen b\xfct\xfcn bur\xe7lara anlay\u0131\u015f g\xf6sterir. Sadece y\xfczeyde g\xf6r\xfcneni de\u011fil, alt\u0131nda yatan ger\xe7ekleri de g\xf6rmede ustad\u0131r. Bal\u0131k erke\u011fi ile Yenge\xe7 kad\u0131n\u0131 ayn\u0131 beklentilere sahiptir. D\xfczg\xfcn bir ev hayat\u0131, \xe7ocuklar, yarat\u0131c\u0131l\u0131\u011f\u0131n\u0131 ifade edebilme f\u0131rsat\u0131 onlar i\xe7in \xf6nemlidir. Bal\u0131k erke\u011fi ile Yenge\xe7 kad\u0131n\u0131n\u0131n ili\u015fkisi uyum ve a\u015fk i\xe7inde ilerleyecektir. Bal\u0131k erke\u011fi a\u015fk\u0131n\u0131n g\xfcc\xfc ile Yenge\xe7 kad\u0131n\u0131n\u0131 kendine ba\u011flayacakt\u0131r.","\u0130ki Aslan aras\u0131nda \xe7ok uyumlu bir ili\u015fki olabilece\u011fi gibi tamamen uyumsuz bir ili\u015fki de olabilir. Hem kad\u0131n, hem erkek bur\xe7 ate\u015f grubudur ve ayn\u0131 bur\xe7tan kad\u0131n ve erke\u011fin bir\xe7ok ortak noktas\u0131 olabilir. Her ikisi de hareketli, ne\u015feli, giri\u015fken ve romantiktir. Hayat\u0131n g\xfczelliklerine, g\xf6steri\u015fe ve l\xfckse olduk\xe7a d\xfc\u015fk\xfcnd\xfcr. Ayn\u0131 zamanda da gururludur. Birbirlerine anlay\u0131\u015f g\xf6sterdikleri ve kar\u015f\u0131 taraf\u0131 bask\u0131 alt\u0131na almaya \xe7al\u0131\u015fmad\u0131klar\u0131 m\xfcddet\xe7e ili\u015fkileri y\xfcr\xfcyebilir.","Aslan kad\u0131n\u0131 hareketli, ne\u015feli, giri\u015fken ve romantiktir. Hayat\u0131n g\xfczelliklerine, g\xf6steri\u015fe ve l\xfckse olduk\xe7a d\xfc\u015fk\xfcnd\xfcr. Ayn\u0131 zamanda da gururludur. Ba\u015fak erke\u011fi ise sevecen, iyi niyetli, g\xfcvenilir ve detayc\u0131d\u0131r. Bir kez sevdi\u011fi zaman g\xfcvenilir ve sad\u0131k bir a\u015f\u0131k olacakt\u0131r. \u0130kisi aras\u0131ndaki ili\u015fkinin \xe7ok uyumlu olaca\u011f\u0131 s\xf6ylenemez ama birbirlerine anlay\u0131\u015f g\xf6sterirlerse iyi bir ili\u015fkileri olabilir.","Ba\u015fak ve Aslan aras\u0131nda uyumlu bir ili\u015fki olabilir. Ba\u015fak ak\u0131ll\u0131, sevecen, iyi niyetli ve detayc\u0131d\u0131r. Aslan ise korumac\u0131, sevecen, duygusal ve hareketli bir yap\u0131ya sahiptir. Aslan erke\u011finin \xe7al\u0131\u015fkanl\u0131\u011f\u0131, gururlu duru\u015fu Ba\u015fak kad\u0131n\u0131n\u0131 etkiler. Aslan'\u0131n pohpohlanmak ihtiyac\u0131n\u0131 Ba\u015fak fark eder ve kar\u015f\u0131larsa, Aslan'\u0131n onun i\xe7in yapamayaca\u011f\u0131 \u015fey kalmaz. Her iki taraf da seks\xfcel y\xf6nden olduk\xe7a arzuludur. Aralar\u0131ndaki dengeyi kar\u015f\u0131l\u0131kl\u0131 fedakarl\u0131klarla korurlarsa, \xf6m\xfcr boyu bir birliktelik ya\u015fayabilirler.","Terazi erke\u011fi ne\u015felidir ve Aslan kad\u0131n\u0131na \xe7ok iyi gelir. Aslan kad\u0131n\u0131 da ne\u015feli, giri\u015fken ve romantik tav\u0131rlar\u0131yla Terazi erke\u011fini kolayca etkisi alt\u0131na al\u0131r. Bu iki burcun insan\u0131 a\u015fk hayat\u0131nda \xe7ok iyi anla\u015facaklar\u0131 gibi iki iyi de arkada\u015f olacakt\u0131r. Tek sorun Aslan burcunun gururunun \xf6n plana \xe7\u0131kmas\u0131 olabilir. Bu durumda da Terazi'nin dengeleyici bir tutum i\xe7ine girmesi gerekir.","Aslan erke\u011fi ne\u015feli, giri\u015fken ve zekidir. Terazi kad\u0131n\u0131 ise zarifli\u011fi ve duygusall\u0131\u011f\u0131yla dikkat \xe7eker. Bu ikilinin birlikteli\u011fi gayet uyumlu ve uzun s\xfcreli olacakt\u0131r. Aslan erke\u011fi ki\u015fili\u011fi ve cazibesiyle Terazi'yi kolayca etkisi alt\u0131na al\u0131r. \u0130li\u015fkinin ilerleyen zamanlar\u0131nda Aslan erke\u011fi gururunu \xf6n plana \xe7\u0131kararak bask\u0131c\u0131 tav\u0131rlar izlemeye ba\u015flayabilir ancak Terazi bunu dengelemeyi bilecektir. Her iki taraf da seks\xfcel a\xe7\u0131dan tutkuludur ve bu ikilinin ili\u015fkisine \u201ciyi\u201d demek az olur!","Aslan burcu, yo\u011fun duygularla dolu ve tutkulu bir a\u015f\u0131k olan Akrep burcunun b\xfcy\xfcs\xfcne \xe7abuk kap\u0131lacakt\u0131r. Bu iki burcun ili\u015fkilerini zorlayacak en \xf6nemli nokta her ikisinin de sabit fikirli olmas\u0131 ve kararlar\u0131ndan vazge\xe7memesi olacakt\u0131r. Akrep burcu sevdi\u011fi zaman t\xfcm benli\u011fi ile sevdi\u011finden bu durum Aslan burcunun \xe7ok ho\u015funa gidecektir. Bir kavga an\u0131nda her iki taraf da kararlar\u0131ndan vazge\xe7medi\u011finden bar\u0131\u015fmalar\u0131 kimi zaman zor olacakt\u0131r ancak her iki taraf da sevdi\u011fine sad\u0131k oldu\u011fundan uzun \xf6m\xfcrl\xfc bir ili\u015fki olmas\u0131 kuvvetle muhtemeldir.","Akrep erke\u011finin sihirli \xe7ekim g\xfcc\xfc Aslan kad\u0131n\u0131n\u0131 kolayca etkisi alt\u0131na alacakt\u0131r. \u0130kisi aras\u0131nda uyumlu ve tutkulu bir ili\u015fki olabilir. Yaln\u0131z Akrep'in ikili ili\u015fkilerde fazlaca k\u0131skan\xe7 olmas\u0131 ili\u015fkinin y\u0131prat\u0131c\u0131 olmas\u0131na ve zarar g\xf6rmesine sebep olabilir. Aslan kad\u0131n\u0131 da Akrep'i bask\u0131 alt\u0131na almaya \xe7al\u0131\u015fmamal\u0131 ve ona h\xfckmetmeye kalkmamal\u0131d\u0131r. \xc7\xfcnk\xfc beklemedi\u011fi kadar sert bir tepkiyle kar\u015f\u0131la\u015fabilir.","Yay erke\u011fi, her zaman macera ve meydan okuma aray\u0131\u015f\u0131ndad\u0131r. Gitti\u011fi her yerde g\xf6z\xfc pek davran\u0131\u015flarda bulunabilir. Cesaret ve at\u0131lganl\u0131\u011f\u0131 Aslan kad\u0131n\u0131n\u0131n olduk\xe7a ho\u015funa gider. Bunun yan\u0131 s\u0131ra, sorumsuzluk ve duyars\u0131zl\u0131\u011f\u0131 da s\xf6z konusudur. \u0130ki ayr\u0131 mizaca sahip bu iki ki\u015fi, \u015fa\u015f\u0131rt\u0131c\u0131 bir \u015fekilde \xe7ok iyi anla\u015fabilir. Hatta uzun vadede evlili\u011fe d\xf6n\xfc\u015febilecek uyumlu bir birliktelik olacakt\u0131r.","Birlikte sekste m\xfckemmel bir uyum yakalayabilirsiniz. Her iki bur\xe7 da Ate\u015f grubudur ve birbirlerine \xe7ok benzerler. Aslan erke\u011fi ne\u015feli, giri\u015fken ve romantiktir. Ayr\u0131ca l\xfckse d\xfc\u015fk\xfcnl\xfc\u011f\xfcyle bilinir. Yay kad\u0131n\u0131 da e\u011flenmeyi, gezmeyi seven ne\u015feli bir karakterdir. Bu iki bur\xe7 birbirini adeta tamamlar. \xd6nce \xe7ok iyi iki dost ard\u0131ndan da sevgili olabilirler. Uzun vadede evlili\u011fe d\xf6n\xfc\u015febilecek uyumlu bir ili\u015fki olacakt\u0131r.","Aslan erke\u011fi c\xf6mert, aristokrat ruhlu, giri\u015fken ve romantiktir. Hayat\u0131n g\xfczelliklerine ve l\xfckse \xe7ok d\xfc\u015fk\xfcnd\xfcr. O\u011flak kad\u0131n\u0131 ise sevdi\u011fi ki\u015fiye her konuda destek olan, duygusal ve d\xfc\u015f\xfcnceli bir yap\u0131dad\u0131r. Sevdi\u011fi ki\u015fiyi fazla sahiplenir ve k\u0131skan\u0131r. Bu ikilinin mutlu olmas\u0131n\u0131n tek ko\u015fulu \xf6zveridir. E\u011fer ikiniz de hayat tarzlar\u0131n\u0131zda de\u011fi\u015fiklik yapabilir ve birbirinizin isteklerine cevap verebilirseniz uzun vadede uyumlu bir birliktelik ya\u015fayabilirsiniz.","C\xf6mert ve aristokrat Aslan ile h\u0131rsl\u0131 ve i\u015fkolik O\u011flak bur\xe7lar\u0131n\u0131n birlikteli\u011fi m\xfcmk\xfcn, ancak iki taraf\u0131nda da elinden geleni yapmas\u0131 \u015fart. Aslan kad\u0131n\u0131 romantik, ne\u015feli, giri\u015fken ve l\xfcks merakl\u0131s\u0131d\u0131r. O\u011flak erke\u011fi ise Sat\xfcrn taraf\u0131ndan y\xf6netilir, tedbirlidir ve hayat\u0131 \xe7ok ciddiye al\u0131r. \u0130ki burcun insan\u0131 \xe7ok farkl\u0131 olsa da birbirine iyi gelir. Seks\xfcel a\xe7\u0131dan da birbirlerinin isteklerini kar\u015f\u0131larlar. Biraz \xe7abayla uzun vadede uyumlu bir ritm yakalayabilirler.","Kova erke\u011finin sevgi konusundaki \u0131srar\u0131 ve sabr\u0131, Aslan kad\u0131n\u0131n\u0131 etkiler. Kova erke\u011fi idealisttir, belirgin bir duyarl\u0131l\u0131\u011f\u0131 vard\u0131r, bu nedenle birbirlerini tamamlayacaklard\u0131r. Aslan kad\u0131n\u0131, onu \xfctopyalar aleminden alarak, ger\xe7ekler d\xfcnyas\u0131na indirecek ki\u015fidir. Birbirlerinden her durumda \xe7ok \u015fey \xf6\u011frenebilirler. Ortak ve farkl\u0131 noktalar\u0131 onlar\u0131 dengede tutar. Kova'n\u0131n Aslan'\u0131n gururunu s\xfcrekli ok\u015famas\u0131 ve ikilinin ki\u015filik \xe7at\u0131\u015fmalar\u0131ndan uzak durmalar\u0131 \u015fart\u0131yla ili\u015fkileri evlili\u011fe kadar gidebilir.","Kendini bulundu\u011fu ortam\u0131n lideri olarak g\xf6ren Aslan burcu genel olarak Kova burcuyla uyumlu bir ili\u015fki g\xf6steremez. \u0130ki taraf\u0131n da birlikte olabilmesi i\xe7in gerekli olan k\u0131v\u0131lc\u0131m\u0131 beklemek kova burcu i\xe7in eziyet gibidir. Herkesin dikkatini \xe7eken Kova burcu, bir Aslan burcunun dikkatini \xe7ekemedi\u011finde sinirlenir, uzun bir s\xfcre u\u011fra\u015ft\u0131ktan sonra da pes eder. Kova bur\xe7lar\u0131 ili\u015fkide asla ve asla aldatmaya y\xf6nelik bir hareket sergilemezler. Ba\u015fka birinin varl\u0131\u011f\u0131n\u0131 hissettiklerinde bile ili\u015fkiyi kesebilir, yeni bir \u015fans vermeyebilirler. Bu iki burcun ili\u015fkisi taraflar\u0131n duygusal tav\u0131rlar\u0131na g\xf6re olumlu ya da olumsuz \u015feklini alacakt\u0131r.","Bal\u0131k ile Aslan burcunun ortak \xf6zelliklerinden ilki ikisinin de yarat\u0131c\u0131 bur\xe7lar olmas\u0131d\u0131r. Bal\u0131k burcunu Aslan burcuna hayran b\u0131rakan en temel \xf6zellik Aslan burcunun sahip oldu\u011fu c\xf6mertlik ve ihti\u015famd\u0131r. \u0130ki bur\xe7 da sanat ve edebiyata \xe7ok \xf6nem verir. Aslan burcu Bal\u0131k burcuna cesur olma konusunu \xf6\u011fretirken Bal\u0131k burcu ise Aslan'a kurnaz olmay\u0131 \xf6\u011fretebilir. Aslan'\u0131n hareketli ve d\u0131\u015fa d\xf6n\xfck ki\u015fili\u011fi bu ili\u015fkiyi dengeleyecektir. Uzun vadede uyumlu ve g\xfczel bir ili\u015fki yakalamalar\u0131 m\xfcmk\xfcnd\xfcr.","Aslan ve Bal\u0131k birbirinden \xe7ok farkl\u0131 iki bur\xe7tur ve bir araya gelmeleri olduk\xe7a zordur. Aslan kad\u0131n\u0131 hareketli, ne\u015feli ve giri\u015fkendir. Bal\u0131k erke\u011fi ise duygusal, hassas ve romantiktir. Bal\u0131k burcu ince d\xfc\u015f\xfcn\xfcr ve hayalperesttir. Aslanlar ise ba\u015fkalar\u0131n\u0131n duygular\u0131na fazla \xf6nem vermezler. Yine de birbirlerine bir\xe7ok konuda destek olacaklar\u0131 d\xfc\u015f\xfcn\xfcl\xfcrse, k\u0131sa vadeli ve tutkulu bir birliktelik ya\u015fayabilirller.","\u0130ki Ba\u015fak burcu aras\u0131nda son derece uyumlu bir ili\u015fki ya\u015fanabilir. Karakter \xf6zellikleri birbirine \xe7ok benzeyece\u011finden, ikisinin de rahatlar\u0131na \xe7ok d\xfc\u015fk\xfcn olmas\u0131 kimseyi rahats\u0131z etmeyecektir. Ya\u015fad\u0131klar\u0131 yerlerde titizli\u011fe \xe7ok \xf6nem verecek, d\xfczen konusunda birbirlerinin alanlar\u0131na girmeyeceklerdir. Birbirlerinin zay\u0131f ve g\xfc\xe7l\xfc yanlar\u0131n\u0131 bildiklerinden aralar\u0131nda \xe7at\u0131\u015fma \xe7\u0131kma olas\u0131l\u0131\u011f\u0131 zay\u0131f olacakt\u0131r. \xc7ocuklara olan d\xfc\u015fk\xfcnl\xfckleri onlar\u0131 birbirine ba\u011flayacak, uzun s\xfcreli uyumlu bir ili\u015fki ya\u015fayacaklard\u0131r.","Ba\u015fak erke\u011fi titiz, tutumlu, d\xfczenlidir. Abart\u0131l\u0131 titizli\u011fi sizi zaman zaman \xe7ileden \xe7\u0131karabilir. O ise Terazi kad\u0131n\u0131n gizemli yap\u0131s\u0131ndan etkilenecektir. Terazi ve Ba\u015fak ikilisinin ili\u015fkisi kolay olmayacakt\u0131r ama \xe7ok keyifli olabilir. Farkl\u0131l\u0131klar\u0131n\u0131z\u0131 kabul eder, birbirinizi delicesine ele\u015ftirmez ve sayg\u0131 s\u0131n\u0131rlar\u0131n\u0131 a\u015fmazsan\u0131z, birlikte \xe7ok e\u011flenebilir ve birbirinizden \xe7ok \u015fey \xf6\u011frenebilirsiniz.","Ba\u015fak burcu ki\u015filik \xf6zellikleriyle, Terazi'yi fazlas\u0131yla etkisi alt\u0131na al\u0131r. Terazi de renkli ki\u015fili\u011fi ve samimi tav\u0131rlar\u0131yla Ba\u015fak i\xe7in e\u011flenceli bir partnerdir. Terazi ince ruhlu ve anlay\u0131\u015fl\u0131d\u0131r. \u0130yi bir sevgilinin yan\u0131 s\u0131ra iyi bir dinleyici ve iyi bir dost olur. Fakat duygular\u0131n\u0131 kolay kolay belli etmez. Dolay\u0131s\u0131yla Ba\u015fak, Terazi'nin bu gizemli y\xf6n\xfcnden etkilenir. Ba\u015fak'\u0131n, Terazi'yi elinde tutabilmesi i\xe7in duygu ve d\xfc\u015f\xfcncelerini yumu\u015fak bir dille ifade etmesi gerekmektedir. Uzun vadede e\u011flenceli ve uyumlu bir ili\u015fkileri olabilir.","Ba\u015fak burcu ve Akrep burcunun birlikteli\u011fi \xe7ok gizemli olabilir. Ba\u015fak burcu Akrep burcunu \xe7\xf6zd\xfc\u011f\xfcn\xfc san\u0131r. Ancak onu en \xe7ok \xe7\xf6zd\xfc\u011f\xfcn\xfc sand\u0131\u011f\u0131 anda akrep burcu onu \u015fa\u015f\u0131rtacakt\u0131r. Akrep h\xfckmetmeyi sever. Fakat Ba\u015fak e\u015fitlik\xe7i bir yap\u0131ya sahip oldu\u011fu i\xe7in bu durumu kolay kolay kabullenemeyecektir. Anla\u015fmazl\u0131klar ya\u015fanmas\u0131 muhtemeldir. Seks\xfcel a\xe7\u0131dan Akrep fazlas\u0131yla arzulu ve tutkuludur. Fakat Ba\u015fak i\xe7in \xf6ncelik romantizmdir. Aralar\u0131nda ger\xe7ek bir sevgi varsa uzun s\xfcreli bir ili\u015fki olabilir.","Ba\u015fak burcu ve Akrep burcu ili\u015fkisinde Ba\u015fak burcunun Akrep burcundan \xf6\u011frenece\u011fi \xe7ok \u015fey vard\u0131r. Akrep tutkulu, ak\u0131ll\u0131, duygusal ve a\xe7\u0131k s\xf6zl\xfcd\xfcr. Kendine olduk\xe7a g\xfcvenir. Etkileyici bir d\u0131\u015f g\xf6r\xfcn\xfcm\xfc vard\u0131r. E\u011fer severse tutkulu bir a\u015f\u0131k olacakt\u0131r. Ba\u015fak, Akrep'in cazibesinden fazlas\u0131yla etkilenecektir. Bu ikilinin birliktelikleri hem duygusal, hem tutkulu hem de \u015fehvetli olacakt\u0131r. Akrep burcu, Ba\u015fak burcuna hayal edemeyece\u011fi duygular\u0131 ya\u015fatacakt\u0131r. Bu da Ba\u015fak burcunun Akrep burcuna olan ba\u011fl\u0131l\u0131\u011f\u0131n\u0131 artt\u0131racakt\u0131r. Ba\u015fak burcu ili\u015fkide g\xfcven arar, arad\u0131\u011f\u0131 g\xfcven ve sadakati ona akrep burcu verecektir.","Bu iki tip birbirini adeta tamamlar ve \xe7ok iyi anla\u015f\u0131r. \xd6ncelikle \xe7ok iyi iki dost ve ard\u0131ndan da iyi iki sevgili olacaklard\u0131r. G\xfcven ve sadakate ihtiya\xe7 duyan Ba\u015fak'\u0131, Yay bir nebze de olsa korkutabilir. Fakat ki\u015fisel \xf6zg\xfcrl\xfcklere fazla m\xfcdahale edilmezse Yay bunun kar\u015f\u0131l\u0131\u011f\u0131n\u0131 ili\u015fkiye sahip \xe7\u0131karak verecektir. Seks\xfcel a\xe7\u0131dan her iki taraf da romantik ve arzuludur. Ba\u015fak burcu ve yay burcu ili\u015fkisinde her iki taraf da ba\u011f\u0131ms\u0131z oldu\u011fundan birini bile uzun bir ili\u015fkide tutmak olduk\xe7a zor olacakt\u0131r.","Ba\u015fak erke\u011fi, g\xfcvenilir, detayc\u0131, ak\u0131ll\u0131 ve sevecendir. Birini sevdi\u011fi zaman g\xfcvenilir ve sad\u0131k bir a\u015f\u0131k olur. Yay kad\u0131n\u0131 ise g\xfcvenilir, ne\u015feli, zeki ve d\u0131\u015fa d\xf6n\xfckt\xfcr. Bu iki bur\xe7 \xf6nce \xe7ok iyi iki dost, ard\u0131ndan da iyi iki sevgili olacakt\u0131r. Cinsel y\xf6nden de frekanslar\u0131 uyu\u015fur. \u0130ki taraf da romantik ve arzulu oldu\u011fu i\xe7in birlikte uzun vadede e\u011flenceli ve uyumlu bir a\u015fk ya\u015fayabilirler.","O\u011flak ve Ba\u015fak aras\u0131nda uyumlu bir ili\u015fki ya\u015fanabilir. Ba\u015fak erke\u011fi iyi niyetli, g\xfcvenilir ve detayc\u0131d\u0131r. O, sizi me\u015fgul edecek heyecanl\u0131 erkeklerden de\u011fildir, tersine yan\u0131nda kendinizi rahat ve mutlu hissetmenizi sa\u011flayacakt\u0131r. Bu iki burcun hayattan beklentileri benzer oldu\u011fu i\xe7in kolay anla\u015f\u0131rlar. Hem Ba\u015fak hem de O\u011flak \xe7ekingen insanlar olduklar\u0131 i\xe7in birbirlerine yakla\u015fmalar\u0131 zaman alsa da birbirlerini bulduklar\u0131nda uzun vadede evlili\u011fe do\u011fru gidecek bir ili\u015fkiye do\u011fru yol alabilirler.","Ba\u015fak burcu ve O\u011flak burcu \xe7ifti uyumlu bir \xe7ift olacakt\u0131r. \xd6zellikle Ba\u015fak burcu i\xe7in O\u011flak burcu ideal bir e\u015ftir. Her iki burcun da toprak grubunda olmas\u0131 benzer \xf6zellikler ta\u015f\u0131d\u0131klar\u0131n\u0131 ve birbirlerini anlayacaklar\u0131n\u0131 g\xf6sterir. O\u011flak erke\u011finin ger\xe7ekten sevince yapmayaca\u011f\u0131 fedakarl\u0131k yoktur. Her konuda sevdi\u011fi ki\u015fiye destek olur. Ba\u015fak burcu e\u011fer ba\u015farabilirse o\u011flak burcunun kalbinde taht kuracakt\u0131r. Sevdi\u011fine tamamen ba\u011fl\u0131 olan O\u011flak burcu, Ba\u015fak burcuna a\u015fk\u0131n farkl\u0131 taraflar\u0131n\u0131 \xf6\u011fretecek ve ya\u015fatacakt\u0131r..","Ba\u015fak burcu ve Kova burcu birbirinden tamamen farkl\u0131 karakterler olmakla beraber, bu ikilinin birliktelikleri kendisinden tamamen farkl\u0131 biriyle olma iste\u011finden do\u011facakt\u0131r. Kova duygusal ve bir o kadar da de\u011fi\u015fken bir ki\u015fili\u011fe sahiptir. S\xfcrekli bir de\u011fi\u015fim halindedir. S\xfcrekli de\u011fi\u015fik ortamlarda, de\u011fi\u015fik ki\u015filerle olmaktan keyif al\u0131r. Her iki tipin de ili\u015fkiden ve hayattan beklentileri farkl\u0131d\u0131r. Kova, Ba\u015fak burcuna g\xfcven vermez. Seks\xfcel a\xe7\u0131dan da beklentileri pek birbirlerine uymaz. Uzun vadede uyumlu bir ili\u015fki yakalamalar\u0131 zordur.","Kova burcunu anlamak di\u011fer bur\xe7larda da oldu\u011fu gibi ba\u015fak burcu i\xe7in de olduk\xe7a zor olacakt\u0131r. Ba\u015fak burcu kova burcunu \xf6zg\xfcr b\u0131rakt\u0131\u011f\u0131 s\xfcrece onu daha yak\u0131ndan tan\u0131r, ona g\xf6re davran\u0131r ise kova da bu \xf6l\xe7\xfcde ona yak\u0131nla\u015facakt\u0131r. \xd6zg\xfcrl\xfc\u011f\xfcn\xfc hissetmek Kova burcu i\xe7in \xe7ok \xf6nemlidir. Kar\u015f\u0131s\u0131nda kendisi gibi hareketli, detayc\u0131 ama bir o kadar da anlay\u0131\u015fl\u0131 bir Ba\u015fak burcu g\xf6rd\xfc\u011f\xfc takdirde sizi el \xfcst\xfcnde tutacakt\u0131r. Bu \u015fartlar sa\u011fland\u0131\u011f\u0131 takdirde Kova burcunun Ba\u015fak burcu ile ho\u015f bir ili\u015fkiye ba\u015flamamas\u0131 i\xe7in bir sebep yoktur.","Ba\u015fak burcu Bal\u0131k burcunun ihtiyac\u0131 olan \u015feyleri belirler bu ihtiya\xe7lar\u0131 gidermek i\xe7in canla ba\u015fla \xe7al\u0131\u015f\u0131r. Ba\u015fak, Bal\u0131k'\u0131n hayal d\xfcnyas\u0131n\u0131n geni\u015fli\u011fine hayranl\u0131k duyar ve onun yan\u0131nda olmaktan mutluluk duyar. Ba\u015fak burcu idealist bir bur\xe7tur. Kimsenin g\xf6rmedi\u011fini g\xf6r\xfcr. \u0130nce ayr\u0131nt\u0131lara \xf6nem verir. Ele\u015ftirici bir kimli\u011fi vard\u0131r. Bal\u0131k ise bakt\u0131\u011f\u0131 her \u015feye g\xfczel g\xf6zle bakt\u0131\u011f\u0131 i\xe7in g\xfczellik g\xf6r\xfcr. Ba\u015fak burcunun ele\u015ftirilerinden incinebilir. Bu anlamda Ba\u015fak burcu daha dikkatli konu\u015fmaya dikkat etmelidir.","Ba\u015fak burcu ile Bal\u0131k burcu beraberli\u011fi olduk\xe7a romantik bir beraberlik olacakt\u0131r. Bu iki bur\xe7 kar\u015f\u0131l\u0131kl\u0131 olarak birbirlerinin ihtiya\xe7 duyduklar\u0131 \xf6zelliklere sahiptirler. Bal\u0131k burcu Ba\u015fak burcuna ihtiya\xe7 duyar. Sezgileri olduk\xe7a geli\u015fmi\u015f Bal\u0131k burcu, Ba\u015fak burcunun i\xe7inden gelenleri bilecektir ve ona g\xf6re hareket edecektir. Bal\u0131k burcunun anlay\u0131\u015fl\u0131 ruhu, Ba\u015fak burcunu kendisine hayran b\u0131rakacakt\u0131r. Toprak grubundaki Ba\u015fak ile su grubundaki Bal\u0131k anla\u015fmakta zorlanmad\u0131klar\u0131ndan ili\u015fkileri de olduk\xe7a uyumlu olacakt\u0131r.","Terazi kad\u0131n\u0131 ve erke\u011finin bir\xe7ok ortak y\xf6n\xfc vard\u0131r. \u0130kisi de yeni yerler ke\u015ffedip yeni ki\u015filerle tan\u0131\u015fmay\u0131 seven d\u0131\u015fa d\xf6n\xfck ve hareketli ki\u015filerdir. Ayr\u0131ca sevecen, samimi, sad\u0131k ve duygusal olurlar. Birbirine benzer bu iki ki\u015finin a\u015fka bak\u0131\u015f a\xe7\u0131s\u0131 da ayn\u0131d\u0131r. Ancak bir s\xfcre sonra bu benzerlikler ili\u015fkinin monotonla\u015f\u0131p heyecan\u0131n\u0131 yitirmesine sebep olabilir.","Terazi kad\u0131n\u0131 Akrep erke\u011fini ya \xe7ok sever ya da ondan nefret eder. Sahiplenici ve k\u0131s\u0131tlayac\u0131 tav\u0131rlar\u0131 olan Akrep erke\u011fi \xe7ok \u015f\xfcphecidir ve bu durum Terazi kad\u0131n\u0131yla olan ili\u015fkisini olumsuz etkiler. Terazi kad\u0131n\u0131 s\xfcrekli kontrol alt\u0131nda tutulmak istemez. \u0130ki taraf da cinsel a\xe7\u0131dan olduk\xe7a arzulu ve tutkuludur. Terazi Akrep'in kendisine h\xfckmetmesinden rahats\u0131z olmay\u0131p ipleri onun eline verirse ili\u015fki uyumlu bir \u015fekilde devam edebilir.","Bu iki tip do\u011fal cazibelerinden dolay\u0131 birbirini fazlas\u0131yla \xe7eker. Akrep kad\u0131n\u0131 tutkulu, duygusal, hareketli ve \xe7ekicidir. Terazi ise sevecen, d\u0131\u015fa d\xf6n\xfck, zarif ve duygusald\u0131r. Akrep sahiplenici ve k\u0131s\u0131tlay\u0131c\u0131d\u0131r. K\u0131skan\xe7l\u0131\u011f\u0131 ile Terazi'yi \xe7ileden \xe7\u0131karabilir. Terazi burcu yaln\u0131z b\u0131rak\u0131lmaya gelmez. Teselliyi ba\u015fka kollarda arayacakt\u0131r. Bu da sevgilisine ders vermek isteyen akrep burcunun pek de ho\u015funa gitmeyecektir. Bu nedenle Akrep burcu e\u011fer bir Terazi burcuyla birlikte olmak istiyorsa hayat tarz\u0131n\u0131 biraz de\u011fi\u015ftirmesi gerekebilir. Yine de birbirlerini seviyorlarsa her \u015fey m\xfcmk\xfcn.","Terazi kad\u0131n\u0131 olduk\xe7a duygusal ve romantiktir. Kar\u015f\u0131 cinse nas\u0131l hitap etmesi gerekti\u011fini iyi bilir. Yay erke\u011fi ise g\xfcvenilir, d\u0131\u015fa d\xf6n\xfck ve ne\u015felidir. \u0130ki burcun ili\u015fkisi gayet uyumlu olabilir. Ancak Yay erke\u011finin ba\u011flanmaktan ka\xe7an yap\u0131s\u0131, ili\u015fkide uzun vadede sorunlar \xe7\u0131kmas\u0131na neden olabilir. Seks\xfcel a\xe7\u0131dan iki taraf da romantiktir ve uyumlu bir ili\u015fkileri olur.","Bir Terazi erke\u011fine a\u015f\u0131k olduysan\u0131z, kendinize \xe7ok uygun birini buldunuz demektir. Terazi erkekleri zarif, sevecen, duygusal ve romantiktir. A\u015fkta uyumlu ve sad\u0131k bir partner olurlar. Yay kad\u0131n\u0131 ise g\xfcvenilir, ne\u015feli ve d\u0131\u015fa d\xf6n\xfckt\xfcr. Bu iki tip birbirlerinden fazlas\u0131yla etkilenir. E\u011fer birbirlerinin ki\u015filik \xf6zelliklerine anlay\u0131\u015f g\xf6sterirlerse birlikte uyumlu ve e\u011flenceli bir a\u015fk ya\u015fayabilirler.","O\u011flak erke\u011fi duygusal, d\xfc\u015f\xfcnceli ve sab\u0131rld\u0131r. A\u015f\u0131k oldu\u011funda g\xf6z\xfc hi\xe7bir \u015fey g\xf6rmez ve sevdi\u011fi ki\u015fiyi fazlas\u0131yla sahiplenir. O, duygular\u0131n\u0131 dile getiren ve hislerinden bahseden biri de\u011fildir. \xc7\xfcnk\xfc bunu bir zay\u0131fl\u0131k g\xf6stergesi olarak kabul eder. T\xfcm bu \xf6zellikleriyle O\u011flak erkekleri Terazi kad\u0131nlar\u0131na pek uygun de\u011fildir. Ancak seks\xfcel anlamda birbirlerinin beklentilerini m\xfckemmel \u015fekilde tamamlarlar.","Bu iki burcun pek uyumlu bir ili\u015fkisi olmaz. Terazi erke\u011finin karars\u0131zl\u0131\u011f\u0131 O\u011flak kad\u0131n\u0131n\u0131 yorabilir. D\xfczeni seven O\u011flak ise Terazi'nin hareketli ve de\u011fi\u015fimden ho\u015flanan yap\u0131s\u0131n\u0131 yad\u0131rgayacakt\u0131r. Yine de t\xfcm olumsuzluklara ra\u011fmen birbirlerine sonsuz g\xfcven verebilirler. Benzer faaliyetlerden ho\u015flanmalar\u0131 da onlar\u0131 birbirlerine yakla\u015ft\u0131r\u0131r. Biraz \xe7aba ile uyumlu bir birliktelik ya\u015fayabilirler.","Terazi ile Kova birlikteli\u011fi her zaman uyum i\xe7erisinde olur. Terazi erke\u011fi yan\u0131nda g\xfcvende ve huzurla kalabilece\u011finiz bir tiptir. Kova kad\u0131n\u0131n\u0131n biraz \xe7aba g\xf6stermesi gerekebilir. Terazi her zaman s\xfcrprizlerden ho\u015flan\u0131r. Bu y\xfczden iki burcun ili\u015fkisinin s\u0131k\u0131c\u0131 ve dura\u011fan olmas\u0131 pek m\xfcmk\xfcn de\u011fildir. Ayr\u0131ca ikisinin de k\u0131skan\xe7 olmamas\u0131 \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcn bu iki bur\xe7 i\xe7in de \u015fanst\u0131r. Ak\u0131ll\u0131 bir Kova kad\u0131n\u0131 Terazi erke\u011fini \xf6zg\xfcr b\u0131rakarak, s\u0131kmayacakt\u0131r. \u0130ki bur\xe7 birbirine g\xfcven duyuyorsa, uyumlu bir birliktelikleri olur.","Terazi kad\u0131n\u0131 ve Kova erke\u011fi aras\u0131nda uyumlu bir ili\u015fki olabilir. \u0130kiniz de ileti\u015fimci oldu\u011funuz i\xe7in uzun sohbetleriniz, canl\u0131 tart\u0131\u015fmalar\u0131n\u0131z olacakt\u0131r ve yeni fikirler ortaya \xe7\u0131kacakt\u0131r. Ancak Kova burcu erke\u011fi, \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcn, yak\u0131n ili\u015fkilerden ka\xe7an bir ki\u015fidir. Siz ili\u015fkinizin ciddile\u015fmesini beklerken Kova'n\u0131n bu konudaki uzakl\u0131\u011f\u0131 sizi \xe7\u0131ld\u0131rtabilir. Seks\xfcel y\xf6nden iki taraf da aktiftir. \u0130stek ve arzular\u0131n\u0131 kolayca birbirlerine ifade edebilirler.","Terazi kad\u0131n\u0131 ve Bal\u0131k erke\u011finin ili\u015fkisi pek de uyumlu olmaz. Bal\u0131k'\u0131n duygusall\u0131\u011f\u0131 ve hayal aleminde ya\u015fayan biri olmas\u0131 Terazi i\xe7in pek cazip de\u011fildir. Terazi kad\u0131n\u0131 daha cesur ve ayaklar\u0131 yere sa\u011flam basan erkeklerle daha sa\u011flam bir ili\u015fki kurabilir. Seks\xfcel y\xf6nden de Terazi'nin beklentileri kar\u015f\u0131s\u0131nda Bal\u0131k'\u0131n duygusall\u0131\u011f\u0131 \xf6n plana \xe7\u0131kar. Bu y\xfczden bu iki bur\xe7 aras\u0131nda sorunsuz bir ili\u015fki g\xf6rmek pek m\xfcmk\xfcn de\u011fildir.","Bal\u0131k ile Terazi zarif, kibar ve ince yap\u0131l\u0131 iki bur\xe7tur. Bal\u0131k su elementinin Terazi ise hava elementinin etkisi alt\u0131ndad\u0131r. Hava ve su uyumu g\xf6z \xf6n\xfcnde al\u0131nd\u0131\u011f\u0131nda uyumlu bir \xe7ifttir. Terazi burcu k\xfclt\xfcrel olaylar\u0131 yak\u0131ndan takip eder. Yeni a\xe7\u0131lan t\xfcm mekanlar\u0131 takip eder. Bu anlamda Bal\u0131k burcunu \xe7ok renkli ve heyecan dolu bir hayat bekliyor. Bal\u0131k burcu maneviyata daha \xe7ok \xf6nem verdi\u011fi i\xe7in sosyal rekabetlerin i\xe7erisine girmez. Bal\u0131k ile Terazi ya\u015fant\u0131 olarak farkl\u0131 kutuplarda olsalar da d\xfc\u015f\xfcnce ve hassasl\u0131k konusunda \xe7ok iyi anla\u015fan iki bur\xe7tur.","Akrep'ler aras\u0131nda uyumlu bir ili\u015fki olabilir. Bu iki tip aras\u0131nda bir\xe7ok ortak \xf6zellik oldu\u011fu gibi bir \xe7ok z\u0131tl\u0131k da olabilir. Fakat birbirlerini \xe7ok iyi anlarlar. Her ikisi de tutkulu, duygusal, hareketli ve \xe7ekicidir. Hayat\u0131 dolu dolu ya\u015famaktan keyif al\u0131rlar. K\u0131skan\xe7l\u0131k ve sadakat bu ili\u015fkinin temellerini olu\u015fturur. Akrep burcu kar\u015f\u0131s\u0131ndakinin sezgilerini ve i\xe7g\xfcd\xfclerini iyi bilir. Bu da kar\u015f\u0131s\u0131ndaki Akrep burcunu anlamas\u0131n\u0131 sa\u011flar. Bu ili\u015fkide taraflar konu\u015fmadan sadece g\xf6zleriyle dahi anla\u015fabilir. Akrep burcu sevdi\u011fine tam olarak ba\u011fl\u0131 oldu\u011fundan uzun \xf6m\xfcrl\xfc bir ili\u015fki bu \xe7iftin kaderi olacakt\u0131r.","Akrep burcu bir bak\u0131\u015fta kar\u015f\u0131s\u0131ndakinin g\xf6zlerini okuyabilen, pratik zekal\u0131 ve kurnazd\u0131r. Yay burcu ise iyimser ve ba\u015fkalar\u0131n\u0131n kolayca etkisinde kalabilen bir bur\xe7tur. Yay burcu seyahat etmekten \xe7ok ho\u015flan\u0131r, buna kar\u015f\u0131l\u0131k akrep burcu da evde oturmaktan b\xfcy\xfck keyif al\u0131r. Yay burcu ac\u0131mas\u0131zca d\xfcr\xfcstt\xfcr, akrep burcu ise su grubunda oldu\u011fundan duygusald\u0131r. Yay burcu kar\u015f\u0131s\u0131ndaki Akrep burcundan, s\xf6zlerini sak\u0131nmayacakt\u0131r. Onun bu yorumlar\u0131 da kimi zaman Akrep burcunu y\u0131pratacakt\u0131r. Z\u0131t kutuplar\u0131n birbirini \xe7ekmemesi halinde birlikteli\u011fi pek m\xfcmk\xfcn de\u011fildir.","Akrep erke\u011fi gizemli havas\u0131 ve seksili\u011fi ile sizi kendine \xe7ekecektir. Ancak onunla ciddi bir ili\u015fkiye girmeden \xf6nce iki kez d\xfc\u015f\xfcn\xfcn. \xc7\xfcnk\xfc seks hayat\u0131n\u0131z yolunda gitse de ileti\u015fim anlam\u0131nda ciddi problemler ya\u015fayabilirsiniz. Akrep insan\u0131 sahiplenen, k\u0131skan\xe7 ve hatta tak\u0131nt\u0131l\u0131 bir yap\u0131dad\u0131r. Siz ise \xf6zg\xfcrl\xfc\u011f\xfcn\xfcze a\u015f\u0131r\u0131 d\xfc\u015fk\xfcn oldu\u011funuzdan aran\u0131zda s\u0131k s\u0131k tart\u0131\u015fma ya\u015fanabilir.","O\u011flak disiplinli ve d\xfczenlidir. Bu durumda Akrep ile sorunsuz bir ili\u015fkileri olacakt\u0131r. L\xfcks\xfc ve iyi bir i\u015fi seven O\u011flak burcu, Akrep burcu ile \xe7ok iyi anla\u015facakt\u0131r. Her iki tip de sad\u0131kt\u0131r. Her iki taraf da arzulu ve tutkuludur, fakat Akrep burcu \xf6zelikle O\u011flak burcunun bu taraf\u0131n\u0131 ortaya \xe7\u0131karmas\u0131 ve onu desteklemesi gerekir. Uzun vadede uyumlu ve g\xfczel bir ili\u015fki yakalamalar\u0131 m\xfcmk\xfcnd\xfcr. Akrep burcu ile O\u011flak burcu tensel a\xe7\u0131dan da olduk\xe7a uyumludur. Bak\u0131m\u0131na d\xfc\u015fk\xfcn olan her iki taraf da birbiriyle bir uyum i\xe7erisinde olacakt\u0131r.","Bir Akrep erke\u011finin yan\u0131na yakla\u015fmak O\u011flak kad\u0131n\u0131 i\xe7in olduk\xe7a tehlikelidir. Akrep burcunda do\u011fan bu adama cinsel organlar\u0131 h\xfckmeder. \u0130htirasl\u0131, heyecanl\u0131 ve hesaplanamazd\u0131r. Onunla ya\u015fayabilece\u011finiz bir a\u015fk tecr\xfcbesi, sizi ihtiras\u0131n doruklar\u0131na \xe7\u0131karacakt\u0131r. Ancak duygusal olarak y\u0131pranabilirsiniz. \u0130li\u015fkinizde her \u015feyden \xe7ok fiziki \xe7ekimin hakimin olmas\u0131na raz\u0131ysan\u0131z, \xe7ok mutlu olabilirsiniz.","Akrep burcunun temsil etti\u011fi dominant karakter, Kova burcunda fazlas\u0131yla bulundu\u011fundan bu ili\u015fki zorlu bir ili\u015fki olacakt\u0131r. Olduk\xe7a k\u0131skan\xe7 ve talepkar bir bur\xe7 olan Akrep burcu, \xf6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcn Kova burcu ile pek uyumlu g\xf6r\xfcnmemektedir. Bu beraberlik a\u015fk hayat\u0131nda i\u015f hayat\u0131nda g\xf6re daha olumlu sonu\xe7lar getirebilir. Arkada\u015fl\u0131k ise ancak ortak ilgi ve bilgi d\xfczeyin ba\u011fl\u0131 olacakt\u0131r. Kova'n\u0131n sosyal bir bur\xe7 olmas\u0131 Akrep burcunu rahats\u0131z etse de Kova burcuna do\u011fru \xe7ekilmesine neden olacakt\u0131r.","Akrep burcu duygusald\u0131r ve sezgileriyle hareket eder. Buna kar\u015f\u0131l\u0131k Kova duygusal de\u011fildir fazla ba\u011flanmay\u0131 sevmez. Akrep burcu ise derin duygular ya\u015famay\u0131, tutkuyu ve ilgilenilmeyi \xe7ok sever. Bu ili\u015fkide taraflar\u0131 birbirinden ay\u0131ran en \xf6nemli nokta buras\u0131 olacakt\u0131r. Akrep burcunun duygusall\u0131\u011f\u0131 daha a\u011f\u0131r basar. Kova mant\u0131kl\u0131d\u0131r. Duygular\u0131n\u0131 fazla belli etmez. Dolay\u0131s\u0131yla Akrep duygusal tatminsizlik ya\u015fayabilir. Bu iki tipin uzun vadede uyumlu bir ili\u015fki yakalamas\u0131 zordur.","Her ikisi de su grubuna giren bu beraberlik olduk\xe7a g\xfczel bir beraberlik olacakt\u0131r. \u0130ki taraf\u0131nda ruh e\u015fini bulmu\u015f olmas\u0131 kuvvetle muhtemeldir. Akrep burcu bir\xe7ok bur\xe7 aras\u0131nda Bal\u0131k burcuna kendini \xe7ok yak\u0131n hissedecektir. Sezgileriyle hareket eden ve kar\u015f\u0131s\u0131ndakinin i\xe7ini g\xf6zlerinden okuyan Akrep burcu, Bal\u0131k burcunun saf ve temiz i\xe7 d\xfcnyas\u0131yla kar\u015f\u0131la\u015f\u0131nca \xe7ok mutlu olacakt\u0131r. K\u0131skan\xe7 Akrep burcunu, Bal\u0131k burcu sab\u0131rla kendisine g\xfcvendirmek i\xe7in u\u011fra\u015facakt\u0131r. Seks\xfcel a\xe7\u0131dan duygusal, romantik ve arzuludurlar. Uzun vadede \xe7ok uyumlu ve mutlu bir ili\u015fkileri olacakt\u0131r.","Akrep burcunun sad\u0131k ve tedbirli olmas\u0131 Bal\u0131k burcunu cezp eder. Akrep erke\u011fi yo\u011fun duygulara sahiptir. Akrep erke\u011fi yaln\u0131z kald\u0131\u011f\u0131 zaman mutlaka onunla ileti\u015fime ge\xe7ilmelidir. Bal\u0131k hassas duygular\u0131 ve geli\u015fmi\u015f \xf6nsezileri ile nerede ne yapmas\u0131 gerekti\u011fini iyi bilir. Bal\u0131k kad\u0131n\u0131n\u0131n kendinden emin tav\u0131r sergilemesi Akrep erke\u011finin ho\u015funa gider. Onu bu m\xfccadelesinde sonuna kadar destekler. Bal\u0131k burcu ile Akrep burcu aras\u0131ndaki cinsel uyum da m\xfckemmeldir. Bal\u0131k insan\u0131 i\xe7in seks ger\xe7ek a\u015fk\u0131n en kutsal bi\xe7imde ifade edilmesidir. Bal\u0131k burcunun bu g\xf6r\xfc\u015f\xfc Akrep'in olduk\xe7a ho\u015funa gider.","Yay'lar aras\u0131nda pek uyumlu bir ili\u015fki s\xf6z konusu olmaz. Bu iki insan\u0131n benzer \xf6zellikleri \xe7ok fazla olsa da iki taraf da ha\u015far\u0131 birer \xe7ocuk mizac\u0131ndad\u0131r. Sosyal ya\u015famdan ve arkada\u015flar\u0131yla vakit ge\xe7irmekten \xe7ok ho\u015fland\u0131klar\u0131 i\xe7in ili\u015fkiye odaklanamazlar. Bu iki ki\u015fi, iyi bir \xe7iftten \xe7ok iyi birer dost olabilir. \u015eiddetli ba\u015flayan bir a\u015fk, hareketli g\xfcnlerle devam edip k\u0131sa s\xfcre i\xe7inde sona erebilir.","Yay kad\u0131n\u0131 ve O\u011flak erke\u011fi aras\u0131nda pek uyumlu bir ili\u015fki olmaz. O\u011flak'\u0131n i\xe7 disiplini ve kurallar\u0131 aras\u0131nda kendini ku\u015fat\u0131lm\u0131\u015f hisseden Yay, her an bu ili\u015fkiden ka\xe7maya haz\u0131rd\u0131r. O\u011flak erke\u011finin t\xfckenmek bilmeyen mant\u0131\u011f\u0131ndan s\u0131k\u0131lan Yay, kaprisli bir ki\u015fiye d\xf6n\xfc\u015febilir. Ancak birbirlerini mutlu etmek i\xe7in ellerinden geleni yapar ve ayn\u0131 y\xf6nde hareket etmeyi ba\u015far\u0131rlarsa \xf6m\xfcr boyu mutlu olabilirler.",u.B,"Yay burcu her konuda bilgisi olan, donan\u0131ml\u0131, k\xfclt\xfcrel y\xf6nden di\u011fer insanlardan \xfcst\xfcn olan bir bur\xe7tur. Bu \xf6zelli\u011finin verdi\u011fi tutum ile \xe7evrede anla\u015f\u0131lamayan bir karakter olarak g\xf6r\xfcl\xfcr. Bu durum Kova burcunun dikkatini \xe7eker. Kova burcu kad\u0131n\u0131 Yay erke\u011finden \xf6\u011frenilecek \xe7ok \u015fey oldu\u011funu d\xfc\u015f\xfcn\xfcr ve onu tan\u0131mak ister. Bu iki tip birbirlerinden ki\u015filik \xf6zellikleri nedeniyle \xe7ok etkilenir ve \xe7ok iyi dost olurlar. Bu dostluk k\u0131sa s\xfcrede bir a\u015fka d\xf6n\xfc\u015febilir. Seks\xfcel a\xe7\u0131dan birbirlerine uyum g\xf6sterirler. Uzun vadede e\u011flenceli ve m\xfckemmel bir ili\u015fkileri olacakt\u0131r.","Yay kad\u0131n\u0131 g\xfcvenilir, ne\u015feli, zeki ve d\u0131\u015fa d\xf6n\xfckt\xfcr. Ba\u011flanmaktan korkar. Gezmek, e\u011flenmek ve hayattan zevk almak ister. Kova erke\u011fi ise duygusal ama bir o kadar da de\u011fi\u015fken bir ki\u015fili\u011fe sahiptir. Birbirlerinin ki\u015filik \xf6zelliklerinden etkilenen bu iki burcun insan\u0131 seks\xfcel a\xe7\u0131dan da birbirine uyum g\xf6sterir. Dolay\u0131s\u0131yla uzun vadeli ve m\xfckemmel bir ili\u015fkileri olacakt\u0131r.","Yay burcu a\xe7\u0131k s\xf6zl\xfc, Bal\u0131k burcu k\u0131r\u0131lgan oldu\u011fu i\xe7in bu iki burcun uyumu \xe7ok zordur. Yay kimi zaman patavats\u0131z oldu\u011fu ve a\u011fz\u0131ndan \xe7\u0131kan\u0131 kula\u011f\u0131 duymad\u0131\u011f\u0131 i\xe7in s\u0131k s\u0131k Bal\u0131k burcunu k\u0131rabilir. Di\u011fer yandan Bal\u0131k burcunun hayata bak\u0131\u015f \u015fekli Yay'\u0131 e\u011flendirebilir. Fakat tav\u0131rlar\u0131 uzun vadede Yay burcunu \xe7ileden \xe7\u0131karacakt\u0131r. Bu iki tip aras\u0131nda seks\xfcel a\xe7\u0131dan \xe7ok da uyumlu bir ili\u015fki olmaz. Bal\u0131k burcunun duygusal y\xf6n\xfc a\u011f\u0131r basaca\u011f\u0131ndan Yay kadar aktif olmayacakt\u0131r. Ancak Yay, Bal\u0131k burcunun i\xe7 d\xfcnyas\u0131na girer ve onu anlamak i\xe7in \xe7aba sarf ederse ili\u015fkileri devam edebilir.","\xd6zg\xfcrl\xfck savunucusu Yay kad\u0131n\u0131 ve duygusal Bal\u0131k erke\u011fi aras\u0131nda pek uyumlu bir ili\u015fki olmaz. Bu ili\u015fki s\xfcrekli kendi dikenlerine tak\u0131laca\u011f\u0131 i\xe7in zamanla k\u0131s\u0131r d\xf6ng\xfcye girecektir. Yay, bir Bal\u0131k'\u0131n gereksiz al\u0131ngan ve duygusal davran\u0131\u015flar\u0131na al\u0131\u015famaz. \xdcstelik onun kadar i\xe7sel d\xfc\u015fleri olan biri de\u011fildir. Bal\u0131k ne kadar kendine d\xf6n\xfckse, Yay da o kadar \xe7evresiyle bar\u0131\u015f\u0131kt\u0131r. Her \u015feyiyle zor bir ili\u015fkidir ve devam edebilmesi i\xe7in fazlas\u0131yla \xe7aba gerekir.",u.B,"O\u011flak kad\u0131n\u0131 ve Kova erke\u011fi aras\u0131nda pek uyumlu bir ili\u015fki olmaz. O\u011flak kad\u0131n\u0131 duygusal ve sab\u0131rl\u0131d\u0131r. Sevdi\u011fi ki\u015fiye her konuda destek olur. Kova erke\u011fi isi de\u011fi\u015fken bir ki\u015fili\u011fe sahiptir. S\xfcrekli farkl\u0131 ortamlara girmekten ve yeni ki\u015filerle tan\u0131\u015fmaktan ho\u015flan\u0131r. Bu halleriyle O\u011flak kad\u0131n\u0131na g\xfcven vermesi zaman al\u0131r. \u0130ki bur\xe7 seks\xfcel a\xe7\u0131dan da birbirine uymaz.","O\u011flak burcunun arad\u0131\u011f\u0131 ba\u011fl\u0131l\u0131\u011f\u0131 vermesi olduk\xe7a g\xfc\xe7 olan Kova burcu di\u011fer bur\xe7lara nazaran \xf6zg\xfcrl\xfc\u011f\xfcne olduk\xe7a d\xfc\u015fk\xfcnd\xfcr. O\u011flak burcu ve Kova burcunun en b\xfcy\xfck ortak noktalar\u0131 ise her iki burcun da h\u0131rslar\u0131 ve inat\xe7\u0131l\u0131\u011f\u0131d\u0131r. \u0130stemedi\u011fi bir \u015feyi kimsenin yapt\u0131rmas\u0131 m\xfcmk\xfcn olmayan O\u011flak burcunu, kararl\u0131l\u0131\u011f\u0131 ile her \u015feyi ba\u015faracak Kova burcu dize getirecektir. Ancak yine de gelecekleri pek parlak de\u011fildir. Her iki tipin de ili\u015fkiden ve hayattan beklentileri farkl\u0131d\u0131r. Kova burcu, O\u011flak'a g\xfcven vermez. Seks\xfcel a\xe7\u0131dan da beklentileri pek birbirlerine uymaz.","O\u011flak ve Bal\u0131k a\u015fkta mutlu olabilir mi? Kesinlikle evet! O\u011flak kad\u0131n\u0131 duygusal, d\xfc\u015f\xfcnceli ve sevdi\u011fi ki\u015fiyi destekleyici bir yap\u0131dad\u0131r. Bu \xf6zellikleriyle Bal\u0131k erke\u011fini kolayca kendine a\u015f\u0131k edebilir. Bal\u0131k erke\u011fi de romantizmi ve duygusall\u0131\u011f\u0131yla O\u011flak'\u0131n ayaklar\u0131n\u0131 yerden kesebilir. \u0130kisinin aras\u0131ndaki ili\u015fki kusursuz olacakt\u0131r ve yatakta da ili\u015fkileri sorunsuz ilerleyecektir.","Bal\u0131k duygusal, d\xfc\u015f\xfcnceli ve sab\u0131rl\u0131d\u0131r. Bir kez sevdi mi yapamayaca\u011f\u0131 fedakarl\u0131k yoktur. Her konuda sevdi\u011fi ki\u015fiye destek olur. Yaln\u0131z utanga\xe7 bir mizac\u0131 oldu\u011fu i\xe7in kendini ifade etmekte zorluk \xe7ekebilir. Sevdi\u011fi ki\u015fiyi fazlas\u0131yla sahiplenir ve k\u0131skan\xe7t\u0131r. Tam bir g\xfcven insan\u0131d\u0131r. Fakat O\u011flak burcunu anlamak onun i\xe7in zor olabilir. \xc7\xfcnk\xfc O\u011flak duygular\u0131n\u0131 belli etmez ve incinmekten korkar. O\u011flak burcunun hedefleri b\xfcy\xfckt\xfcr. Bal\u0131k burcu bu hedeflerin sevgilerinin \xf6n\xfcne ge\xe7mesinden endi\u015fe duyar. O\u011flak burcunun maddeci yap\u0131s\u0131 duygusal Bal\u0131k burcunda korkular olu\u015fmas\u0131na neden olur.","\u0130ki taraf\u0131n da kova burcu olmas\u0131, \u015f\xfcphesiz ili\u015fkiyi muhte\u015fem k\u0131lacakt\u0131r. Zodyak'\u0131n en zeki burcu say\u0131lan Kova burcu, her iki taraf\u0131n birbirini her konuda anlayabilecek bir ikili ili\u015fkinin varl\u0131\u011f\u0131n\u0131 ortaya koyar. Ancak yine de ba\u011f\u0131ms\u0131zl\u0131klar\u0131na d\xfc\u015fk\xfcnl\xfckleri onlar\u0131n arad\u0131klar\u0131 g\xfcveni birbirlerinde bulamamalar\u0131na neden olabilir. Her ikisi de duygusal ve bir o kadar da de\u011fi\u015fken bir ki\u015fili\u011fe sahiptir. S\xfcrekli bir de\u011fi\u015fim halindedirler. Seks\xfcel a\xe7\u0131dan arzulu olmalar\u0131na ra\u011fmen birbirlerinden \xe7abuk s\u0131k\u0131lmalar\u0131 olas\u0131d\u0131r. Uyumlu ve dengeli bir ili\u015fki kurmak onlar\u0131 zorlayacakt\u0131r.","Kova burcu ilgisiz ve gizemli havas\u0131 ile Bal\u0131k burcunun can\u0131n\u0131 fena halde s\u0131kabilir. Kova erke\u011fi sabit fikirli, inat\xe7\u0131 bir ki\u015fili\u011fe sahiptir. Bal\u0131k burcunun ise de\u011fi\u015fken bir yap\u0131s\u0131 vard\u0131r. \u0130li\u015fkinin y\xfcr\xfcmesi i\xe7in Bal\u0131k burcunun bir\xe7ok taviz vermesi gerekir. Kova burcu sosyal olarak g\xfc\xe7l\xfc bir ki\u015fili\u011fe sahip gibi g\xf6r\xfcnse de tekilde asl\u0131nda zaaflar\u0131 oldu\u011funu g\xf6r\xfcrs\xfcn\xfcz. Bu da Bal\u0131k kad\u0131n\u0131n\u0131 olumsuz etkileyebilir. B\xfct\xfcn z\u0131tl\u0131klar\u0131 \xfczerinde bar\u0131nd\u0131ran Bal\u0131k burcu ile Kova burcunun anla\u015fmas\u0131 olduk\xe7a zordur.","Bal\u0131k burcunun romantik ve olduk\xe7a duygusal havas\u0131 ba\u015flarda Kova burcunun ilgisini \xe7ekecek fakat her zaman oldu\u011fu gibi \xe7abuk s\u0131k\u0131lacakt\u0131r. Bal\u0131k burcu ise Kova burcunun b\xfcy\xfcs\xfcne kap\u0131ld\u0131ktan sonra onun bu y\xfcz\xfcn\xfc g\xf6rd\xfc\u011f\xfcnde k\u0131r\u0131lacakt\u0131r. Uyumlu bir ili\u015fkiye ula\u015fmak i\xe7in iki taraf i\xe7in de fedakarl\u0131klar gerekecektir. E\u011fer bir Kova burcu, Bal\u0131k burcuna ba\u011flanm\u0131\u015fsa onu asla terk etmez, olduk\xe7a sad\u0131kt\u0131r; sevgisini daimi k\u0131lmaya \xe7al\u0131\u015f\u0131r. Bal\u0131k burcu da ili\u015fkisinde sad\u0131k ve ba\u011fl\u0131d\u0131r. Alttan al\u0131nan her sorun i\xe7in ili\u015fkinin vadesi uzun olma yolunda ilerleyecektir.","Bal\u0131k erke\u011fi ile Bal\u0131k kad\u0131n\u0131n\u0131n uyumu m\xfckemmeldir! \u0130ki bur\xe7 da maddiyata \xf6nem vermedi\u011fi i\xe7in en b\xfcy\xfck s\u0131k\u0131nt\u0131lar\u0131 maddiyattan yana olur. Bal\u0131k burcu yaln\u0131zl\u0131\u011f\u0131 sevdi\u011fi kadar birlikte hareket etmeyi de \xe7ok sever. Bu y\xfczden partilerde, a\xe7\u0131l\u0131\u015flarda, e\u011flencelerde bulunmak i\xe7in can atarlar. Bal\u0131k kad\u0131n\u0131 ile Bal\u0131k erke\u011finin cinsel uyumu da t\u0131pk\u0131 duygusal ili\u015fkileri gibi m\xfckemmeldir. \u0130\xe7g\xfcd\xfcleri kuvvetli olan Bal\u0131k kar\u015f\u0131s\u0131ndaki insan\u0131n ne istedi\u011fini bilir ve kar\u015f\u0131s\u0131ndakini mutlu etmek i\xe7in elinden gelen her \u015feyi yapar."]),t.s)
