B.Ln=A.b(s([" - Terazi burcu kad\u0131nlar\u0131n\u0131n \xe7o\u011fu, kar\u015f\u0131lar\u0131na en ufak bir fikir tart\u0131\u015fmas\u0131 olana\u011f\u0131 \xe7\u0131kt\u0131\u011f\u0131 zaman, keskin zekalar\u0131n\u0131 g\xf6stereceklerdir.\n\n - Teraziyle tart\u0131\u015fmaya girmek istemezseniz, o kendi kendiyle tart\u0131\u015facakt\u0131r. \n\n - Bir terazi k\u0131z\u0131 tek ba\u015f\u0131na kavgay\u0131 ba\u015flatabilir ve b\xfcy\xfck bir zevkle s\xfcrd\xfcrebilir ve yine kendisi sonu\xe7land\u0131rabilir. \n\n - Ona g\xf6re her \u015fey sonunda e\u015fitlenir. O daima hakl\u0131d\u0131r ve sonunda son kararlar\u0131 o verecektir.\n\n - Terazi kad\u0131n\u0131 adil de\u011filse, d\xfcnyada hi\xe7bir \u015fey e\u015fit de\u011fildir. \n\n - Onun \xe7ekicili\u011fi ve dayan\u0131lmaz tebess\xfcm\xfc di\u011fer kad\u0131nlardan \xe7ok farkl\u0131d\u0131r. \n\n - A\xe7\u0131k ve berrak bir mant\u0131kla sizi daima kendine inand\u0131racakt\u0131r. O bir Ven\xfcs k\u0131z\u0131d\u0131r. \n\n - Hayat\u0131 g\xfczel ve zevkli ya\u015famak, ve sat\u0131n alabilece\u011fi t\xfcm g\xfczel \u015feyleri ister.\n\n - Onlar\u0131n b\xfcy\xfck paralara ihtiya\xe7lar\u0131 vard\u0131r. L\xfcks\xfc, pahal\u0131 giysileri, parf\xfcmleri ve kendini g\xfczel hissettirecek e\u015fyalara sahip olmak isterler.\n\n - Bir terazi kad\u0131n\u0131 asla a\u015fks\u0131z ya\u015fayamaz. Gerek i\u015f hayat\u0131nda, gerek \xf6zel ya\u015fam\u0131nda daima romantik bir ili\u015fkiye ihtiya\xe7 duyar. \n\n - \xd6zellikle sevece\u011fi bir erke\u011fin \xf6zlemini \xe7eker. Terazi kad\u0131n\u0131n hakk\u0131n\u0131 vermek zorundas\u0131n\u0131z.\n\n - O Zodyak\u2019\u0131n herkese nasip olmayacak \xf6zel bir di\u015fisidir. Zaman zaman, dengelerini kaybedebilir. \n\n - \xc7\xfcnk\xfc, duygusal d\xfcnyas\u0131 daima kar\u0131\u015f\u0131kt\u0131r. \xd6zlemlerini ve isteklerini kar\u015f\u0131layamad\u0131\u011f\u0131 zaman kaprisli y\xf6nleri ortaya \xe7\u0131kar.\n\n - A\u015fk ormanlar\u0131n\u0131n romantik gezilerine daima ihtiya\xe7 duyarlar.\n\n - Uygun partner buluncaya kadar, g\xf6n\xfcl kap\u0131lar\u0131n\u0131 daima a\xe7\u0131k tutarlar.\n\n - Y\xfczleri g\xfczel duru ve sevecendir. Bak\u0131\u015flar\u0131 anlay\u0131\u015f doludur. G\xf6zlerinin i\xe7i g\xfcler. \n\n - Orant\u0131l\u0131 bir v\xfccuda sahip olmalr\u0131na kar\u015f\u0131n, hafif etine dolgun hatlar\u0131 ya\u015flar\u0131 ilerledik\xe7e hantalla\u015fabilir.\n\n - Giyim konusunda \xe7ok zevklidirler, cezbedici ve c\xfcretkar giyinmekle beraber, asla baya\u011f\u0131 olmazlar. \n\n - Ger\xe7ek bir diplomatt\u0131r. Nerede ne yapaca\u011f\u0131n\u0131 bilir. Nezaketi ve inceli\u011fi ona t\xfcm kap\u0131lar\u0131 a\xe7ar. \u0130\u015fleri ne olursa olsun, as\u0131l i\u015fleri ya\u015fam\u0131 ve \xe7evresini g\xfczelle\u015ftirmektir.\n\n - Hayat\u0131n hep g\xfczel yanlar\u0131n\u0131 g\xf6rmek isterler. Evlili\u011fi dost\xe7a yap\u0131lan bir ortakl\u0131k olarak g\xf6r\xfcrler. Yaln\u0131z kalmaktan hi\xe7 ho\u015flanmazlar. \n\n - \u0130nsan ili\u015fkilerine \xe7ok \xf6nem verirler."," - Bu adamdan pek \xe7ok \xf6\u011f\xfct alacaks\u0131n\u0131z. Sorunlar\u0131n\u0131z\u0131 b\xfcy\xfck bir zevkle dinleyecek ve ve size yard\u0131mc\u0131 olmak i\xe7in t\xfcm olanaklar\u0131n\u0131 kullanacakt\u0131r. \n\n - Sizi o e\u015fsiz mant\u0131k g\xfcc\xfcn\xfcn etkisi alt\u0131na alacakt\u0131r. .\u0130kna kabiliyeti \xe7ok y\xfcksektir. \n\n - Onunla birlikteyken, eski hayal k\u0131r\u0131kl\u0131klar\u0131n\u0131z\u0131 unutacaks\u0131n\u0131z.\n\n - Size g\xfcl\xfcmsedi\u011fi anda, t\xfcm d\xfcnyan\u0131n ayaklar\u0131n\u0131z\u0131n alt\u0131nda oldu\u011funu hissedecek ve, sanki i\xe7inizden bir \u015feyler kopacak ve onun m\u0131knat\u0131s ki\u015fili\u011fi alt\u0131nda kendinizi \xe7ok farkl\u0131 d\xfcnyalar i\xe7inde bulacaks\u0131n\u0131z.\n\n - Fakat Ven\xfcs\u2019\xfcn etkisinde olan bu erkekle, a\u015fk\u0131n\u0131z\u0131n sonsuza kadar s\xfcrece\u011fine inanacak kadar saf olmay\u0131n. \n\n - O, sizi \xfczmeden ve k\u0131rmadan ka\xe7maya \xe7al\u0131\u015fabilir. \xc7\xfcnk\xfc, ili\u015fki kan kaybetmeden uzakla\u015fmak ve a\u015fk\u0131n\u0131 hep en g\xfczel an\u0131lar\u0131yla hat\u0131rlamak isterler.\n\n - Bir terazi erke\u011fi y\xfcz ya\u015f\u0131na gelse bile,kar\u015f\u0131 cinse ilgisini kaybetmeyece\u011fi i\xe7in, \xe7evresi daima kalabal\u0131k ve kad\u0131nlarla \xe7evrili olacakt\u0131r. \n\n - Zodyak\u0131n a\u015fk yapma sanat\u0131n\u0131 \xe7ok iyi bilen bu erke\u011fin kar\u015f\u0131nda hi\xe7bir kad\u0131n ilgisiz kalamayaca\u011f\u0131 muhakkak. \n\n - Fakat i\u015fin ilgin\xe7 y\xf6n\xfc, ayr\u0131ld\u0131\u011f\u0131 sevgilileri ile dost ve arkada\u015f kalabilen, ender ki\u015filerdir. \n\n - O, daima size sayg\u0131l\u0131 davranacak ve hi\xe7bir i\u015finize burnunu sokmayacakt\u0131r. Sizin t\xfcm s\u0131rlar\u0131n\u0131z\u0131 \xf6\u011frenmek gibi bir merak\u0131 yoktur.\n\n - E\u011fer siz, b\xf6yle bir \u015feye yeltenirseniz, olduk\xe7a \u015fa\u015f\u0131racak ve g\xfcvenilmedi\u011fi duygusuna kap\u0131larak, size k\u0131r\u0131lacakt\u0131r.\n\n - Terazi erke\u011fi, ayn\u0131 zamanda ya\u015fam\u0131n iyi bir yarg\u0131c\u0131d\u0131r. Onun inan\xe7lar\u0131na sayg\u0131 g\xf6stermek zorundas\u0131n\u0131z. \n\n - \xc7\xfcnk\xfc, onlar i\xe7in yalan son derece i\u011fren\xe7 ve berbat bir olayd\u0131r. B\xf6yle bir duygu insan bedenini ve ruhunu kirleten bir \u015feydir. \n\n - Anala\u015f\u0131lmad\u0131\u011f\u0131 zaman, ruhunun derinliklerinde gizli bir ac\u0131 ya\u015far. \u0130ncindi\u011fi zaman, nazik\xe7e sizden uzakla\u015f\u0131r.\n\n - \u0130\u015fte t\xfcm bu \xf6zellikleri Terazi erke\u011fini farkl\u0131 k\u0131lar. Terazi erke\u011finin sosyal \xe7evresinde bol bol zeki ve ak\u0131ll\u0131 insanla olacakt\u0131r.\n\n - Para konusunda eli s\u0131k\u0131 biri de\u011fildir. Dostlar\u0131n\u0131 en iyi \u015fekilde a\u011f\u0131rlamas\u0131n\u0131 bilir. \n\n - Sanat ve entellekt\xfcellik ta\u015f\u0131yan konular ilgisini \xe7eker. Kalabal\u0131k ve kapal\u0131 yerlerden s\u0131k\u0131l\u0131r. \n\n - Nezih ve kaliteli ortamlar\u0131 tercih ederler. Ruhsal dengelerini korumak i\xe7in ger\xe7ekten her \u015feyin uyum i\xe7inde olmas\u0131n\u0131 isterler.\n\n - E\u011fer bir Terazi erke\u011fine a\u015f\u0131k olursan\u0131z, hemen vakit kaybetmeden gidin ve teklifinizi ona yap\u0131n. \n\n - Sizi ger\xe7ekten be\u011fenmi\u015fse belki biraz naz yapacakt\u0131r. Fakat onu duygu karars\u0131zl\u0131klar\u0131ndan kurtarm\u0131\u015f olursunuz.. \n\n - Sizi ger\xe7ekten be\u011feniyorsa, oda bu teklifiniz kar\u015f\u0131s\u0131nda rahatlayacakt\u0131r. \n\n - \xc7\xfcnk\xfc bu zarif adam, a\u015fk konusunda ilk ad\u0131m\u0131 atacak kadar cesur de\u011fildir.\n\n"," - Hi\xe7 ku\u015fkusuz m\xfckemmel bir a\u015f\u0131ks\u0131n\u0131z. A\u015fk\u0131 yaratan Ven\xfcs \xf6nce sizi yaratm\u0131\u015f. \n\n - Sevgi aray\u0131\u015flar\u0131n\u0131z hi\xe7 bitmedi\u011fi i\xe7in de, dengeleriniz s\xfcrekli hassast\u0131r. \n\n - Bazen a\u015fks\u0131z ya\u015fama korkusu y\xfcz\xfcnden, kendinizi yanl\u0131\u015f ili\u015fkiler i\xe7inde bulabilirsiniz. \n\n - Evlilik ve a\u015fk i\xe7in yarat\u0131lm\u0131\u015fs\u0131n\u0131z. A\u015fkta duygusall\u0131k ve mant\u0131\u011f\u0131 bir arada ya\u015fars\u0131n\u0131z. \n\n - A\u015fk sanat\u0131n\u0131 en iyi bilen mitolojinin \xf6zel insanlar\u0131n\u0131z. Ayr\u0131l\u0131klarda \xe7abuk toparlan\u0131rs\u0131n\u0131z. \n\n - \xc7\xfcnk\xfc \xe7evreniz sizi be\u011fenen bir dolu insanla \xe7evrilidir. A\u015fka a\u015f\u0131ks\u0131n\u0131z.\n\n"," - TERAZ\u0130 KIZLARI Terazi k\u0131zlar\u0131 kaba olmaktan ve \xe7evresine k\xf6t\xfc g\xf6r\xfcnmekten nefrete ederler. \n\n - E\u011fer g\xfcn\xfcn her saatinde d\u0131\u015f g\xf6r\xfcn\xfc\u015f\xfcn \xf6nemliyse, kavgal\u0131 ve g\xfcr\xfclt\xfcl\xfc ortamlardan ka\xe7\u0131yor ve haks\u0131zl\u0131klar kar\u015f\u0131s\u0131nda isyan ediyor ve yumu\u015fac\u0131k yap\u0131na ra\u011fmen, h\u0131rsla savunmaya ge\xe7iyorsan? Sen tipik bir terazi k\u0131z\u0131s\u0131n.\n\n - Pek \xe7ok insan sana; sevgi, g\xfczellik ve tatl\u0131l\u0131k \u0131\u015f\u0131\u011f\u0131 oldu\u011funu s\xf6yleyecektir. \n\n - Bunun do\u011fru olmad\u0131\u011f\u0131n\u0131 asl\u0131nda sevimli bir cad\u0131 oldu\u011funu, fakat bu \xf6zelli\u011fini her zaman kullanmad\u0131\u011f\u0131n\u0131 anlatmaya \xe7al\u0131\u015fsan da, nas\u0131l olsa onlar anlamayacakt\u0131r.\n\n - Bo\u015f verin gitsin. Nas\u0131l olsa bir g\xfcn can\u0131n\u0131 yakacaklar ve senin bu y\xfcz\xfcn\xfc de g\xf6receklerdir.. Senin hi\xe7 acelen yok.\n\n - Beklesin de g\xf6rs\xfcnler bakal\u0131m. Sen sevgili terazi k\u0131z\u0131 ; dengelerinle problemin hi\xe7 bitmez. \n\n - En b\xfcy\xfck derdin, bir anda alt \xfcst olan duygular\u0131n ve yeniden ayar yap\u0131na dek, bo\u015fa ge\xe7en zaman\u0131nd\u0131r. \n\n - Huysuzluk ve kapris konusunda eline hi\xe7 kimse su d\xf6kemez.\n\n - Oysa d\xfcnyan\u0131n en sevimli yarat\u0131klar\u0131 oldu\u011funu nas\u0131l anlas\u0131nlar ki\u2026 \u0130\u015flerin yolunda gitmemesi senin su\xe7un de\u011fil ki\u2026 \n\n - Sevgili terazi seni anlatmaya kelimelerin yetmeyece\u011fini sende biliyorsun. \n\n - Onlarda zaman i\xe7inde \xf6\u011freneceklerdir. Merak etme\u2026. \n\n - TERAZ\u0130 KIZI PART\u0130 HAVASINDA Tarz sahibi ve kendine has ki\u015fili\u011finle, bulundu\u011fun alanda herkesi b\xfcy\xfcler m\u0131knat\u0131s gibi kendine \xe7ekersin.\n\n - Sanat\xe7\u0131 ve artistik yap\u0131nla \xe7evreni \xe7ok kolay etkiler, bulundu\u011fun ortamda fl\xf6rt havas\u0131 estirirsin. \n\n - Di\u015fi ve kad\u0131ns\u0131 k\u0131yafetin herkesin akl\u0131n\u0131 ba\u015f\u0131ndan al\u0131r. \n\n - \xc7i\xe7ek ve meyve kokulu parf\xfcm\xfcn sana e\u015flik ederken, herkes gecenin en \u015fansl\u0131 erke\u011finin kim olabilece\u011fi konusunda gizli tart\u0131\u015fmalar\u0131 ba\u015flat\u0131r hemen.\n\n - Gecenin sonuna kadar, ka\xe7amak fl\xf6rtlerle devam ederken, y\xfcre\u011fin bir Kova\u2019ya ye\u015fil \u0131\u015f\u0131k yakm\u0131\u015ft\u0131r bile. \n\n - Yay\u2019la \xf6zg\xfcrce muhabbetler, \u0130kizlerle seyahat planlar\u0131 yapars\u0131n Hatta bir sonraki toplant\u0131ya beraber gitme karar\u0131 al\u0131rs\u0131n\u0131z. \n\n - Aslan\u0131n g\xf6rkemli yap\u0131s\u0131ndan etkilenir ve ger\xe7ek oyunu kendine saklars\u0131n.\n\n"," - Brigitte Bardot, Catgerine Deneuve, Cem \xd6zer, Cervantes, Christopher Reeves, Cliff Richards, H\xfclya Av\u015far, Jimmy Carter, John Lennon, Julio Iglesias, Klaus Kinski, Konficyus, Lizst, Meryl Streep, Michael Douglas, Nurseli \u0130diz, Oscar Wilde, Pavorotti, Rahmi Ko\xe7, Roger Moore, Sylvia Kristel, Turgut Ozal, Verdi, Tarkan, Ay\u015feg\xfcl Aldin\xe7 Tar\u0131k Akan, Ne\u015fe Erberk, Levent K\u0131rca, Y\u0131ld\u0131z Kenter Mehmet Aslantu\u011f, EY\u015eAN \xd6ZH\u0130M,\n\n"," - \xc7ok y\xf6nl\xfc Terazi \xe7ocuklar\u0131 \xe7ocukluk y\u0131llar\u0131nda olduk\xe7a \xe7ekingen ve usludurlar.\n\n - Yemek problemi olmayan ve fazla a\u011flamayan bebeklerdir. \n\n - G\xfcr\xfclt\xfcs\xfcz ortamlarda huysuzluk etmeyen bu bebekler, b\xfcy\xfcrken sizi yormayacakt\u0131r. Hislerini a\xe7mayan bu terazi \xe7ocuklar\u0131 s\xfcrekli sizden ilgi bekleyece\u011fi i\xe7in, annelerinin ve babalar\u0131n\u0131n anlay\u0131\u015fl\u0131 olmalar\u0131 \u015fartt\u0131r.\n\n - \xc7ocukluk y\u0131llar\u0131ndan itibaren g\xfczelliklere d\xfc\u015fk\xfcnd\xfcr. \n\n - Erken ya\u015fta onun hangi konuya kar\u015f\u0131 kabiliyeti oldu\u011funu analamak gerekir. \n\n - \xd6zellikle anne ona \xe7ok itina etmeli ve b\xfcy\xfcme \xe7a\u011f\u0131nda sevgi ve \u015fevkatini esirgememelidir. \n\n - Genelde a\u011flamak yerine uyumay\u0131 tercih ederler. S\xfcrekli ba\u011f\u0131ran ve tart\u0131\u015fan aile b\xfcy\xfcklerinden rahats\u0131zl\u0131k duyarlar. \n\n - Zekalar\u0131 \xe7ok \xe7abuk geli\u015fir. Okul y\u0131llar\u0131nda sosyalle\u015fmeye ba\u015flarlar. Karars\u0131zd\u0131rlar. \n\n - Bu nedenle h\u0131zl\u0131 d\xfc\u015f\xfcnmek ve karar vermek i\xe7in, deste\u011fe ihtiya\xe7lar\u0131 vard\u0131r. \n\n - Terazi \xe7ocuklar\u0131 iyi yeti\u015ftirilir, ailesi taraf\u0131ndan takdir ve sevgi g\xf6r\xfcrse ileride \xe7ok ba\u015far\u0131l\u0131 olurlar.\n\n - Anne ve babalar\u0131 s\xfcrekli acele karar vermesi i\xe7in \u0131srar eden ve hassas dengesi bozulan terazi burcu \xe7ocuklar\u0131 \xe7o\u011funlukla se\xe7im yapma konusunda olduk\xe7a sinirli insanlar olarak b\xfcy\xfcrler.\n\n - Sizi memnun etmeyi ger\xe7ekten ister fakat onun d\xfcnyas\u0131nda ses, renk, ve d\xfc\u015f\xfcnce uyumu oldu\u011fu zaman, ancak kendisi de, uyumlu olabilir. \n\n - B\xfcy\xfcrken sak\u0131n onun \xf6zel ya\u015fam\u0131na kar\u0131\u015fmay\u0131n ve rahat b\u0131rak\u0131n. Ruh dengesi sa\u011fl\u0131kl\u0131 ve mutlu bir insan olacakt\u0131r\n\n"," - D\u0131\u015f g\xf6r\xfcn\xfc\u015f\xfcne dikkat eden yak\u0131\u015f\u0131kl\u0131 erkeklerin ve g\xfczel kad\u0131nlar\u0131n burcu olan Teraziler; \u015f\u0131kl\u0131\u011fa ve g\xf6steri\u015fe \xf6nem veriyor. \n\n - Bu y\xfczden ne al\u0131rsan\u0131z al\u0131n hediyenin ambalaj\u0131na \xf6zen g\xf6sterin. \n\n - Estetik duygusu geli\u015fmi\u015f bu kibar insanlar i\xe7in yine zarif hediyeler tercih etmelisiniz.\n\n - Terazi kad\u0131n\u0131 s\xfcrprizlerden ho\u015flan\u0131r. Ona \u015f\u0131k bir masada, ahenkli ve g\xfczel bir ak\u015fam yeme\u011fi s\xfcrprizi haz\u0131rlayabilirsiniz. \n\n - Ayr\u0131ca sa\xe7 \u015fekillendirme setleri, \u015farap, parf\xfcm, spor g\xf6mlek de sat\u0131n alabilirsiniz. \n\n - Terazi erke\u011fine \u015f\u0131k bir kravat, kalem seti veya sevdi\u011fi bir sanat\xe7\u0131n\u0131n m\xfczik cd\u2019sini hediye edebilirsiniz.\n\n"," - Yarat\u0131c\u0131 ve artistik bir benli\u011fi vard\u0131r. Ona yak\u0131\u015fan i\u015f fazla zor olmamal\u0131d\u0131r.\n\n - Neyin nerede uyum sa\u011flayaca\u011f\u0131n\u0131 ondan ba\u015fka hi\xe7 kimse bilemez. \n\n - Huzursuz ve kaba ortamlarda \xe7al\u0131\u015fmaktan ho\u015flanmazlar. \n\n - Bir Terazi\u2019nin ofisi zevkle d\xf6\u015fenmi\u015f, g\xfczel ki\u015fili\u011fini yans\u0131tan objelerle s\xfcslenmi\u015ftir. \n\n - Masas\u0131nda daima taze \xe7i\xe7ekler olacakt\u0131r. Misafirlerini en kaliteli ikramlarla a\u011f\u0131rlayacakt\u0131r. \n\n - \u0130yi bir Terazi\u2019nin yan\u0131nda \xe7al\u0131\u015fmak son derece keyif vericidir. \xc7ok mant\u0131kl\u0131d\u0131r.\n\n - Olaylar\u0131 her a\xe7\u0131dan farkl\u0131 boyutlarda de\u011ferlendirir ve hemen karar vermez. \n\n - Dedikodular onu ilgilendirmez ve sadece g\xfc\xe7l\xfc akl\u0131ndan yararlan\u0131r. \n\n - \u0130li\u015fkilerinde, kar\u015f\u0131l\u0131kl\u0131 al\u0131\u015f veri\u015f \xe7ok \xf6nemlidir ve hedeflerine ula\u015fmak i\xe7in gerekli \xe7al\u0131\u015fma disiplinine sahiptir fakat d\u0131\u015f g\xf6r\xfcn\xfc\u015f\xfc bu \xf6zelli\u011fini farkl\u0131 yans\u0131tabilir.\n\n"," - Terazi bir denge burcudur. En ufak bir dengesizlik, hassas v\xfccudunu alt \xfcst etmeye yeterlidir. \n\n - Hastal\u0131klar\u0131 s\u0131ras\u0131nda yo\u011fun ilgi beklersin. Arad\u0131\u011f\u0131n\u0131 ilgiyi bulamad\u0131\u011f\u0131n zaman, huysuzla\u015f\u0131r daha \xe7ok hastalan\u0131rs\u0131n.. \n\n - \u0130\xe7 d\xfcnyanda dalgalanmalar y\xfcz\xfcnden, ba\u015f a\u011fr\u0131s\u0131 ve a\u015f\u0131r\u0131 yemek yeme e\u011filimi g\xf6sterirsin.. \n\n - Sinir sistemin mideni etkiledi\u011fi i\xe7in, midedeki asit fazlal\u0131\u011f\u0131n\u0131 fosfor i\xe7erikli yiyeceklerle dengelemelisin..\n\n - Metabolizman \xe7ok yava\u015f \xe7al\u0131\u015f\u0131r. Baharatl\u0131, soslu, \u015fekerli g\u0131dalar d\xfc\u015fk\xfcn olman nedeniyle, \xe7ok fazla kilo almaya m\xfcsaitsin.. \n\n - Ya\u015fam boyunca s\xfcrekli egzersiz yapmak zorundas\u0131n.. \u0130leri ya\u015flarda senin i\xe7in \u015fi\u015fmanl\u0131k ka\xe7\u0131n\u0131lmaz olur. \n\n - Sa\u011flam yap\u0131l\u0131 bir g\xf6r\xfcnsen de, \xe7ok \xe7abuk hastalan\u0131rs\u0131n. \n\n - Sa\u011fl\u0131kl\u0131 g\xf6r\xfcn\xfc\u015f\xfcne kar\u015f\u0131n, so\u011fuk alg\u0131nl\u0131klar\u0131na \xe7ok \xe7abuk yakalan\u0131rs\u0131n. \n\n - Teraziler b\xf6brekleri, bel b\xf6lgesini, omurga ve s\u0131rt\u0131 simgeler.\n\n - Ayr\u0131ca Ven\xfcs etkisinde olduklar\u0131 i\xe7in, troidler d\xfczensiz \xe7al\u0131\u015fabilir.\n\n - Kilo problemi olan Terazilerin, ara s\u0131ra hormon testleri yapt\u0131rmalar\u0131 gerekebilir.\n\n - \u0130leri ya\u015flarda romatizma men\u015feli rahats\u0131zl\u0131klara aday olursun.. G\xfczel y\xfcz\xfcn zaman ge\xe7tik\xe7e \xe7ok \u015fey kaybedebilir. \n\n - Herkesten daha \xe7ok kendine \xf6zen g\xf6stermen gerekiyor. \n\n - Siz Terazilerin \xe7o\u011fu bu konuda duyarl\u0131 olurlar ve kendilerine \xf6zen g\xf6steren insanlar en \xe7ok bu bur\xe7tan \xe7\u0131kar.\n\n"," - Y\xfckselen burcu Terazi olan ki\u015filer, bur\xe7lar ku\u015fa\u011f\u0131n\u0131n en sevimli, en i\xe7ten burcudur.\n\n - Hemen herkes ile uyumlu olabilir, anla\u015famad\u0131\u011f\u0131 insan yok denecek kadar azd\u0131r.\n\n - Fazla duygusald\u0131r ve \xe7evresel telkinlerden kolayca etkilenebilirler. D\xfcr\xfcstt\xfcr, yalandan ve dolandan nefret ederler.\n\n - \u0130yimser davran\u0131r, her olaya iyi taraf\u0131ndan bakmaya \xe7al\u0131\u015f\u0131r. \u0130\xe7ten davran\u0131r, yapmac\u0131k hareketli yoktur. \n\n - Y\xfckseleni Terazi olan ki\u015filerin belki de negatif tek \xf6zelli\u011fi bir olaya farkl\u0131 farkl\u0131 a\xe7\u0131lardan bakmalar\u0131d\u0131r.\n\n - Karars\u0131zl\u0131k, y\xfckselen burcu Terazi olan ki\u015filerin olumsuzluklar\u0131ndan birisidir. \n\n - Y\xfckseleni Terazi olanlar olduk\xe7a yetenekli ve yarat\u0131c\u0131 ki\u015filerdir. \n\n - Uyum i\xe7erisinde olan ve g\xf6ze g\xfczel g\xf6r\xfcnen her \u015feye d\xfc\u015fk\xfcnl\xfckleri vard\u0131r. \n\n - Resim, heykel ve m\xfczik konusunda olduk\xe7a yeteneklidir. \n\n - Bir konu \xfczerinde ba\u011fl\u0131 kalmamalar\u0131 y\xfcz\xfcnden, giri\u015ftikleri \xe7o\u011fu i\u015fte ba\u015far\u0131s\u0131z olabilirler, yetenekleri olmas\u0131na ra\u011fmen.\n\n - Y\xfckselen burcu Terazi olan ki\u015filer sosyal hayata ve ki\u015fisel zevklerine d\xfc\u015fk\xfcnd\xfcr. \n\n - Ortakl\u0131k ve uyumlu ili\u015fkiler y\xfckselen Teraziler i\xe7in olmazsa olmazlar aras\u0131nda bulunur. \n\n - Er ya da ge\xe7 toplumda dikkat \xe7eken, \xfcst s\u0131n\u0131f insan olmay\u0131 ba\u015far\u0131rlar.\n\n"]),t.s)
