B.Lr=A.b(s(["Hayat\u0131n\u0131zda h\u0131z, y\xfcksek tempo ve heyecan eksik olmas\u0131n diyorsan\u0131z bu ili\u015fki size g\xf6re olabilir. Ancak ayn\u0131 oranda yorucu ve enerji t\xfcketici bir ili\u015fki de olabilir. Zira ikiniz i\xe7in de benlik duygusu ve kafan\u0131z\u0131n dikine gitmek \xf6nemlidir. Bu a\u015fk ve ili\u015fkiyi bir alev topuna benzetebiliriz. Ya\u015fam\u0131n\u0131zda aksiyon ve enerji eksik olmaz. Kavgan\u0131n, g\xfcr\xfclt\xfcn\xfcn son raddesinde oldu\u011fu bir ili\u015fkiniz olabilir. Her iki taraf\u0131n dedi\u011finde \u0131srar etmesi, birden bozup atmas\u0131 ili\u015fkiyi aniden bitirebilir. \u0130kinizin Mars ate\u015finin birbirinizden \xe7ok etraf\u0131n\u0131z\u0131 yakabilece\u011fini g\xf6z ard\u0131 etmemelisiniz. Bunun d\u0131\u015f\u0131nda da\u011fda kar\u015f\u0131la\u015fan iki ke\xe7i misali bir ili\u015fkiniz olabilir.","\u0130ki boynuzlu burcun birlikteli\u011finin pek kolay olmad\u0131\u011f\u0131n\u0131 belirtmek gerek. Bir kere her iki bur\xe7 da olduk\xe7a inat\xe7\u0131d\u0131r. \xdcstelik feminen bur\xe7 Bo\u011fa\u2019da kad\u0131n daha g\xfc\xe7lenir, erkek de Ko\xe7\u2019ta y\xf6netici durumdad\u0131r. Bo\u011fa\u2019n\u0131n inad\u0131, Ko\xe7\u2019un liderli\u011fi bir araya geldi\u011finde kilit olup kalabilen bir ili\u015fki olabilir. Ko\xe7 sab\u0131rs\u0131z olup gidebilir, Bo\u011fa bu harekete tepki vermekte ge\xe7 kalabilir. Bo\u011fa kad\u0131n\u0131n\u0131n y\xfcksek libidosu Ko\xe7\u2019a en ba\u015fta cazip gelse de, g\xfczelli\u011fi onu ba\u015ftan \xe7\u0131karsa da bu kilit durum ili\u015fkiyi zorla\u015ft\u0131rabilir. \xdcstelik Bo\u011fa kad\u0131n\u0131 her daim g\xfcven, konfor ve l\xfcks bekler. Aksi halde ayak uydurmakta zorlan\u0131r, iyice pasifle\u015fir. Bo\u011fa\u2019n\u0131n sakinli\u011fi Ko\xe7\u2019un enerjisini dengeleyece\u011fi d\xfc\u015f\xfcn\xfclse de hiperaktif ve hareketli Ko\xe7 sevgilinin temposuna ayak uydurmak zor olabilir.","Her ikiniz de ki\u015fisel de\u011ferlerinize \xf6nem veriyorsunuz. Siz ki\u015filik boyutunda bu de\u011ferleri g\xf6z \xf6n\xfcne al\u0131rken, kar\u015f\u0131n\u0131zdaki maddi boyutu g\xf6zetiyor, aradaki fark kabaca bu. Her ikinizde bu denli ben merkezci olurken bu ili\u015fkiyi y\xf6netmek kolay olmasa gerek. Ko\xe7 kad\u0131n\u0131 olarak kar\u015f\u0131n\u0131zdaki erke\u011fin yava\u015f, a\u011f\u0131r, keyfine d\xfc\u015fk\xfcn ve zaman zaman tembel ve hareketten yoksun olmas\u0131 sizin enerjik yap\u0131n\u0131z\u0131 daraltmayacaksa bu a\u015fka merhaba diyebilirsiniz. Bu ili\u015fkide Bo\u011fa erke\u011finin sahiplenici, k\u0131skan\xe7 y\xf6nlerini, paraya, konfora, l\xfckse d\xfc\u015fk\xfcnl\xfc\u011f\xfcn\xfc de g\xf6z ard\u0131 edilmemeli.","Kar\u015f\u0131n\u0131zda olduk\xe7a hareketli, \xe7ok konu\u015fan, entelekt\xfcel g\xfcc\xfc y\xfcksek, sohbet etmeyi seven, duygusall\u0131ktan \xe7ok da haz etmeyen bir erkek var. Bir g\xfcn\xfcn\xfcn di\u011ferine uymamas\u0131 da ayr\u0131 bir durum. \u0130kizler erke\u011finin zeki y\xf6nleri ho\u015funuza gidebilir. Ancak tezcanl\u0131l\u0131\u011f\u0131n\u0131z kar\u015f\u0131s\u0131nda de\u011fi\u015fken ve zaman zaman ne istedi\u011fini kendi de bilemeyip savrulabilen \u0130kizler erke\u011fi yorucu olabilir. Fazlaca merakl\u0131, konu\u015fkan halleriyle sevimli gelebilir. Onunla hemen her \u015fey hakk\u0131nda konu\u015fabilir, her konuda bilgi alabilirsiniz. Ancak bir s\xfcre sonra onun bu bilgi oburlu\u011fundan, konu\u015fmalar\u0131ndan s\u0131k\u0131labilirsiniz.","S\u0131ra d\u0131\u015f\u0131 zek\xe2 ve k\u0131vrakl\u0131\u011f\u0131n\u0131z, esnek ve becerikli y\xf6n\xfcn\xfczle ba\u015fta Ko\xe7 erke\u011finin enerjisine ayak uydurabilirsiniz. Ancak onun lider ve \xf6nc\xfc \xf6zelliklerine uyum sa\u011flaman\u0131z gerekecek. Zira Ko\xe7 burcu erke\u011fi anl\u0131k hevesler pe\u015finde olabilir ve akl\u0131n\u0131 geleni ger\xe7ekle\u015ftirme konusunda olduk\xe7a sab\u0131rs\u0131zd\u0131r. Bir sonraki a\u015famaya bir an \xf6nce ge\xe7mek isteyen bir oyuncu gibidir ve hayat\u0131 da \xe7o\u011fu kez bir oyun olarak g\xf6rebilir. Duygusal de\u011fildir, konular\u0131n \xfczerinde asla fazla durmaz, hemen unutur, sonra da hat\u0131rlamayabilir. \xc7\xfcnk\xfc zaten art\u0131k o a\u015famay\u0131 ge\xe7mi\u015ftir. Bu h\u0131zl\u0131 erke\u011fe enerjinizle ba\u015fta ayak uydursan\u0131z da bir s\xfcre sonra size olduk\xe7a yorucu, y\u0131prat\u0131c\u0131 gelebilir. Ko\xe7\u2019un hiperaktifli\u011fi, canl\u0131l\u0131k ve enerjisi zaman i\xe7inde ba\u015f\u0131n\u0131z\u0131 d\xf6nd\xfcrebilir. Bu hareketlilik kar\u015f\u0131s\u0131nda k\u0131vrak zek\xe2n\u0131z zay\u0131f gelip y\u0131pranabilir. Bu aksiyon i\xe7inde sizin de\u011fi\u015fken karakterinize ve ruh hallerinize yan\u0131t veremez, anlamakta zorlan\u0131r. \xdcstelik ikinizin de s\u0131k\u0131lgan yap\u0131s\u0131 ili\u015fkiden vazge\xe7menize neden olabilir ve bu durum kar\u015f\u0131l\u0131kl\u0131 tahamm\xfcls\xfczl\xfc\u011fe gidebilir.","Bir Ko\xe7 erke\u011fini idare etmeniz zordur. Son derece enerjik yap\u0131s\u0131yla i\xe7erde ve d\u0131\u015farda s\xfcrekli hareket beklentisi i\xe7indedir. Ana\xe7 ve evcimen yap\u0131n\u0131zla onu s\u0131kmadan yan\u0131n\u0131zda tutman\u0131z ise zor bir s\u0131nav olabilir. \xdcstelik Ko\xe7 her ne kadar ba\u015fta g\xfczel g\xf6r\xfcnse de duygusall\u0131ktan ve romantizmden \xe7abuk s\u0131k\u0131labilir. Zira bir aksiyon, h\u0131z, heyecan, adrenalin insan\u0131d\u0131r. Hassas yan\u0131n\u0131z, empati g\xfcc\xfcn\xfcz ve m\xfcthi\u015f su enerjinizle bu ate\u015fi s\xf6nd\xfcrebilirsiniz. Ancak gerek onun tutkusuna gerek sizin engin hassasiyetinize yaz\u0131k olmayaca\u011f\u0131na emin olun bu ili\u015fkiye ba\u015flarken. Yenge\xe7 kad\u0131n\u0131 olarak ev ve aile ve \xf6zellikle de anneniz asla vazge\xe7emeyece\u011finiz konular aras\u0131nda. Ko\xe7 erke\u011fi ise her ne kadar aile kavram\u0131na inansa da evi evde b\u0131rak\u0131r ve d\u0131\u015far\u0131ya odaklan\u0131r. Aile bireylerini sever, sayg\u0131 duyar ve g\xf6zetir ancak i\xe7i\u015flerine kar\u0131\u015fmalar\u0131na pek de m\xfcsaade etmez zira onun i\xe7in kendi hedefi, amac\u0131 ve istekleri \xf6nemlidir. Velhas\u0131l s\xf6z\xfcn k\u0131sas\u0131 bu i\xe7inde \xe7at\u0131\u015fman\u0131n fazla olaca\u011f\u0131 bir ili\u015fki modeli olabilir.","Kar\u015f\u0131n\u0131zda olduk\xe7a derin ve duygusal bir ki\u015fi var. Bir o kadar da hassas, sevecen, \u015fefkatli ve evine bark\u0131na d\xfc\u015fk\xfcn biri ayn\u0131 zamanda. Bu a\xe7\u0131lardan size olduk\xe7a cazip gelebilir. Ancak i\xe7inizdeki ate\u015fin sularda bo\u011fulmas\u0131na haz\u0131r m\u0131s\u0131n\u0131z? Zira Yenge\xe7\u2019in sessizli\u011fi, \xe7o\u011fu zaman ne yapaca\u011f\u0131n\u0131, nas\u0131l ilerleyece\u011fini hi\xe7 belli etmemesi, duygusal olarak manip\xfcle edebilme g\xfcc\xfc rahats\u0131z edici olabilir. Tarzlar\u0131n\u0131z farkl\u0131 olsa da her ikiniz de lider ve \xf6nc\xfc \xf6zelliklere sahipsiniz ve bu \xf6zelliklerinizi bast\u0131rman\u0131z g\xfc\xe7 olabilir. Yenge\xe7\u2019in duygusal \xe7alkant\u0131lar\u0131n\u0131 idare etmek hi\xe7 de kolay olmayabilir. Her ne kadar yumu\u015fak gibi g\xf6r\xfcnse de bu g\xf6r\xfcnt\xfcn\xfcn ard\u0131ndan b\xfcy\xfck bir duygusal manip\xfclasyon \xe7\u0131kabilir.","Genel anlamda uyumlu bir ili\u015fkiniz oldu\u011fu s\xf6ylenebilir. Tek yapmaman\u0131z gereken acelecili\u011finiz ve a\u015f\u0131r\u0131 dolays\u0131z yap\u0131n\u0131zla Aslan\u2019\u0131n gururunu k\u0131rmamak, ac\u0131s\u0131n\u0131 sizden olduk\xe7a k\xf6t\xfc \xe7\u0131karabilir. Kar\u015f\u0131n\u0131zdaki Aslan burcunu pohpohlad\u0131\u011f\u0131n\u0131z, bolca alk\u0131\u015f tuttu\u011funuz ve hatta \u015f\u0131martt\u0131\u011f\u0131n\u0131z s\xfcrece sizden iyisi olamaz. Asl\u0131nda do\u011fall\u0131\u011f\u0131n\u0131zla kar\u015f\u0131n\u0131zdaki erke\u011fin bunu ger\xe7ekten hak etti\u011fini d\xfc\u015f\xfcn\xfcyorsan\u0131z, bunu kolayca yapabilirsiniz. Aslan erke\u011fi ayaklar\u0131n\u0131z\u0131n yere sa\u011flam basman\u0131z\u0131 sa\u011flarken, i\xe7inizdeki ate\u015fin uzun \xf6m\xfcrl\xfc \u015fekilde yanmas\u0131n\u0131 sa\u011flayabilir.","Ko\xe7 erke\u011fi enerjisi, ma\xe7o yanlar\u0131 ve \xf6zg\xfcveniyle kalbinizi i\xe7ten fethedebilir. Ko\xe7\u2019un \xf6nc\xfc ve lider yanlar\u0131n\u0131 bast\u0131rmaya \xe7al\u0131\u015fmamal\u0131s\u0131n\u0131z. \u0130ki ate\u015f burcunun birlikteli\u011fi g\xfczeldir. Son derece \u015fehvetli ve ate\u015fli bir beraberli\u011finiz olabilir. Bu birlikteli\u011fin ba\u015frol\xfcnde ger\xe7ek kalpler ve a\u015fk olabilir. Ko\xe7 erke\u011fi \xf6nc\xfc y\xf6nleriyle hayat\u0131n\u0131z\u0131 daha iyi y\xf6nlendirmenize destek olacakt\u0131r. Siz de koruyucu kollay\u0131c\u0131 taraf\u0131n\u0131zla onun zor ve sava\u015f\xe7\u0131 d\xfcnyas\u0131nda ihtiya\xe7 duydu\u011fu istikrar\u0131 sa\u011flayabilirsiniz. Birbirinizin ate\u015f enerjilerini iyi dengeledi\u011finiz s\xfcrece m\xfckemmel bir birlikteli\u011finiz olabilir.","Ba\u015fak erke\u011fi hi\xe7bir detaydan ka\xe7mayan, g\xf6rev ve sorumluluklar\u0131n bilincinde, her i\u015fi lay\u0131\u011f\u0131yla yerine getirmeye \xe7al\u0131\u015fan tam bir g\xf6rev adam\u0131d\u0131r. Size hizmet etmeyi de, s\xf6ylediklerinizi yerine getirmeyi de sever, olduk\xe7a \xe7al\u0131\u015fkand\u0131r. \xdcstelik olduk\xe7a pratik zek\xe2l\u0131, esnek ve uyumludur. Sizin ta\u015fk\u0131n enerjiniz, co\u015fkunuz, d\xfcrt\xfcsel ve ani hareketleriniz ona abart\u0131l\u0131 ve anlams\u0131z gelebilir. Sizi olduk\xe7a \xe7ocuksu ve naif bulabilir. Siz ise onun bu t\u0131k\u0131r\u0131nda y\xfcr\xfcyen zaman zaman mekanikle\u015febilen ya\u015fam\u0131ndan s\u0131k\u0131labilirsiniz bir s\xfcre sonra.","\xc7al\u0131\u015fkanl\u0131\u011f\u0131n\u0131z ve \xf6zverili yap\u0131n\u0131zla Ko\xe7 erke\u011finin g\xf6nl\xfcn\xfc fethedebilirsiniz. Ancak fazla detay ve a\u015f\u0131r\u0131 kuruntu onun can\u0131n\u0131 s\u0131kabilir. Saf enerjisine ayak uydurabilmelisiniz. Ko\xe7\u2019un s\xfcrekli aktif ve yerinde bir an bile duramayan enerjik yap\u0131s\u0131, bir i\u015fi daha bitirmeden di\u011ferine giri\u015fmesi sizin gibi d\xfczenden, detaydan, inceliklerden ho\u015flanan bir kad\u0131n i\xe7in fazlas\u0131yla yorucu olabilir. \xdcstelik hi\xe7bir \u015feyi en ince ayr\u0131nt\u0131s\u0131na kadar d\xfc\u015f\xfcnmedi\u011fi i\xe7in size fazla kaba ve erkeksi g\xf6r\xfcnebilir. Zor ve yorucu bir ili\u015fki olabilir. Zira her \u015feyi \xe7ar\xe7abuk bitirip, t\xfcketip h\u0131zl\u0131ca bir sonraki a\u015famaya ilerlemek isteyen Ko\xe7 burcu i\xe7in Ba\u015fak detaylar\u0131yla, m\xfckemmeliyet\xe7ili\u011fiyle epey yorucudur, k\u0131sa bir s\xfcre sonra Ko\xe7 burcunun ilgisini kaybetmesiyle sonu\xe7lanacak bir birliktelik olabilir.","Sizin \xe7ocuksu enerjiniz, hareketlili\u011finiz ve co\u015fkunuz kar\u015f\u0131s\u0131nda Terazi erke\u011finin kibarl\u0131\u011f\u0131, nezaketi, tolerans\u0131 en \xe7ok da zarafeti ve kendini bozmamas\u0131 ho\u015funuza gidecektir. Birbirinizi tamamlayan bir ili\u015fkiniz olaca\u011f\u0131 s\xf6ylenebilir. Terazi erke\u011fi sizden ho\u015fland\u0131\u011f\u0131 an, sizinle ili\u015fki kurabilmenin her yolunu deneyebilir. Tam bir politika ve ili\u015fki insan\u0131d\u0131r, ileti\u015fim ve diplomatik yetenekler konusunda ondan olduk\xe7a fazla \u015fey \xf6\u011frenebilirsiniz. Sanatsal inceli\u011fi, estetik anlay\u0131\u015f\u0131 ve adalet duygusu da sizi ve y\xfcksek saf enerjinizi dengeleyecek unsurlar olabilir.","Ko\xe7 erke\u011finin girgin, dolays\u0131z, m\xfcdanaas\u0131z davran\u0131\u015flar\u0131 Terazi kad\u0131n\u0131 i\xe7in caziptir. Ko\xe7 erke\u011fi de hararetli d\xfcnyas\u0131nda sakinli\u011finiz ve dengenizden b\xfcy\xfclenecektir. Onunla g\xfczel bir ili\u015fki kurabilirsiniz. Sonu\xe7ta dengeyi korumak sizin maharetiniz, onda da ihtiya\xe7 duydu\u011funuz ate\u015fi bulabilirsiniz. Ruhunuzdaki dengeyi Ko\xe7 ile tamamlayabilirsiniz. Onun cesareti, korkusuzlu\u011fu, g\xfcc\xfc ve enerjisi size olduk\xe7a \xe7ekici gelebilir. Sizin ak\u0131lc\u0131 ve mant\u0131kl\u0131 y\xf6nleriniz onun da bitmek bilmeyen enerjisi ve azmi bu ili\u015fkiyi uzun s\xfcre ayakta tutabilir. Onun ate\u015f enerjisi sizin hava enerjinizi besleyecektir. Uzun vadede harika bir kombinasyon olabilir.","Sava\u015f\xe7\u0131 gezegen Mars'\u0131n y\xf6netiminde iki bur\xe7sunuz. Ancak Akrep erke\u011fi size g\xf6re \xe7ok daha derinden, gizemli, tabiri caizse sinsi \xe7al\u0131\u015f\u0131r ve ilerler. E\u011fer sizden bir \u015fekilde ho\u015flanm\u0131\u015f ve etkilenmi\u015fse, sizi a\u011f\u0131na \xe7ekmek i\xe7in hi\xe7 tahmin edemeyece\u011finiz yollar, y\xf6ntemler denemekten korkmaz ve asla da vazge\xe7mez. Akrep sevgiliniz varsa iki kez dikkatli olmal\u0131s\u0131n\u0131z, her \u015feyi bilir, g\xf6r\xfcr, hisseder, sezgileri g\xfc\xe7l\xfcd\xfcr. Yanl\u0131\u015f bir \u015fey yapman\u0131z halinde gazab\u0131 ac\u0131mas\u0131z olabilir. Kafay\u0131 bir kez size takt\u0131ysa hayat boyu ondan kurtulman\u0131z olduk\xe7a zor olabilir.","Tarzlar\u0131n\u0131z farkl\u0131 olsa da ikiniz de sava\u015f\xe7\u0131 \xf6zelliklerinizle birbirinizin dikkatini \xe7ekebilirsiniz. Sizin derin, gizemli y\xf6nleriniz Ko\xe7 erke\u011finin dikkatini \xe7ekecektir. Yeri geldi\u011finde ortaya \xe7\u0131kard\u0131\u011f\u0131n\u0131z cesaret ve korkusuzlu\u011funuz da etkileyicidir. Onun da pervas\u0131zl\u0131\u011f\u0131, enerjisi ve g\xfcc\xfc sizin ho\u015funuza gidecektir. Ancak i\xe7inde \xe7ok fazla \xe7eki\u015fme, iti\u015f, kak\u0131\u015f olan zor bir ili\u015fki olabilir. \u0130ki Mars insan\u0131n\u0131n ili\u015fkisi hi\xe7 de kolay de\u011fildir. Aran\u0131zda elektrik ve aksiyon hi\xe7 eksik olmaz, yorucu bir ili\u015fki olabilir, birbirinizi y\u0131pratabilirsiniz.","Gezmeyi seven, payla\u015fmaktan ho\u015flanan, her t\xfcrl\xfc fikre, inanca a\xe7\u0131k, sosyal \xe7evresi zengin, yerli ve yabanc\u0131 pek \xe7ok arkada\u015f\u0131 olan bir erkek istiyorsan\u0131z Yay burcu tam da size g\xf6re. Bir Yay erke\u011finden ho\u015flan\u0131yorsan\u0131z, ona seyahat planlar\u0131n\u0131zdan, yurt d\u0131\u015f\u0131 ve yabanc\u0131larla ileti\u015fiminizden ve temaslar\u0131n\u0131zdan s\xf6z edin. Birlikte seyahatlere \xe7\u0131kabilir, fiziksel aktivitelere kat\u0131labilir, bol bol spor yapabilir. Bir Yay burcu e\u015finiz veya sevgiliniz varsa spor k\u0131yafetleriniz ve bavulunuz her daim haz\u0131r olmal\u0131.","\u0130ki eril bur\xe7tan olduk\xe7a eril bir ili\u015fki do\u011fabilir, mask\xfclen g\xfc\xe7 ve unsurlar hakim olabilir bu ili\u015fkiye. Dolay\u0131s\u0131yla bu ili\u015fkide bol hareket, \xe7ok\xe7a spor ve fiziksel aktivite olabilir. Gezmekten, tozmaktan ve e\u011flenmekten ayaklar\u0131n\u0131z bir t\xfcrl\xfc yeri bulmayabilir. Kedinizi s\xfcrekli farkl\u0131 yerlerde, yolculuklarda bulabilirsiniz. Din\xe7 ve sportif yap\u0131lar\u0131n\u0131zla birbirinize uyum sa\u011flayabilirsiniz. Ko\xe7\u2019un enerjisi, sizin d\u0131\u015fa d\xf6n\xfck ve sosyal enerjisiyle birle\u015fti\u011finde ortaya ate\u015fli bir beraberlik \xe7\u0131kabilir. Bu y\xfcksek enerjiyi dengede tutmak \xf6nemli aksi halde iyimserli\u011finiz, pozitif bak\u0131\u015f a\xe7\u0131n\u0131z, ne\u015fe ve e\u011flenceniz ancak bir yere kadar yetecektir bu ili\u015fkide. \xd6te yandan dinamik ve keyifli bir ili\u015fkidir ama y\xfcksek enerjisiyle etraf\u0131ndakileri bir miktar yorabilir.","Kar\u015f\u0131n\u0131zda bir O\u011flak erke\u011fi varsa i\u015finiz pek de kolay de\u011fil. Her ne kadar m\xfccadeleci, g\xf6z\xfcpek ve cesur da olsan\u0131z, kar\u015f\u0131n\u0131zda so\u011fuk bir duvar ve hatta da\u011f var diyebiliriz. O\u011flak erke\u011fi m\xfccadeleden asla y\u0131lmaz, \xfcstelik sizin aksinize olduk\xe7a so\u011fukkanl\u0131 ve planl\u0131d\u0131r. Zorlu ve sab\u0131r gerektiren s\u0131navlardan ho\u015flan\u0131yorsan\u0131z O\u011flak erke\u011fine evet deyin. Stratejiler kurarak ve bunlar\u0131 disiplinli bir \u015fekilde takip ederek sizi alt edebilir. \u0130\u015fi pek kolay olmasa da sabr\u0131 ve metaneti sayesinde masadan galip kalkabilir. Sizi hi\xe7bir konuda y\xfcz \xfcst\xfc b\u0131rakmayaca\u011f\u0131n\u0131 ve olduk\xe7a g\xfcvenilir olduklar\u0131n\u0131 da belirtelim","Her ikiniz de \xf6nc\xfc bur\xe7 grubunun zorlu bur\xe7lar\u0131s\u0131n\u0131z. Zira O\u011flak zorlu Sat\xfcrn, Ko\xe7 ise ate\u015fli sava\u015f\xe7\u0131 Mars y\xf6netimindedir. Asl\u0131nda bu noktada fazla s\xf6ze gerek yok. Ko\xe7 erke\u011finin \xf6nc\xfc, lider y\xf6nleri sizinkilerle \xe7ak\u0131\u015ft\u0131\u011f\u0131nda son derece zor bir ili\u015fki olabilir. Ko\xe7 s\xfcrekli dinamizm arar, m\xfccadele eder, kar\u015f\u0131s\u0131nda s\u0131k \xf6r\xfclm\xfc\u015f duvarlar, beton gibi sert yap\u0131lar bulmak pek ho\u015funa gitmeyecektir. Sizin de kurallar\u0131n\u0131zdan kolay kolay \xf6d\xfcn vermeyece\u011finiz d\xfc\u015f\xfcn\xfcld\xfc\u011f\xfcnde bu ili\u015fkinin pek oluru g\xf6r\xfcnmemektedir. Her yapt\u0131\u011f\u0131n\u0131za, her dedi\u011finize de\u011fil, duru\u015funuza bile kar\u015f\u0131 \xe7\u0131kabilir, itiraz edebilir, akl\u0131na geldi\u011fi gibi hareket eder, akl\u0131na geleni s\xf6yler. Sizin gibi a\u011f\u0131rba\u015fl\u0131l\u0131ktan, sab\u0131rdan, zaman\u0131n g\xfcc\xfcnden ho\u015flanan biri i\xe7in bu durum hi\xe7 de kolay de\u011fildir.","Ko\xe7 erke\u011finin enerjisi sizin i\xe7in fazlas\u0131yla yorucu olabilir. Sizin uzun vadeli vizyonerli\u011finiz kar\u015f\u0131s\u0131nda o daha k\u0131sa vadeli sonu\xe7lar ve bunlara ula\u015fma yolunda m\xfccadeleler pe\u015findedir. Ak\u0131l ve mant\u0131\u011f\u0131n \xf6n planda oldu\u011fu d\xfc\u015f\xfcnceleriniz, s\u0131rad\u0131\u015f\u0131, u\xe7uk fikirleriniz bir s\xfcre sonra Ko\xe7 erke\u011finin s\u0131k\u0131l\u0131p masadan kalkmas\u0131na neden olacakt\u0131r. \xdcstelik deli dolu, hareketli ve enerjik Ko\xe7, enerjisini ak\u0131taca\u011f\u0131 bir y\xf6n bulamazsa patlamaya haz\u0131r bir bomba gibidir. Lider ve \xf6nc\xfc karakteri sizin toplumsal, herkesin iyili\u011fine y\xf6nelik yap\u0131n\u0131z ve \xe7al\u0131\u015fmalar\u0131n\u0131za sekte vurabilir. Sizin gibi her zaman ba\u015fkalar\u0131n\u0131n iyili\u011fini ve refah\u0131n\u0131 da d\xfc\u015f\xfcnen bir ki\u015fi kar\u015f\u0131s\u0131nda kendi beklentilerini \xf6ne koyan biri vard\u0131r. Ortak noktalar\u0131 yakalaman\u0131n zor oldu\u011fu biraz u\u011fra\u015ft\u0131ran bir ili\u015fki olabilir.","Bu kez de kar\u015f\u0131n\u0131zda olduk\xe7a orijinal hatta zaman zaman marjinal olabilen de\u011fi\u015fik ve s\u0131rad\u0131\u015f\u0131 bir erkek var. Sosyal \xe7evresi ve arkada\u015fl\u0131klar\u0131 Kova sevgiliniz i\xe7in olduk\xe7a \xf6nemli olabilir. Bir Kova burcu sevgiliniz varsa, onun arkada\u015f ve dost \xe7evresiyle de anla\u015fman\u0131z \xf6nemlidir. U\xe7uk, ka\xe7\u0131k fikirleri size durduk yere bu da nerden \xe7\u0131kt\u0131 dedirtebilir. De\u011fi\u015fimden ve yenilikten ho\u015flan\u0131r, s\u0131radanl\u0131\u011f\u0131 olduk\xe7a basit ve heyecans\u0131z bulur. Orijinal fikir ve yakla\u015f\u0131mlar\u0131n\u0131zla onun akl\u0131n\u0131 ba\u015f\u0131ndan alabilirsiniz. Ate\u015f g\xfcc\xfcn\xfczle onun fikirlerini, d\xfc\u015f\xfcncelerini aksiyona ge\xe7irmesine destek olursunuz. Ama Kova'n\u0131n bir Sat\xfcrn burcu ve dolay\u0131s\u0131yla zor oldu\u011funu eklemeden ge\xe7meyelim","Ma\u011frur, mert ve korkusuz yap\u0131n\u0131z kar\u015f\u0131s\u0131nda Bal\u0131k sevgilinizin yumu\u015fakl\u0131\u011f\u0131, duygusall\u0131\u011f\u0131, zaman zaman hassas ve narin y\xf6nleri sizde zay\u0131f hissi uyand\u0131rabilir. Oysa bir Bal\u0131k erke\u011fi sahip oldu\u011fu esneklik ve uyum kabiliyeti, her kaba s\u0131\u011fabilen \xf6zellikleriyle asl\u0131nda farkl\u0131 \u015fekilde g\xfc\xe7l\xfcd\xfcr. \xdcstelik merhameti, sevecenli\u011fi ve \u015fefkati ba\u015fka hi\xe7bir burcun erke\u011finde bulunmaz. S\xfcrekli ma\u011fdur ve kurban g\xf6r\xfcn\xfcm\xfcnden s\u0131k\u0131lmazsan\u0131z, a\u015f\u0131r\u0131 duygusall\u0131\u011f\u0131 ve hassasiyeti sizi bunaltmazsa ki bunlar pek de kolay ihtimaller de\u011fildir, bir ili\u015fki kurabilirsiniz. Ayaklar\u0131n\u0131n yere basmamas\u0131, s\xfcrekli hayallere kap\u0131lmas\u0131 zaman zaman onu ciddiye alman\u0131z\u0131 zorla\u015ft\u0131r\u0131r. Sizin sava\u015f\xe7\u0131 ve m\xfccadele yanlar\u0131n\u0131z ona \xe7ok sert gelebilir, bu hassas kad\u0131n\u0131 k\u0131rmamaya \xe7al\u0131\u015f\u0131n.","Ko\xe7 erke\u011finin h\u0131z\u0131na, giri\u015fkenli\u011fine, enerjisine, dinamizmine, hi\xe7bir \u015feyi kolay kabul etmeyen, kendi yolunda direten yap\u0131s\u0131na uyum sa\u011flaman\u0131z kolay de\u011fildir. Bir anda kendinizi farkl\u0131 y\xf6nlere giderken bulabilirsiniz. Birbirini anlayan ve g\xf6ren bir ili\u015fki olmas\u0131 zordur. Ancak y\xfcksek uyum enerjinizle en zor ve \xe7at\u0131\u015fmac\u0131 Ko\xe7 erke\u011fini bile dize getirebilirsiniz. \xdcstelik tart\u0131\u015fmas\u0131z manyetizman\u0131z, g\xfczelli\u011finiz ve cazibeniz en etkili ara\xe7lar\u0131n\u0131zdan biri olabilir. Ancak bu sizi olduk\xe7a yorabilir, maddi ve manevi enerjinizi olduk\xe7a t\xfcketebilir. \xdcstelik Ko\xe7 her ne kadar m\xfccadeleci olsa da ilerlemeyi sever ve bir s\xfcre sonra s\u0131k\u0131labilir. Sizi da\u011f\u0131lm\u0131\u015f bir durumda b\u0131rakmamas\u0131na dikkat etmelisiniz.","\u0130ki Ven\xfcs burcunun birbiriyle uyumu pek de zor de\u011fildir asl\u0131nda. \u0130kinizde tensel hazlardan, cinsellikten zevk al\u0131yorsunuz ve bu ili\u015fkinizi keyifli hale getirebilir. Ancak fazla sabit kalabilirsiniz, yerinden kalkmayan bir ili\u015fkiniz olabilir. Bo\u011fa erke\u011fi keyiflerine olduk\xe7a tutkundur, konfor alan\u0131ndan kolay kolay vazge\xe7mek istemez, oturdu\u011fu yerden kalkmas\u0131 ve hareket etmesi pek kolay de\u011fildir. S\xf6zgelimi koltu\u011fundan kalkmaz, TV kumandas\u0131n\u0131 b\u0131rakmaz, sabah b\u0131rakt\u0131\u011f\u0131n\u0131z yerde ak\u015fam bulabilirsiniz. Bo\u011fa kad\u0131n\u0131n da kendi konfor zonunda benzer \xf6zelliklerde oldu\u011fu g\xf6z \xf6n\xfcne al\u0131n\u0131rsa birbirinizi s\u0131kman\u0131z, ili\u015fkiyi harekete ge\xe7irememeniz gibi durumlar k\u0131sa s\xfcrede kar\u015f\u0131l\u0131kl\u0131 b\u0131kk\u0131nl\u0131\u011fa neden olabilir. Buna ilave sorumluluklar eklenince ili\u015fki \xe7\u0131kmaza girebilir.","Bo\u011fa erke\u011fini \xe7\xf6zmeniz ve kendi taraf\u0131n\u0131za \xe7ekmeniz pek zor de\u011fildir. Beceriklili\u011finiz ve k\u0131vrak zek\xe2n\u0131zla onu kolayca yan\u0131n\u0131za \xe7ekebilirsiniz. \xdcstelik bol ve lezzetli yemekler, tensel hazlar Bo\u011fa erke\u011finin kalbine giden kolay bir yol olabilir. Ancak onu \xe7ok fazla harekete ve esnekli\u011fe zorlamamal\u0131s\u0131n\u0131z. Zira g\xfcven ve sadakat i\xe7inde yerini belirleyip \xe7\u0131kmamak onun i\xe7in \xf6nemlidir. Gezmeyi, hareket etmeyi seven \u0130kizler burcu i\xe7in yerini b\u0131rakmayan sad\u0131k Bo\u011fa erke\u011fi zaman i\xe7inde monoton gelebilir. Bo\u011fa\u2019n\u0131n kendinden emin ve inat\xe7\u0131 tavr\u0131yla her ne kadar yumu\u015fak ve \u0131l\u0131ml\u0131 g\xf6r\xfcnse de kafas\u0131na takt\u0131\u011f\u0131 konuda asla \xf6d\xfcn vermeyi\u015fi de esnek ve de\u011fi\u015fken yap\u0131n\u0131za pek uymayabilir. Zihinsel ve entelekt\xfcel konulardan ho\u015flanan \u0130kizler kad\u0131n\u0131 i\xe7in bu durum olduk\xe7a can s\u0131k\u0131c\u0131 olabilir. Bu ili\u015fki uzun vadede y\xfcr\xfcmesi zor bir ili\u015fki olabilir.","A\u011f\u0131rl\u0131ktan ve zarafetten ho\u015flanan bir kad\u0131ns\u0131n\u0131z, kar\u015f\u0131n\u0131zdaki erkekte ise g\xfc\xe7, kuvvet ve sa\u011flaml\u0131k bekliyorsunuz. Dolay\u0131s\u0131yla bir \u0130kizler erke\u011fi size olduk\xe7a y\xfczeysel gelebilir. Rafine, estetik, sanatsal zevklerinizi, gurme y\xf6nlerinizi, tensel ihtiya\xe7lar\u0131n\u0131z\u0131 kar\u015f\u0131lamas\u0131 zor olabilir. \xc7ok g\xfczel sohbetler, entelekt\xfcel konu\u015fmalar yapabilirsiniz, \xe7ok iyi arkada\u015f olabilirsiniz ancak temel ihtiya\xe7lar\u0131n\u0131z kar\u015f\u0131lanmad\u0131\u011f\u0131nda \u0130kizler erke\u011fi size fazlas\u0131yla havai, de\u011fi\u015fken ve karars\u0131z gelebilir. \xdcstelik hayat boyu bekleyip arad\u0131\u011f\u0131n\u0131z g\xfcven unsuru \u0130kizler erke\u011finde son araman\u0131z gereken \xf6zellik olabilir. Yerinde durmakta bile zorlanan \u0130kizler i\xe7in uzun s\xfcreli, kal\u0131c\u0131 ba\u011fl\u0131l\u0131klar, sadakat haritas\u0131nda farkl\u0131 unsurlar yoksa \u0130kizler erke\u011fi i\xe7in olduk\xe7a zorlay\u0131c\u0131 olabilir.","Su enerjisinin toprak enerjisiyle uyumland\u0131\u011f\u0131 keyifli bir birliktelik olabilir bu ili\u015fki. Yenge\xe7\u2019in hassasiyetleri Bo\u011fa\u2019n\u0131n g\xfcven verene istikrarl\u0131 tutumu her iki tarafa da olduk\xe7a iyi gelirken bu \xe7ift dengeyi bulmakta zorlanmayacakt\u0131r. Bo\u011fa erke\u011fi sizin \u015fefkat ve merhametinizden etkilenecektir. G\xfcven ve sadakati ba\u015f tac\u0131 yapan Bo\u011fa erke\u011fi i\xe7in s\u0131ms\u0131k\u0131 saran kollar\u0131n zaman zaman k\u0131skaca d\xf6n\xfc\u015fmesinin hi\xe7 mi hi\xe7 \xf6nemi yoktur. \xdcstelik Yenge\xe7 kad\u0131n\u0131 ona arad\u0131\u011f\u0131 s\u0131cak, huzurlu yuvay\u0131 sa\u011flayacakt\u0131r. Tek yapmas\u0131 gereken insiyatif konusunda Yenge\xe7\u2019e \xe7ok \xe7ok kar\u0131\u015fmamas\u0131, ili\u015fkinin komutas\u0131n\u0131 ona b\u0131rakmas\u0131d\u0131r ki bu da sorun olmayacakt\u0131r. Birbirini besleyen sakin ve uyumlu bir beraberli\u011finiz olabilir. G\xfczel yemekler ve sofralar bu ili\u015fkin temel ta\u015flar\u0131ndan biridir, birbirinize kilo ald\u0131rabilirsiniz.","Bu asl\u0131nda gayet g\xfczel gidebilecek bir ili\u015fkidir. Bir Bo\u011fa kad\u0131n\u0131 olarak sa\u011flaml\u0131k ve sabitlik olmazsa olmaz beklentileriniz. Sizi harekete ge\xe7irecek bir \xf6nc\xfc bur\xe7, \xf6zellikle duygular ve yemek konusunda da hassas ise, a\u015fk\u0131n\u0131z bir Yenge\xe7 erke\u011fi neden olmas\u0131n. Yenge\xe7 burcu sevgiliniz duygular\u0131n\u0131zdan anlar, sizi \u015fefkatli kollar\u0131yla kucaklayabilir, ihtiya\xe7 duydu\u011funuz s\u0131cak, yak\u0131n yuva ortam\u0131n\u0131 yaratman\u0131z\u0131, g\xfczel ve \u015f\u0131k sofralar kurman\u0131za yard\u0131mc\u0131 olabilir. Ancak Yenge\xe7 burcunun kendi ailesine ve annesine \xf6zellikle d\xfc\u015fk\xfcn olabilece\u011finin alt\u0131n\u0131 \xe7izelim. Sakin ve a\u011f\u0131rba\u015fl\u0131 yap\u0131n\u0131zla bunun \xfcstesinden gelirim diyorsan\u0131z hi\xe7bir s\u0131k\u0131nt\u0131 ya\u015famayabilirsiniz.","Kar\u015f\u0131n\u0131zda en az sizin kadar inat\xe7\u0131 ve dedi\u011fim dedik olabilecek, pohpohlanmaktan, \u015f\u0131mart\u0131lmaktan ve alk\u0131\u015f tutulmaktan ho\u015flanan bir erkek var. Aslan erke\u011fi g\xf6z al\u0131c\u0131 ve \u0131\u015f\u0131lt\u0131l\u0131 duru\u015fu, son derece \xe7ekici, temiz g\xf6r\xfcn\xfcm\xfc, al\u0131ml\u0131 yap\u0131s\u0131yla siz esteti\u011fe \xf6nem veren Bo\u011fa kad\u0131n\u0131n\u0131n g\xf6z\xfcnden ka\xe7mayacakt\u0131r elbet. Ancak buradaki sorun sizin \xf6zellikle keyif, konfor ve estetikle ilgili konularda Aslan burcu sevgiliniz de gurur ve egosuna dokunan konularda burnunuzdan k\u0131l ald\u0131rmayacak olman\u0131zd\u0131r. Ancak kar\u015f\u0131l\u0131kl\u0131 ciddi feragatlerle y\xfcr\xfcyecek bir ili\u015fkiniz olabilir.","Bo\u011fa burcu erke\u011finin \u015fifresini \xe7\xf6zmeniz hi\xe7 de zor de\u011fil. Bir ipucu verelim, ortak zevk ve keyiflerde pekala bulu\u015fabilirsiniz. Bo\u011fa erke\u011finin konforlu rahat e\u011flenceyi sevdi\u011fini unutmay\u0131n. \u0130ki inat\xe7\u0131 burcun birlikteli\u011fi a\u011f\u0131r ve ilerlemesi zor bir ili\u015fkiyi beraberinde getirebilir. Bu a\u011f\u0131rl\u0131k zaman i\xe7inde iki taraf\u0131 da bir \u015fekilde b\u0131kt\u0131rarak \xe7at\u0131\u015fmaya s\xfcr\xfcklenebilir. Aslan s\xfcrekli pohpohlanmaktan, g\xf6steri\u015f ve be\u011fenilmekten ho\u015flan\u0131r. Bo\u011fa\u2019n\u0131n da g\xfczellik ve estetik ile ilgili tak\u0131nt\u0131lar\u0131 vard\u0131r. Fiziksel olarak her zaman bak\u0131ml\u0131 ve g\xfczel olmal\u0131s\u0131n\u0131z. Ayr\u0131ca her ikinizin de konfor ve l\xfcksle ilgili beklentileriniz vard\u0131r. Aslan kad\u0131n\u0131 s\xfcrekli taht\u0131nda krali\xe7e olmak ister. Bu durumu bir \u015fekilde idare etmeye \xe7al\u0131\u015fsa da bir s\xfcre sonra kar\u015f\u0131l\u0131kl\u0131 beklentilerden ve bunlar\u0131n de\u011fi\u015fmemesinden dolay\u0131 bunabilirsiniz.","Bo\u011fa erke\u011finin uyumlu ve sakin yap\u0131s\u0131, estetik y\xf6nden inceli\u011fi ve zarafeti ho\u015funuza giden fakt\xf6rler olacakt\u0131r. Maddi her t\xfcrl\xfc konforu sa\u011flad\u0131\u011f\u0131n\u0131z s\xfcrece, ki \xe7al\u0131\u015fkanl\u0131\u011f\u0131n\u0131z ile bunu yapman\u0131z hi\xe7 de zor olmayabilir, uyumlu ve huzurlu bir beraberli\u011finiz olabilir. Sizin beceriklili\u011finiz ve zek\xe2n\u0131zla i\u015flerini kolayla\u015ft\u0131r\u0131p hayat\u0131n\u0131 daha konforlu k\u0131lman\u0131z onu mutlu edecektir. Rahat\u0131na d\xfc\u015fk\xfcn Bo\u011fa\u2019n\u0131n her dakika ard\u0131n\u0131 arkas\u0131n\u0131 toplaman\u0131z, sahiplenici toprak \xf6zellikleriniz, detaylar i\xe7in g\xf6sterdi\u011finiz titizlik sizi bir anda vazge\xe7ilmez k\u0131labilir. Arad\u0131\u011f\u0131n\u0131z m\xfckemmel ili\u015fkiyi Bo\u011fa ile yaratabilirsiniz.","\u0130ki toprak grubu burcunun anla\u015fmas\u0131 pek de zor de\u011fildir. Birbirinizi pek \xe7ok konuda anlayabilir, dost ve arkada\u015f rahatl\u0131kla olabilirsiniz. Ba\u015fak burcu sevgiliniz uzun s\xfcreli yol arkada\u015f\u0131n\u0131z olabilir, \xfcstelik \xe7al\u0131\u015fkanl\u0131\u011f\u0131yla bekledi\u011finiz maddi zevkleri, keyifli ve rahat ortam\u0131 size sunabilir. Ancak sanat\xe7\u0131 ruhunu, arzu ve tutku dolu y\xf6nleriniz, Ba\u015fak erke\u011finin mekanik, pragmatik, i\u015flev ve fayda odakl\u0131 mant\u0131k anlay\u0131\u015f\u0131yla \xe7ak\u0131\u015ft\u0131\u011f\u0131nda i\u015fler biraz zorla\u015fabilir. Ama Ba\u015fak erke\u011fi pek \xe7ok konuda i\u015finizi kolayla\u015ft\u0131rd\u0131\u011f\u0131ndan uzun s\xfcreli besleyici ve dengeli bir beraberlik d\xfc\u015f\xfcn\xfclebilir. Sanata, m\xfczi\u011fe odaklanmak romantik taraf\u0131n\u0131z\u0131 doyururken Ba\u015fak erke\u011fi zek\xe2s\u0131yla zaten en ba\u015f\u0131ndan \xfczerine gitmesi gereken alan\u0131 ke\u015ffedecek ve bunu uygulayacakt\u0131r.","\u0130ki Ven\xfcs burcunun a\u015fk\u0131 hi\xe7 de fena de\u011fildir. Ortak zevk ve keyif noktalar\u0131nda bulu\u015fabilirsiniz. \u0130kinizin de \xfczerinde fazla sorumluluk yoksa bu ili\u015fki gayet g\xfczel gidebilir. Ancak ortaya ev, i\u015f, para, \xe7ocuk gibi sorumluluklar \xe7\u0131kt\u0131k\xe7a, s\xfcrekli birbirinizin \xfczerine pasl\u0131yor olman\u0131zdan dolay\u0131 problemler \xe7\u0131kabilir. Her ikinizin de keyiflere d\xfc\u015fk\xfcnl\xfc\u011f\xfcn\xfcz ikinizi birbirinize ba\u011flayan zamk gibi. Buna sanat\xe7\u0131 ki\u015fili\u011finiz ve estetik g\xf6r\xfc\u015f\xfcn\xfcz de kat\u0131l\u0131nca g\xfczel bir ili\u015fki gibi g\xf6r\xfcn\xfcyor. Ancak as\u0131l problem sorumluluklar ve i\u015f ba\u015fa d\xfc\u015f\xfcnce ortaya \xe7\u0131kabilir.","Ortak materyel zevkler ve keyifler, Terazi\u2019nin zarafet ve l\xfckse d\xfc\u015fk\xfcnl\xfc\u011f\xfcn\xfc tatmin edebilir. Ancak Terazi sevgiliniz sizinle bekledi\u011fi ho\u015f, \u015firin ve ak\u0131l dolu ikili sohbetleri yapamad\u0131\u011f\u0131nda, onu fikirsel ve d\xfc\u015f\xfcnsel anlamda besleyemedi\u011finizde s\u0131k\u0131labilir, farkl\u0131 ve yeni ili\u015fkilerin pe\u015finden ko\u015fabilir. Kararl\u0131 ve sa\u011flam duru\u015funuzla, g\xfczelliklere d\xfc\u015fk\xfcnl\xfc\u011f\xfcn\xfczle bir Terazi erke\u011finin dikkatini \xe7ekmeniz hi\xe7 de zor de\u011fil. Ancak olaylar\u0131 somuta indirgeme arzunuz, ger\xe7ek\xe7ili\u011finiz ve ayaklar\u0131n\u0131z\u0131n yere basmas\u0131, bulundu\u011funuz ortama ve yere ba\u011fl\u0131l\u0131\u011f\u0131n\u0131z, sosyal ve ili\u015fkileri zaman zaman abartarak \xf6nemseyen Terazi burcuna ili\u015fkinin ilerleyen s\xfcrecinde fazlas\u0131yla monoton gelebilir. Terazi\u2019yi a\u015f\u0131r\u0131 sahiplenmemeye ya da bunu usulca ve uzaktan yapmaya gayret etmeli, onun \u201chava\u201ds\u0131n\u0131 bozmamaya \xf6zen g\xf6stermelisiniz.","Bo\u011fa erke\u011finde arad\u0131\u011f\u0131n\u0131z ve bir t\xfcrl\xfc yakalayamad\u0131\u011f\u0131n\u0131z huzuru, g\xfcveni, sadakati, ba\u011fl\u0131l\u0131\u011f\u0131 bulabilirsiniz. Her daim yan\u0131n\u0131zdad\u0131r, size ihtiya\xe7 duydu\u011funuz g\xfcvenli ve konforlu ortam\u0131 sa\u011flar. \xdcstelik sab\u0131rl\u0131d\u0131r ve kolay kolay istifini bozmaz. Akrep ve Bo\u011fa birbirlerini tamamlayan enerjilerdir. Bo\u011fa erke\u011finde arad\u0131\u011f\u0131n\u0131z g\xfcveni, maddi refah\u0131, sa\u011flaml\u0131\u011f\u0131 ve istikrar\u0131 bulabilirsiniz. Mutlu bir ili\u015fki olabilir. Ancak yine de fazla k\u0131\u015fk\u0131rtmamaya \xe7al\u0131\u015f\u0131n, aksi halde \xf6fkesi kald\u0131rabilece\u011finizin \xfcst\xfcnde olabilir.","Akrep erke\u011finin derin ve gizemli y\xf6nleri, ketum ajandas\u0131 size olduk\xe7a cazip gelebilir. Bu gizem dolu erke\u011fin s\u0131rlar\u0131n\u0131 \xe7\xf6zmek size \xe7ekici g\xf6r\xfcnebilir, asl\u0131nda \xe7o\u011fu Akrep erke\u011fi bu gizem ve \u015feytan t\xfcy\xfcyle kar\u015f\u0131s\u0131ndaki kad\u0131n\u0131 kendine \xe7eker. Onu g\xfczelli\u011finizle ve cazibenizle b\xfcy\xfcleyebilirsiniz ancak bu b\xfcy\xfcy\xfc yans\u0131tmas\u0131n\u0131 ve tepkisini size hemen g\xf6stermesini beklemeyin. Ayr\u0131ca Akrep erke\u011fi sizi cezbetmek i\xe7in gizemli yollar deneyebilir. \xdcstelik size kancay\u0131 bir takt\u0131 m\u0131, ya benimsin ya kara topra\u011f\u0131n misali sizden vazge\xe7mesi olduk\xe7a zor olabilir. Kafas\u0131na takt\u0131\u011f\u0131n\u0131 ele ge\xe7irmek, ele ge\xe7irdi\u011fini b\u0131rakmamak konusunda olduk\xe7a kararl\u0131d\u0131r. Ancak ona bir \xf6m\xfcr boyu g\xfcvenebilirsiniz.","\u0130yimserli\u011finiz, ne\u015feniz, her daim harekete ve etkinli\u011fe haz\u0131r yap\u0131n\u0131z, yerinden k\u0131p\u0131rdamakta zorlanabilen Bo\u011fa erke\u011fine bir miktar fazla gelebilir. Fikirlere, d\xfc\u015f\xfcncelere, ideallere \xf6nem veren yap\u0131n\u0131zla Bo\u011fa ataletini kald\u0131rman\u0131z zor olabilir, her ne kadar size g\xfcven ve sadakat dolu risksiz bir d\xfcnya sunsa da. Keza Bo\u011fa kad\u0131n\u0131n\u0131n ataleti, dinginli\u011fi pek size uygun de\u011fildir. G\xfczelli\u011fi ve seksi bak\u0131\u015flar\u0131yla, bak\u0131ml\u0131 g\xf6r\xfcn\xfcm\xfcyle sizi b\xfcy\xfclese de bir s\xfcre sonra arad\u0131\u011f\u0131n\u0131z canl\u0131l\u0131\u011f\u0131 onda bulamay\u0131nca ili\u015fkiniz teklemeye ba\u015flayabilir. En basitinden Bo\u011fa\u2019y\u0131 yerinden kald\u0131rmak zordur, siz ise kendinizi koyacak yer bulamayacak kadar enerjik, canl\u0131 birisiniz. Bo\u011fa riski sevmezken siz ise ke\u015fif ve macera insan\u0131s\u0131n\u0131z. Epeyce zorlama bir ili\u015fki olabilir.","Evinize, bulundu\u011funuz ortama, yuvan\u0131za olduk\xe7a ba\u011fl\u0131s\u0131n\u0131z, g\xfcven ve g\xfcvenilirlik olgusu sizde olduk\xe7a y\xfcksek. Kar\u015f\u0131n\u0131zda ise de\u011fi\u015fim ve hareketten ho\u015flanan, bulundu\u011fu yerde \xe7abuk s\u0131k\u0131lan ve \u015fartlar ne olursa olsun hayat\u0131nda gezi, seyahat arayan canl\u0131 ve sosyal bir erkek var. Birbirinizi rahat b\u0131rakt\u0131\u011f\u0131n\u0131z \xf6l\xe7\xfcde sorun olmayaca\u011f\u0131n\u0131 s\xf6yleyebiliriz. Zira siz sabit, tutucu hatta zaman zaman muhafazak\xe2r olurken sizin rafine zevklerinizin aksine sala\u015fl\u0131ktan ve bohemden ho\u015flanan bir erkek duruyor. Bu erke\u011fe bir s\xfcre arad\u0131\u011f\u0131 sa\u011flaml\u0131\u011f\u0131 ve kararl\u0131l\u0131\u011f\u0131 sunsan\u0131z da bir s\xfcre sonra onun de\u011fi\u015fiklik ve farkl\u0131l\u0131k aramas\u0131 ve s\u0131k\u0131lmas\u0131, sizin de onun sonu gelmeyen arkada\u015f, dost \xe7evresi, ucu buca\u011f\u0131 olmayan fikirlerinden bunalman\u0131z yollar\u0131n\u0131z\u0131n ayr\u0131lmas\u0131na neden olabilir.","Kar\u015f\u0131n\u0131zda kuralc\u0131, disiplinli, uzun vadeli strateji konusunda uzman, kariyerine ve itibar\u0131na \xf6nem veren bir erkek var. \xdcstelik her ne kadar ciddi duru\u015funun ard\u0131na saklasa da h\u0131rslar\u0131 ve \xf6nc\xfc \xf6zellikleri olduk\xe7a fazla. Maddi g\xfc\xe7ten ho\u015flanman\u0131z, g\xfcven ve istikrar beklentileriniz sa\u011flam ve g\xfcvenilir O\u011flak erke\u011fini sizin i\xe7in olduk\xe7a cazip k\u0131labilir. \xdcstelik a\u015fkta tenselli\u011fe, tutkuya \xf6nem veren O\u011flak erke\u011finin en \xe2\u015f\u0131k oldu\u011fu bur\xe7lar\u0131n ba\u015f\u0131nda Bo\u011fa gelir. Zira ona arad\u0131\u011f\u0131 istikrar\u0131, sabitli\u011fi, g\xfcveni sunan Bo\u011fa kad\u0131n\u0131ndan ba\u015fkas\u0131 olamaz. Bu ili\u015fkide en ciddi handikap, keyfinize, l\xfckse ve konfora \xf6nem veren rahat y\xf6nlerinizin kar\u015f\u0131 tarafta pek de kolay kar\u015f\u0131l\u0131k bulamamas\u0131 olabilir. O\u011flak\u2019\u0131n ciddi ve vakur duru\u015fu size son derece \xe7ekici gelse de kurall\u0131 ve disiplinli bir hayat bir s\xfcre sonra s\u0131k\u0131c\u0131 hale gelebilir.","Her \u015feyden \xf6nce Bo\u011fa en sevdi\u011finiz bur\xe7tur. Bo\u011fa erke\u011fi sa\u011flaml\u0131\u011f\u0131, g\xfcven veren yap\u0131s\u0131 ve bunun yan\u0131nda estetik anlay\u0131\u015f\u0131 ve tensel hazlar\u0131 \xf6nemseyi\u015fiyle \xe2\u015f\u0131k olaca\u011f\u0131n\u0131z biridir. Bo\u011fa\u2019n\u0131n a\u011f\u0131r, sa\u011flam ve g\xfcvenilir y\xf6nleri ili\u015fkinizi tamamlay\u0131c\u0131 niteliktedir. \xdcstelik estetik g\xf6r\xfcn\xfcm\xfc ve uyumlu yap\u0131s\u0131yla da olduk\xe7a dikkatinizi \xe7ekecektir. Onu kurallar\u0131n\u0131z ve planlar\u0131n\u0131zla fazla s\u0131kmamaya \xe7al\u0131\u015f\u0131n. Yine de rahatl\u0131\u011f\u0131 ve konforu yerinde oldu\u011fu s\xfcrece sizi \xe7ok g\xfczel idare edebilir. G\xfczel bir a\u015fk akabinde mutlu bir beraberlik ya\u015fayabilir, ortak maddi zevklerde bulu\u015fabilirsiniz.","Bo\u011fa erke\u011finin dillere destan \xe7ekicili\u011fi ba\u015f d\xf6nd\xfcr\xfcc\xfc olabilir. Bundan sizin de etkilenmeniz bir \xf6l\xe7\xfcde ka\xe7\u0131n\u0131lmazd\u0131r. Ancak zaman ilerledik\xe7e keyfine, konfor alan\u0131na olduk\xe7a \xf6nem veren Bo\u011fa, \xfczerinize bir a\u011f\u0131rl\u0131k gibi \xe7\xf6kebilir. \u0130dare edebildi\u011finiz \xf6l\xe7\xfcde pek de problem yoktur. Bo\u011fa erke\u011fi zor \xf6fkelenir ama \xf6fkelenince de onu kontrol etmek hatta kendisinin kendini kontrol etmesi imk\xe2ns\u0131z gibidir. \xd6te yandan onda arad\u0131\u011f\u0131n\u0131z huzurlu g\xfcveni bulabilirsiniz. Maddi ihtiya\xe7lar\u0131n\u0131z\u0131 kar\u015f\u0131lamaktan \xe7ekinmeyecektir. Fikirlerinizin de yere basmas\u0131n\u0131, d\xfc\u015flerinizi somutla\u015ft\u0131rman\u0131z\u0131 sa\u011flayabilir. Ancak onun haz ve keyif anlay\u0131\u015f\u0131na bir \u015fekilde uyum sa\u011flaman\u0131z gerekiyor.","Kova burcunun s\u0131ra d\u0131\u015f\u0131 ve u\xe7uk ka\xe7\u0131k halleri size k\u0131sa s\xfcrede olduk\xe7a cazip gelebilir. Bu farkl\u0131 erke\u011fin \xe7evresinde de pek \xe7ok ki\u015fi vard\u0131r ve s\xfcrekli arkada\u015f gruplar\u0131n\u0131n, sosyal kurulu\u015flar\u0131n, dernek, vak\u0131f gibi toplumsal olu\u015fumlar\u0131n i\xe7inde yer al\u0131r. Kova sevgiliniz \xe7evrenizin de bir anda dolmas\u0131na ve geni\u015flemesine yard\u0131mc\u0131 olur, sizi bir anda sosyal olarak aktif biri k\u0131labilir. Somut ve ger\xe7ek\xe7i yakla\u015f\u0131mlar\u0131 seven yap\u0131n\u0131z, bu kadar u\xe7uk, ka\xe7\u0131k ve yenilik\xe7i yakla\u015f\u0131m\u0131 ne kadar kald\u0131rabilece\u011fini kendinize sormal\u0131s\u0131n\u0131z. Ayr\u0131ca tutkular\u0131 ve sahiplenmeyi seven yap\u0131n\u0131z\u0131n sevgilinizi bir s\xfcr\xfc ba\u015fka ki\u015fiyle, dopdolu bir sosyal \xe7evreyle payla\u015fmay\u0131 ne kadar kabullenebilece\u011fini de iyice tart\u0131p de\u011ferlendirmelisiniz. Bu sorular\u0131n cevaplar\u0131n\u0131 kar\u015f\u0131layabildi\u011finiz \xf6l\xe7\xfcde bu ili\u015fkiyi y\xf6netebilirsiniz.","Bo\u011fa\u2019n\u0131n sakinli\u011fi, verdi\u011fi huzur hassas ruhunuza iyi gelebilir. Ancak materyalist y\xf6nlerini, keyiflerini \xf6nde tutan yan\u0131n\u0131, kendi rahat\u0131 i\xe7in para harcamay\u0131 sevmesini ancak ba\u015fkalar\u0131n\u0131 g\xf6z ard\u0131 edebilmesini bir s\xfcre sonra kald\u0131rman\u0131z pek de kolay olmayabilir. Ancak birbirinize maddi ve manevi anlamda b\xfcy\xfck \u015fans ve k\u0131smet getirebilirsiniz. Bo\u011fa erke\u011fiyle birbirinizi besleyen bir ili\u015fki modeli yaratabilirsiniz. Sizin duygusall\u0131\u011f\u0131n\u0131z ve hassasiyetleriniz onu yumu\u015fatacakt\u0131r ama yine de maddeye, tensel zevklere, paraya d\xfc\u015fk\xfcnl\xfc\u011f\xfcn\xfc g\xf6z ard\u0131 etmemelisiniz.","Toprak - Su elementlerinin ili\u015fkisi birbirini her zaman besleyicidir. Bo\u011fa\u2019n\u0131n sabitli\u011fi, Bal\u0131k\u2019\u0131n de\u011fi\u015fkenli\u011fi de iyi gelir, zira ona esneklik ve ekstra duyarl\u0131l\u0131k katar. Bal\u0131k cazibesiyle Bo\u011fa\u2019y\u0131 adeta bir m\u0131knat\u0131s gibi kendine \xe7ekip b\xfcy\xfcleyebilir. Ancak de\u011fi\u015fken, zaman zaman belirsiz durumlar ve \xe7o\u011fu zaman flu ve bazen de kaotik ilerleyen ili\u015fkiniz istikrar\u0131 seven ruhunuza ters d\xfc\u015febilir. Zira Bal\u0131k sevgilinizi tutabilmeniz, \u015fekillendirebilmeniz, bir kaba koyman\u0131z olduk\xe7a zor olabilir. Ancak ortak yarat\u0131c\u0131, sanatsal zevklerde bulu\u015fabilirsiniz. Bal\u0131k kad\u0131n\u0131n\u0131n duyarl\u0131, hassas ve sanat\xe7\u0131 ki\u015fili\u011fi sizi etkileyebilir ve yelkenleri suya indirmenizi sa\u011flayabilir. \xdcstelik Bal\u0131k erke\u011finin merhametinden, fedakarl\u0131\u011f\u0131ndan ve vericili\u011finden olduk\xe7a ho\u015flanabilirsiniz.","Bu ili\u015fki ortak entelekt\xfcel zevkler, bol konu\u015fma, sohbet, yolculuklar a\xe7\u0131s\u0131ndan harika olabilir. \u0130kizler erke\u011fi duygusal beklentileri \xe7ok olmayan, kafaca anla\u015fabilece\u011finiz hafif bir ili\u015fki sunar size. Onun da sizin gibi envai \xe7e\u015fit ilgi alan\u0131 vard\u0131r, t\xfcrl\xfc t\xfcrl\xfc konulardan ho\u015flan\u0131r, her konuda, her \u015feye m\xfcdahil olmak ama bunu daha \xe7ok merak\u0131n\u0131 gidermek i\xe7in yapmak ister. Ancak ili\u015fkiniz somut bir noktaya varamamak, baz\u0131 fikirleri hayata ge\xe7irememek, \xe7ok fazla hareket, gezme, tozma i\xe7inde belli bir amaca odaklanamamak, hedef belirleyememek gibi handikaplardan dolay\u0131 sekteye u\u011frayabilir, zarar g\xf6rebilir ya da bitebilir.","Bu k\u0131p\u0131r k\u0131p\u0131r erkek size fazlas\u0131yla de\u011fi\u015fken, karars\u0131z g\xf6r\xfcnebilir. Sizin duygusal \xe7alkant\u0131lar\u0131n\u0131z onun u\xe7ar\u0131 havas\u0131yla \xf6rt\xfc\u015fmesi zordur. Sizi anlama, duygular\u0131n\u0131z\u0131 de\u011ferlendirme konusunda bekledi\u011finiz sabr\u0131 ve metaneti g\xf6stermeyebilir. Her \u015feyi fikirleriyle tartan ve pratik \xe7\xf6z\xfcmlere ula\u015fmaya seven \u0130kizler erke\u011fi Yenge\xe7\u2019in a\u011f\u0131r duygusall\u0131\u011f\u0131n\u0131 ve hassasiyetini anlamakta zorlanabilir. Ortak noktalar\u0131 yakalaman\u0131z bu a\xe7\u0131dan olduk\xe7a zor olabilir. Siz evi ve sar\u0131p sarmalayan duygusal ortam\u0131n\u0131 tercih ederken o d\u0131\u015far\u0131da gezip tozmak, seyahat etmek, spor yapmak isteyecektir. \u0130kizler\u2019in ele avuca s\u0131\u011fmayan u\xe7ar\u0131 y\xf6nleri, havaili\u011fi, dost ve arkada\u015f canl\u0131s\u0131 \xf6zellikleri ev ve aile hayat\u0131ndan ho\u015flanan Yenge\xe7 i\xe7in biraz zor olabilir. \xdcstelik Yenge\xe7 ailesine ve \xf6zellikle de annesine a\u015f\u0131r\u0131 d\xfc\u015fk\xfcnd\xfcr. Bu gelenek\xe7i ba\u011f\u0131ml\u0131l\u0131k, ba\u011f\u0131ms\u0131zl\u0131ktan haz eden ruhunuza zaman i\xe7inde olduk\xe7a ters gelebilir.","Zek\xe2n\u0131zla bu erke\u011fi fethetseniz de Yenge\xe7'in sabr\u0131, sessizli\u011fi, zaman zaman yava\u015fl\u0131\u011f\u0131 ve a\u011f\u0131rl\u0131\u011f\u0131 sizin de\u011fi\u015fken ve u\xe7ar\u0131 karakterinize zaman zaman olduk\xe7a ters gelebilir, sizin i\xe7in yorucu olabilir. Yenge\xe7 erke\u011finin a\u015f\u0131r\u0131 duyarl\u0131l\u0131\u011f\u0131, s\xfcrekli bir anlam \xe7\u0131karmaya \xe7al\u0131\u015fan karakteri, \u015fefkati size fazlas\u0131yla a\u011fdal\u0131 ve duygusal gelebilir. Son derece hassas, duyarl\u0131, koruyucu, kollay\u0131c\u0131, t\u0131pk\u0131 bir yengecin k\u0131ska\xe7lar\u0131 gibi sizi saran bu erkek yumu\u015fak karn\u0131n\u0131 g\xf6stermeyebilir ve kendini ele vermeyebilir. Sizin gibi konu\u015fmay\u0131 seven biri i\xe7in bu s\u0131r dolu yap\u0131 ve ketumluk bir s\xfcre sonra can s\u0131k\u0131c\u0131 bir hal alabilir. \xdcstelik lider ve \xf6nc\xfc \xf6zelliklere de sahip ve bir \u015feyi akl\u0131na koydu\u011funda ya da bir konuda sebat etti\u011finde hedefine fazla g\xf6stermeden, belli etmeden, dolayl\u0131 yollardan yan yan ilerleyerek ula\u015fabilen bu erkekle u\u011fra\u015fman\u0131z sand\u0131\u011f\u0131n\u0131zdan \xe7ok daha zor olabilir. \xd6te yandan ailesine, ge\xe7mi\u015fine, manevi k\xf6k ve de\u011ferlerine son derece ba\u011fl\u0131 Yenge\xe7 erke\u011fi sizi kolay kolay b\u0131rakmayacak ve her daim yan\u0131nda olman\u0131z\u0131 kollayan sad\u0131k bir e\u015f olacakt\u0131r.","\xd6zg\xfcveniniz ve al\xe7akg\xf6n\xfcll\xfcl\xfc\u011f\xfcn\xfczle her \u015feye merakl\u0131 bir \u0130kizler erke\u011finin dikkatini \xe7ekebilirsiniz. Ancak bu erke\u011fin her \u015feyi \xe7ok y\xfczeysel ele alabilece\u011fini, \xe7e\u015fitlili\u011fe, de\u011fi\u015fkenli\u011fe, kolay ula\u015f\u0131labilir \u015feylere ilgi duydu\u011funu unutmay\u0131n. \u0130kizler kad\u0131n\u0131n\u0131n bitmek t\xfckenmek bilmeyen fikirleri, zaman zaman kendini tutamay\u0131p \xe7ok fazla konu\u015fmas\u0131, zek\xe2s\u0131yla ortada bir \u015fey g\xf6r\xfcnmese de etraf\u0131n\u0131 manip\xfcle etmeye \xe7al\u0131\u015fmas\u0131, daha basit, daha d\xfcz d\xfc\u015f\xfcnen Aslan y\xfcre\u011fine yabanc\u0131 gelebilir. T\xfcm bu zihinsel aktiviteyi son derece gereksiz bulabilirsiniz. Ancak yine de birbirinize alan tan\u0131d\u0131\u011f\u0131n\u0131z \xf6l\xe7\xfcde s\xfcrd\xfcrebilece\u011finiz bir ili\u015fki olabilir. \u0130kizler\u2019in ayaklar\u0131n\u0131 yere basmas\u0131na yard\u0131mc\u0131 olursunuz. O da sizin her anlamda daha esnek ve hareketli olman\u0131z\u0131 sa\u011flar.","G\xf6steri\u015fli hareketleri, dramatik y\xf6nleri, renkli ki\u015fili\u011fiyle Aslan erke\u011finin dikkatini \xe7ekmeniz hi\xe7 de g\xfc\xe7 de\u011fildir. Onu g\xfczel s\xf6zleriniz, konu\u015fkanl\u0131\u011f\u0131n\u0131z, bahsetti\u011finiz t\xfcrl\xfc t\xfcrl\xfc ilgin\xe7 konuyla mest edebilirsiniz. Ancak bu ili\u015fkinin devam\u0131 i\xe7in daha fazlas\u0131 gerekebilir. Zira bir Aslan erke\u011fi keyiflerine, ki\u015fisel zevklerine bir bak\u0131ma saltanat\u0131na olduk\xe7a d\xfc\u015fk\xfcnd\xfcr. Aslan burcu, inat\xe7\u0131 ki\u015fili\u011fi ve zaman zaman kendinden ba\u015fkas\u0131n\u0131 g\xf6rememesiyle sizi k\u0131sa bir s\xfcre sonra bezdirebilir. De\u011fi\u015fken ruh haliniz, s\xfcrekli gezmekten ho\u015flanan taraf\u0131n\u0131z, her bilgiye a\xe7 merak\u0131n\u0131z ise zaman i\xe7inde onun i\xe7in yorucu olabilir, zira ona g\xf6re zaten her \u015fey elinin alt\u0131nda ve eksiksizdir, bunca hareketi gereksiz bulabilir. \u0130kizler kad\u0131n\u0131 ba\u015flarda bu ili\u015fki idare etse de zaman i\xe7inde Aslan burcunun egosuna, sabit fikirlili\u011fine, benmerkezci yakla\u015f\u0131m\u0131na yenik d\xfc\u015febilir.","Titiz, \xe7al\u0131\u015fkan, pratik, becerikli ve h\xfcnerli Ba\u015fak erke\u011fi i\xe7in zeki, entelekt\xfcel ve bilgili karakteriniz olduk\xe7a enteresan gelecektir. \xdcstelik bu burcun hayat\u0131n\u0131z\u0131 \xe7ok\xe7a kolayla\u015ft\u0131ran \xe7al\u0131\u015fkan \xf6zelliklerini takdirle kar\u015f\u0131layabilirsiniz. Ortak noktan\u0131z ikinizin de y\xf6netici gezegeninizin zek\xe2y\u0131 ve akl\u0131 temsil eden Merk\xfcr olmas\u0131. Aran\u0131zdaki zek\xe2 oyunlar\u0131, zekice espriler, n\xfcktedanl\u0131\u011f\u0131n\u0131z bu ili\u015fkinin ate\u015fini s\xfcrekli canl\u0131 tutabilir. Yaln\u0131z Ba\u015fak burcunun a\u015f\u0131r\u0131 titiz, detayc\u0131, hesap konusunda k\u0131l\u0131 k\u0131rk yaran taraflar\u0131n\u0131 ise biraz g\xf6rmezden gelmeniz gerekebilir. Ortak ilgi alanlar\u0131 yaratmak aran\u0131zdaki \xe7ekimi g\xfc\xe7lendirecektir. Sa\u011fl\u0131k, \u015fifa, do\u011fru ve dengeli beslenme ile ilgili her t\xfcrl\xfc konu, bitkisel aromatik \xe7aylar, k\xfcrler ve her t\xfcrden bak\u0131m Ba\u015fak sevgilinizin ilgisini \xe7ekece\u011finden emin olabilirsiniz. K\xfc\xe7\xfck sevin\xe7lerle onu mutlu edebilirsiniz. Kar\u015f\u0131l\u0131\u011f\u0131nda her ihtiyac\u0131n\u0131z\u0131 sizden \xf6nce d\xfc\u015f\xfcnmekle kalmay\u0131p uygulamaya ge\xe7iren geride b\u0131rakt\u0131klar\u0131n\u0131z\u0131 toparlayan, unuttuklar\u0131n\u0131z\u0131 hat\u0131rlatan birini bulabilirsiniz.","Kar\u015f\u0131n\u0131zda sizin gibi Merk\xfcr y\xf6netimindeki bur\xe7tan zeki bir erkek var. \u0130leti\u015fim becerileriniz, k\u0131vrak zek\xe2n\u0131z kar\u015f\u0131l\u0131kl\u0131 bu ili\u015fkiyi diri tutabilir. Ancak her ikiniz de olduk\xe7a zeki oldu\u011funuzdan birbirinizi kand\u0131rman\u0131z zordur, istekler do\u011frultusunda kar\u015f\u0131l\u0131kl\u0131 rekabet de ortaya \xe7\u0131kabilir. Her ili\u015fkide bir taraf\u0131n \xf6d\xfcn vermesi gerekti\u011fi d\xfc\u015f\xfcn\xfcld\xfc\u011f\xfcnde bu ili\u015fkide \xf6d\xfcn verecek taraf\u0131 tespit etmek olduk\xe7a zordur. \u0130kizler erke\u011fi entelekt\xfcel ve zihinsel olarak kendisini uyaran ve ilgisini \xe7eken aktivitelerden ho\u015flan\u0131r. Sizin i\xe7in ise bunca \u015feyin bir anlam\u0131 olmal\u0131d\u0131r. Bir eksi\u011fi veya gedi\u011fi kapamaya, bir bo\u015flu\u011fu doldurmaya yaramal\u0131d\u0131r, hemen her \u015fey i\u015flevsel olmal\u0131 ya da bir \u015feye hizmet etmelidir. Bir s\xfcre sonra Ba\u015fak kad\u0131n\u0131 \u0130kizler erke\u011fini olduk\xe7a y\xfczeysel bulabilir. O da sizin bu kadar ayr\u0131nt\u0131ya neden bu kadar takt\u0131\u011f\u0131n\u0131z\u0131 anlamakta zorlanabilir.","\u0130kizler erke\u011finin zek\xe2s\u0131, mant\u0131\u011f\u0131, konu\u015fkanl\u0131\u011f\u0131, entelekt\xfcelli\u011fi Terazi kad\u0131n\u0131 i\xe7in olduk\xe7a caziptir. Kendi fikirlerini, d\xfc\u015f\xfcncelerini besleyen yakla\u015f\u0131m\u0131 \u0130kizler erke\u011finde bulur. \u0130kizler u\xe7ar\u0131, havai y\xf6nleri, zeki esprileri, hayat\u0131 \xe7ok da ciddiye almayan g\xf6r\xfcnt\xfcs\xfcyle ba\u015fta ho\u015funuza gidebilir. \xdcstelik bu erkek size hayrand\u0131r da. \xc7ok g\xfczel bir zihinsel ve entelekt\xfcel birliktelik kurabilirsiniz. Sohbetler edebilir, bol bol konu\u015fabilirsiniz. \u0130kizler taraf\u0131n\u0131n de\u011fi\u015fken yap\u0131s\u0131n\u0131 kilidini \xe7\xf6zd\xfc\u011f\xfcn\xfczde, onu nas\u0131l idare etmeniz gerekti\u011fini bulmu\u015f say\u0131l\u0131rs\u0131n\u0131z.","Terazi erke\u011fi zarafet, kibarl\u0131\u011f\u0131, ak\u0131lc\u0131 ve mant\u0131kl\u0131 y\xf6nleri ve \u015f\u0131k tarz\u0131yla g\xf6nl\xfcn\xfcz\xfc fethedebilir. G\xfczel s\xf6zleri, rafine zevkleri cazip gelmeyecek gibi de de\u011fildir. \xdcstelik birliktelik ve birlikte var olabilme hali onun i\xe7in olduk\xe7a \xf6nemlidir, asla yaln\u0131z olmak istemez ve yan\u0131nda her zaman sevgilisi, e\u015fi veya partneri olsun ister. Birlikte yazd\u0131\u011f\u0131n\u0131z g\xfczel yaz\u0131lar\u0131, \u015fiirleri payla\u015farak, her konuda sohbet edip konu\u015farak keyifli zaman ge\xe7irebilirsiniz. Bu ili\u015fkinin handikaplar\u0131ndan biri her \u015feyin fazla havada kalmas\u0131, ger\xe7e\u011fe ve somuta d\xf6n\xfc\u015ft\xfcr\xfclememesi olabilir. Her ikinizin de mant\u0131\u011fa ve akla dayal\u0131 yakla\u015f\u0131m\u0131 duygulardan yoksun, tutkular\u0131n alevlenemedi\u011fi bir ortam yaratabilir. Yine de ortak noktalar\u0131 tutturdu\u011funuzda bu ili\u015fki ger\xe7ekten harika olabilir.","Akrep erke\u011fiyle sizi bulu\u015fturan ikinizin de merak duygunuz olmal\u0131. Ancak siz bir konudan di\u011ferine ge\xe7erken, Akrep sevgilinizi ula\u015ft\u0131\u011f\u0131 sonu\xe7lar kolay kolay asla tatmin etmez. Her \u015feyi derinine sorgulamaya ve ortaya \xe7\u0131karmaya son derece merakl\u0131d\u0131r. Dolay\u0131s\u0131yla sizin belki de hi\xe7 dikkat etmeden s\xf6yledi\u011finiz s\xf6zler ve sergiledi\u011finiz davran\u0131\u015f Akrep erke\u011fi taraf\u0131ndan tahmin edebilece\u011finizin \xf6tesinde bir derinlikte ve manada alg\u0131lanabilir. Haliyle bu durum ikiniz aras\u0131nda etrafl\u0131ca sorunlara neden olabilir. \u0130li\u015fkinizi merak uyand\u0131ran konular, ilgin\xe7 bilgiler, bir miktar gizem hatta entrika taban\u0131na oturtabildi\u011finiz s\xfcrece iyi bir ili\u015fki olabilir ancak bunun yan\u0131nda sevgilinizin dikkatini da\u011f\u0131tabilecek konular bulman\u0131z sa\u011fl\u0131kl\u0131 olabilir, metafizik konular, \xf6te d\xfcnya ya da psikolojik incelemeler, ruhsal analizler tam da ona g\xf6redir.","\u0130kizler erke\u011fi olduk\xe7a merakl\u0131d\u0131r, ancak bu merak daha \xe7ok bilgi edinmeye, g\xfcncel kalmaya y\xf6neliktir. Bir s\xfcre sonra sordu\u011fu soruyu bile ciddiye almaz \u0130kizler erke\u011fi. Ancak bu ili\u015fkide \u0130kizler erke\u011finin hafif, u\xe7ar\u0131 ve zaman zaman pervas\u0131z yakla\u015f\u0131mlar\u0131 sizin her \u015feyde bir gizem, derinlik ve anlam arayan taraf\u0131n\u0131za \xe7ok y\xfczeysel gelebilir. \u0130kizler\u2019in en \xe7ok da her \u015feye olan merak\u0131 dikkatinizi ve ilginizi \xe7eker. Zira \u0130kizler kad\u0131n\u0131 hemen her \u015feyi an\u0131nda \xf6\u011frenmek, bilgi almak ister ancak \xe7ok derinine inmez. O anda anl\u0131k merak\u0131n\u0131 gidermesi, tatmin etmesi yeterlidir. Siz ise her yapt\u0131\u011f\u0131n\u0131z i\u015fte, her giri\u015fiminizde derinlik, tutku ve \xe7ok daha fazlas\u0131n\u0131 arars\u0131n\u0131z. Dolay\u0131s\u0131yla u\xe7ar\u0131 \u0130kizler bir s\xfcre sonra size yetmeyebilir.","Yay erke\u011finin \xe7ok y\xf6nl\xfcl\xfc\u011f\xfc, \xf6zg\xfcrl\xfck\xe7\xfc ve rahat karakteri, g\xf6nl\xfc zenginli\u011fi ve gezmekten keyif ve mutluluk duymas\u0131, dikkatinizi ve ilginizi \xe7ekmeyecek gibi de\u011fildir. O da sizin gibi a\u011f\u0131rl\u0131ktan, s\xfcr\xfcncemede kalan, bekleyen i\u015flerden, rutinden ve ayn\u0131l\u0131ktan \xe7ar\xe7abuk s\u0131k\u0131l\u0131r. Entelekt\xfcel y\xf6nleriniz, ho\u015f sohbetiniz, bilgi birikiminizle hem Yay\u2019\u0131n ilgisini \xe7ekebilir hem de ili\u015fkinizi ate\u015fleyebilirsiniz. Ortak gezme, seyahat ve \xf6\u011frenme merak\u0131n\u0131z ili\u015fkinizi olduk\xe7a uyumlu bir kombinasyon haline getirebilir. Birbirinizi tamamlayan bir \xe7ift olman\u0131z an meselesi olabilir. Zira her ikinizin de ortak noktas\u0131nda bolca hareketlilik, yerinde duramama, sportif ve fiziksel aktivite var. Yay burcu, \u0130kizler\u2019in hiperaktifli\u011fine bir miktar macera ve ke\u015fif duygusu katarken, \u0130kizler de zek\xe2 ve esneklik getirir ki, uyum yakaland\u0131\u011f\u0131nda tad\u0131ndan yenmeyen bir ili\u015fki do\u011fabilir.","\u0130kinizin de hareketli, esnek, de\u011fi\u015fken, uyum g\xfcc\xfc y\xfcksek y\xf6nleriniz birbirinizi olduk\xe7a tamamlay\u0131c\u0131d\u0131r. Birbirini besleyen harika bir ili\u015fki ortaya koyabilirsiniz. \u0130kizler erke\u011finin konu\u015fma ve ilgi duyduklar\u0131n\u0131 sizi aktarma ve anlatma, merak olgusunu payla\u015fmas\u0131na imk\xe2n tan\u0131mal\u0131s\u0131n\u0131z. Birlikte \xe7ok \u015fey \xf6\u011frenebilir, her yeri gezebilirsiniz. Siz bilgeli\u011finizle \u0130kizler erke\u011fine \xe7ok \u015fey \xf6\u011fretirken onun zeki, parlak, ak\u0131lc\u0131 ve becerikli y\xf6nlerinin hayat\u0131n\u0131z\u0131 kolayla\u015ft\u0131rmas\u0131ndan ho\u015fnut olursunuz. \u0130kinizin de kafay\u0131 belirli \u015feylere takmay\u0131\u015f\u0131n\u0131z, konular\u0131n \xfczerinde durmay\u0131\u015f\u0131n\u0131z, \u0130kizler\u2019in bilgisi ve Yay\u2019\u0131n bilgeli\u011fi bu ili\u015fkiyi capcanl\u0131 tutabilir.","\u0130kizler erke\u011finin hafifli\u011fi, ele avuca gelmeyi\u015fi, de\u011fi\u015fken halleri sadece sizi de\u011fil hayatta hemen hi\xe7bir \u015feyi ciddiye almay\u0131\u015f\u0131 ciddi, sorumlu, planl\u0131 yap\u0131n\u0131z\u0131 hasta edebilecek \xf6l\xe7\xfcde olabilir. Onu anlaman\u0131z hi\xe7 de kolay olmayabilir. Hem kendinizi hem de ili\u015fkinizi \xe7ok\xe7a zorlaman\u0131z gerekebilir. Sab\u0131r bu ili\u015fkide en g\xfc\xe7l\xfc silah\u0131n\u0131z olabilir. \u0130kizler erke\u011finin s\xf6zleri ve hafif ve \xfczerinize a\u011f\u0131rl\u0131k bindirmeyen y\xf6nleri ruhunuzu ok\u015fasa da zaman i\xe7inde sabr\u0131n\u0131z\u0131 zorlayabilir. Zira hi\xe7bir plan\u0131n\u0131za, kural\u0131n\u0131za riayet etmek istemeyecek, akl\u0131n\u0131n esti\u011fi y\xf6ne gitmek isteyecektir.","O\u011flak erke\u011fi ciddiyeti, vakurlu\u011fu, sa\u011flaml\u0131\u011f\u0131 ile g\xf6z doldurur. \xdcstelik g\xfcvenilir ve sa\u011flam duru\u015fludur. Dayan\u0131kl\u0131 ve uzun vadeli bir ili\u015fki i\xe7in ondan iyisi olmayabilir. Zira hemen her konu \xfczerinde \xf6nemle durulmas\u0131 gerekecek kadar ciddidir, hi\xe7bir \u015fey kolay kolay basite indirgenemez, hafif\xe7e ele al\u0131namaz. Bu durum aran\u0131zdaki ili\u015fkiye mesafeleri do\u011fal yoldan getiriverir. Bir de bakm\u0131\u015fs\u0131n\u0131z O\u011flak sevgiliniz sizden gittik\xe7e uzakla\u015fm\u0131\u015f, kendini ciddi i\u015f ve sorumluluklar\u0131n\u0131n aras\u0131na g\xf6mm\xfc\u015f. Mesafenin O\u011flak erke\u011fi i\xe7in \xf6nemli oldu\u011funu akl\u0131n\u0131zdan \xe7\u0131karmaman\u0131z gerekiyor. Fazla yak\u0131nla\u015fmaya, samimi veya senlibenli olmaya \xe7al\u0131\u015fmay\u0131n ve zaman onlar i\xe7in son derece \xf6nemli oldu\u011fundan e\u011fer \xe7ok s\u0131cakkanl\u0131ysa bunu zamana b\u0131rak\u0131n. Yine de siz her ne kadar ona ula\u015fmaya \xe7al\u0131\u015fsan\u0131z da bir miktar duvar\u0131 hemen \xf6r\xfcverecektir. En iyisi oldu\u011fu gibi kabullenmek. Onun i\xe7in i\u015finin ve kariyerinin \xf6nemli oldu\u011fu akl\u0131n\u0131zdan \xe7\u0131karmamal\u0131s\u0131n\u0131z. Sorumluluklar\u0131, planlar\u0131, kurallar\u0131 \xf6n plandad\u0131r. Sayg\u0131 ve resmiyet beklentilerini de hafife almamal\u0131s\u0131n\u0131z. Aksi halde i\u015finiz olduk\xe7a zor olabilir.","\u0130ki hava grubu burcunun anla\u015fmas\u0131 her zaman do\u011fal ve beklenen bir sonu\xe7tur. Fikren olduk\xe7a iyi anla\u015fabilen bir ikili olabilirsiniz. Aran\u0131zda s\u0131k\u0131 bir dostlu\u011fa dayal\u0131 bir ba\u011f kurabilirsiniz. Bunun sonucunda ona bir anda a\u015f\u0131k da olabilirsiniz. Ancak fikirlerin, hayallerin havada kalmas\u0131 bu ili\u015fkinin bir handikap\u0131 olabilir. Oysa entelekt\xfcel boyutta m\xfckemmel anla\u015fabilirsiniz. Konu\u015fabilece\u011finiz binlerce konu olabilir. Sabahlara kadar durmadan sohbet edebilirsiniz. Ancak \u0130kizler d\xfc\u015f\xfcncelerini eyleme d\xf6kmede olduk\xe7a zorlan\u0131r, her \u015fey havada kal\u0131r onun g\xf6z\xfcnde. Siz ise somutla\u015ft\u0131rmaya, bunun i\xe7in \xe7al\u0131\u015fmaya her daim haz\u0131rs\u0131n\u0131zd\u0131r. Yine de uyumlu bir beraberliktir.","Kova erke\u011finin sosyal \xe7evresi, her kesimden geni\u015f arkada\u015f kitlesi onun sizinle kar\u015f\u0131la\u015fmas\u0131nda en \xf6nemli etken olabilir. Siz de arkada\u015fl\u0131\u011f\u0131, sohbeti, konu\u015fmay\u0131, payla\u015fmay\u0131 seven bir bur\xe7sunuz. Ancak Kova'n\u0131n bir Sat\xfcrn burcu oldu\u011funu unutmamal\u0131s\u0131n\u0131z, sorumluluklar\u0131 \xf6zellikle de i\xe7inde bulundu\u011fu sosyal ortam ve \xe7evreyle ba\u011flant\u0131l\u0131ysa onun i\xe7in a\u015f\u0131r\u0131 \xf6nemlidir. Kova i\xe7in aile arkada\u015flar\u0131, dostlar\u0131 ve sosyal \xe7evredir. Ev insan\u0131 olmad\u0131\u011f\u0131 gibi evde \xe7ekirdek aile i\xe7inde kalmaktan da haz etmez ve d\xfc\u015f\xfcnce ve fikir birli\u011fi i\xe7inde oldu\u011fu ki\u015fileri ve dostlar\u0131n\u0131 evde g\xf6rmek ister. D\xfc\u015f\xfcncelerin konu\u015fuldu\u011fu geni\u015f masalar\u0131, s\u0131cak bir yuvaya tercih ederbilir. Sosyal duyarl\u0131l\u0131klar\u0131 olan bir marjinal ve aktivist olabilir. Toplumun iyili\u011fini g\xf6zetir. Bu u\u011furda sevgisini ve a\u015fk\u0131n\u0131 feda bile edebilir. Sosyal gruplar\u0131, ama\xe7lar\u0131 ve hedefleri ile aras\u0131na girmemeye \xf6zen g\xf6stermelisiniz.","\u0130kinizin de de\u011fi\u015fken, uyumlu, esnek ve adaptasyonu g\xfc\xe7l\xfc olmas\u0131 sizi birbirinize \xe7eken ve ba\u011flayan en b\xfcy\xfck etmenlerden birka\xe7\u0131d\u0131r. Kar\u015f\u0131l\u0131kl\u0131 anlay\u0131\u015f\u0131n \xf6n planda oldu\u011fu bir beraberlik olabilir. Bal\u0131k burcunun herkesin en az bir yan\u0131ndan ho\u015flanabilmeleri kuvvetle muhtemeldir, ona g\xf6re herkesin sevilebilecek en az bir y\xf6n\xfc vard\u0131r ve bu onun i\xe7in yeterli ve mutlu edici bir fakt\xf6r olabilir. Hal b\xf6yle olunca kendinizi \xe7ok da \xf6zel hissetmeme gibi bir durumla kar\u015f\u0131la\u015fma olas\u0131l\u0131\u011f\u0131n\u0131z olabilir. Bal\u0131k erke\u011finin sevdi\u011fi herkes i\xe7in kendini feda etmeye haz\u0131r olu\u015fu, kendini kalabal\u0131klara duygusal a\xe7\u0131dan ve manen tamamen b\u0131rakmas\u0131 ve onlar i\xe7in her \u015feyi yapmaya g\xf6n\xfcll\xfc duru\u015fu size zaman zaman anlams\u0131z ve gereksiz g\xf6r\xfcnebilir. Ancak Bal\u0131k erke\u011finin c\xf6mertli\u011fi, merhameti sizi mutlu edecektir.","Her ikinizin de de\u011fi\u015fken ve esnek y\xf6nleriniz, uyumlu taraflar\u0131n\u0131z, her ortama ve her mek\xe2na kolayca adapte olabilmeniz sizi birbirinize olduk\xe7a yak\u0131nla\u015ft\u0131racakt\u0131r. Ancak Bal\u0131k burcunun kaotik duygusall\u0131\u011f\u0131 sizin ise a\u015f\u0131r\u0131 zihinsel ve mant\u0131ksal yan\u0131n\u0131z bu ili\u015fkinin a\xe7mazlar\u0131n\u0131 olu\u015fturabilir. Oysa \u0130kizler erke\u011finin entelekt\xfcel zenginli\u011fi, bilgi birikimi, sizin duygular\u0131n\u0131z ve yarat\u0131c\u0131l\u0131\u011f\u0131n\u0131zla birle\u015fti\u011finde ortaya g\xfczel \u015feyler \xe7\u0131kabilir. \u0130kinizin de de\u011fi\u015fken karakteri uyum g\xfcc\xfcn\xfcz\xfc art\u0131rabilir ancak bu nereye gitti\u011fi pek bilinmeyen ve anla\u015f\u0131lmayan bir ili\u015fki olabilir. Hemen her konuda arad\u0131\u011f\u0131n\u0131z idealizmi, romantizmi \u0130kizler erke\u011finden beklemeniz beyhude olabilir.","Ay y\xf6netiminde iki insan\u0131n Ay\u2019\u0131n hareketlerine duyal\u0131 \u015fekilde de\u011fi\u015febilen ruh halleri ve duygudurumlar\u0131 bu ili\u015fkiyi olduk\xe7a zor k\u0131labilir. Ancak ortak noktalar\u0131n\u0131za sar\u0131l\u0131p birbirinizle empati kurabildi\u011finizde bu zorlu\u011fun \xfcstesinden gelebilirsiniz. Duyargalar\u0131 her y\xf6nden a\xe7\u0131k bir Yenge\xe7 kad\u0131n\u0131 olarak Yenge\xe7 erke\u011fi adeta yans\u0131man\u0131z gibidir. O da sizin gibi sessiz ve derinden ilerleyebilir. Kar\u015f\u0131l\u0131kl\u0131 susup konu\u015fmad\u0131\u011f\u0131n\u0131z ancak duygularla anla\u015ft\u0131\u011f\u0131n\u0131z zamanlar ili\u015fkiyi iyice a\u011f\u0131rla\u015ft\u0131rabilir. \u0130kinizin de sahip oldu\u011fu \xf6nc\xfc karakter ve lider \xf6zellikler g\xfcn\xfcn sonunda bu ili\u015fkiyi i\xe7inden \xe7\u0131k\u0131lmaz bir hale getirebilir. Bu ili\u015fki bu y\xf6nden sizin i\xe7in oldu\u011fu kadar etraf\u0131n\u0131zdakiler i\xe7in de olduk\xe7a zordur, \xf6zellikle de ileride \xe7ocuklar\u0131n\u0131z oldu\u011funda onlar bu a\u011f\u0131r sular\u0131n alt\u0131nda bo\u011fulmamak i\xe7in epeyce gayret sarf etmek durumunda kalabilir.","Sabr\u0131n\u0131z, empati g\xfcc\xfcn\xfcz ve duygusal hassasiyetinizle Aslan erke\u011finin h\xfckmeden, zaman zaman k\xfckreyen tavr\u0131n\u0131, ben merkezci duru\u015funu kolayca s\xf6n\xfcmleyebilirsiniz asl\u0131nda. Aslan erke\u011fi sizde ihtiya\xe7 duydu\u011fu duygusal korumay\u0131, yak\u0131nl\u0131\u011f\u0131, \u015fefkati bulmaktan ho\u015flanacak ve keyif duyacakt\u0131r ve bu keyif duygusu Aslan erke\u011finin en \xf6nem verdi\u011fi ve be\u011fendi\u011fi yan\u0131n\u0131z olabilir. Aslan, kollar\u0131n\u0131zda onu besleyecek, yarat\u0131c\u0131l\u0131\u011f\u0131na yarat\u0131c\u0131l\u0131k katacak duygu yo\u011funlu\u011funu bulabilir. Bunun bilinciyle onu idare etmeniz hatta y\xf6netmeniz hi\xe7 de zor de\u011fildir. Yapt\u0131\u011f\u0131n\u0131z yemeklerle, sundu\u011funuz rahatl\u0131k ve konforla, s\u0131cac\u0131k bir yuvayla Aslan\u2019\u0131 bir kediye d\xf6n\xfc\u015ft\xfcrmek sizin elinizde olabilir. Aslan\u2019\u0131n ate\u015fi suyun yumu\u015fakl\u0131\u011f\u0131yla g\xfczel bir \u015fekilde \xf6rt\xfc\u015febilir. Di\u015fil bur\xe7 Yenge\xe7 kad\u0131n\u0131 evin krali\xe7esi, eril bur\xe7 Aslan erke\u011fi de evin kral\u0131 pek\xe2l\xe2 olabilir.","Ate\u015finizi, tutku ve heyecanlar\u0131n\u0131z\u0131 Yenge\xe7 erke\u011fi bir nebze de olsa s\xf6n\xfcmleyerek ili\u015fkinizi kolayla\u015ft\u0131rabilir. \u0130plerin kimin kontrol\xfcnde olaca\u011f\u0131 sadece bazen problem olabilir, o sizin egolar\u0131n\u0131z\u0131 siz onun hassas kalbini ok\u015fad\u0131ktan sonra sorun kalmaz. Tarzlar\u0131n\u0131z farkl\u0131 da olsa da her ikiniz de dedi\u011fim dedik tiplersiniz. Bu tarz farkl\u0131l\u0131\u011f\u0131 zaman i\xe7inde her ikinizin de ayr\u0131 ayr\u0131 kendi y\xf6n\xfcn\xfcze gitmenize neden olabilir. Aslan kad\u0131n\u0131n\u0131n m\xfcthi\u015f \xf6zg\xfcveni ve kararl\u0131l\u0131\u011f\u0131, g\xf6steri\u015fli hareketleri ba\u015fta size olduk\xe7a \xe7ekici gelse de zaman i\xe7inde arkas\u0131n\u0131n dolu olmay\u0131\u015f\u0131 ve bir noktada tutulup kal\u0131\u015f\u0131, sizin gibi ilerlemeyi seven \xf6nc\xfc \xf6zelliklere sahip biri i\xe7in olduk\xe7a zor olabilir.","Yenge\xe7 erke\u011fi duygusal ihtiya\xe7lar\u0131n\u0131z\u0131 \xe7ok iyi anlar ve kar\u015f\u0131lar. \xdcstelik sizin g\xfcndelik kayg\u0131lar\u0131n\u0131z, evham ve vesveseleriniz kar\u015f\u0131s\u0131nda da olduk\xe7a rahatlat\u0131c\u0131 ve sakindir. Titizli\u011finiz ve \xe7al\u0131\u015fkanl\u0131\u011f\u0131n\u0131z onun ihtiya\xe7lar\u0131n\u0131 kar\u015f\u0131laman\u0131z\u0131 sa\u011flayacakt\u0131r. G\xfczel bir ili\u015fki olabilir. Ancak Yenge\xe7 burcu her ne kadar g\xf6r\xfcn\xfc\u015fte gayet sevecen ve \u015fefkatli g\xf6r\xfcnse de \xf6nc\xfc bir ruha sahiptir ve hayat\u0131n\u0131z\u0131 y\xf6nlendirmek isteyebilir. Aile ve \xe7ocuklar onun i\xe7in hep \xf6n plandad\u0131r ve onlar\u0131n refah\u0131 yerinde olmad\u0131k\xe7a asla huzur bulamaz. Bu ili\u015fkide biraz pasif durumda kalmay\u0131 g\xf6ze alarak ipleri biraz daha e\u015finize, sevgilinize b\u0131rakt\u0131\u011f\u0131n\u0131z ve ona \xe7al\u0131\u015fkanl\u0131\u011f\u0131n\u0131z ve beceriklili\u011finizle destek oldu\u011funuz s\xfcrece m\xfckemmel bir ili\u015fki yaratabilirsiniz.","Suyun toprakla birle\u015fmesi uyumlu bir beraberliktir. Sizde duygusall\u0131\u011f\u0131, hassasiyeti getiren su a\u011f\u0131rl\u0131\u011f\u0131 Ba\u015fak erke\u011finde de topra\u011f\u0131n g\xfcvenilirli\u011fi ve sa\u011flaml\u0131\u011f\u0131 bulunur. Ba\u015fak erke\u011finin pratik, becerikli ve \xe7al\u0131\u015fkan y\xf6nleri hayat\u0131n\u0131z\u0131 kolayla\u015ft\u0131r\u0131rken \xfczerinizden sizi yava\u015flatan ve a\u011f\u0131rla\u015ft\u0131ran enerjileri alabilir. Ortak bir paydada ve dengede bulu\u015fabilirsiniz. Koruyucu, kollay\u0131c\u0131 ve \u015fefkatli y\xf6nleriniz, derin hisleriyle en incelikli konular\u0131 bile alg\u0131layabilen yap\u0131n\u0131z, her \u015feyi en ince ayr\u0131nt\u0131s\u0131na kadar d\xfc\u015f\xfcnen Ba\u015fak erke\u011fine teslimiyet, kontrol etmeme ve vazge\xe7ebilme kap\u0131lar\u0131n\u0131 aralayabilir, zira sizin kollar\u0131n\u0131zda kendini huzurlu ve g\xfcvende hissedecektir. Onun incelikli, narin yap\u0131s\u0131yla her \u015feyden kolayca etkilenen bir ba\u015fak dal\u0131 misali mizac\u0131 sizin koruyucu sar\u0131c\u0131 kollar\u0131n\u0131zda huzur bulacakt\u0131r.","Y\xfcksek empati g\xfcc\xfcn\xfcz, \u015fefkat ve merhametiniz Terazi erke\u011finin kendini uzak ve yabanc\u0131 hissetti\u011fi \xf6zellikler olabilir. Mant\u0131\u011f\u0131 ve akl\u0131yla bunlar\u0131 anlamland\u0131ramayan Terazi erke\u011fine ilk bak\u0131\u015fta olduk\xe7a ters gelebilirsiniz, aran\u0131zda bir anla\u015famama veya \xe7at\u0131\u015fma durumu s\xf6z konusu olabilir. Ancak huzur ve konfor noktas\u0131nda size arad\u0131\u011f\u0131 yumu\u015fakl\u0131\u011f\u0131 bulabilir ancak her ikiniz de \xf6nc\xfc bur\xe7sunuz dolay\u0131s\u0131yla onun da beklentileri olacakt\u0131r ve bu gemiyi kimin g\xfcdece\u011fi bir anla\u015fmazl\u0131k konusu olabilir. Aran\u0131zdaki ili\u015fki zamanla ray\u0131na oturacakt\u0131r, zira kalpleriniz birbirinizi anlad\u0131k\xe7a \xe7at\u0131\u015fmalar\u0131n bertaraf edilebilece\u011fini g\xf6rebilirsiniz. Sessiz, a\u011f\u0131rba\u015fl\u0131, anlay\u0131\u015fl\u0131 ve hassas \xf6zellikleriniz Terazi erke\u011fi taraf\u0131ndan er ya da ge\xe7 fark edilir ve bu kad\u0131n akl\u0131 ve mant\u0131\u011f\u0131yla aran\u0131zdaki m\xfckemmel uyumun s\u0131rr\u0131n\u0131 \xe7\xf6zebilir.","Yenge\xe7 erke\u011fi sizin i\xe7in pek de anla\u015f\u0131lmas\u0131 kolay biri de\u011fildir. Her \u015feyden \xf6nce \xe7ok ketumdur, sessizdir, ne hissetti\u011fini, ne d\xfc\u015f\xfcnd\xfc\u011f\xfcn\xfc anlayamazs\u0131n\u0131z. Sa\u011f g\xf6sterirken sol vurabilir, beni sevmiyor diye d\xfc\u015f\xfcn\xfcrken asl\u0131nda sizi \xe7ok seviyordur. A\u015f\u0131r\u0131 korumac\u0131, \u015fefkatli, \xfczerinize d\xfc\u015fen y\xf6nleriyle evinin kral\u0131 olabilir. Ancak hassas ve duygusal y\xf6nleri, zaman zaman duygu s\xf6m\xfcr\xfcs\xfcne varan talep ve istekleri sizi yorabilir. Sizden bekledi\u011fi evcimenli\u011fi, duygusall\u0131\u011f\u0131, romantizmi, \u015fefkat ve anlay\u0131\u015f\u0131 ona her daim sunabilmeniz zordur. G\xf6r\xfcn\xfcrde uyumlu bir \xe7ift gibi g\xf6r\xfcnseniz de i\xe7ten i\xe7e pek \xe7ok \xe7at\u0131\u015fma s\xf6z konusu olabilir.","Su grubu bur\xe7lar\u0131n uyumu tart\u0131\u015f\u0131lmaz bir ger\xe7ek. Dolay\u0131s\u0131yla Yenge\xe7 sevgiliniz sizin duygular\u0131n\u0131zdan da duygusal ihtiya\xe7 ve beklentilerinizden de \xe7ok iyi anlayacakt\u0131r. \xdcstelik \xe7al\u0131\u015fkan ve verici olan bu erkek yuvan\u0131zda paran\u0131n hi\xe7 eksik olmamas\u0131na ve maddi ihtiya\xe7lar\u0131n\u0131z\u0131n da kar\u015f\u0131lanmas\u0131na destek olacakt\u0131r. \u0130ki G\xfczel ve duygusal y\xf6nden besleyici bir ili\u015fki olabilir. Yenge\xe7\u2019in \u015fefkatli kollar\u0131 aras\u0131nda yumu\u015fakl\u0131\u011f\u0131, huzuru, sevgiyi bulabilirsiniz. \xc7ok kurcalay\u0131c\u0131, kurgulay\u0131c\u0131, \u015f\xfcpheci davranmamaya, Akrep\u2019in yanan ate\u015fini zaman zaman kendi i\xe7inizde s\xf6n\xfcmlendirmeye dikkat etmelisiniz. Yenge\xe7\u2019in sular\u0131 fazla geldi\u011finde de yani k\u0131ska\xe7lar\u0131n\u0131 \xe7ok fazla s\u0131kt\u0131\u011f\u0131nda s\xf6zgelimi, bo\u011fulmamaya dikkat etmelisiniz.","\u0130kiniz de derin duygular\u0131n insan\u0131s\u0131n\u0131z. Ancak sizdeki duygusall\u0131k daha fazla sar\u0131p sarmalama ve besleme y\xf6n\xfcnde kuvvetlenirken, Akrep erke\u011finin derin alg\u0131 ve hassasiyeti onda s\xfcrekli bir \u015f\xfcphe ve huzursuzluk yaratmaktad\u0131r. Ona ihtiya\xe7 duydu\u011fu duygusal g\xfcveni sa\u011flayarak, yedirerek, i\xe7irerek besleyerek kafas\u0131ndaki bu ikilemleri ortadan kald\u0131rmas\u0131na yard\u0131mc\u0131 olabilirsiniz. Akrep size sezgilerin, alt\u0131nc\u0131 hissin g\xfcc\xfcn\xfc g\xf6sterecek, sizi gizemli ve kapal\u0131 olan\u0131n \xe7ekicili\u011fiyle tan\u0131\u015ft\u0131racakt\u0131r. Ondaki derinli\u011fi kat kat ke\u015ffederken s\xfcre\xe7 esnas\u0131nda bu ke\u015fiften haberiniz bile olmayabilir. Ancak g\xfcn\xfcn sonunda bir de bakars\u0131n\u0131z ki, nedenini, nas\u0131l\u0131n\u0131 tam olarak kestiremedi\u011finiz bir \u015fekilde hissetti\u011finiz her duygu bir anlam bulmu\u015f, yapt\u0131\u011f\u0131n\u0131z hi\xe7bir \u015fey bo\u015fa gitmemi\u015ftir. Anlay\u0131\u015fl\u0131, alg\u0131s\u0131 y\xfcksek, kaliteli bir bur\xe7tur Akrep ve duygusal a\xe7\u0131dan yo\u011fun ve besleyici bir beraberlik diliyorsan\u0131z, size bu ortam\u0131 yaratabilir.","Yenge\xe7 erke\u011finin derinli\u011fi, hi\xe7bir \u015feyi basit ve s\u0131\u011f alg\u0131lamay\u0131\u015f\u0131, s\xfcrekli bakma ve bak\u0131lma arzusu, engin denizlere a\xe7\u0131lmaktan ho\u015flanan g\xf6n\xfcl zenginli\u011finize ters d\xfc\u015ft\xfc\u011f\xfcnde problem \xe7\u0131kabilir. Kolay bir ili\u015fki de\u011fildir, krizler \xe7\u0131kabilir. Yenge\xe7\u2019in ailesine, annesine, evine ve yuvas\u0131na ba\u011fl\u0131l\u0131\u011f\u0131, gezmekten, seyahatten, yeni ve farkl\u0131 insanlar tan\u0131maktan ho\u015flanan Yay i\xe7in fazlas\u0131yla anlams\u0131z, can s\u0131k\u0131c\u0131 ve a\u015f\u0131r\u0131 gelenek\xe7i gelebilir. \xdcstelik dolayl\u0131 her t\xfcrl\xfc yoldan, t\u0131pk\u0131 ger\xe7ek bir Yenge\xe7 gibi yan yan ilerleyerek ili\u015fkiyi y\xf6netmeye \xe7al\u0131\u015fmas\u0131, sizi \u015fekillendirmeye giri\u015fmesi zaman i\xe7inde b\u0131kt\u0131r\u0131c\u0131 olabilir. Zor bir ili\u015fki modelidir","A\u011f\u0131rba\u015fl\u0131 ve tutucu \xf6zellikleriniz canl\u0131, ne\u015feli, a\u015f\u0131r\u0131 sosyal zaman zaman hiperaktif Yay erke\u011fini durultacak niteliktedir. Onun ne\u015fesi ve de\u011fi\u015fkenli\u011fi hayat\u0131n\u0131za ve ili\u015fkinize ate\u015fi ve k\u0131v\u0131lc\u0131m\u0131 getirir. Yay erke\u011fi i\xe7in gezebilece\u011fi, fikirlerini payla\u015fabilece\u011fi \xe7evresindeki herkes \xf6nemlidir. Ancak Yay burcunu \xe7ok fazla eve, aileye, yuvaya ba\u011flamaman\u0131z, \xf6zg\xfcrl\xfck alan\u0131na sayg\u0131 duyman\u0131z gerekebilir. Evden \xe7\u0131k\u0131p seyahatlere \xe7\u0131kmak, sosyalle\u015fme ve payla\u015fma arzusunu anlay\u0131\u015fla kar\u015f\u0131lay\u0131p uyum g\xf6stermek aran\u0131zdaki ili\u015fkiyi kuvvetlendirecektir. Evden \xe7\u0131kabildi\u011finiz, aile ve annenizden biraz uzakla\u015fabildi\u011finiz m\xfcddet\xe7e bu ili\u015fki y\xfcr\xfcyebilir. Aksi halde zaten kolayca s\u0131k\u0131labilen Yay i\xe7in her zaman en \xe7ok arad\u0131\u011f\u0131 ve de\u011fer verdi\u011fi unsur olan macera noksanl\u0131\u011f\u0131 bu ili\u015fkiyi zora sokabilir.","\u0130\u015fte birbirini tamamlayan g\xfczel bir ili\u015fki modeli. Bu erke\u011fin gelenek\xe7i, tutucu \xf6zellikleri sizin uzun vadeli ve stratejik beklentilerinizi m\xfckemmel \u015fekilde kar\u015f\u0131layacakt\u0131r. Siz d\u0131\u015farda g\xfc\xe7lenirken o size evinizde arad\u0131\u011f\u0131n\u0131z huzuru, s\u0131cakl\u0131\u011f\u0131, \u015fefkati sunabilir. Birbirini anlayan ve tolere eden bir ili\u015fkiniz olabilir. \u0130kinizin de gelenek\xe7i, muhafazak\xe2r ve tutucu y\xf6nleri bu ili\u015fkinin zamk\u0131 gibidir. Yenge\xe7 erke\u011fi evinde, yuvas\u0131nda, \xf6zel hayat\u0131nda, siz ise g\xf6rev ve sorumluluk alan\u0131n\u0131zda i\u015fyerinizde ve kariyerinizde ba\u015far\u0131 ve mutlulu\u011fu \xf6nceliklendirirsiniz. Birbirinizi bu anlamda \xe7ok iyi tamamlayabilirsiniz.","M\xfckemmel bir uyumu birlikte yakalayabilirsiniz. O\u011flak erke\u011finin ciddiyeti, asaleti, mesafeli, ketum ve mesafeli duru\u015fu arad\u0131\u011f\u0131n\u0131z ve sizi tamamlayan \xf6zelliklerdir. Her zaman koruyan ve saran kollar\u0131n\u0131z, yaratt\u0131\u011f\u0131n\u0131z g\xfcvenli ve \u015fefkatli ev ortam\u0131n\u0131z O\u011flak erke\u011finin d\u0131\u015far\u0131da \xe7ok b\xfcy\xfck \xf6nem verdi\u011fi \xe7etin ve zorlay\u0131c\u0131 g\xf6rev ve sorumluluklar\u0131n\u0131n, a\u015f\u0131r\u0131 ciddiyet ve resmiyet duygusunun, kariyer hayat\u0131n\u0131n ard\u0131ndan ona ihtiya\xe7 duydu\u011fu huzur ve s\xfckuneti sa\u011flar. Bu ili\u015fkiyi birbirini tamamlayan, noksanl\u0131klar\u0131n\u0131 dolduran bir ili\u015fki olarak adland\u0131rabiliriz. Ancak kar\u015f\u0131t y\xf6nler yan\u0131nda ortak noktalar yaratmaya, bulmaya da \xf6zen g\xf6stermelisiniz. \u0130kiniz de \xf6nc\xfc karakterde bur\xe7lars\u0131n\u0131z, ili\u015fkiniz bir sizin, bir onun taraf\u0131na pinpon topu gibi gidip gelmemesine \xf6zen g\xf6stermelisiniz.","Yenge\xe7 erke\u011finin duygusal ihtiya\xe7lar\u0131n\u0131 anlaman\u0131z ve kar\u015f\u0131laman\u0131z d\xfc\u015f\xfcnd\xfc\u011f\xfcn\xfczden zor olabilir. A\u015f\u0131r\u0131 hassas, d\xfc\u015f\xfcnceli sar\u0131p sarmalayan, ev ve aileye d\xfc\u015fk\xfcn Yenge\xe7 erke\u011fi \xe7ok iyi bir aile babas\u0131 olabilir. Ancak bu kadar evcimenlik, arkada\u015fl\u0131ktan, sosyallikten ho\u015flanan siz Kova kad\u0131n\u0131na bir zaman sonra epeyce bo\u011fucu gelebilir. Zira sizin i\xe7in \u015fefkat, koruma, kollamadan ziyade fikirler, \xf6zg\xfcn bir ruh ve d\xfc\u015f\xfcnceler \xf6nemlidir. \xdcstelik sosyal hassasiyetleriniz, arkada\u015fl\u0131klar\u0131n\u0131za d\xfc\u015fk\xfcnl\xfc\u011f\xfcn\xfcz, dost canl\u0131s\u0131 y\xf6nleriniz, Yenge\xe7\u2019in tutucu, gelenek\xe7i yap\u0131s\u0131yla pek de iyi gitmeyebilir. Zaman i\xe7inde birbirini anlamayan bir \xe7ift olabilirsiniz. Dikkat edilmesi gereken bir ili\u015fkidir.","Fazlas\u0131yla gelenek\xe7i burcunuzla bunun tam z\u0131tt\u0131 modern hatta zaman zaman marjinal olabilen Kova\u2019n\u0131n uyumu pek kolay bir birliktelik olmayabilir. Kova erke\u011fi yenilik\xe7i, orijinal, s\u0131ra d\u0131\u015f\u0131 yakla\u015f\u0131mlardan ho\u015flan\u0131r, konu ne olursa olsun onun dikkatini \xe7ekmek i\xe7in s\xfcrekli farkl\u0131 \u015feyler katmal\u0131s\u0131n\u0131z hayat\u0131n\u0131za. Kova erke\u011fi sizin a\u015f\u0131r\u0131 duygusal, a\u011f\u0131rba\u015fl\u0131 ve sessiz tavr\u0131n\u0131z\u0131 anlamland\u0131rmakta zorlanabilir. \u0130li\u015fkiniz bir kilide ve d\xfc\u011f\xfcme d\xf6n\xfc\u015febilir. \xdcstelik evi ve mutlu yuvas\u0131n\u0131n yan\u0131nda toplumsal ili\u015fkileri son derece \xf6nemlidir. Arkada\u015f \xe7evresi, sosyal ama\xe7lar\u0131 hayat\u0131nda vazge\xe7ilmezdir. Kova erke\u011finin mant\u0131\u011f\u0131 ve rasyonelli\u011fini anlaman\u0131z zaman zaman zor olabilir. Y\xfcksek empatinizi onun s\u0131ra d\u0131\u015f\u0131 zek\xe2s\u0131yla b\xfct\xfcnle\u015ftirdi\u011finizde g\xfczel bir uyum yakalayabilirsiniz. Aksi halde dikkat edilmesi gereken bir birlikteliktir.","Yenge\xe7 erke\u011finin size sahip \xe7\u0131kmas\u0131, sizi \u015fefkatli kollar\u0131yla sar\u0131p sarmalamas\u0131 ho\u015funuza gidecektir. Evcimen yap\u0131s\u0131 ve \u015fefkati sizin merhametli ve hassas y\xf6nlerinizle m\xfckemmel uyu\u015fur. Genelde anlamda uyumlu bir beraberliktir. Ancak narin ve kolay etkilenebilen taraflar\u0131n\u0131z, Yenge\xe7 erke\u011finin zaman zaman dengesizli\u011fe varan duygusal \xe7alkant\u0131lar\u0131yla birle\u015fti\u011finde ortak hassasiyetlerden y\u0131pranabilecek bir ili\u015fki s\xf6z konusu olabilir. Bir de Yenge\xe7\u2019in yan yan ve dolayl\u0131 tezah\xfcr edebilen lider ve \xf6nc\xfc y\xf6nlerine dikkat etmelisiniz. \u0130li\u015fkiniz onun istedi\u011fi y\xf6ne bir anda kayabilir.","\u0130ki su burcunun uyumu hi\xe7 \u015f\xfcphesiz tart\u0131\u015f\u0131lmaz. Bal\u0131k burcu erke\u011finde arad\u0131\u011f\u0131n\u0131z hassasiyetin, duygusall\u0131\u011f\u0131n, merhametin gani ganisi bulabilirsiniz. Hemen her konuya duyarl\u0131d\u0131r, resimle, m\xfczikle ilgilenen sanat\xe7\u0131 bir yan\u0131 vard\u0131r. Bal\u0131k burcunun de\u011fi\u015fken, her kaba uyan ve herkesle uyumlu ki\u015fili\u011fi etraf\u0131nda \xe7ok fazla insan\u0131n olmas\u0131na neden olabilir. T\u0131pk\u0131 bir m\u0131knat\u0131s gibi, mistik taraflar\u0131n\u0131n da etkisiyle herkesi kendine \xe7ekebilir. Siz ise \xf6zel ve kendi halinizde, evinizde ve yuvan\u0131zda olmay\u0131 seven, \xf6zel hayat\u0131na \xf6nem veren birisiniz. Dolay\u0131s\u0131yla aran\u0131zdaki elektri\u011fi bozmamaya gayret etmelisiniz, uyumlu bir ili\u015fkiyi y\xf6netmek ve y\xf6nlendirmek sizin elinizde olabilir.","Kar\u015f\u0131n\u0131zda egolar\u0131 en az sizin kadar g\xfc\xe7l\xfc, ayaklar\u0131 yere sizin gibi sa\u011flam basan ne istedi\u011fini, ne bekledi\u011fini bilen bir ki\u015fi daha var. Aslan erke\u011fini bu y\xf6nlerden anlaman\u0131z hi\xe7 de zor de\u011fildir. Onu y\xfcceltti\u011finiz, pohpohlad\u0131\u011f\u0131n\u0131z ve \xe7ok\xe7a \u015f\u0131martt\u0131\u011f\u0131n\u0131z s\xfcrece bu ili\u015fkide \xe7ok da zorlanmayabilirsiniz. Ama ayn\u0131 \u015feyleri siz de bekliyorsunuz. Bu ili\u015fkide gurur \xf6n plandad\u0131r. Her \u015feyi yapabilirsiniz ancak bir Aslan\u2019\u0131n kad\u0131n veya erkek gururuyla asla oynamamal\u0131s\u0131n\u0131z. Her ikinizde kendinizin d\u0131\u015f\u0131nda birbirinizi g\xf6rebildi\u011finiz ve hayat\u0131n\u0131z\u0131n merkezine ortak yapt\u0131\u011f\u0131n\u0131z her \u015feyde sevgiyi, tutkuyu ve naifli\u011fi koruyabildi\u011finiz s\xfcrece mutlu bir beraberlik s\xfcrd\xfcrebilirsiniz.","Aslan erke\u011finin \xe7ok da fazla emek ortaya koymaya gerek duymadan sergiledi\u011fi \xf6zg\xfcven, g\xf6steri\u015f ve abart\u0131l\u0131 hareketler, sizin gibi fonksiyonelli\u011fe, i\u015flevsel ama\xe7lara, faydaya de\u011fer veren \xe7al\u0131\u015fkan Ba\u015fak kad\u0131n\u0131na olduk\xe7a abart\u0131l\u0131, gereksiz veya anlams\u0131z gelebilir. Bu y\xf6nden birbirini anlamakta zorlanabilen bir \xe7ift olabilirsiniz. Aslan\u2019\u0131n hayat\u0131n her y\xf6n\xfcnden zevk al\u0131yor olmas\u0131, abart\u0131l\u0131 zaman zaman teatral ve dramatik y\xf6nleri, vur patlas\u0131n \xe7al oynas\u0131n e\u011flenceden ho\u015flanan taraf\u0131 size olduk\xe7a fazla gelebilir. Siz hayattaki k\xfc\xe7\xfck \u015feylerden, detaylardan, titizlikten, evcil hayvanlar\u0131n\u0131zla k\xfc\xe7\xfck mutluluklardan ho\u015flan\u0131rken bunca g\xfcr\xfclt\xfc pat\u0131rt\u0131 \xe7ok fazla gelebilir, zor bir ili\u015fki olabilir.","Ba\u015fak erke\u011finin detayc\u0131, k\u0131l\u0131 k\u0131rk yaran \xf6zellikleri sizin pek de ald\u0131rmad\u0131\u011f\u0131n\u0131z hatta g\xf6rmedi\u011finiz ve g\xf6z ard\u0131 etti\u011finiz k\xfc\xe7\xfck ayr\u0131nt\u0131lard\u0131r sadece. Sizin i\xe7in bundan \xe7ok daha m\xfchim \u015feyler vard\u0131r, a\u015fk s\xf6zgelimi sizin i\xe7in her t\xfcrl\xfc detay\u0131n \xf6n\xfcndedir ve m\xfckemmel bir a\u015fk i\xe7in detaylara tak\u0131lmamak gereklidir. Ba\u015fak erke\u011finin \xe7al\u0131\u015fkanl\u0131\u011f\u0131 ve sizin zevklerinizi kar\u015f\u0131layacak giri\u015fimlerde bulunmas\u0131 ho\u015funuza gidebilir. A\u015fk dolu tutkulu, sanatsal ve yarat\u0131c\u0131 ki\u015fili\u011finiz onun her \u015feyi ak\u0131l ve zek\xe2yla \xe7\xf6zmeye \xe7al\u0131\u015fan zaman zaman mekanikle\u015febilen kafa yap\u0131s\u0131n\u0131 s\u0131k\u0131c\u0131 bulabilir. Ba\u015fak erke\u011fini zaman zaman anlamakta zorlanabilir, u\u011fra\u015ft\u0131\u011f\u0131 ya da kafas\u0131n\u0131 takt\u0131\u011f\u0131 \u015feyleri gereksiz, anlams\u0131z bulabilirsiniz. Ancak bu ki\u015finim hayat\u0131n\u0131z\u0131 olduk\xe7a kolayla\u015ft\u0131rabilece\u011fini de unutmay\u0131n.","Terazi erke\u011finin zarafeti ve kibarl\u0131\u011f\u0131 kar\u015f\u0131s\u0131nda etkilenmemeniz m\xfcmk\xfcn de\u011fil. Zira o da sizin gibi ancak sizin kadar co\u015fkulu olmasa da sanata ve yarat\u0131c\u0131l\u0131\u011fa olduk\xe7a merakl\u0131d\u0131r. Terazi erke\u011finin akl\u0131 ve rasyonelli\u011fi kar\u015f\u0131s\u0131nda sizin co\u015fkular\u0131n\u0131z vard\u0131r. Diplomasi yetene\u011fiyle, sakinli\u011fi ve nezaketiyle sizin heyecanl\u0131, naif y\xf6nlerinizi y\xf6netebilir. Birbirini \xe7ok\xe7a tamamlayan renkli bir ili\u015fki yaratabilirsiniz. Ortak sanatsal ve estetik zevkleriniz olabilir. Birlikte m\xfczelere, sergilere gidebilir, sinemadan, tiyatrodan bolca konu\u015fabilirsiniz. Terazi\u2019nin zarafeti ve kibarl\u0131\u011f\u0131 ruhunuzu ok\u015farken bunu dile getirmesi ili\u015fkinizi canl\u0131 tutacakt\u0131r, tek yapmas\u0131 gereken sizi pohpohlamay\u0131 ihmal etmemek veya unutmamak, zira kafas\u0131nda \xe7ok \u015fey olan Terazi dalg\u0131n olabilir.","Aslan erke\u011finin g\xf6steri\u015fi, kendine g\xfcveni, cesareti, y\xfcreklili\u011fi Terazi kad\u0131n\u0131 i\xe7in olduk\xe7a caziptir. Zira y\xfcksek estetik y\xf6nlerinizle, bu canl\u0131, yarat\u0131c\u0131, g\xf6steri\u015fli erkek kalbinizi fethedebilir. Tek zorluk bu erke\u011fin s\xfcrekli pohpohlanmaya ve y\xfcceltilmeye olan ihtiyac\u0131d\u0131r. Keza siz de s\xfcrekli be\u011fenilmek, takdir g\xf6rmek istersiniz. Aslan\u2019\u0131n \xf6zg\xfcvenli ve kendine de\u011fer veren tavr\u0131 bir Terazi\u2019yi cezbeder. \xdcstelik size ihtiya\xe7 duydu\u011funuz ate\u015fi, alevi ve heyecan\u0131 getirecektir. \u0130kiniz i\xe7in de a\u015fk \xf6nemlidir, ancak Aslan tutku ve arzular\u0131 \xf6ne \xe7\u0131karken siz ili\u015fkinin daha \xe7ok ak\u0131l ve mant\u0131k taraf\u0131nda olabilirsiniz.","Aslan ne\u015fesi, kahkahas\u0131, e\u011flenceli y\xf6nleriyle hayat\u0131n\u0131za renk ve canl\u0131l\u0131k katar. Bu ili\u015fkinin olumsuz taraf\u0131 her ikinizin de de\u011fi\u015fik tarzda inad\u0131 olabilir. Aran\u0131zdaki \xe7at\u0131\u015fmalar\u0131 kilit noktas\u0131na vard\u0131rmadan \xe7\xf6zmeye \xe7al\u0131\u015fmal\u0131s\u0131n\u0131z. Derin tespitlerinizi ortaya koyan sivri dilinizle Aslan\u2019\u0131n gururunu k\u0131rmamaya \xe7al\u0131\u015fmal\u0131s\u0131n\u0131z. Zira egolar\u0131 g\xfc\xe7l\xfc Aslan burcu erke\u011fi sabit fikirli olmas\u0131 ve tutundu\u011fu ve azmetti\u011fi konuda h\u0131rs\u0131 ve inad\u0131yla da bilinir. \u0130natla\u015fmamaya \xe7al\u0131\u015fmak, onun kafas\u0131n\u0131 takt\u0131\u011f\u0131 konuda ilerlemesine destek olmak bu ili\u015fkiyi besleyecektir, aksi halde \xe7at\u0131\u015fmalar s\xf6z konusu olabilir.","Akrep erke\u011finin gizemi, etkileyici tavr\u0131 ve g\xf6r\xfcnt\xfcs\xfc dikkatinizi cezbedecektir. Bu kapal\u0131 kutuyu \xe7\xf6zmek sizde b\xfcy\xfck bir merak ve ilgi uyand\u0131rabilir. Akrep erke\u011fi size hayat\u0131n o g\xfcne kadar fark\u0131na varamad\u0131\u011f\u0131n\u0131z derin anlamlar\u0131n\u0131 g\xf6sterebilir. \u0130kinizin de dedi\u011fim dedik inat\xe7\u0131 yap\u0131s\u0131 ili\u015fkiyi zorla\u015ft\u0131rabilir. Psikolojik boyutu y\xfcksek, asla y\xfczeysellikle yetinmeyen, her \u015feyi anlamland\u0131rabilen, yarg\u0131lar\u0131nda da \u015fa\u015f\u0131rt\u0131c\u0131 \u015fekilde hakl\u0131 \xe7\u0131kabilen Akrep insan\u0131 hayat\u0131n\u0131za m\xfcthi\u015f bir fark\u0131ndal\u0131k katabilir. O da \u015f\xfcphesiz sizin enerjinize, yarat\u0131c\u0131l\u0131\u011f\u0131n\u0131za, tutkular\u0131n\u0131za kar\u015f\u0131l\u0131ks\u0131z kalamayacakt\u0131r. Ancak huzursuz ve s\xfcrekli m\xfccadele, sava\u015f ve d\xf6n\xfc\u015f\xfcm pe\u015findeki tavr\u0131 rahats\u0131z edici olabilir.","Yay burcu erke\u011finin enerjisi ve hareketi ile sizin co\u015fku ve heyecan\u0131n\u0131z birbirini tamamlayan bir ate\u015f \xe7emberi yaratabilir. Yay erke\u011fi hayat\u0131n\u0131za bol sosyallik, payla\u015f\u0131m ve hareket getirirken o da sizin g\xfcc\xfcn\xfczden, sa\u011flam ve kararl\u0131 duru\u015funuzdan, al\xe7akg\xf6n\xfcll\xfc\u011f\xfcn\xfcz ve bonk\xf6rl\xfc\u011f\xfcn\xfczden etkilenecektir. \u0130kinizin de e\u011flenceden, yeme, i\xe7meden zevk alan y\xf6nleriniz aran\u0131zda g\xfczel bir sinerji olu\u015fmas\u0131n\u0131 sa\u011flayabilir. Enerjisi y\xfcksek uyumlu bir ili\u015fki yakalayabilirsiniz. Birlikte yapaca\u011f\u0131n\u0131z yolculuklar bu ili\u015fkiyi besleyen etken olacakt\u0131r. Bir Yay ile birlikteyseniz biraz maceray\u0131 g\xf6ze al\u0131p taht\u0131n\u0131z\u0131 zaman zaman da olsa b\u0131rakmay\u0131 d\xfc\u015f\xfcnmelisiniz.","Ne\u015feniz, iyimserli\u011finiz ve hareketli yap\u0131n\u0131zla istikrar ve sabitlikten ho\u015flanan ve taht\u0131n\u0131 kolay kolay terk etmeyen Aslan burcu erke\u011fini yerinden oynatabilirsiniz. Onun e\u011flence alg\u0131s\u0131n\u0131, yeme i\xe7meye y\xf6nelik zevklerini beslemeniz yeterli olabilir. Birlikte harika seyahatler yapabilirsiniz. Aslan\u2019\u0131n ne\u015feli, canl\u0131, hayattan zevk alan y\xf6nleri sizin iyimser, her f\u0131rsata ve imkana a\xe7\u0131k k\xe2\u015fif ruhunuz ve gezgin y\xf6nlerinizle birle\u015fti\u011finde m\xfckemmel bir uyum yakalayabilirsiniz. Tek zorlay\u0131c\u0131 olan Aslan kad\u0131n\u0131n\u0131n sabit fikirli taraflar\u0131d\u0131r, inatla\u015fmadan dikkatini farkl\u0131 y\xf6nlere \xe7ekebilirsiniz ve asl\u0131nda bu y\xf6n\xfc bulman\u0131z da \xe7ok zor de\u011fildir, kalbine odaklan\u0131n, onun b\xfcy\xfck bir \xe7ocuk oldu\u011funu, ruhundaki naifli\u011fi unutmay\u0131n.","Kendini \xf6vmeyi seven, kendini be\u011fenen ve takdir edilmekten ve alk\u0131\u015f tutulmaktan ho\u015flanan Aslan erke\u011fi bu \xf6zellikleriyle sizi zaman zaman krize bile sokabilir. Zira bu durum sizin kuralc\u0131, disiplinli, ciddi yap\u0131n\u0131za tek kelimeyle yak\u0131\u015f\u0131ks\u0131z gelebilir. Aslan burcunun g\xf6steri\u015fli y\xf6nleri, e\u011flence, \u015fan, nam, \u015f\xf6hret u\u011fruna para pula \xf6nem vermeden harcamas\u0131, abart\u0131l\u0131 al\u0131\u015fveri\u015fler yapmas\u0131, sizin disiplinli, kuralc\u0131 y\xf6nleriniz taraf\u0131ndan pek de ho\u015f kar\u015f\u0131lanmaz. Egolar\u0131 ve \xf6zg\xfcveni y\xfcksek Aslan burcu kad\u0131n\u0131n\u0131 s\u0131n\u0131rlaman\u0131z ve idare etmeniz pek de kolay de\u011fildir. Zor bir ili\u015fkidir.","Kar\u015f\u0131n\u0131zda dirayeti, kararl\u0131l\u0131\u011f\u0131, planl\u0131, stratejik yakla\u015f\u0131mlar\u0131yla ciddi bir O\u011flak erke\u011fi duruyor. Bu dirayet ve kararl\u0131l\u0131k kar\u015f\u0131s\u0131nda kendi enerjinizin giderek s\xf6n\xfckle\u015fti\u011fini fark etmek pek de ho\u015funuza gitmeyebilir. Zira canl\u0131l\u0131k, g\xf6steri\u015f ve e\u011flenceden haz duyan yap\u0131n\u0131z O\u011flak erke\u011finin planlar\u0131na pek de uymayabilir. O\u011flak kad\u0131n\u0131n\u0131n hayat plan\u0131n\u0131n eninde sonunda bir par\xe7as\u0131 haline geliyor olmak i\xe7inizdeki ne\u015feyi s\xf6nd\xfcrd\xfck\xe7e ve yarat\u0131c\u0131l\u0131\u011f\u0131n\u0131zdan size \xf6d\xfcn verdik\xe7e hayal k\u0131r\u0131kl\u0131\u011f\u0131na u\u011frayabilirsiniz. Zira sizin i\xe7in dibine kadar tutkuyla ya\u015fanmas\u0131 gereken a\u015fk bile O\u011flak burcunun plan ve istikrar \xe7er\xe7evesinde yakla\u015ft\u0131\u011f\u0131, kontrol\xfc elden b\u0131rakmad\u0131\u011f\u0131, ciddi olunmas\u0131 gereken bir konudur. Zor bir ili\u015fki olabilir.","Kova erke\u011finin yenilik\xe7i ve orijinal yakla\u015f\u0131mlar\u0131, co\u015fkulu ve sanatsal y\xf6nlerinizi tetikleyecektir. Onun arkada\u015flar\u0131 ve i\xe7inde bulundu\u011fu toplumun iyili\u011fi ve refah\u0131 i\xe7in kendinden, ki\u015fisel beklentilerinden vazge\xe7i\u015fi taraf\u0131n\u0131zdan \u015fa\u015fk\u0131nl\u0131kla kar\u015f\u0131lanabilir. Sizin i\xe7in kendini g\xf6sterme, t\xfcm varl\u0131\u011f\u0131n\u0131zla ve duru\u015funuzla 'ben' olabilme \xf6nemlidir. Birbirinizi g\xf6rmedi\u011finiz, fark\u0131nda bile olmad\u0131\u011f\u0131n\u0131z eksik y\xf6nlerinizle tamamlay\u0131c\u0131 bir ili\u015fki olu\u015fturabilirsiniz, ancak ortak noktalar\u0131n\u0131z\u0131 yakalamaya gayret etmelisiniz.","Aslan erke\u011fiyle asl\u0131nda kendinizi tamamlanm\u0131\u015f hissedebilirsiniz, her ne kadar bu g\xf6r\xfcn\xfcrde zor gibi olsa da. Ancak aran\u0131zdaki \xe7ekim ve elektrik sizi birbirinize yakla\u015ft\u0131racakt\u0131r. Z\u0131t kutuplar\u0131n birbirini \xe7ekmesi misali yak\u0131nla\u015fabilir, ani bir hareketle de uzakla\u015fabiirsiniz. \xc7ekim g\xfcc\xfc y\xfcksek manyetik bir ili\u015fki ya\u015fayabilirsiniz. Aslan erke\u011finin \xf6zg\xfcveni, kendine inanc\u0131 inan\u0131lmazd\u0131r. Her zaman g\xf6r\xfclmek, sevilmek, takdir edilmek ve t\xfcm dikkatleri \xfczerinde toplamak ister. Dikkatinizi ona odaklamad\u0131\u011f\u0131n\u0131z an ise problemlerin \xe7\u0131kmaya ba\u015flad\u0131\u011f\u0131 and\u0131r.","Aslan erke\u011finin sabit fikirleri, egolar\u0131, g\xfc\xe7l\xfc ki\u015fili\u011fi a\u015f\u0131lacak gibi de\u011fildir. Sizin sanat\xe7\u0131 y\xf6nleriniz ve yarat\u0131c\u0131l\u0131\u011f\u0131n\u0131z onu etkileyecektir. Ama zamanla hassasiyetiniz, merhametiniz ve duygusall\u0131\u011f\u0131n\u0131z sizi fark\u0131nda bile olmadan ve istemeden ezmesine neden olabilir. Ortaya \xe7\u0131kan bu durum pek ho\u015funuza gitmeyebilir. \u0130dare etmesi zor bir ili\u015fki olabilir. Zira Aslan erke\u011fi kar\u015f\u0131s\u0131nda olduk\xe7a pasif kalabilirsiniz. Ancak onun yarat\u0131c\u0131l\u0131\u011f\u0131, g\xf6steri\u015f ve e\u011flenceden ho\u015flanan taraflar\u0131n\u0131 \xe7ekici bulmaman\u0131z m\xfcmk\xfcn de\u011fil. Kendinizi ezdirmemeye \xe7al\u0131\u015fmal\u0131, onun g\xf6remedi\u011fi zamanlarda bunu ona hat\u0131rlatmal\u0131s\u0131n\u0131z. Zira taht\u0131nda ve asas\u0131 elindeyken etraf\u0131n\u0131 g\xf6rmesi, hissetmesi g\xfc\xe7 bir bur\xe7 olabilir Aslan burcu ve \xf6zellikle de Aslan erke\u011fi.","Bal\u0131k erke\u011finin uyumlu, esnek, her ortama ve ki\u015fiye uyumlanabilen yap\u0131s\u0131 sizin g\xfc\xe7l\xfc yap\u0131n\u0131z kar\u015f\u0131s\u0131nda size zay\u0131f gibi g\xf6r\xfcnebilir. G\xfcc\xfcn\xfcz, egonuz, istek ve beklentilerinizle k\u0131sa s\xfcrede bu ili\u015fkide \xf6ne \xe7\u0131kan taraf olabilirsiniz. Bu durum onun da daha pasif kalmas\u0131na neden olarak sizden uzakla\u015fmas\u0131yla sonu\xe7lanabilir. Aslan burcunun hassas sanat\xe7\u0131 duyarl\u0131l\u0131\u011f\u0131, fedak\xe2r ve cefak\xe2r yap\u0131s\u0131 g\xf6z ard\u0131 edilebilecek \xf6zellikler de\u011fildir, egonuzun ba\u015f\u0131n\u0131z\u0131 d\xf6nd\xfcrmesine izin vermemelisiniz, zira onun a\u015f\u0131r\u0131 uyumlu yap\u0131s\u0131 buna meyletmenize ortam haz\u0131rlayacakt\u0131r.","\xc7al\u0131\u015fkan, titiz ve sebatkar iki Ba\u015fak olarak s\xfcper verimli bir ili\u015fkiniz olabilir. Bir\xe7ok i\u015fin \xfcstesinden gelebilir, hayat\u0131n\u0131z\u0131 m\xfckemmel \u015fekilde pratik hale getirebilirsiniz. Sizin g\xf6remedi\u011finiz detaylar\u0131 o g\xf6recek, onun g\xf6remediklerini ise siz yakalayabileceksiniz. Ancak a\u015f\u0131r\u0131 m\xfckemmeliyet\xe7i bir \xe7ift olabilirsiniz. Kar\u015f\u0131l\u0131kl\u0131 kayg\u0131, evhamlarla, uzayan ele\u015ftirilerle birbirinizi daraltabilirsiniz. S\xfcrekli hastal\u0131klardan, ila\xe7lardan, \u015fifadan konu\u015fabilir, bunlarla ilgili u\u011fra\u015flar edinebilirsiniz. \xc7al\u0131\u015farak ve m\xfckemmeliyet\xe7i \u015fekilde ortak pek \xe7ok maddi getiri, gelir edinebilirsiniz. Ancak zaman i\xe7inde farkl\u0131 \u015feyler arad\u0131\u011f\u0131n\u0131zda, bu ili\u015fki size olduk\xe7a dura\u011fan ve monoton gelebilir. \u0130li\u015fkinin monotonla\u015fmas\u0131n\u0131 \xf6nleyecek tedbirleri almay\u0131 ihmal etmemelisiniz.","Detaylara \xf6nem veren Ba\u015fak erke\u011fi titizli\u011fi, ele\u015ftirel ve m\xfckemmeliyet\xe7i yakla\u015f\u0131m\u0131, kayg\u0131lar\u0131, endi\u015feleriyle konfor alan\u0131n\u0131z\u0131 bir miktar da\u011f\u0131tabilir. Ancak \xe7al\u0131\u015fkanl\u0131\u011f\u0131 ve beceriklili\u011fi her anlamda ho\u015funuza gidecektir, zira sizi topraklayacak, bir nevi ayaklar\u0131n\u0131z\u0131n yere basmas\u0131n\u0131 sa\u011flayacakt\u0131r. Ba\u015fak burcu hayat\u0131n\u0131z\u0131 her \u015feyi d\xfc\u015f\xfcn\xfclm\xfc\u015f m\xfckemmel bir hayata d\xf6n\xfc\u015ft\xfcrebilir. Ancak bu kadar m\xfckemmellik ve titizlik nereye kadar ho\u015funuza gidebilir, bunu d\xfc\u015f\xfcnmelisiniz. Ba\u015fak\u2019\u0131n diken \xfcst\xfcnde duru\u015fu, ele\u015ftirel yakla\u015f\u0131m\u0131, g\xfczelliklerden, keyif ve konfordan ho\u015flanan siz Terazi kad\u0131n\u0131 i\xe7in zaman i\xe7inde rahats\u0131z edici olabilir. Onun bunca eme\u011fine ve \xe7al\u0131\u015fkanl\u0131\u011f\u0131na da anlam veremeyebilirsiniz. Kolay bir ili\u015fki olmayabilir.","\xc7al\u0131\u015fkanl\u0131\u011f\u0131n\u0131z, akl\u0131n\u0131z ve zek\xe2n\u0131zla verime, m\xfckemmeliyete, kusursuzlu\u011fa inanan yap\u0131n\u0131z kar\u015f\u0131s\u0131nda Terazi erke\u011finin keyfi yakla\u015f\u0131mlar\u0131, rahatl\u0131\u011f\u0131 size batabilir. \xdcstelik siz her ne kadar kontrolc\xfc ve detaylara \xf6nem veren yap\u0131da olun fark\u0131na bile varmadan kendinizi Terazi\u2019nin lider kanatlar\u0131 alt\u0131nda s\xfcr\xfckleniyorken bulabilirsiniz. Sakin ve uyumlu ki\u015fili\u011fiyle hi\xe7 g\xf6stermese de Terazi erke\u011fi ili\u015fkileri y\xf6netmekte ustad\u0131r, zek\xe2n\u0131z ve k\u0131vrakl\u0131\u011f\u0131n\u0131z bu ustal\u0131k kar\u015f\u0131s\u0131nda etkisiz kalabilir. Birbirini g\xf6remeyen ya da anlayamayan bir ili\u015fkiniz olabilir.","Titiz, kuruntulu, m\xfckemmeliyet\xe7i tarz\u0131yla Ba\u015fak erke\u011fi hayat\u0131n\u0131zda \xf6zellikle sizin pek de \xf6nem vermedi\u011finiz detaylar\u0131 g\xf6r\xfcr, \xf6nemli t\xfcm k\xfc\xe7\xfck i\u015fleri halleder ve asl\u0131nda hayat\u0131n\u0131z\u0131 kolayla\u015ft\u0131r\u0131r. Ancak bir s\xfcre sonra a\u015f\u0131r\u0131 titizli\u011fi ve vesvesesi size fena halde batmaya ba\u015flayabilir. Arad\u0131\u011f\u0131n\u0131z duygusal derinlik ve tutkuyu da onda bulman\u0131z zordur. Daha \xe7ok pratikli\u011fe, beceriye odakl\u0131d\u0131r. Kolay bir ili\u015fki de\u011fildir. Zira sizin zaman zaman paranoya benzeri bir hal alan merak ve \u015f\xfcphe duygunuz Ba\u015fak erke\u011finin pimpirikli yap\u0131s\u0131yla birle\u015fti\u011finde bu ili\u015fki zor hale gelebilir. Herkes kendi halinde oldu\u011funda ve kendi i\u015fine bakt\u0131\u011f\u0131nda birbirinize rahats\u0131zl\u0131k vermeyebilirsiniz.","Sizi tela\u015feniz, a\u015f\u0131r\u0131 zeki, k\u0131vrak yap\u0131n\u0131z, kusursuzluk beklentiniz s\xfcrekli yorup huzursuz ederken, Akrep erke\u011fini s\xfcrekli kendini ve etraf\u0131n\u0131 d\xf6n\xfc\u015ft\xfcrme, de\u011fi\u015ftirme arzusu huzursuz etmektedir. Dolay\u0131s\u0131yla taraflar\u0131n kar\u015f\u0131l\u0131kl\u0131 \u015fekilde huzursuz oldu\u011fu bu ili\u015fkiden beklentiniz \xe7ok da y\xfcksek olmamal\u0131. Ki\u015fisel beklentileriniz ve aray\u0131\u015flar\u0131n\u0131zla birbirinizi b\u0131kt\u0131rmamaya \xe7al\u0131\u015fmal\u0131s\u0131n\u0131z. Asl\u0131nda her ikinizin de yap\u0131c\u0131, etkili bir d\xfczen beklentisi i\xe7inde kusursuzluk aray\u0131\u015f\u0131n\u0131z birbirinizi anlayabildi\u011finiz \xf6l\xe7\xfcde bu ili\u015fkiyi farkl\u0131 boyutlara \xe7ekebilir, zor ama ilgin\xe7 bir ili\u015fkiniz olabilir. Ortak ilgi ve m\xfckemmel hedefler noktas\u0131nda bulu\u015fabilirsiniz. Asl\u0131nda kendiniz i\xe7in de\u011fil de etraf\u0131n\u0131zdakiler a\xe7\u0131s\u0131ndan anla\u015f\u0131lmas\u0131 ve idare edilmesi zor bir birlikteli\u011finiz olabilir.","\u0130kinizin de de\u011fi\u015fken ruhlu, esnek yap\u0131da ve y\xfcksek adaptasyon g\xfc\xe7l\xfc olman\u0131z bu ili\u015fkinin en \xf6nemli tetikleyicilerinden biridir. Kar\u015f\u0131n\u0131zda e\u011flenmeyi, sosyal payla\u015f\u0131mlar\u0131 seven, fikirlere, d\xfc\u015f\xfcncelere, ideallere de\u011fer veren bir Yay erke\u011fi var. A\u015f\u0131r\u0131 detaylar, hesap kitap ve kayg\u0131lar\u0131n\u0131zla onu s\u0131kmamaya \xe7al\u0131\u015ft\u0131\u011f\u0131n\u0131z s\xfcrece bu engin enerji, s\u0131n\u0131rs\u0131z iyimserlik size olduk\xe7a iyi gelebilir, g\xf6nl\xfcn\xfcz\xfc ferahlatabilir. Zek\xe2n\u0131z, k\u0131vrakl\u0131\u011f\u0131n\u0131z ve beceriklili\u011finizle bu ili\u015fkiyi y\xf6netmeniz zor de\u011fil asl\u0131nda, tek yapman\u0131z Yay erke\u011fini k\u0131s\u0131tlamaya \xe7al\u0131\u015fmamak ve onun macera ve ke\u015fif dolu ruhuna e\u015fde\u011fer duygular geli\u015ftirmek olabilir.","Ba\u015fak erke\u011finin \xe7al\u0131\u015fkanl\u0131\u011f\u0131, \xfcretkenli\u011fi, titizlik gerektiren hesap i\u015flerinde ba\u015far\u0131s\u0131, d\xfczen ve tertip tutkusu zaman zaman size zor gelse de hayat\u0131n\u0131zda \xe7at\u0131\u015fmalara neden olsa da bu erke\u011fin hayat\u0131n\u0131z\u0131 olduk\xe7a kolayla\u015ft\u0131rabilece\u011fini unutmay\u0131n. Ancak zaman zaman detaylara saplan\u0131p kalmas\u0131, hemen her \u015feyde kusursuzluk ve m\xfckemmellik aray\u0131\u015f\u0131 sizi olduk\xe7a zorlayabilir. Ancak ilk bak\u0131\u015fta inceli\u011fi, zarafeti, safl\u0131\u011f\u0131 ve \xe7al\u0131\u015fkanl\u0131\u011f\u0131yla sizi b\xfcy\xfcleyecektir. \xdcstelik pek \xe7ok erke\u011fin aksine Ba\u015fak erke\u011fi olduk\xe7a konu\u015fkan olabilir. Konu\u015fmay\u0131 da seviyorsan\u0131z onunla sohbet edebilir, hemen her konuda size faydas\u0131 olabilecek bilgiler edinebilirsiniz. Ancak sizin u\xe7suz bucaks\u0131z ke\u015fif ve macera duygunuz kar\u015f\u0131s\u0131nda Ba\u015fak erke\u011fi biraz daha s\u0131n\u0131rl\u0131 kalabilir ve bu noktada ili\u015fkinin zorluklar\u0131 ba\u015flayabilir.","Ba\u015fak erke\u011finin kat\u0131ks\u0131z, temiz, titiz, detayc\u0131 y\xf6nleri yapt\u0131\u011f\u0131n\u0131z b\xfcy\xfck planlar\u0131 tamamlay\u0131c\u0131 ve destekleyici niteliktedir. Becerikli Ba\u015fak erke\u011fi tam anlam\u0131yla hayat\u0131n\u0131z\u0131 kolayla\u015ft\u0131r\u0131r, zek\xe2s\u0131yla sizi tamamlar. Sizin u\u011fra\u015fmak istemedi\u011finiz pek \xe7ok \u0131v\u0131r z\u0131v\u0131rla ve detayla \xfc\u015fenmeden ve yorulmadan u\u011fra\u015fan Ba\u015fak erke\u011fi planlar\u0131n\u0131z\u0131 ger\xe7ekle\u015ftirmede size sonsuz destek olabilir. Birlikte hedeflerinize ula\u015fabilece\u011finiz sa\u011flam bir ili\u015fkiniz olur. Birbirinizi iyi topraklayan enerjinizle uyumlu bir beraberli\u011finiz olabilir.","O\u011flak erke\u011finin yap\u0131c\u0131l\u0131\u011f\u0131, somutla\u015ft\u0131rma g\xfcc\xfc ve sabr\u0131 tart\u0131\u015f\u0131lmazd\u0131r. Bu sab\u0131rla birle\u015fen \xe7al\u0131\u015fkanl\u0131\u011f\u0131n\u0131z onun planlar\u0131n\u0131 takip etti\u011finiz s\xfcrece m\xfckemmel uyumda bir ili\u015fkiyi yakalaman\u0131z hi\xe7 zor olmayabilir. Birlikte \xe7ok \u015fey \xfcretebilen, verimli, uzun vadede kal\u0131c\u0131, g\xfcvenilir bir ili\u015fki te\u015fkil edebilirsiniz. Zek\xe2n\u0131z\u0131, beceriklili\u011finizi onun azmi ve h\u0131rs\u0131yla birle\u015ftirebilir, ili\u015fkinizdeki zorluklar\u0131 kolayca giderip ili\u015fkinizi beceriklili\u011finizle y\xf6netebilirsiniz. Uyumlu bir ili\u015fki olabilir ancak O\u011flak burcunun mesafeli tutumunu ve uzun vadeli disiplinini g\xf6z ard\u0131 etmemelisiniz.","Birbirinizi \xe7ok fazla anlay\u0131p g\xf6remeyebilirsiniz. Her ikinizinde kendi \xe7ap\u0131nda i\u015fleri, g\xfc\xe7leri ve me\u015fgaleleri olabilir. Kova erke\u011fi sosyal \xe7evresiyle olduk\xe7a me\u015fguldur. Sizin i\xe7in ise tamamlanmas\u0131 gereken i\u015fleriniz, g\xfcnl\xfck ya\u015fant\u0131n\u0131z, evcil hayvanlar\u0131n\u0131z, sa\u011fl\u0131\u011f\u0131n\u0131z ve s\u0131hhatiniz olduk\xe7a \xf6nemlidir. Birbirinizin farkl\u0131 y\xf6nlerini g\xf6rebildi\u011finiz \xf6l\xe7\xfcde bir beraberlik kurabilirsiniz. Kova erke\u011finin orijinallik d\xfcrt\xfcs\xfcyle \xe7ok s\u0131ra d\u0131\u015f\u0131 bir ili\u015fkiniz de olabilir. Ancak fazla \xf6zg\xfcr, yenilik\xe7i tav\u0131rlar\u0131 sizin i\xe7in ters ve yorucu olabilir. Hesaplay\u0131p \xf6ng\xf6rebilece\u011finizden \xe7ok daha farkl\u0131, s\u0131ra d\u0131\u015f\u0131 ve marjinal d\xfc\u015f\xfcnebilir.","Ba\u015fak erke\u011finin en ufak detaylara bile odaklanabilmesi, ince ayr\u0131nt\u0131lar\u0131 yakalamas\u0131 size inan\u0131lmaz gelebilir. Vizyoner, modern ve yenilik\xe7i d\xfcnyan\u0131zda g\xf6z\xfcn\xfczden ka\xe7an her ne varsa g\xf6rebilir ve size g\xf6sterebilir. Hassasiyeti ve inceli\u011fi ise tart\u0131\u015f\u0131lmazd\u0131r. Ancak bir s\xfcre sonra narin, hastal\u0131klara meyilli yap\u0131s\u0131, titiz ve kuruntulu y\xf6nleri size anlams\u0131z gelmeye ve batmaya ba\u015flayabilir. Ele\u015ftirel, m\xfckemmeliyet\xe7i y\xf6nleri k\u0131l\u0131 k\u0131rk yard\u0131ran titizli\u011fi zihinsel a\xe7\u0131dan sizi olduk\xe7a yorabilir, psikolojik bir krize dahi sokabilir. Ba\u015fak erke\u011finin bir diki\u015f makinesi gibi tekd\xfcze fakat kusursuz i\u015fleyen zihni ve bunun yaratt\u0131\u011f\u0131 g\xfcr\xfclt\xfc \xf6zg\xfcrl\xfck\xe7\xfc, yenilik\xe7i b\xfcnyenize \xe7ok fazla gelebilir. Kolay bir ili\u015fki de\u011fildir.","Sizin sonsuz ve s\u0131n\u0131rs\u0131z fedak\xe2rl\u0131\u011f\u0131n\u0131z, Ba\u015fak erke\u011finin \xfcretkenli\u011fi ve \xe7al\u0131\u015fkanl\u0131\u011f\u0131yla birle\u015fti\u011finde m\xfcthi\u015f bir ikili olabilirsiniz. Kar\u015f\u0131l\u0131kl\u0131 hizmet ve maddi ve manevi al\u0131\u015fveri\u015f \xe7er\xe7evesinde sizi bulu\u015fturabilecek bir ili\u015fkidir. Ancak aran\u0131zdaki al\u0131\u015fveri\u015f dengesini iyi g\xf6zetmelisiniz. Sizin sezgileriniz, Ba\u015fak burcunun zek\xe2s\u0131 g\xfczel bir al\u0131\u015fveri\u015f olabilir. O sizin d\xfcnyan\u0131za s\u0131n\u0131rlar, siz onunkine engin bir d\xfcnya g\xf6r\xfc\u015f\xfc katabilirsiniz. Ba\u015fak erke\u011finin ayaklar\u0131 yere basan, pragmatik, yap\u0131c\u0131, becerikli \xe7al\u0131\u015fkanl\u0131\u011f\u0131n\u0131 sizin manevi zenginli\u011finiz, farkl\u0131 bak\u0131\u015f a\xe7\u0131lar\u0131n\u0131z tamamlayacakt\u0131r. Bu ili\u015fki dengesini iyi kavray\u0131p y\xf6netti\u011finizde \xe7ok g\xfczel bir beraberli\u011finiz olabilir.","Titizli\u011finizi, \xe7al\u0131\u015fkanl\u0131\u011f\u0131n\u0131z\u0131, kusursuzluk d\xfcrt\xfcn\xfcz\xfc anlamakta zorlanmayacakt\u0131r Bal\u0131k erke\u011fi. \xdcstelik bu \xf6zveri kar\u015f\u0131s\u0131nda o da kendini tamamen size adayabilir ve feda edebilir. De\u011fi\u015fken yap\u0131lar\u0131n\u0131z bu ili\u015fkiyi kolayla\u015ft\u0131r\u0131rken, siz detayc\u0131l\u0131k ve m\xfckemmeliyet\xe7ili\u011fin zirvesinde, Bal\u0131k erke\u011fi ise her \u015feyi b\u0131rakabilmenin, ak\u0131\u015fa kap\u0131labilmenin b\xfcy\xfcs\xfcnde olabilir. Maddi ve manevi anlamda kar\u015f\u0131l\u0131kl\u0131 al\u0131\u015fveri\u015fe dayal\u0131, alma ve verme dengesi \xfczerine oturan bir ili\u015fkiniz olabilir. Bal\u0131k erke\u011fi sizin kendinizde eksik g\xf6rd\xfc\u011f\xfcn\xfcz ak\u0131\u015f\u0131na b\u0131rakabilme, vazge\xe7ebilme ve kontrol\xfc b\u0131rakma gibi hayat\u0131n manevi ve mistik boyutlar\u0131 y\xfcksek y\xf6nlerini size g\xf6sterebilir. Siz de onun da\u011f\u0131n\u0131k, kaotik hayat\u0131n\u0131 toparlayan g\xfcvenilir g\xfc\xe7 olabilirsiniz. Dengeli ve uyumlu bir birlikteli\u011finiz olabilir","Terazi ile pek \xe7ok ortak \xf6zelli\u011finiz bulunabilir. Birbirinizle saatlerce konu\u015fabilir, kar\u015f\u0131l\u0131kl\u0131 dertlerinizi, sorunlar\u0131n\u0131z\u0131 \xe7ok iyi anlayabilirsiniz. Ancak kar\u015f\u0131l\u0131kl\u0131 incelikler, fazla nezaket, kibarl\u0131k ve diplomasi y\xfcz\xfcnden kay\u0131p bir ili\u015fki olabilir, zira ikiniz de ayn\u0131 durumda \xe7ok benzer \u015fekilde d\xfc\u015f\xfcn\xfcp hareket edebilirsiniz, birbirinizi \xe7ok iyi anlasan\u0131z da y\xfczle\u015fmekte zorlanabilirsiniz. Terazi erke\u011fi de t\u0131pk\u0131 sizin gibi be\u011fenilmek, takdir g\xf6rmek ister. Yine ayn\u0131 sizin gibi keyiften, ki\u015fisel zevklerden, l\xfcksten yanad\u0131r. Bu kadar ayn\u0131l\u0131k olunca birbirinizin ke\u015ffedecek yan\u0131n\u0131z kalmamas\u0131 size s\u0131k\u0131c\u0131 gelebilir.","Siz bir Ven\xfcs kad\u0131n\u0131, kar\u015f\u0131n\u0131zdaki de bir Mars erke\u011fidir. K\u0131\u015fk\u0131rt\u0131c\u0131 bir ili\u015fki olabilir. Siz Akrep erke\u011fini fazla derin, m\xfccadeleci bulabilirsiniz. O da sizin fazla rahat oldu\u011funuzu d\xfc\u015f\xfcnebilir. Ancak \xe7al\u0131\u015fkanl\u0131\u011f\u0131 ve \xf6zverisiyle konfor alan\u0131n\u0131z\u0131 geni\u015fletecektir ama bunu yaparken sizi sinir edebilece\u011fini hat\u0131rlatal\u0131m. Keza Akrep burcunun a\u015f\u0131r\u0131 merak\u0131ndan, s\xfcrekli gizeminde, bir detektif gibi sorgulay\u0131c\u0131 ve irdeleyici olmas\u0131ndan da rahats\u0131zl\u0131k duyabilirsiniz. Derin duygusall\u0131\u011f\u0131, her \u015feyi g\xf6r\xfcp anlayabilen taraflar\u0131, \u015f\xfcphecili\u011fi, k\u0131skan\xe7l\u0131\u011f\u0131 \xfczerinizde duygusal bask\u0131 yaratabilir. Eninde sonunda Akrep her \u015feyi bilmek, bilmese de \xf6\u011frenmek zorunda hissedecektir kendini. A\u015fkta tehlikeli olabilir, zira akl\u0131na koydu\u011funu yapma, yapt\u0131rma, elde etme konusunda 'ya benimsin ya kara topra\u011f\u0131n' diyebilecek kadar korkusuz ve cesurdur.","Akrep kad\u0131n\u0131 olarak m\xfcthi\u015f sezgi ve duygular\u0131yla hemen her konuyu sorgulabilecek g\xfc\xe7tesiniz ve bu zaman zaman hem kendinizle hem de \xe7evrenizle m\xfccadele i\xe7inde olman\u0131za neden olabilir. Terazi\u2019nin zarafeti ve kibarl\u0131\u011f\u0131ndan etkilenmeyecek kad\u0131n ise yok gibidir. En \xf6nemli silah\u0131 ise sakin ama etkili tarz\u0131d\u0131r. \u0130nan\u0131lmaz diplomatik ve politik davranabilir, nabza g\xf6re \u015ferbet vermekte ustad\u0131r, yumu\u015fak g\xf6r\xfcnt\xfcs\xfc ard\u0131nda \xf6nc\xfc ve lider bir karaktere sahiptir. Onunla birlikte olmak istiyorsan\u0131z de\u011fi\u015ftirmeye asla \xe7al\u0131\u015fmamal\u0131, kendi halinde ve \xf6zg\xfcr b\u0131rakmal\u0131s\u0131n\u0131z. Zira bu nezaket ve kibarl\u0131\u011f\u0131n\u0131n ard\u0131nda dominant bir yap\u0131s\u0131 vard\u0131r, detaylar\u0131 hi\xe7 ummad\u0131\u011f\u0131n\u0131z bir \u015fekilde yakalayabilir, \xe7ok \u015feyi zaten bildi\u011finizi zannederken sizi \u015fa\u015f\u0131rtabilir. Ger\xe7ekten s\xfcrprizli bir ili\u015fki olabilir.","Uyumlu ve zengin bir ili\u015fkiniz olabilir. Yay erke\u011fi gezip tozmaya, seyahat etmeye, de\u011fi\u015fik k\xfclt\xfcrler, insanlar tan\u0131y\u0131p ufkunu ve vizyonunu geli\u015ftirmeye bay\u0131l\u0131r. Bu sayede \xe7ok \u015fey bilir, \xf6\u011frenir ve payla\u015f\u0131r. Onunla hemen her \u015feyden konu\u015fabilir, seyahat edebilir, zengin bir sosyal \xe7evre edinebilirsiniz. Ancak onunlayken harekete, seyahate ve spora yatk\u0131n olmal\u0131s\u0131n\u0131z. Ven\xfcsyen karakterinizi hareket, aktivite y\xf6n\xfcnde biraz zorlaman\u0131z da gerekebilir. Aksi halde onu elinizde tutman\u0131z zor olabilir. F\u0131rsat\u0131n\u0131 bulunca ka\xe7maya haz\u0131r bir ok gibidir. Siz yumu\u015fak ve romantik hayaller kurarken, o avu\xe7lar\u0131n\u0131zdan \xe7oktan u\xe7up gidebilir.","\u0130yimser, olumlu, \u015fansl\u0131 bir ili\u015fkidir. Terazi\u2019nin bilgisi, entelekt\xfcelli\u011fi, zek\xe2s\u0131, ak\u0131lc\u0131l\u0131\u011f\u0131, insiyatif sahibi olu\u015fu ili\u015fkiyi destekleyen \xf6nemli fakt\xf6rlerdir. \xdcstelik duru\u015fuyla, kibarl\u0131\u011f\u0131 ve zarafetiyle tam bir salon adam\u0131 olabilir. Keyiften ve l\xfcksten ho\u015flanan bu erke\u011fi, fikirleriniz ve \xf6zg\xfcr y\xf6nlerinizle olduk\xe7a etkileyebilirsiniz. Terazi erke\u011fiyle \xe7ok g\xfczel sosyalle\u015febilir, zengin bir arkada\u015f \xe7evresine sahip olabilirsiniz. Onun dengesi, uyumu, politik ve diplomatik yetenekleri sayesinde kar\u015f\u0131l\u0131kl\u0131 beslendi\u011finiz g\xfczel bir ili\u015fkiniz olabilir.","O\u011flak\u2019\u0131n ciddiyeti, istikrar\u0131, disiplini, kuralc\u0131l\u0131\u011f\u0131, planl\u0131, programl\u0131 yap\u0131s\u0131, keyfine, zevkine, l\xfcks\xfcne \xf6nem veren Terazi erke\u011fi i\xe7in olduk\xe7a can s\u0131k\u0131c\u0131 olabilir. Bu beraberli\u011fin, evlili\u011fin veya ili\u015fkinin a\u015fk beraberli\u011finin romantizminden ziyade bir i\u015f projesi gibi resmi veya ciddi bir havada y\xfcr\xfcmesi ruhunuza pek uygun gelmeyebilir. Kurallar\u0131, disiplini ve prensipleriyle O\u011flak erke\u011fi \xf6zg\xfcr ruhunuza ters gelebilir. Yumu\u015fakl\u0131\u011f\u0131n\u0131z kar\u015f\u0131s\u0131nda sert bir enerjiyle kar\u015f\u0131la\u015fabilirsiniz. G\xfczelliklerden zevk al\u0131rs\u0131n\u0131z, onun i\xe7in ise uzun vadede adamak\u0131ll\u0131 bir plan, strateji \u015fartt\u0131r. Kurallar\u0131, \xe7er\xe7eveleri size ters gelebilir. Bu ili\u015fki zaman ve sab\u0131r gerektirir ve asl\u0131nda birbirinize ne kadar mesafeli durursan\u0131z o kadar iyidir.","Sizin i\xe7in ba\u015fkalar\u0131 taraf\u0131ndan ne \u015fekilde alg\u0131land\u0131\u011f\u0131n\u0131z, itibar\u0131n\u0131z ve prestijiniz \xf6nemlidir. Terazi burcunun kibarl\u0131\u011f\u0131, sakin ve dengeli g\xfczelli\u011fi ve nezaketi bu a\xe7\u0131dan olduk\xe7a ho\u015funuza gidecektir. Ancak s\u0131k\u0131 kural ve prensiplerinizin, fark\u0131nda olmadan yaln\u0131zca planlar\u0131n\u0131z \xe7er\xe7evesinde uygulad\u0131\u011f\u0131n\u0131z bask\u0131n\u0131n onun rahat\u0131n\u0131 ka\xe7\u0131rabilece\u011fini unutmay\u0131n. Terazi erke\u011finin kibarl\u0131\u011f\u0131 ve zarafetiyle dikkatinizi \xe7ekmesi, ba\u015f\u0131n\u0131z\u0131 d\xf6nd\xfcrmesi hi\xe7 de zor de\u011fildir. Ancak bu erkek her ne kadar \u0131l\u0131ml\u0131 ve iyimser g\xf6r\xfcnse de kendi istek, beklenti ve planlar\u0131n\u0131z do\u011frultusunda onu y\xf6nlendirmeniz pek de kolay de\u011fildir. Akl\u0131 ve mant\u0131\u011f\u0131yla lider \xf6zelliklere sahiptir. Ayr\u0131ca sizin planl\u0131, ciddi, resmi yap\u0131n\u0131z onun Ven\xfcsyen konforuyla ters d\xfc\u015febilir ve \xe7at\u0131\u015fmalar s\xf6z konusu olabilir.","Bu iki hava burcunun uyumu tart\u0131\u015f\u0131lmazd\u0131r. Entelekt\xfcel anlamda bu erkekle \xe7ok iyi anla\u015fabilir, her t\xfcrl\xfc konudan konu\u015fabilirsiniz. Terazi erke\u011fiyle yapaca\u011f\u0131n\u0131z sehayatler de olduk\xe7a keyifli ge\xe7ecektir. Ak\u0131l ve mant\u0131k d\xfczleminde Terazi ile s\xfcper anla\u015f\u0131rs\u0131n\u0131z. Adalete ve e\u015fitli\u011fe kar\u015f\u0131 son derece duyarl\u0131 Terazi, sizin toplumcu, ilerici, yenilik\xe7i, vizyoner y\xf6nlerinizi m\xfckemmel \u015fekilde tamamlayacakt\u0131r. \xdcstelik Terazi de sosyal bir bur\xe7tur, dostluklardan, arkada\u015fl\u0131k ili\u015fkilerinden haz eder. Her ne kadar siz \xe7evrenizde daha fazla ki\u015fi ve sa\u011flam bir sosyal \xe7evre arasan\u0131z da Terazi\u2019nin bire bir ili\u015fkilerdeki diplomatik, dengeli ve uyumlu tavr\u0131ndan \xe7ok etkilenirsiniz. \xdcstelik Ven\xfcsyen cazibesi de ba\u015fka bir art\u0131d\u0131r. G\xfczel bir ili\u015fkiniz olabilir.","Kova i\xe7in i\xe7inde bulundu\u011fu sosyal \xe7evrenin, toplumun huzuru, refah\u0131 ve mutlulu\u011fu en az kendisininkiler kadar \xf6nemlidir. Bu u\u011furda engel tan\u0131madan gerekeni yapmaya haz\u0131rd\u0131r, bu nedenle arkada\u015flar\u0131n\u0131 ve sosyal \xe7evresini fazlas\u0131yla \xf6nemser. Ayr\u0131ca orijinal fikirleri, s\u0131ra d\u0131\u015f\u0131 yakla\u015f\u0131mlar\u0131, ak\u0131lc\u0131 y\xf6nleriyle ger\xe7ek bir vizyonerdir. Ancak \xe7evresinde s\xfcrekli arkada\u015flar\u0131 vard\u0131r ve \xe7ok sosyaldir. Onu arkada\u015flar\u0131 ve sosyal ama\xe7lar\u0131 ile birlikte kabul etmelisiniz. Kova erke\u011finin zek\xe2s\u0131, parlak fikirleri, u\xe7uk, ka\xe7\u0131k tarz\u0131yla asl\u0131nda sizin a\u015fktan beklentilerinizin \xe7o\u011funu kar\u015f\u0131lar. Konu\u015fmay\u0131, payla\u015fmay\u0131 seven yanlar\u0131n\u0131zla \xe7ok iyi iki dost olabilirsiniz her \u015feyden \xf6nce. Tek sorun marjinal ve s\u0131rad\u0131\u015f\u0131 y\xf6nlerinin sizin zarif ve kibar tarz\u0131n\u0131zla \xf6rt\xfc\u015fmemesi olabilir. Ayr\u0131ca onun bir Sat\xfcrn erke\u011fi oldu\u011fu dolay\u0131s\u0131yla biraz sert ve kural sahibi olabilece\u011fini hat\u0131rlatal\u0131m. A\u015fktan yana harika olabilir, ili\u015fki i\xe7in biraz daha fazlas\u0131 gerekebilir.","Bal\u0131k burcunun yumu\u015fakl\u0131\u011f\u0131, hassasiyeti, duygusall\u0131\u011f\u0131, her zaman dolmaya haz\u0131r g\xf6zleri, yarat\u0131c\u0131, sanatsal \xf6zellikleri ilgi \xe7ekici ve caziptir. Bu\u011fulu bak\u0131\u015flar\u0131, g\xfczel ve etkileyici sesi, yumu\u015fak dokunu\u015flar\u0131 ve s\xf6zleriyle akl\u0131n\u0131z\u0131 ba\u015f\u0131ndan alabilir. Size romantik \u015fiirler yazar, \u015fark\u0131lar yazar, ger\xe7ek bir romantik Don Juan veya Valentino olabilir ve ruhunuzu her daim ok\u015famas\u0131n\u0131 bilir. Ancak ona bakman\u0131z, derleyip, toplaman\u0131z, y\xf6n vermeniz gerekecektir. Hayat\u0131ndaki kaosu y\xf6netmeniz i\xe7in kendi konforunuzdan ne kadar \xf6d\xfcn verebilece\u011finizi her zaman yapt\u0131\u011f\u0131n\u0131z gibi iyi tartmal\u0131s\u0131n\u0131z. Aksi halde hemen her ortama ve herkese uyan yakla\u015f\u0131mlar\u0131 Bal\u0131k erke\u011fini g\xf6z\xfcn\xfczde elle tutulamaz, yakalanamaz hale getirir, bir anda elinizden \xe7oktan ka\xe7t\u0131\u011f\u0131n\u0131 fark edebilirsiniz.","Sanat ve estetik sizi bulu\u015fturan etkenlerden en \xf6nemlileridir. Yarat\u0131c\u0131l\u0131\u011f\u0131n\u0131z ve hassasiyetiniz detaylar\u0131 \xe7akt\u0131rmadan \xf6nemseyen Terazi\u2019nin g\xf6z\xfcnden ka\xe7mayacakt\u0131r. Olduk\xe7a romantik bir ili\u015fki kurabilirsiniz. Ancak zaman i\xe7inde kendinizi hayallere \xe7ok fazla kapt\u0131rabilirsiniz. Terazi de ikili ili\u015fki konusundaki ideallerinin ve beklentilerinin k\xf6lesi olabilir ve siz onun g\xf6z\xfcnde a\u015f\u0131r\u0131 hassas g\xf6r\xfcnebilirsiniz. Maddi sorunlar ortaya \xe7\u0131kt\u0131\u011f\u0131nda krizlere a\xe7\u0131k bir ili\u015fkiye d\xf6n\xfc\u015febilir. Oysa Terazi erke\u011finin estetik ve sanatsal inceli\u011fi g\xf6nl\xfcn\xfcz\xfc fethedebilir. Birlikte g\xfczel ve nezih bir dost ve arkada\u015f \xe7evresi edinebilir ve rafine zevkleri payla\u015fabilirsiniz. \xc7ok romantik bir ili\u015fkiniz olabilir. Hem kendinize hem etraf\u0131n\u0131za \u015fans da\u011f\u0131tabilirsiniz. Tek yapman\u0131z gereken kar\u015f\u0131n\u0131za \xe7\u0131kan zorluklar oldu\u011funda bunlardan ka\xe7mamak ya da fark\u0131nda olarak ya da olmadan birbirinizin \xfcst\xfcne atmamak olabilir.","Birbirinin ayn\u0131 bur\xe7lar ayn\u0131 ruhsal benzerliklere sahiptir. Dolay\u0131s\u0131yla kar\u015f\u0131n\u0131zda en az sizin kadar g\xfc\xe7l\xfc, m\xfccadeleci bir erkek var. Aran\u0131zdaki tart\u0131\u015fmalar\u0131 \xe7\xf6z\xfclmez noktalara ta\u015f\u0131mamaya \xf6zen g\xf6stermelisiniz. Dikkat edilmesi gereken bir ili\u015fkidir, birikilmi\u015f duygularla bir anda kopabilir. Di\u015fil bir bur\xe7 olan Akrep\u2019in kad\u0131nda daha g\xfc\xe7l\xfc tezah\xfcr etti\u011fini unutmamal\u0131s\u0131n\u0131z. Akrep kad\u0131n\u0131 olumsuz duygular\u0131 y\xf6netmeyi bilir. Ortak maddi sorunlar, k\xfclfetler bu ili\u015fkinin \xe7\u0131kmazlar\u0131ndan biri olabilir. Ayr\u0131ca kar\u015f\u0131l\u0131kl\u0131 olarak ilkelerinden vazge\xe7meme, al\u0131\u015fkanl\u0131klar\u0131 b\u0131rakamama, tarz ve duru\u015funda diretme gibi sorunlar ortaya \xe7\u0131kabilir.","Yay erke\u011finin iyimserli\u011fi ve ne\u015fesi ili\u015fkinizi besleyecek en \xf6nemli fakt\xf6rlerden biridir. Spora ve harekete merak\u0131, sosyalli\u011fi, \xf6zg\xfcr ve herkesle barr\u0131\u015f\u0131k ruhu kendinizi iyi hissetmenizi sa\u011flayacakt\u0131r. Yay\u2019\u0131n ne\u015fesi, canl\u0131l\u0131\u011f\u0131, her imkana, f\u0131rsata a\xe7\u0131k duru\u015fu, iyimserli\u011fi ve hayata olumlu bak\u0131\u015f\u0131 sizi derin aray\u0131\u015flardan \xe7ekip alabilir, hayat\u0131n\u0131za farkl\u0131 perspektifler katabilir. Sizin gizemli, tutkulu y\xf6nleriniz, onun enerjisi ile birle\u015fti\u011finde g\xfczel bir ili\u015fki do\u011fabilir. Ancak Yay erke\u011finin de\u011fi\u015fkenli\u011fine, her \u015feyden kolayca ge\xe7ip, farkl\u0131 farkl\u0131 pek \xe7ok alana y\xf6nelebilmesine, a\u015f\u0131r\u0131 sosyalli\u011fine uyum sa\u011flaman\u0131z kolay de\u011fildir. Ayr\u0131ca kendinin de kontrol edemedi\u011fi maddi veya manevi savruklu\u011fu kaynaklar\u0131n\u0131z\u0131n t\xfckenmesine neden olabilir, dikkat etmelisiniz.","Akrep burcu erke\u011fini anlaman\u0131z hi\xe7 de kolay de\u011fildir. Sizin olaylar\u0131n ve ki\u015filerin \xfczerinde \xe7ok\xe7a durmayan iyimser ve ho\u015fg\xf6r\xfcl\xfc tavr\u0131n\u0131z kar\u015f\u0131s\u0131nda o her daim \u015f\xfcpheci ve s\xfcrekli baz\u0131 \u015feyleri d\xf6n\xfc\u015ft\xfcrme ve geli\u015ftirme arzusundad\u0131r. Akrep erke\u011finin derinli\u011fi, sezgileri sizin bilgeli\u011finizle birle\u015fti\u011finde ortaya harika bir ili\u015fki \xe7\u0131karabilirsiniz. Ancak etraf\u0131n\u0131zda \xe7ok fazla ki\u015fi olmas\u0131, sosyal, geli\u015fime, de\u011fi\u015fime her daim a\xe7\u0131k kap\u0131lar\u0131n\u0131z \u015f\xfcpheci ve zaman zaman k\u0131skan\xe7 Akrep\u2019e ters gelebilir. Ama yanl\u0131\u015f bir \u015fey yapmad\u0131\u011f\u0131n\u0131z s\xfcrece hi\xe7 sorun olmaz, g\xf6zleri ve hisleri her daim \xfczerinizde oldu\u011fundan sizi anlar ve bilir. Yine de zaman zaman fark\u0131nda bile olmad\u0131\u011f\u0131n\u0131z noktalar\u0131 zorlamas\u0131yla sizin i\xe7in kolay bir ili\u015fki olmayabilir.","O\u011flak erke\u011fi sab\u0131r ve metanet gerektirir. \u0130li\u015fkinin zorlay\u0131c\u0131 yan\u0131 duygular\u0131n\u0131z\u0131 biriktirerek sabr\u0131n\u0131z\u0131n t\xfckendi\u011fi noktada bir anda patlaman\u0131z olabilir. Bu erke\u011fe kar\u015f\u0131 duygular\u0131n\u0131z\u0131 biraz daha kontrol edebilmelisiniz. O\u011flak\u2019\u0131n prensipleri, kurallar\u0131, ciddiyeti, resmiyeti, planlar\u0131 size olduk\xe7a k\u0131s\u0131tlay\u0131c\u0131, daralt\u0131c\u0131 ve zor gelebilir. Onun da sizin derinli\u011finizi, tutkular\u0131n\u0131z\u0131, her \u015feyi kurcalamaya meyilli yap\u0131n\u0131z\u0131 anlamas\u0131 pek kolay de\u011fildir. Ayr\u0131ca d\u0131\u015far\u0131da \xf6nemli buldu\u011fu daha ciddi i\u015f, g\xf6rev ve sorumluluklar\u0131 olabilir ve s\u0131n\u0131rs\u0131z sorgulay\u0131c\u0131l\u0131\u011f\u0131n\u0131z, meraklar\u0131n\u0131z kar\u015f\u0131s\u0131nda \xe7ok daha s\u0131n\u0131rl\u0131, klasik ve gelenek\xe7idir. Zor bir ili\u015fki olabilir.","Akrep tutkulu, derin ve gizemlidir. Onu \xe7\xf6zmek zaman\u0131n\u0131z\u0131 alsa da bir s\xfcre sonra, gereken sabr\u0131 ve vakti tan\u0131d\u0131\u011f\u0131n\u0131zda uyumlu bir beraberlik yakalayabilirsiniz. Onun ihtiya\xe7lar\u0131n\u0131, beklentilerini do\u011fru anlamal\u0131 ve \xf6nerilerine ve s\xf6ylediklerine kar\u015f\u0131 gelmeden \xf6nce iyi d\xfc\u015f\xfcnmelisiniz. Akrep erke\u011finin sadakati ve ba\u011fl\u0131l\u0131\u011f\u0131 uzun vadede sizi tatmin edici \xf6zelli\u011fidir. Onunla sosyalle\u015febilir, arkada\u015f \xe7evrenizi zenginle\u015ftirebilirsiniz. Ancak s\xfcrekli hem kendini hem \xe7evresini de\u011fi\u015ftirme \xe7abas\u0131, bu y\xf6nde dinmek bilmeyen ele\u015ftirel ve m\xfckemmeliyet\xe7i bak\u0131\u015f a\xe7\u0131s\u0131 ve huzursuzlu\u011fu rahats\u0131z edici olabilir. Ancak onun sorgulay\u0131c\u0131, inat\xe7\u0131 yap\u0131s\u0131n\u0131 kendi hedef ve planlar\u0131n\u0131za ba\u011flarsan\u0131z bu ili\u015fkide arad\u0131\u011f\u0131n\u0131z ba\u015far\u0131y\u0131 yakalayabilirsiniz.","Akrep burcu erke\u011finin derinli\u011finden, her olay\u0131 en ince ayr\u0131nt\u0131s\u0131na kadar bilmek ve ayd\u0131nlatmak iste\u011finden etkilenebilirsiniz. \u0130\xe7sel ve ruhsal zenginli\u011fi de sizi ona \xe7ekecektir. Ancak \u015f\xfcpheci tutumu, k\u0131skan\xe7l\u0131\u011f\u0131, gizlili\u011fe d\xfc\u015fk\xfcnl\xfc\u011f\xfc \xf6zg\xfcr bak\u0131\u015f a\xe7\u0131n\u0131z\u0131 zorlayabilir. Akrep\u2019in sezgileri inan\u0131lmazd\u0131r. Sizin ak\u0131l boyutunuzu, i\xe7ten gelen sezgisel ve genellikle de hakl\u0131 \xe7\u0131kt\u0131\u011f\u0131 savlar\u0131yla, \xf6nerileriyle asl\u0131nda \xe7ok iyi tamamlayabilir. Ancak Akrep erke\u011finin gizemli, tehlikeli bir sava\u015f\xe7\u0131 oldu\u011funu da akl\u0131n\u0131zdan \xe7\u0131karmay\u0131n. Hi\xe7 ummad\u0131\u011f\u0131n\u0131z bir yer ve anda sizin fark\u0131nda bile olmad\u0131\u011f\u0131n\u0131z ancak kendi i\xe7inde biriktirdi\u011fi duygular\u0131n\u0131 d\u0131\u015fa vurmaktan asla \xe7ekinmeyecektir. Bu da \xe7ok duygusal olmayan, akla, zek\xe2ya \xf6nem veren yap\u0131n\u0131z\u0131 sarsabilir. \u0130li\u015fkiyi bir rekabete ta\u015f\u0131maman\u0131z sizin i\xe7in iyi olabilir.","Kova\u2019n\u0131n orijinal, marjinal, s\u0131ra d\u0131\u015f\u0131 \xf6zellikleri dikkatinizden ka\xe7mayacakt\u0131r. Ancak yenilik\xe7i ve \xf6zg\xfcrl\xfck\xe7\xfc oldu\u011fu kadar, sert, kat\u0131 ve so\u011fuk taraflar\u0131 da vard\u0131r. Bu da muhtemelen daha \xf6nceki d\xf6neminde, erken ya\u015flar\u0131nda ya\u015fad\u0131\u011f\u0131 s\u0131k\u0131nt\u0131lar ve ald\u0131\u011f\u0131 sorumluluklardan kaynakl\u0131d\u0131r. Kolay bir ili\u015fki de\u011fildir ancak onun bilgisinden ve tecr\xfcbelerinden \xe7ok \u015fey \xf6\u011frenebilirsiniz. Kova erke\u011finin sosyal ve toplumcu y\xf6nleri, s\u0131ra d\u0131\u015f\u0131 yakla\u015f\u0131mlar, sizin ise sezgisel ve metafizik g\xfcc\xfcn\xfcz birle\u015fti\u011finde birbirinizi besleyici bir ili\u015fki yaratabilirsiniz. Ancak bunun i\xe7in u\u011fra\u015fman\u0131z ve onu iyice anlaman\u0131z gerekiyor.","Bal\u0131k erke\u011fi vericili\u011fi, fedak\xe2rl\u0131\u011f\u0131 ve sonsuz merhametiyle sizi duygusal y\xf6nden olduk\xe7a besler. Bu erke\u011fe kolayca a\u015f\u0131k olabilirsiniz, o da size. Sizi bak\u0131\u015flar\u0131, karma\u015f\u0131k duygular\u0131, uyumlu y\xf6nleri, g\xfczel sesiyle b\xfcy\xfcleyebilir. Sizin de gizemli taraflar\u0131n\u0131z, derinli\u011finiz aran\u0131zda sihirli bir ili\u015fki yaratabilir. Duygusal seviyede olduk\xe7a iyi bir ili\u015fkidir. Maddi konular\u0131n bu sihri ve b\xfcy\xfcy\xfc bozmas\u0131na izin vermemelisiniz. Aran\u0131zdaki duygusal \xe7ekim ve elektrik uzun s\xfcreli bir ili\u015fki kurman\u0131z\u0131 sa\u011flayabilir. Birbirinizi b\xfcy\xfcledi\u011finiz kadar \xe7evrenizi de etkileyen bir \xe7ift olabilirsiniz. Akrep\u2019in a\xe7\u0131klar\u0131 yakalayabilme g\xfcc\xfc, Bal\u0131k\u2019\u0131n sihirli bilgeli\u011fi tuhaf ve gizemli bir \u015fekilde bu ili\u015fkinin uzun s\xfcrmesini de \xe7abuk\xe7a bitmesini de sa\u011flayabilir.","Akrep erke\u011finin ruhundan iyi anlars\u0131n\u0131z ve bu anlay\u0131\u015f\u0131n kar\u015f\u0131l\u0131\u011f\u0131n\u0131 da bulabilirsiniz. Olduk\xe7a uyumlu bir beraberli\u011finiz olabilir. Ancak Akrep m\xfccadeleden ve dramadan ho\u015flan\u0131r ve zaman zaman sizin iyiliksever, ba\u011f\u0131\u015flay\u0131c\u0131 ve fedak\xe2r y\xf6nleriniz ona biraz anlams\u0131z gelebilir. Romantik a\xe7\u0131dan olduk\xe7a uyumlu bir ili\u015fkiniz olabilir. Akrep\u2019in kararl\u0131l\u0131\u011f\u0131, h\u0131rs\u0131, zorluklar kar\u015f\u0131s\u0131nda m\xfccadeleci y\xf6n\xfc sizi \xf6zellikle d\u0131\u015f etkilere kar\u015f\u0131 toparlayacakt\u0131r. Siz de spirit\xfcel ve manevi y\xf6nlerinizle bu ili\u015fkiyi besleyen taraf olabilirsiniz. Kar\u015f\u0131l\u0131kl\u0131 bilinmezler ve gizemlerle olduk\xe7a sihirli ve b\xfcy\xfcl\xfc bir ili\u015fki yaratabilirsiniz. Bu ili\u015fkinin belki de yeg\xe2ne zorlu\u011fu ba\u015fkalar\u0131 taraf\u0131ndan anla\u015f\u0131lmamak olabilir.","Yay erke\u011fiyle bol bol gezebilir, seyahatlere \xe7\u0131kabilir, felsefi, dini her t\xfcrl\xfc g\xf6r\xfc\u015f\xfcn\xfcz\xfc payla\u015fabilirsiniz. Ancak bu ili\u015fki bir yerlere ba\u011fl\u0131 kalamama, s\u0131n\u0131rlar\u0131 fazla zorlama ve abartma, ak\u0131l ve mant\u0131kla \xe7\xf6z\xfclebilecek konular\u0131 g\xf6rememe gibi baz\u0131 handikaplar ta\u015f\u0131r. Kar\u015f\u0131l\u0131kl\u0131 bol bol spor yap\u0131p, gezece\u011finiz olduk\xe7a dinamik ve hareketli bir ili\u015fkiniz olabilir. Farkl\u0131 yerlerde oturabilir, s\u0131k\xe7a mek\xe2n de\u011fi\u015ftirebilir, akl\u0131n\u0131za esti\u011fi anda, esti\u011fi \u015fekilde ya\u015famak isteyebilirsiniz. Maddi konular, g\xf6rev, i\u015f ve sorumluluklar, \xe7oluk \xe7ocuk i\u015fin i\xe7ine girdi\u011finde olduk\xe7a zorlay\u0131c\u0131 bir ili\u015fkiye d\xf6n\xfc\u015febilir. Bu ili\u015fkinin s\u0131n\u0131r tan\u0131mama, \xe7izememe, belirleyememe gibi sorunlar\u0131 olabilir.","O\u011flak erke\u011fi size ihtiya\xe7 duydu\u011funuz maddi g\xfcveni sa\u011flayabilir. Size g\xfcvenilir, uzun vadeli, dayan\u0131kl\u0131 ve sa\u011flam bir ili\u015fki sunabilir. Ancak kuralc\u0131 ve disiplinli yap\u0131s\u0131, lider \xf6zellikleri, sizin \xf6zg\xfcrl\xfc\u011f\xfcn\xfcz\xfc bast\u0131rabilir, iyimserli\u011finizi elinizden alabilir. O\u011flak burcunun s\u0131k\u0131, kuralc\u0131, planl\u0131 yap\u0131s\u0131, ya\u015fam\u0131n her t\xfcrl\xfc zenginli\u011finden, geni\u015flemeden uygun yap\u0131n\u0131za son derece k\u0131s\u0131tlay\u0131c\u0131 gelebilir. Birbirinizi anlaman\u0131z ve birbirinize ayak uydurman\u0131z neredeyse imkans\u0131zd\u0131r. Yay olarak ke\u015ffetme, b\xfcy\xfcme arzunuz O\u011flak\u2019\u0131n s\u0131n\u0131rl\u0131 sorumlu ve bir \u015firket gibi y\xf6netti\u011fi ya\u015fam\u0131n\u0131n daralt\u0131c\u0131 y\xf6nleriyle ciddi \u015fekilde \xe7ak\u0131\u015fabilir.","Yay burcu erke\u011fini anlaman\u0131z, onun da sizi anlamas\u0131 kolay de\u011fildir. Yay erke\u011fi maddi, manevi geni\u015fleme ve zenginle\u015fmeden yanad\u0131r, siz ise istikrar ve kararl\u0131l\u0131k i\xe7in baz\u0131 k\u0131s\u0131tlama ve s\u0131n\u0131rlamalar\u0131n getirilmesi gerekti\u011fine inan\u0131rs\u0131n\u0131z. Dolay\u0131s\u0131yla Yay\u2019\u0131n \xf6zg\xfcr y\xf6n\xfc, s\u0131n\u0131r tan\u0131mamas\u0131 ve hayat\u0131n\u0131 zenginle\u015ftirecek pek \xe7ok ilgi alan\u0131na sahip olmas\u0131, s\u0131n\u0131rlardan, \u015fekillerden, \u015fablonlardan ho\u015flanan yap\u0131n\u0131za olduk\xe7a ters gelecektir. S\xfcrekli hareket ve seyahat aray\u0131\u015f\u0131nda olmas\u0131 sizin tutucu yap\u0131n\u0131zla pek \xf6rt\xfc\u015fmeyebilir. Siz uzun vadeli, \xf6nemli ve ciddi planlar\u0131n, hedeflerin pe\u015findeyken o ise hayat\u0131 tam bir macera ve ke\u015fif alan\u0131 olarak g\xf6rebilir. Bu ili\u015fkinin y\xfcr\xfcmesi olduk\xe7a zor ve me\u015fakkatlidir.","Yay erke\u011fi hayat\u0131n\u0131za ya\u015fam enerjisi ve iyimserlik katarken, birlikte sosyalle\u015febilir, zengin bir arkada\u015f grubu edinebilirsiniz. Yay\u2019\u0131n ate\u015fi sizi harekete ge\xe7irirken, sizin ak\u0131lc\u0131l\u0131\u011f\u0131n\u0131z ve fikirleriniz onun hayat\u0131n\u0131 kolayla\u015ft\u0131racakt\u0131r. \xdcstelik ne\u015feli ve geni\u015f d\xfcnya g\xf6r\xfc\u015f\xfc, sizin vizyoner yap\u0131n\u0131zla son derece \xf6rt\xfc\u015f\xfcr. Ancak Yay\u2019\u0131n de\u011fi\u015fken y\xf6nleri, esnekli\u011fi ve s\xfcrekli hareket halinde olmas\u0131, sizin istikrardan ve kararl\u0131l\u0131ktan yana taraflar\u0131n\u0131zla \xe7eli\u015febilir. Birbirinizi bu y\xf6nlerden tolere edebildi\u011finiz \xf6l\xe7\xfcde, ki bunu yapabilmeniz \xe7ok da zor de\u011fildir, g\xfczel bir ili\u015fkiniz olabilir.","Kova erke\u011finin s\u0131ra d\u0131\u015f\u0131l\u0131\u011f\u0131, orijinal yakla\u015f\u0131mlar\u0131 o g\xfcne kadar g\xf6remedi\u011finiz veya fark\u0131na varamad\u011f\u0131n\u0131z yeni kap\u0131lar a\xe7abilir size. Bunlar geni\u015f ve zengin vizyonunuzu tamamlayan \u015feylerdir. Size hayat\u0131n\u0131z\u0131 zenginle\u015ftirme u\u011fruna g\xf6z ard\u0131 etti\u011finiz akl\u0131n ve mant\u0131\u011f\u0131n yolunu hat\u0131rlatacakt\u0131r. Kova\u2019n\u0131n de\u011fi\u015fime her daim a\xe7\u0131k ve yenilik\xe7i fikirleri, \xf6zg\xfcrl\xfck\xe7\xfc ve her t\xfcrl\xfc u\xe7uk, ka\xe7\u0131kl\u0131ktan ho\u015flanan y\xf6nleri ho\u015funuza gidecektir. \xdcstelik ak\u0131lc\u0131, zeki, toplumcu yanlar\u0131 bu ili\u015fkiye farkl\u0131 boyutlar katabilir. Ancak Kova'n\u0131n her \u015feye ra\u011fmen sert ve disiplinli bir taraf\u0131n\u0131n da oldu\u011funu unutmamal\u0131s\u0131n\u0131z.","Ortak hayaller sizi bir araya getirse de Yay erke\u011fi bu hayalleri fiziksel olarak da ya\u015famak, her ge\xe7en g\xfcn daha fazlas\u0131n\u0131 ke\u015ffetmek isteyebilir siz ise kendi hayal aleminizde, d\xfc\u015flerinizle kalmay\u0131 tercih edebilirsiniz. Bu da her ne kadar aran\u0131zda \xe7ekim olsa da uzun vadeli bir birlikteli\u011fi zor k\u0131labilir. Yay erke\u011fi dolayl\u0131 durumlardan ve karma\u015f\u0131kl\u0131ktan pek haz etmez. Y\xfcksek enerjisiyle kaosu \xe7\xf6zmeye \xe7al\u0131\u015fmak ona g\xf6re bir u\u011fra\u015f de\u011fildir. Sportif ve fiziksel hedefleri, zevkleri vard\u0131r. Ke\u015fif ve macera ruhunu anlamad\u0131\u011f\u0131 duygusal bir \xf6r\xfcnt\xfcyle bezemekten ka\xe7\u0131nacakt\u0131r. D\xfc\u015f\xfcnd\xfc\u011f\xfcn\xfc h\u0131zl\u0131 ve a\xe7\u0131k \u015fekilde s\xf6ylemekten ve ifade etmekten yanad\u0131r ve size g\xf6re \xe7ok daha ger\xe7ek\xe7idir. Sizde ise her zaman hayalperest, ger\xe7eklerden uzakla\u015fmaya, onlarla y\xfczle\u015fmemeye meyilli bir taraf vard\u0131r. Zor bir ili\u015fki olabilir.","Her ikiniz i\xe7in de bu ili\u015fkiyi uzun vadede korumak ve y\xf6netmek hi\xe7 kolay olmayabilir. Zira ili\u015fkinin ne s\u0131n\u0131rlar\u0131n\u0131 ne de hangi uca buca\u011fa varaca\u011f\u0131n\u0131 kestirmeniz olduk\xe7a g\xfc\xe7t\xfcr. Hi\xe7 fark\u0131nda olmad\u0131\u011f\u0131n\u0131z bir anda kopup, da\u011f\u0131l\u0131p gidebilir, toparlamak, \xe7eki d\xfczen vermek her iki taraf\u0131n da umurunda olmayabilir. Bal\u0131k erke\u011finin duygusal y\xf6nleri, hassasiyeti ve yarat\u0131c\u0131l\u0131\u011f\u0131 aran\u0131zdaki ili\u015fkiyi siz fark\u0131nda olmadan besleyen unsurlard\u0131r. Ancak sizin hareket onun ise duygusal a\xe7\u0131dan s\u0131n\u0131r tan\u0131mamazl\u0131\u011f\u0131 ili\u015fkinizi bir yere vard\u0131rman\u0131z\u0131 zorla\u015ft\u0131rabilir.","O\u011flak erke\u011fi de yine sizin ho\u015fland\u0131\u011f\u0131n\u0131z ve be\u011fendi\u011finiz \u015feylerden ho\u015flan\u0131r. O da sizin gibi planl\u0131 ve stratejik hareket etmeyi, ciddiyeti, resmiyeti sever. Farkl\u0131 etkiler yoksa biraz so\u011fuk ve kasvetli bir ili\u015fki olabilir. Do\u011fum haritalar\u0131n\u0131z\u0131n O\u011flak d\u0131\u015f\u0131ndaki y\xf6nlerine kar\u015f\u0131l\u0131kl\u0131 a\u011f\u0131rl\u0131k vererek bu ili\u015fkiyi y\xfcr\xfctmeniz m\xfcmk\xfcnd\xfcr. Onun d\u0131\u015f\u0131nda b ili\u015fki kar\u015f\u0131l\u0131kl\u0131 kurallar, disiplin ve planlar \xe7er\xe7evesinde y\xfcr\xfcyebilir. Kar\u015f\u0131l\u0131kl\u0131 olarak ili\u015fkinizi bir i\u015f y\xf6netir gibi y\xf6netebilirsiniz. Birbirinizi \xe7ok iyi anlayabilirsiniz ama iyi anlamak, anla\u015fmak olmayabilir.","Kova erke\u011finin kendi d\u0131\u015f\u0131nda arkada\u015flar\u0131n\u0131, i\xe7inde bulundu\u011fu toplumu ve ortam\u0131 g\xf6zetmesi, sosyal ama\xe7lar i\xe7in \xe7al\u0131\u015fmas\u0131, organize olmas\u0131 ve emek sarf etmesi ve bundan dolay\u0131 yan\u0131nda s\xfcrekli ba\u015fka birilerinin de bulunmas\u0131 bir s\xfcre sonra kendinizi pek de \xf6zel hissetmemenize neden olabilir. \xd6zg\xfcrl\xfck\xe7\xfc ve yenilik\xe7i y\xf6nlerine alan tan\u0131yabildi\u011finiz s\xfcrece bir ili\u015fkiniz ve beraberli\u011finiz olabilir. Ancak ihtiya\xe7 duydu\u011funuz s\u0131cakl\u0131\u011f\u0131 ve \u015fefkati onda bulman\u0131z zor olacakt\u0131r. Kova erke\u011fi size fazla sosyal, umutlar\u0131n\u0131n pe\u015finde, kendini bunlara adam\u0131\u015f biri olarak fazlaca idealist gelebilir. Sizin kurallar\u0131n\u0131z da yenilik\xe7i ve \xf6zg\xfcr ruhlu Kova i\xe7in fazla daralt\u0131c\u0131 gelebilir. Gelenek\xe7i taraf\u0131n\u0131z\u0131 onun modern ve vizyoner y\xf6nleriyle bulu\u015fturman\u0131z zaman ve \xe7aba harcanmas\u0131 gereken bir \xf6r\xfcnt\xfc do\u011furabilir.","O\u011flak erke\u011fini \xf6zellikle ruhsal y\xf6nden anlaman\u0131z asl\u0131nda zor de\u011fil, zira her ikiniz de belirli ama\xe7 ve hedefler do\u011frultusunda ilerlemekten, programdan, zaman\u0131 y\xf6netmekten ho\u015flan\u0131rs\u0131n\u0131z. \xdcstelik disiplinli ve kuralc\u0131 yap\u0131s\u0131, resmiyeti ve ciddiyeti asl\u0131nda size \xf6z\xfcn\xfczde \xe7ok da ters gelen \xf6zellikler de\u011fildir. Ancak O\u011flak erke\u011fine orijinal, s\u0131rad\u0131\u015f\u0131 yakla\u015f\u0131mlar\u0131n\u0131z fazlas\u0131yla u\xe7uk, arkada\u015f \xe7evreniz a\u015f\u0131r\u0131 kalabal\u0131k gelebilir. Birbirinizin fikirlerine ve kurallar\u0131na sayg\u0131 duydu\u011funuz \xf6l\xe7\xfcde uyumlu bir beraberlik olabilir. Ancak yine de duygulardan yoksunluk, fikirlerin, plan ve projelerin \xf6nde olmas\u0131 resmi bir ili\u015fkiyle sonu\xe7lanabilir.","Bal\u0131k erke\u011finin da\u011f\u0131n\u0131kl\u0131\u011f\u0131 kuralc\u0131 ve disiplinli O\u011flak burcu i\xe7in olduk\xe7a zorlay\u0131c\u0131 olabilir. Sizin disiplin aray\u0131\u015f\u0131n\u0131z, sisteme ve d\xfczene d\xfc\u015fk\xfcnl\xfc\u011f\xfcn\xfcz Bal\u0131k erke\u011fine, onun romantizm ve yarat\u0131c\u0131l\u0131\u011f\u0131na olduk\xe7a ters d\xfc\u015febilir. Bal\u0131k burcu bu ili\u015fkide bir s\xfcre sonra kendini olduk\xe7a pasif ve silik hissedebilir. Ancak onun da\u011f\u0131n\u0131kl\u0131\u011f\u0131n\u0131 toparlayabildi\u011finiz, karma\u015f\u0131k duygu d\xfcnyas\u0131na bir y\xf6n verebildi\u011finiz \xf6l\xe7\xfcde ili\u015fkiyi \u015fekillendiren ve y\xf6neten ki\u015fi siz olursunuz. Onun yarat\u0131c\u0131 ve sanat\xe7\u0131 y\xf6nlerini bast\u0131rmamaya gayret etmelisiniz. Zorlay\u0131c\u0131 bir ili\u015fki s\xf6z konusu olabilir.","O\u011flak erke\u011finin maddiyata \xf6nem veren ve ayaklar\u0131 fazlas\u0131yla yere basan y\xf6nlerini duygular\u0131n\u0131z ve hassasiyetinizle dengeleyebilirsiniz. \xdcstelik bu erkek size ihtiyac\u0131n\u0131z olan maddi g\xfcc\xfc ve dirayeti sa\u011flayacakt\u0131r. Birbirinizdeki bu eksik y\xf6nleri tamamlad\u0131k\xe7a m\xfckemmele yak\u0131n bir ili\u015fkiniz olabilir. Ancak lider ve y\xf6netici \xf6zellikleriyle O\u011flak erke\u011finin bu ili\u015fkide bask\u0131n duruma gelebilece\u011fini unutmay\u0131n. Ama sezgilerinizle onun kafas\u0131n\u0131 kar\u0131\u015ft\u0131rabilir, farkl\u0131 y\xf6nlere \xe7ekebilirsiniz. Yine de pasifize edilmemeye dikkat. Bir de bu kadar ciddi, ger\xe7ek\xe7i, resmi bir yap\u0131dan ne kadar ho\u015flanabilece\u011finizi iyi tartmal\u0131s\u0131n\u0131z. O\u011flak burcunun kurallar\u0131, disiplini, her \u015feyi s\u0131n\u0131fland\u0131rmaya ve bir \u015fekle sokmaya \xe7al\u0131\u015fan y\xf6nleri sizin u\xe7lar\u0131 sonsuz a\xe7\u0131k d\xfcnyan\u0131za olduk\xe7a ters gelebilir.","Ayn\u0131 bur\xe7tan iki ki\u015finin ili\u015fkisi kolay g\xf6r\xfcnse de asl\u0131nda \xe7e\u015fitli zorluklar\u0131 beraberinde ta\u015f\u0131yor olabilir. Her ne kadar birbirinizi en iyi siz anlasan\u0131z da bu ili\u015fkiyi somutla\u015ft\u0131ramamak, ayaklar\u0131n\u0131 yere bast\u0131ramamak, fikirlerin havada kalmas\u0131 zaman i\xe7inde problem olabilir. Ancak birlikte her t\xfcrl\xfc sosyal projede yer alabilir, dernek, vak\u0131f ve sosyal ama\xe7l\u0131 kurulu\u015flarda \xe7al\u0131\u015fabilirsiniz. Bu t\xfcr ortamlarda kar\u015f\u0131la\u015fm\u0131\u015f ve yak\u0131nla\u015fm\u0131\u015f olman\u0131z da zaten kuvvetle muhtemeldir. Ortak bir sosyal ama\xe7 ve arkada\u015f \xe7evresi, ortak bir vizyon ili\u015fkinizi ayakta ve diri tutabilir.","Siz de hayaller, Kova erke\u011finde ise bolca gelece\u011fe y\xf6nelik umutlar vard\u0131r. \xdcstelik bu erkek umutlar\u0131 s\xf6z konusu oldu\u011funda onlar\u0131 ger\xe7ekle\u015ftirme konusunda da kararl\u0131d\u0131r. \u0130kisini birle\u015ftirdi\u011finizde harika bir uyum yakalayabilirsiniz. Kova erke\u011finin realist ve ak\u0131lc\u0131 d\xfcnyas\u0131na getirece\u011finiz duygusall\u0131k m\xfckemmel bir ili\u015fkide m\xfckemmel uyumun kap\u0131lar\u0131n\u0131 aralayacakt\u0131r. Birbirinizi anlad\u0131\u011f\u0131n\u0131z ve duygusal ve zihinsel d\xfcnyalar\u0131n\u0131z\u0131 birle\u015ftirdi\u011finiz anda s\u0131cak, duygu dolu ve bir o kadar da ilham verici bir yuva kurabilirsiniz. Sosyal \xe7evrenizin, toplumun, d\xfcnyan\u0131n, insanl\u0131\u011f\u0131n yarar\u0131na i\u015flere, u\u011fra\u015flara birlikte imza atabilirsiniz. Kendinizden \xe7ok ba\u015fkalar\u0131n\u0131n yarar\u0131na bir ili\u015fkiniz olabilir.","Siz toplumsal y\xf6nden Bal\u0131k erke\u011fi evrensel a\xe7\u0131dan idealisttir. Bu idealizm anlay\u0131\u015f\u0131 sizi birbirinize yak\u0131nla\u015ft\u0131ran bir fakt\xf6r olabilir. Uyumlu bir birlikteli\u011finiz olabilir. Bal\u0131k burcunun yarat\u0131c\u0131l\u0131\u011f\u0131, sezgileri, sanat\xe7\u0131 y\xf6nleri ili\u015fkinizi duygusal y\xf6nden besleyen taraflar olacakt\u0131r. Sizin de fikirleriniz, d\xfc\u015f\xfcnsel zenginli\u011finiz beraberli\u011finize entelekt\xfcel bir zenginlik katar. Birlikte ba\u015fka ki\u015filerin iyili\u011fine ve hayr\u0131na olabilecek \xe7ok fazla \u015fey yapabilirsiniz, verimli olduk\xe7a uzun s\xfcren bir beraberli\u011finiz olacakt\u0131r. Ancak Bal\u0131k erke\u011finin engin, u\xe7suz bucaks\u0131z, s\u0131n\u0131rs\u0131z hayal g\xfcc\xfcnde, d\xfc\u015flerinde, aray\u0131\u015flar\u0131nda kaybolmamaya dikkat etmelisiniz.","\u0130kinizin de de\u011fi\u015fken yap\u0131s\u0131 \xf6zellikle zorluklar kar\u015f\u0131s\u0131nda karma\u015f\u0131k, i\xe7inden \xe7\u0131k\u0131lmas\u0131 imk\xe2ns\u0131z yollara sapman\u0131za neden olabilir. Zorluklar da her ili\u015fki i\xe7in ka\xe7\u0131n\u0131lmazd\u0131r. Kendinizi karma\u015f\u0131k, her \u015feyin belirsiz oldu\u011fu bir ili\u015fki denizinde hatta okyanusunda bulabilirsiniz. Spirit\xfcel ve ruhsal anlamda harika bir ili\u015fki olsa da maddi anlamda d\u0131\u015f etkenlere, ba\u015fka ki\u015filerin ve olaylar\u0131n m\xfcdahalesine olduk\xe7a a\xe7\u0131k olabilirsiniz. Hayal g\xfcc\xfcn\xfcn ve yarat\u0131c\u0131l\u0131\u011f\u0131n s\u0131n\u0131rlar\u0131n\u0131 zorlayan, mistik zirveye ula\u015fan bir beraberli\u011finiz olabilir. Ancak kar\u015f\u0131l\u0131kl\u0131 ihmaller, dalg\u0131nl\u0131klar ve hatta sakarl\u0131klar denizinde birbirinizi kaybetmemeye \xf6zen g\xf6stermelisiniz. Her ne kadar harikulade bir ili\u015fki gibi g\xf6r\xfcnse de ger\xe7eklerle temas\u0131n\u0131z\u0131 sa\u011flayacak bir enerjiye ve deste\u011fe ihtiyac\u0131n\u0131z olacakt\u0131r."]),t.s)
