B.Lz=A.b(s([" - Son derece sad\u0131k, c\xf6mert ve y\xfcce g\xf6n\xfcll\xfc olmalar\u0131na ra\u011fmen, evlilikte her zaman \u015fansl\u0131 say\u0131lmazlar.\n\n - Hatta ili\u015fkileri tuhaf bir \u015fekilde biter. Ya\u015famlar\u0131nda \xe7o\u011fu kez \xe7ocuklar\u0131yla sorunlar\u0131 olur. ve bu da evliliklerinin g\xf6lgelenmesine neden olabilir.\n\n - Gen\xe7lik y\u0131llar\u0131nda acemi a\u015fklar\u0131n avc\u0131s\u0131yken, ya\u015f\u0131n\u0131z ilerledik\xe7e olgun a\u015fklar\u0131n g\xf6rkemli yarat\u0131c\u0131s\u0131 olur ve yaln\u0131z bir ya\u015fam\u0131 asla d\xfc\u015f\xfcnemez.. \n\n - Duygulu romatik bile olsa, l\xfcks ya\u015fam arzusundan asla vazge\xe7emez. Hayat\u0131nda daima ona e\u015flik edecek a\u015fklar vard\u0131r. Se\xe7imleri isabetli ve uygun ki\u015filer olacakt\u0131r. \n\n - D\xfcr\xfcst oldu\u011fu i\xe7in de, hayat\u0131ndaki ki\u015fiden b\u0131ksa bile onu terk etmeden ya\u015fant\u0131s\u0131na ba\u015fka bir kimseyi almaz.. Aslan kad\u0131nlar\u0131 gece hayat\u0131ndan ve g\xf6rkemden ho\u015flan\u0131r.\n\n - Siz de, her konuda bu \xf6zelli\u011fkerini yans\u0131tan k\u0131yafetler ve e\u015fyalardan alman\u0131z\u0131 isteyebilir.\n\n - Tak\u0131lar\u0131n da ya\u015fant\u0131lar\u0131nda \xf6nemli bir yer tuttu\u011funu unutmay\u0131n.Bu kad\u0131n sayg\u0131 duydu\u011fu bir e\u015fi oldu\u011fu zaman ya\u015fant\u0131s\u0131ndaki ki\u015fiyide mutlu edecektir.\n\n"," - S\u0131cak romantik, ate\u015fli a\u015f\u0131klard\u0131r. Birlikte oldu\u011fu insan\u0131 ayaklar\u0131n\u0131 yerden keser. \n\n - \u0130yi bir konu\u015fmac\u0131 oldu\u011fu i\xe7inde, g\xfczel a\u015fk s\xf6zleri s\xf6ylemekte \xfcstlerine yoktur.Bulunduklar\u0131 her ortamda sevgi krall\u0131klar\u0131n\u0131 ilan etmeye haz\u0131rd\u0131rlar.\n\n - Kar\u015f\u0131 cins \xe7ekici ve toplum i\xe7inde kendilerini belli eden ki\u015filerdir.Cinsel a\xe7\u0131dan yo\u011fun ya\u015fad\u0131klar\u0131 duygular\u0131n\u0131 zor idare ederler.\n\n - Aslan burcu ki\u015fisi partnerinden s\xfcrekli olumlu s\xf6zler duymaktan ho\u015fland\u0131klar\u0131 i\xe7in, en k\xfc\xe7\xfck bir ilgisizlik kar\u015f\u0131s\u0131nda t\xfcm dengelerini yitirirler.\n\n - Ya\u015fam\u0131n karizmatik oyuncular\u0131d\u0131r. Sizi seven bir aslan erke\u011finden kurtulman\u0131z o kadar kolay olmayacakt\u0131r. \n\n - O sizi se\xe7mi\u015f ise ona direnmeniz faydas\u0131zd\u0131r. Farkl\u0131 a\u015fklar\u0131n kahraman\u0131 olmaya e\u011filimlidirler. \n\n - G\xfc\xe7l\xfc yap\u0131lar\u0131n\u0131 \xe7ocuklar\u0131nada yans\u0131tarak, onlar\u0131n m\xfckemmel olmas\u0131na \xe7al\u0131\u015f\u0131rlar. Aslan babas\u0131 iyi bir baba olman\u0131n t\xfcm \xf6zelliklerini ta\u015f\u0131r.\n\n"," - \xd6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcn ve ba\u015f\u0131nda g\xf6r\xfcnmeyen bir ta\xe7la dola\u015f\u0131rs\u0131n. K\u0131skan\xe7 oldu\u011fun halde, kendin k\u0131skan\xe7l\u0131\u011fa dayanamazs\u0131n\u0131z.\n\n - Ya\u015fama \xe7ok ba\u011fl\u0131 oldu\u011fun i\xe7in e\u011flenceli ve ak\u0131ll\u0131 erkelerden ho\u015flan\u0131rs\u0131n. A\u015fk konusunda ayaklar\u0131n hep yerdedir.\n\n - Gezmeyi ve e\u011flenmeyi seversin ama asla u\xe7ar\u0131 bir k\u0131z de\u011filsin. Aldat\u0131lma konusunda son derece duyarl\u0131s\u0131n ve affetme \xf6zelli\u011fin asla yoktur.\n\n - Duygular\u0131n\u0131 iyi kontrol edersin. Sana kar\u015f\u0131 art niyetsiz sevgi g\xf6sterildi\u011fi zaman, sende ayn\u0131 \u015fekilde davran\u0131rs\u0131n.\n\n - Do\u011fal bir asalete sahipsin. Affedici \xf6zelli\u011fin yo\u011fun duygular\u0131ndan dolay\u0131 k\u0131s\u0131tl\u0131d\u0131r. Ya\u015fam\u0131n do\u011fru k\u0131zlar\u0131 oldu\u011fun i\xe7in, a\u015fk hayat\u0131nda ikili davran\u0131\u015f bi\xe7imlerine kar\u015f\u0131s\u0131n ve kar\u015f\u0131ndaki ki\u015finin yalan\u0131n\u0131 \xe7abuk g\xf6r\xfcrs\xfcn.\n\n - Seninle ya\u015famak zor, ayn\u0131 zamanda kolayd\u0131r.\n\n"," - ASLAN KIZLARI \xc7arp\u0131c\u0131 giyim tarz\u0131n, aslan yelesi sa\xe7\u0131n ve al\u0131ml\u0131 y\xfcr\xfcy\xfc\u015f\xfcnle uzaktan bile ke\u015ffedebilirsiniz.\n\n - Ba\u015fkalar\u0131n\u0131n dikkatini \xe7eken k\u0131yafetleri tercih edersin. Canl\u0131 renkler tam senin i\xe7indir. \n\n - Kendini be\u011fenmi\u015f, kibirli g\xf6r\xfcn\xfc\u015f\xfcnle fark edilmemen m\xfcmk\xfcn de\u011fildir. Sa\xe7\u0131n uzun olmasa bile kabar\u0131k ve haval\u0131 bir g\xf6r\xfcn\xfc\u015f\xfcn vard\u0131r.\n\n - G\xfcne\u015flenmeyi \xe7ok seversin. U\xe7u\u015fan modelleri tercih edersin. Bir aslan k\u0131z\u0131 olarak l\xfcks objeler daima ilgini \xe7eker. \n\n - \xd6v\xfclmeyi ve pohpohlanmay\u0131 seversin, ama; ger\xe7ek iltifatlar\u0131 hemen fark edersin. Arkada\u015flar\u0131n\u0131n her t\xfcrl\xfc sorunlar\u0131na sahip \xe7\u0131kars\u0131n. \n\n - G\xf6z \xf6n\xfcnde olmak ve alk\u0131\u015f almak seni mutlu eden g\xfczel \u015feylerdir. \xd6zel bir k\u0131zs\u0131n ve \xf6zel kalmak i\xe7in t\xfcm maharetlerini \xe7evrene yayars\u0131n.\n\n - I\u015f\u0131klar\u0131ndan herkes yararlan\u0131r. ASLAN KIZI PART\u0130 HAVASINDA G\xfc\xe7l\xfc ki\u015fili\u011fin ve \xf6zg\xfcveninle partilerin odak noktas\u0131 haline gelirsin. \n\n - Dikkat \xe7ekti\u011finizin fark\u0131ndas\u0131n\u0131z ve t\xfcm partilerin en \xe7arp\u0131c\u0131 ki\u015fisi olmaktan kendiniz al\u0131koyamazs\u0131n\u0131z.\n\n - Sa\xe7lar\u0131n ve al\u0131ml\u0131 giysilerinle bulundu\u011fun ortam\u0131n krali\xe7esi olmaya adays\u0131n. P\u0131r\u0131lt\u0131l\u0131 k\u0131yafetler, ger\xe7ek m\xfccevherler, danteller, ipekler, ve geniz yakan parf\xfcmleriyle, kim bir Aslan\u2019a kar\u015f\u0131 koyabilir.\n\n - \u0130\u015fte sizi g\xf6z\xfcn\xfcze kestiren bir Ko\xe7, kalbinizi fethetmeye haz\u0131rlan\u0131rken, g\xfczel sesli ve etkileyici g\xfcl\xfcmsemesiyle bir a\u015fk tanr\u0131s\u0131 olan Terazi seni daha \xe7ok etkileyebilir..\n\n - Komik f\u0131kralar\u0131yla seni g\xfcld\xfcren bir Yay\u2019\u0131n dostlu\u011funu kazan\u0131rken, \u0130kizlerin seyahat an\u0131lar\u0131n\u0131 ilgiyle dinleyebilirsin. \n\n - Seni etkisi alt\u0131na almak isteyen Bo\u011fadan uzak durmal\u0131 ve Kovan\u0131n enteresanl\u0131\u011f\u0131na s\u0131\u011f\u0131nmal\u0131s\u0131n.\n\n"," - Zuhal Olcay,G\xf6n\xfcl Yazar, Ben Deniz, U\u011fur Mumcu, Hakan Altun, \u015eenay Akay, Deniz Akkaya Zuhal Olcay, Ben Deniz U\u011fur Mumcu Napoleon Bonaparte, Fidel Castro, Alfred Hitchcock, Robert De Niro, Bill Clinton, Benito Mussolini, Coco Chanel, Mata Hari, Jaqueline Onassis, Mae West, Henry Ford, Mick Jagger, Carl Gustav Jung, Guy De Maupassant, Madonna, G\xf6n\xfcl Yazar, Ahu Tu\u011fba, Shoren Stone\n\n"," - D\xfcnyay\u0131 parmaklar\u0131yla d\xf6nd\xfcreceklerine inanan bu ufakl\u0131klar, evin tek hakimi olduklar\u0131n\u0131 bilirler.\n\n - Parlak g\xfcl\xfc\u015fleri ve tatl\u0131l\u0131klar\u0131yla size yapt\u0131ramayacaklar\u0131 \u015fey yoktur.Bu burcun \xe7ocuklar\u0131 adeta enerji deposudur.\n\n - \u0130stedikleri bir \u015fey oldu\u011fu zaman, s\xfcrekli a\u011flayarak aile \xfcyelerini testten ge\xe7iriler ve sonunda pes ettirirler.\n\n - Daha k\xfc\xe7\xfck ya\u015fta gururlu ve ma\u011frurdur. Kalabal\u0131kta ona asla k\xf6t\xfc bir \u015fey s\xf6ylemeyin.\n\n - Kesinlikle al\u0131nacak ve size kin duyacakt\u0131r..Yenilgiyi kabul etmeyen bu \xe7ocuklar,s\xfcrekli \xf6vg\xfcye ve sevilmeye ihtiya\xe7lar\u0131 vard\u0131r.\n\n - Okul y\u0131llar\u0131n da tiyatro ve piyeslerde rol alarak,sanat\xe7\u0131 kimli\u011fiyle kar\u015f\u0131n\u0131z \xe7\u0131kacak ve sizi \u015fa\u015f\u0131rtacakt\u0131r.\n\n - Ya\u015fam\u0131 b\xf6ylesine kucaklayan \xe7ocuklara her \u015fey hediye edebilirsiniz. \n\n - Orijinal duvar posterleri, oyuncaklar canl\u0131 renklerden yap\u0131lm\u0131\u015f kol saatleri kazaklar, ti\u015f\xf6rtler. \n\n - M\xfczik aletleri,. Deniz toplar\u0131, mayolar, orijinal c\xfczdanlar ve film kasetleri foto\u011fraf makinesi, ilgin\xe7 \u015fapkalar, kemerler. ve daha neler.\n\n"," - L\xfckse ve g\xf6steri\u015fe d\xfc\u015fk\xfcn Aslan bur\xe7lar\u0131na hediye be\u011fendirmek olduk\xe7a zordur. Onurland\u0131r\u0131lmaktan ho\u015flan\u0131rlar. \n\n - P\u0131r\u0131lt\u0131l\u0131, parlak ve kaliteli bir hediye se\xe7meye dikkat edin! Her \u015feyin en iyisini isteyen, \xf6zg\xfcveni tam aslan kad\u0131n\u0131n\u0131 en \xe7ok tek ta\u015f p\u0131rlanta y\xfcz\xfck ile mutlu edebilirsiniz. \n\n - Orijinal parf\xfcmler, seyahat aksesuarlar\u0131, kol saati, deri \xe7anta ya da kristal aksesuarlar da yine aslan kad\u0131n\u0131 i\xe7in olduk\xe7a uygun bir hediye olacakt\u0131r. \n\n - L\xfcks\xfcne ve rahat\u0131na d\xfc\u015fk\xfcn aslan erke\u011fi i\xe7in kol saati, kaliteli viski, puro, sigara aksesuarlar\u0131, deri satran\xe7 veya tavla tak\u0131m\u0131, \u015f\u0131k kol d\xfc\u011fmeleri ve nadir bulunan ev aksesuarlar\u0131 en uygun sevgililer g\xfcn\xfc hediyesidir. \n\n"," - M\xfckemmel bir \u015firket ba\u015fkan\u0131d\u0131r. Ba\u015fkalar\u0131n\u0131n farkl\u0131 yeteneklerini \xe7ok iyi anlar ve de\u011ferlendirir. \n\n - Her konuda a\xe7\u0131k ve net bir stile sahiptirler. Onaylad\u0131\u011f\u0131 konuyu hareketleri ile belli eder. \n\n - Ba\u015flad\u0131\u011f\u0131 bir i\u015f konusunda son derece sebatkard\u0131r. Hi\xe7 ara vermeden uzun s\xfcre \xe7al\u0131\u015fabilir hatta g\xfcnlerce \xe7evresindeki her \u015feyi unutur. \n\n - Konu bitti\u011fi zaman da hi\xe7 kimse onu yerinden k\u0131m\u0131ldatamaz. Onu ilgilendiren her \u015fey g\xf6rkemli ve g\xf6steri\u015fli olmal\u0131d\u0131r. \n\n - Birlikte \xe7al\u0131\u015ft\u0131\u011f\u0131 ki\u015filer; dar kafal\u0131 ve k\xf6t\xfc bir organizat\xf6rse, bulundu\u011fu yeri terk edebilir. \n\n - Gen\xe7lerle \xe7al\u0131\u015fmaktan daha b\xfcy\xfck zevk al\u0131rlar.\n\n"," - Aslan burcu insanlar\u0131n\u0131n g\xf6zleri, av pe\u015findeki bir aslan kadar keskin olur. Son derece dikkatli ve ayr\u0131nt\u0131lar\u0131 \xe7ok iyi tespit edebilir.\n\n - Aslan burcu kalp, s\u0131rt, omurga ve bel kemi\u011fini y\xf6netir. \xc7evresinde sosyal ya\u015fant\u0131s\u0131 \xe7ok hareketli ki\u015fi olarak, Sinemalara, tiyatrolara, partilere ko\u015fturup durursunuz. \n\n - Bu kadar h\u0131zl\u0131 bir tempoyu v\xfccudun ne kadar kald\u0131raca\u011f\u0131n\u0131 merak etmemek m\xfcmk\xfcn de\u011fil.\n\n - Bu nedenle, zaman\u0131 geldi\u011finde durulmay\u0131 bilmen gerekiyor. Aksi takdirde ciddi sa\u011fl\u0131k sorunlar\u0131 ile kar\u015f\u0131 kar\u015f\u0131ya kalabilirsin.\n\n - Uzun y\u0131llar\u0131n yo\u011funlu\u011funa dayanamayan organizman da, kalp sorunlar\u0131 ba\u015f g\xf6sterebilir.\n\n - H\u0131rsl\u0131 ve \xe7al\u0131\u015fkan yap\u0131n nedeniyle, s\xfcrekli \xe7al\u0131\u015f\u0131rs\u0131n. Enerjini a\xe7\u0131\u011fa \xe7\u0131karan a\xe7\u0131k hava sporlar\u0131 ile u\u011fra\u015f\u0131rken, a\u015f\u0131r\u0131 hareketlerden ka\xe7\u0131nmal\u0131s\u0131n. \n\n - \xd6fkeli yap\u0131n\u0131 frenlemek i\xe7in, sakin bir ya\u015fam tarz\u0131n\u0131 hedeflemeli ve ger\xe7ekle\u015ftirmelisin.\n\n - Hastalanmaktan ve kendini g\xfc\xe7s\xfcz hissetmekten nefret edersin. Yata\u011fa d\xfc\u015ft\xfc\u011f\xfcnde \xe7ok kaprisli bir hasta olursun. \n\n - Fakat; b\xfcnyen \xf6ylesine sa\u011flamd\u0131rlar ki, \xe7ok \xe7abuk aya\u011fa kalkars\u0131n.\n\n - G\xf6z\xfc pek, cesur yap\u0131n y\xfcz\xfcnden s\u0131kl\u0131kla kazaya u\u011frama \u015fans\u0131zl\u0131\u011f\u0131n olabilir.\n\n - S\xfcrekli ele\u015ftiren yap\u0131n nedeniyle, y\xfcksek tansiyon hastal\u0131\u011f\u0131na aday olabilirsin. \n\n - V\xfccut i\xe7in gerekli olan minerallere \xe7ok dikkat etmelisin. A ve B vitamin eksiklikleri \xe7ok \xf6nemli olabilir.\n\n  - \u0130yot i\xe7eren ku\u015fkonmaz, so\u011fan, sar\u0131msak, havu\xe7, bezelye ve deniz \xfcr\xfcnlerine a\u011f\u0131rl\u0131k vermen gerekiyor.\n\n - Klorofil i\xe7eren bitkiler, her t\xfcrl\xfc ye\u015fil sebzeler, vazge\xe7ilmez g\u0131dalar\u0131n olmal\u0131d\u0131r.\n\n"," - Y\xfckselen burcu Aslan olan ki\u015filer iyi niyetli, sevecen insanlard\u0131r. En b\xfcy\xfck arzular\u0131, \xe7evrelerinde sayg\u0131 g\xf6ren insan olmakt\u0131r.\n\n - Bunu bilin\xe7li olsun ya da olmas\u0131n b\xfcy\xfck bir arzu i\xe7erisinde yaparlar. \u0130dealleri \xe7ok y\xfcksektir. \n\n - Ufak, tefek ayr\u0131nt\u0131lara \xf6nem vermez, hatta nefret ederler. \xc7ok fazla gururlu, eli a\xe7\u0131k ve hemen her konuda olduk\xe7a yetenekli ki\u015filerdir.\n\n - Y\xfckselen burcu Aslan olan ki\u015filer \xe7al\u0131\u015fkand\u0131r ve hayatlar\u0131n\u0131 daha \xfcst noktada ya\u015famak i\xe7in \xe7abalarlar.\n\n - Y\xfckselen burcu Aslan olanlar\u0131n davran\u0131\u015flar\u0131 g\xf6steri\u015flidir, hatta \u015fiirsel bir davran\u0131\u015f bi\xe7imleri vard\u0131r.\n\n - Bu tarz davran\u0131\u015flar\u0131, \xe7evresinde bulunan baz\u0131 insanlar taraf\u0131ndan bencillik olarak yorumlanabilir. \n\n - Ancak, y\xfckselen Aslan bunu bilin\xe7li olarak yapmaz, bu i\xe7lerinden gelen bir davran\u0131\u015ft\u0131r. \n\n - \xc7al\u0131\u015fkan olduklar\u0131 i\xe7in ba\u015far\u0131ya sab\u0131rl\u0131 bir \u015fekilde ula\u015f\u0131rlar. \xdcn ve servete Aslan burcu \xe7abalamadan da sahip olabilir.\n\n - Sab\u0131rl\u0131 ve konuda kararl\u0131 olmalar\u0131 di\u011fer insanlar taraf\u0131ndan kendini be\u011fenmi\u015flik olarak g\xf6r\xfclebilir. \n\n - Y\xfckselen burcu Aslan olan ki\u015filer bir anda sinirlenip, \xe7ileden \xe7\u0131kabilecek insanlard\u0131r ama bu durum asla uzun s\xfcrmez, bir anda yumu\u015farlar.\n\n"]),t.s)
B.LA=A.b(s([" - Yay burcu kad\u0131n\u0131 \xf6ncelikle ger\xe7ekten k\xfclt\xfcrl\xfc bir ki\u015fili\u011fe sahiptir. \n\n - Bu \xf6zellikleri ile her ortamda, her insan\u0131n dikkatini \xe7ekmeyi ba\u015farabilirler. \n\n - Espri yetenekleri olduk\xe7a iyidir ve kendisi ne\u015feli oldu\u011fu gibi insanlara da ne\u015fe verirler. \n\n - Bu nedenle yay burcu kad\u0131n\u0131 sevilen ve aran\u0131lan bir kad\u0131nd\u0131r.\n\n"," - Yay burcu erke\u011fi entelekt\xfcel bir ki\u015fili\u011fe sahiptir. \n\n - Kibar, son derece bilgili ve beyefendi bir erkektir. Hayat\u0131n\u0131n her alan\u0131nda bu \u015fekilde ya\u015famak ister. \n\n - Asl\u0131nda bu durumun onlar i\xe7in \xe7ok \xf6nemlidir. Renkli, sevecen ve \u0131l\u0131ml\u0131d\u0131rlar. \n\n - Cana yak\u0131n davran\u0131\u015flar\u0131 ile insanlar taraf\u0131ndan sevilen bir erkektir.\n\n"," - Merk\xfcr, ani hareketlerle bir gerileme d\xf6nemine giriyor ve bu da sizin i\xe7in romantik bir kafa kar\u0131\u015f\u0131kl\u0131\u011f\u0131 demek. \n\n - A\u015fk ili\u015fkilerinize h\u0131zl\u0131 giri\u015f \xe7\u0131k\u0131\u015f yapmas\u0131, zor bir d\xf6nem gibi g\xf6r\xfcnse de partnerinizin her zaman orada oldu\u011fundan emin olun.\n\n - Seksi sava\u015f\xe7\u0131 Mars, s\u0131n\u0131rlar\u0131ndan \xe7\u0131km\u0131\u015f \u015fekilde on ikinci hanede duruyor ve yakla\u015f\u0131k olarak \xfc\xe7 ay boyunca da konumunu koruyacak;\n\n - ili\u015fkilerinize gizlilik ve merak getirecek. S\xf6z verilmi\u015f ili\u015fkiler, \u015fimdilik \xf6nceli\u011finiz de\u011fil ancak a\u015fk ka\xe7amaklar\u0131 \xf6yle ve siz bu ka\xe7amaklar esnas\u0131nda her zamankinden daha k\u0131r\u0131lgan olabilirsiniz.\n\n"," - Yaylar her zaman kurgu d\xfcnyas\u0131nda olmay\u0131 severler ve macera dolu aktivitelere kat\u0131lmay\u0131 severler. \n\n - Bo\u015f zamanlar\u0131nda kendilerini bir yere hapsetmezler ve fiziksel aktiviteleri i\xe7eren hareketlerde olmay\u0131 her zaman ister. \n\n - Yaylar bir sonraki hareketin ne olaca\u011f\u0131n\u0131 d\xfc\u015f\xfcnmek konusunda her zaman tetiktedir. \n\n - Yer ald\u0131klar\u0131 oyunlarda ve sporlarda maksimum derecede zevk almaya \xe7al\u0131\u015f\u0131rlar.\n\n - Yaylar \xe7o\u011funlukla basketbol, beyzbol, hokey gibi oyunlarda yer almaktan ho\u015flan\u0131rlar; \n\n - bu y\xfczden bir tak\u0131m\u0131n i\xe7inde olmak onlar i\xe7in \xe7ok m\xfckemmel bir \u015feydir, co\u015fkular\u0131n\u0131 ifade ederler ve memnun olurlar.\n\n - Binicilikte, avc\u0131l\u0131kta yer almak i\xe7in yeterince fiziksel g\xfcce sahip olmamalar\u0131na ra\u011fmen, onlar hala bunlarda yer almak i\xe7in \xe7ok heyecanl\u0131d\u0131r.\n\n - Yaylar \xe7ok iyi ileti\u015fim kurarlar ve hikaye anlat\u0131m\u0131nda ve okumas\u0131nda \xe7ok iyilerdir.\n\n - Konsantrasyon eksikli\u011finden dolay\u0131 \xf6d\xfcller kazanamamalar\u0131na ra\u011fmen, t\xfcfekle ate\u015f etmek ve dart gibi iyi zekasal yetenek gerektiren oyunlarda iyilerdir.\n\n - Ritim duygular\u0131 geli\u015fmi\u015ftir ve modern ile rock muzi\u011fine ilgi g\xf6sterirler.\n\n"," - Azra Ak\u0131n, Woody Allen, Ludwig van Beethoven, Walt Disney, Mark Twain, Kirk Douglas, Frank Sinatra, Jane Fonda, Mehmet AIi Birand, Zeki M\xfcren, Winston Churchill, Gustave Flaubert, Edith Piaf, Merve \u0130ldeniz, T\xfclin \u015eahin, H\xfclya Ko\xe7yi\u011fit, Fatma Girik, G\xfcl\u015fen Bubiko\u011flu, Ediz Hun, G\xfczide Kasac\u0131, Sertab Erener, Onno Tun\xe7, \u0130brahim Kutluay\n\n"," - Yay \xe7ocuklar\u0131 i\xe7in hayat; g\xfclmek, takla atmak ve ne\u015felenmek demektir.\n\n - En \xe7\u0131lg\u0131n oyunlar onlardan \xe7\u0131kar. Ya\u015fam\u0131 b\xf6ylesine tersinden ve delice ya\u015famak i\xe7in ger\xe7ek anlamda bir Yay \xc7ocu\u011fu olmak gerekir.\n\n - Konu\u015fmay\u0131 \xe7ok \xe7abuk \xf6\u011frenirler ve sonra da b\xfcy\xfckleri bunaltan sorularla kar\u015f\u0131lar\u0131na \xe7\u0131karlar. \n\n - \xc7evresindeki her \u015feyi merak ederler. Sizi 'Yeter art\u0131k' diye ba\u011f\u0131rtacak kadar \xe7ileden \xe7\u0131kartabilir.\n\n - Fakat \xf6ylesine sevimlidir ki.. Sonunda kahkahalarla g\xfclersiniz.\n\n - Yaln\u0131zl\u0131ktan ho\u015flanmayan Yay \xc7ocuklar\u0131 s\u0131k s\u0131k evlerine arkada\u015flar\u0131n\u0131 \xe7a\u011f\u0131r\u0131rlar. \n\n - Al\u0131\u015fveri\u015ften m\xfcthi\u015f keyif alan bu \xe7ocuklar, istedi\u011fi her \u015feyi size ald\u0131rmakta ba\u015far\u0131l\u0131d\u0131r. \n\n - Ona hay\u0131r demenin bir anlam\u0131 yoktur. \xc7\xfcnk\xfc kafas\u0131na koymu\u015fsa, kesinlikle yapt\u0131racakt\u0131r. \n\n - Nelerden mi ho\u015flan\u0131r ? Akl\u0131n\u0131za gelen her \u015fey. \n\n - Ayakkab\u0131lar, blue-jeanler seyahat kitaplar\u0131 m\xfczik CD'leri ve bir \xe7ok \u015fey.\n\n"," - Gezmeyi tozmay\u0131 ve yeni insanlar tan\u0131may\u0131 seven Yaylara seyahati \xe7a\u011fr\u0131\u015ft\u0131racak hediyeler al\u0131n.\n\n - Mesela gezginci Yaylara u\xe7ak bileti, k\xfclt\xfcr turu, kapl\u0131ca veya tatil hediye ederseniz d\xfcnyan\u0131n en mutlu insan\u0131 olurlar.\n\n - Pahal\u0131 tak\u0131lar, foto\u011fraf makinesi, \u015f\u0131k bir valiz, \xe7anta, bavul, ko\u015fu ayakkab\u0131s\u0131 hediye ederek Yay kad\u0131n\u0131n\u0131n g\xf6nl\xfcn\xfc alabilirsiniz. \n\n - Spor salonu \xfcyeli\u011fi, spor ayakkab\u0131, seyahat \xe7antas\u0131, felsefe, tarih, ki\u015fisel geli\u015fim kitaplar\u0131 da yine Yay erkekleri i\xe7in en uygun hediyeler olacakt\u0131r.\n\n"," - 2016'n\u0131n ba\u015flamas\u0131yla birlikte hakim y\u0131ld\u0131z\u0131n\u0131z J\xfcpiter, kariyerinizin onuncu hanesine ad\u0131m atacak. \n\n - Sizin i\xe7in g\xfc\xe7l\xfc bir pozisyon planlar\u0131 yapt\u0131\u011f\u0131n\u0131, g\xf6nderece\u011fi sinyallerden anlayabilirsiniz. \n\n - \xc7al\u0131\u015f\u0131yor olun veya olmay\u0131n, hayat\u0131n\u0131z\u0131n bu b\xf6l\xfcm\xfc olduk\xe7a hareketli ge\xe7ecek.\n\n - J\xfcpiter'e Sat\xfcrn ve Nept\xfcn'\xfcn de kat\u0131lmas\u0131yla birlikte ne kadar zor g\xf6r\xfcn\xfcrse g\xf6r\xfcns\xfcn kendinizi t\u0131pk\u0131 bir dans yar\u0131\u015fmas\u0131n\u0131n i\xe7inde gibi hissedeceksiniz.\n\n - 20 Mart haftas\u0131 ise sizin i\xe7in, o dans yar\u0131\u015fmas\u0131nda j\xfcrinin kar\u015f\u0131s\u0131na \xe7\u0131kmak gibi olacak.\n\n"," - Yay'lar\u0131n v\xfccutlar\u0131 \xe7ok sa\u011flamd\u0131r ve genelde spor yapt\u0131klar\u0131ndan ya\u015fland\u0131klar\u0131ndan sa\u011fl\u0131k problemleri pek olmaz.\n\n - Hareketli ve sosyal ya\u015famlar\u0131 onlar\u0131 din\xe7 tutar. Kendilerine \xe7ok dikkat ederler, kolay kolay hastalanmazlar.\n\n - Hastaland\u0131klar\u0131nda ise hastal\u0131\u011f\u0131n tad\u0131n\u0131 \xe7\u0131kartarak, ne\u015feli bir \u015fekilde naz yapabilirler.\n\n - Hayata d\xf6rt elle sar\u0131lan ki\u015filikleri, yatakta uzun g\xfcnler ge\xe7irmelerine izin vermez.\n\n - Yay burcu, astrolojik olarak karaci\u011feri, pankreas\u0131, kal\xe7a, uyluk ve bald\u0131rlar\u0131 y\xf6netir.\n\n - Romatizmal\u0131 hastal\u0131klar, ya\u015fland\u0131klar\u0131nda ba\u015flar\u0131na i\u015f a\xe7abilir.\n\n - Yemek ve i\xe7kiye olan d\xfc\u015fk\xfcnl\xfckleri, zaman i\xe7inde hassas b\xf6lgeleri olan kal\xe7a ve bald\u0131rlar\u0131nda ya\u011flanmaya neden olur.\n\n - \xd6zellikle orta ya\u015flar\u0131nda bununla ilgili sorunlarla kar\u015f\u0131la\u015fabilirler.\n\n - \xc7ok hassas olan karaci\u011ferlerine dikkat etmeli, alkoll\xfc i\xe7ecekler kullan\u0131rken ipin ucunu ka\xe7\u0131rmamalar\u0131 faydal\u0131 olur.\n\n"," - Siz hayata iyimser g\xf6zl\xfckle bakan, asil yarad\u0131l\u0131\u015fl\u0131, herkesi dost kabul eden,arkada\u015f canl\u0131s\u0131,s\u0131cak kanl\u0131 ve samimi birisiniz.\n\n - Oldu\u011funuz gibi g\xf6r\xfcnmekten ho\u015flan\u0131yorsunuz ve insanlara \xe7abuk inan\u0131yorsunuz. \n\n - Mert olup onlar\u0131 incitmekten ka\xe7\u0131n\u0131yorsunuz. Haks\u0131zl\u0131k yapmak sizin i\xe7in d\xfcnyadaki en son i\u015f say\u0131l\u0131r.\n\n - Ba\u015fka insanlardan da b\xf6yle olmalar\u0131n\u0131 beklersiniz. Hareketli, ne\u015feli ve n\xfcktedans\u0131n\u0131z.\n\n - Bulundu\u011funuz ortama \xe7abucak uyars\u0131n\u0131z. Espriler yapt\u0131\u011f\u0131n\u0131z gibi be\u011fenmedi\u011finiz \u015feyleri de alaya alabilirsiniz.\n\n - Genel olarak s\xf6zc\xfcklerinizde ac\u0131tmayan ama insanlara dokunduran espriler yer al\u0131r.H\u0131nc\u0131n\u0131z\u0131 s\xf6zc\xfcklerle almay\u0131 istersiniz.\n\n - \xc7ift karakterli ve de\u011fi\u015fken yap\u0131n\u0131z sizi iki \xe7e\u015fit insan yapabilir. Birincisi duygusal ve i\xe7ine d\xf6n\xfck birisidir.\n\n - \xc7ekingen ve duyarl\u0131d\u0131r. \u0130kincisi ise cesur,ate\u015fli,tedbirsiz,gururu s\xf6z konusu olursa s\xf6z\xfcn\xfc esirgemeyen birisidir.\n\n - Bunlardan birisi yerine g\xf6re ortaya \xe7\u0131kabilir. Y\xfckselen yay i\xe7in \xf6zg\xfcrl\xfck de \xe7ok \xf6nemlidir ve bunun k\u0131s\u0131tlanmas\u0131 bile onu \xe7\u0131lg\u0131na \xe7evirebilir.\n\n - Y\xfckselen Yay burcu insan\u0131 olarak seyahat etmekten, ser\xfcvenler ya\u015famaktan ve gezip g\xf6rmekten b\xfcy\xfck zevk al\u0131rs\u0131n\u0131z.\n\n - Asl\u0131nda sizin macera pe\u015finde ko\u015fman\u0131za gerek yoktur zira, macera gelir sizi bulur. Her yolculu\u011fun sonunda anlatmaya de\u011fer bir \u015feyler bulursunuz.\n\n - Yay Y\xfckselen ile yolculuk yapmak ger\xe7ekten zevklidir.Size ya\u015fam pek \xe7ok \u015fey verecektir.\n\n - \xd6yle olaylar kar\u015f\u0131n\u0131za \xe7\u0131kacakt\u0131r ki bunlardan derin deneyimler elde edeceksiniz.\n\n  - Bu da size hayat\u0131n sadece e\u011flence olmad\u0131\u011f\u0131n\u0131 g\xf6sterecektir. Ya\u015fad\u0131\u011f\u0131n\u0131z deneyimlerden ders alacak ve ayn\u0131 yanl\u0131\u015flar\u0131 yapmamaya \xe7al\u0131\u015facaks\u0131n\u0131z.\n\n - Sonunda bir g\xfcn gelecek olgunla\u015facaks\u0131n\u0131z. Yine de ya\u015fam\u0131n her zaman\u0131nda her zaman yaydan f\u0131rlamaya haz\u0131r bir ok gibi olacaks\u0131n\u0131z. \n\n - Siz pencereleri kapal\u0131 bir evde rahat edemezsiniz. Do\u011fa her y\xf6n\xfc ile sizi \xe7ekecektir.\n\n"]),t.s)
