B.LF=A.b(s([" - Garip bir do\u011falar\u0131 vard\u0131r. Az veya \xe7ok, kendilerine yeten tav\u0131rlar\u0131yla evlili\u011fe her zaman tepkilidirler.. \n\n - Se\xe7ici ve ele\u015ftirici tutumlar\u0131yla, a\u015fk\u0131 s\xfcrekli kendilerinden s\xfcrekli uzakla\u015ft\u0131r\u0131rlar. \n\n - Hele evlili\u011fi hi\xe7 yakla\u015ft\u0131rmazken, ili\u015fkilerinde bencilliklerini ortaya koyarlar..\n\n - E\u011fer; bir g\xfcn ger\xe7ekten evlenmeyi isterlerse, ili\u015fkilerini sayg\u0131 ve mant\u0131k \xe7er\xe7evesinde y\xfcr\xfct\xfcrlerdir..\n\n - M\xfckemmelli\u011fi arayan bir ki\u015fi olarak, se\xe7tikleri e\u015f onlar\u0131 fazlas\u0131yla hak ederler.. Onlar da bunun fark\u0131ndad\u0131r. \n\n - Bu evlilikte, asla ayr\u0131l\u0131\u011fa yer olmayacakt\u0131r. Kusursuz bir anne \xf6rne\u011fi olduklar\u0131 i\xe7in, \xe7ocuklar\u0131n\u0131nda her konuda m\xfckemmel olmas\u0131n\u0131 isterler..\n\n - Ev ve i\u015f ya\u015fam\u0131 ayn\u0131 derecede \xf6nemli oldu\u011fundan, her ikisini de ba\u015far\u0131l\u0131 bir \u015fekilde g\xf6t\xfcr\xfcrs\xfcn\xfcz.\n\n - \xc7ocuklar\u0131yla terbiyeli ve s\xf6z dinleyen \xe7ocuklar olacak ve sayg\u0131l\u0131 bir \u015fekilde ili\u015fkileriniz y\xfcr\xfcteceklerdir.. \n\n - Klasik ve sade zevkleri vard\u0131r. Hedeflerini iyi se\xe7erler. Ba\u015far\u0131 i\xe7in hi\xe7bir engel tan\u0131mazlar.. \n\n - Tarafs\u0131z gibi g\xf6r\xfcnseler de, taraf tutarlar. Tutkulu fakat kinci de\u011fildirler.. Duygu ve mant\u0131\u011f\u0131 aras\u0131nda m\xfcthi\u015f bir denge yetene\u011fi vard\u0131r..\n\n - \u0130li\u015fkilerinde \xe7ok severse taviz verirler.. Tenkit edilmeye gelemezler.\n\n"," - Ya\u015fama sade bakan do\u011fal ve samimi ki\u015filerdir. Onlarla ya\u015famak kolay de\u011fildir.\n\n - \xc7\xfcnk\xfc disiplin duygusu i\xe7inde ya\u015fad\u0131klar\u0131 i\xe7in, birlikte olduklar\u0131 ki\u015filerin de ya\u015fam d\xfczenlerine kar\u0131\u015f\u0131rlar. \n\n - Titiz ve sorgulay\u0131c\u0131d\u0131rlar. Ama\xe7s\u0131z ve beklentisiz ki\u015filer i\xe7in, zaman harcamaktan ho\u015flanmazlar.\n\n - \u0130yi, bir aile reisi olduklar\u0131 s\xf6ylense de, bunu geciktirmek i\xe7in her t\xfcrl\xfc yolu denerler ve m\xfczmin bir bekar olmaktan kurtulamazlar.\n\n - A\u015fk ili\u015fkileri zordur..S\xfcrekli denetleme duygular\u0131 y\xfcz\xfcnden partnerleriyle aralar\u0131nda s\xfcrekli sorun \xe7\u0131kar.\n\n - Baba olduklar\u0131 zaman da bu duyguyu ge\xe7 tatman\u0131n keyifsizli\u011fini duyarlar. Onlar\u0131 en iyi ko\u015fullarda yeti\u015ftirmek i\xe7in ellerinden gelen her \u015feyi yaparlar.\n\n - \xc7ocuklar\u0131 onlar\u0131n d\xfczenlerinden s\u0131k\u0131lsa bile en k\xfc\xe7\xfck sorunlar\u0131nda yanlar\u0131nda, babalar\u0131n\u0131 g\xf6rmekten keyif al\u0131rlar.\n\n - Temkinlidirler ve hata yapmaktan \xe7ekinirler. M\xfckemmel olmak i\xe7in her t\xfcrl\xfc olanaklar\u0131 sonuna kadar savunur ve kullan\u0131rlar.\n\n - Yapmak istedikleri ile hayalleri aras\u0131nda u\xe7urum yoktur. D\xfcnyay\u0131 kendi ki\u015fisel \xe7er\xe7evesinden g\xf6rmeye al\u0131\u015fk\u0131nd\u0131rlar.\n\n - Duygusal istekleri ve arzular\u0131 \xf6n plandad\u0131r..Sabit d\xfc\u015f\xfcnme konusunda \u0131srarc\u0131 ve \xf6d\xfcn vermedikleri i\xe7in kendini zorlayacak konular ortaya \xe7\u0131kacakt\u0131r.\n\n"," - Mant\u0131k ve duygu karma\u015fas\u0131 ya\u015fad\u0131klar\u0131 i\xe7in, s\xfcrekli d\xfczen aray\u0131\u015f\u0131 i\xe7indedirler.\n\n - Ya\u015famlar\u0131nda ger\xe7ek a\u015fk\u0131n sadece mant\u0131k s\xfczgecinden ge\xe7ti\u011fine inand\u0131klar\u0131 i\xe7in, isteklerine kavu\u015fmak i\xe7in idealleri i\xe7in ya\u015farlar.\n\n  - \u0130stemeseler de \xf6n yarg\u0131l\u0131 olmaktan kendilerini alamazlar.\n\n - Birlikte oldu\u011fu ki\u015fi s\xfcrekli m\xfckemmel g\xf6rmek istedikleri i\xe7in, partnerlerini tenkitleriyle ya\u015famlar\u0131ndan bezdirebilirler. \n\n - Y\xfcksek standartlar\u0131 zamanla kendileriniz de rahats\u0131z eder. \xc7ok ge\xe7 ya\u015flarda evlenen bir \xe7ok m\xfczmin bekar Ba\u015fak bulman\u0131z m\xfcmk\xfcnd\xfcr. \n\n - Kendilerini kolay teslim edemezler. Ya\u015fam\u0131 sorgulamaktan vazge\xe7medikleri m\xfcddet\xe7e duygular\u0131nda \xf6n yarg\u0131l\u0131 olmaya devam ettikleri m\xfcddet\xe7e a\u015fklar\u0131n\u0131 zor ya\u015fayacaklard\u0131r.\n\n - Ya\u015fam\u0131 ve a\u015fk\u0131 sorgulamaktan vazge\xe7melisiniz. Duygular\u0131n\u0131z\u0131n sizi yan\u0131ltabilece\u011fi ku\u015fkular\u0131na art\u0131k son vermeli, \xf6n yarg\u0131l\u0131 davranman\u0131n yanl\u0131\u015flar\u0131n\u0131 g\xf6rmelisiniz.\n\n - A\u015fk\u0131n k\xfc\xe7\xfck detaylar\u0131 yerine, size sunulan g\xfczelliklerini ya\u015famal\u0131s\u0131n\u0131z.\n\n"," - BA\u015eAK KIZLARI Asl\u0131nda pek belli etmesen de, olduk\xe7a utanga\xe7 bir yap\u0131n var. G\xfcvenilir ve samimi olman bazen antipatik olabilir. \n\n - D\xfcr\xfcstl\xfc\u011f\xfcn agresif s\u0131n\u0131rlar\u0131nda oldu\u011fu zaman \xe7evrendekiler sana k\u0131zabilirler. \n\n - Ald\u0131rmaz ve bildi\u011fin konulardan taviz vermezsin. \xc7evreni ele\u015ftirmekten korkmad\u0131\u011f\u0131n bir ger\xe7ek.\n\n - Peki seni tenkit ederlerse ne yapars\u0131n ?.. \xdcstelik kar\u015f\u0131n\u0131zdaki ki\u015fi sonuna kadar hakl\u0131 da, olabilir.\n\n  - \u0130\u015fte o zaman kar\u015f\u0131ndaki ki\u015fiye d\xfcnyay\u0131 zindan edebilir, kendini savunmak ad\u0131na d\xfc\u015f\xfcnmeden konu\u015ftu\u011fun kelimeler h\u0131zl\u0131 bir \u015fekilde a\u011fz\u0131ndan d\xf6k\xfcl\xfcrken haks\u0131z olaca\u011f\u0131n\u0131 d\xfc\u015f\xfcnmezsin bile.\n\n  - Her \u015feye ra\u011fmen, zor g\xfcnlerin dostu oldu\u011fun i\xe7in, insanlar seni severler. S\xfcrekli da\u011f\u0131n\u0131k oldu\u011funu s\xf6yleyebilir ve zaman\u0131n sana yetmedi\u011finizde yak\u0131nabilirsin de\u2026 \n\n - \xc7evrendeki di\u011fer ki\u015filere g\xf6re \xe7ok daha planl\u0131 ve programl\u0131 oldu\u011funu kim bilir ka\xe7 ki\u015fi sana hat\u0131rlatt\u0131.\n\n - Derslerini programl\u0131 yapar ve kurallar\u0131n d\u0131\u015f\u0131na \xe7\u0131kmad\u0131\u011f\u0131n i\xe7inde gizli takdirler hep senindir. \n\n - S\u0131n\u0131f\u0131n en sakin ve disiplinli \xf6\u011frencisi olabilirsin. Seni anlamak kolay de\u011fildir.\n\n  - H\u0131zl\u0131 d\xfc\u015f\xfcn\xfcr ve karar veren sen, bazen en sakin ki\u015fileri bile \xe7ileden \xe7\u0131karan bir a\u011f\u0131rkanl\u0131l\u0131k sergileyebilirsin.\n\n - Anla\u015f\u0131lmak i\xe7in \xf6zel bir \xe7aba sarf etmelerini istemedi\u011fin i\xe7in de, kendi d\xfcnyanda ya\u015famay\u0131 ye\u011flersin.\n\n  - BA\u015eAK KIZIMIZ PART\u0130 HAVASINDA Disiplinli ve sadeli\u011fi seven siz Ba\u015faklar i\xe7in, g\xf6rkemli toplant\u0131lar can s\u0131k\u0131c\u0131 ve iticidir. \n\n - Arkada\u015flar\u0131n\u0131n \u0131srar\u0131na ra\u011fmen, tercihin k\xfc\xe7\xfck ve samimi dostluklar\u0131n oldu\u011fu ortamlard\u0131r.\n\n  - Giyim zevkinde titiz bir se\xe7icilik \xf6rne\u011fi sergilerken, klasik fakat \u015f\u0131k k\u0131yafetleri tercih edersin.\n\n  - Sabun ve fresh kokulardan vazge\xe7mez, az makyajl\u0131 y\xfcz\xfcn\xfczde daima taze bir gen\xe7 k\u0131z havas\u0131 estirirsin..\n\n - Kaliteli yemeklerden ve beyaz \u015faraptan ho\u015flan\u0131r s\u0131cak dost sohbetlerini tercih eder fl\xf6rt tarz\u0131 ili\u015fiklerden uzak durursun. \n\n - Bo\u011fan\u0131n ciddi konu\u015fmalar\u0131 ilgini \xe7ekerken, Yenge\xe7le rahatlat\u0131c\u0131 bir sohbet yapabilirsin.\n\n - O\u011flakla gizli bir \u015fekilde \xe7eki\u015fmek ho\u015funa gidebilir. Bir Akrep\u2019in cazibesinin etkisinde kalman fazla zaman\u0131n\u0131 almayacak ve duygusal kap\u0131lar\u0131n\u0131 ona aralayacaks\u0131n.\n\n"," - Ba\u015fak burcunun erkek \xfcnl\xfcleri; Ali Sunal, Rafet El Roman, Alper Sald\u0131ran, Andrew Lincoln, Aras Bulut \u0130ynemli, Can Temiz, Dylan O\u2019brien, G\xf6khan T\xfcrkmen, James Marsden, Jensen Ackles, Keanu Reeves, Ludacris, Mabel Matiz, Martin Freeman, Paul Walker, Cansel El\xe7in, Tommy Lee Jones, \xdcmit Kantarc\u0131lar, Yusuf Akg\xfcn ve Michael Jackson'd\u0131r. Ba\u015fak burcunun kad\u0131n \xfcnl\xfcleri; Amanda Schull, Angel Coulby, Alg\u0131 Eke, Beg\xfcm Birg\xf6ren, Berg\xfczar Korel, Blake Lively, Ceyda Ate\u015f, Claudia Schiffer, Duygu Yeti\u015f, Ebru C\xfcnd\xfcbeyo\u011flu, Ece Uslu, Eda Ta\u015fp\u0131nar, Evrim Solmaz, Gamze \xd6z\xe7elik, G\xfclben Ergen, Hande Ataizi, Katerina Graham, Lea Michele, Marlee Matlin, Merve Bolu\u011fur, P\u0131nar Altu\u011f, Pink, Rose McGowan, Saadet I\u015f\u0131l Aksoy, Salma Hayek, Sarah Roemer, Shania Twain, Sophia Loren, Ya\u011fmur Tanr\u0131sevsin, Belgin Erdo\u011fan, Beyonce ve Cameron Diaz'd\u0131r.\n\n"," - Daha do\u011fdu\u011fu anda ya\u015fama ciddi bakan bu \xe7ocuklar , mama saatlerinin aksamas\u0131na dayanamaz ve hastane odas\u0131nda \xe7\u0131\u011fl\u0131klara ba\u015flar.\n\n - Rol yapma yetenekleri \xf6ylesine geli\u015fmi\u015ftir ki, k\xfc\xe7\xfck ya\u015flarda ayna kar\u015f\u0131s\u0131nda mimiklerini incelerler. \n\n - \xc7o\u011fu kez sesli d\xfc\u015f\xfcn\xfcr ve annesini taklit ederler.. Okul y\u0131llar\u0131nda disipline en yak\u0131n yine bu \xe7ocuklard\u0131r.\n\n - Sakinlikten ho\u015flan\u0131r ve tenkite gelemezler.Hatalar\u0131n\u0131 sessizce bir kere s\xf6yleyin bir daha asla yapmayacakt\u0131r.\n\n - Sorumlulu\u011funu bilir ve sizi yormadan odas\u0131n\u0131 toplar. Sadece e\u015fyalar\u0131n\u0131 hi\xe7 kimseyle payla\u015fmaz.\n\n - Onunla asla \xe7ocuk gibi de\u011fil de arkada\u015f gibi konu\u015fmal\u0131s\u0131n\u0131z. \n\n - Daha k\xfc\xe7\xfck ya\u015flarda sizin s\u0131rr\u0131n\u0131z\u0131 payla\u015facak ve sizi ele vermeyecektir.\n\n - Ona de\u011fi\u015fik sabunlar, i\xe7 \xe7ama\u015f\u0131rlar\u0131 hediye edebilirsiniz. Yine beyaz bir sweet shorta hay\u0131r demeyecektir.\n\n - Bir kol saati bornoz, k\xfc\xe7\xfck bir kedi veya k\xf6pek, resim \xe7er\xe7evesi, deri okul \xe7antas\u0131, yumu\u015fak deriden yap\u0131lm\u0131\u015f \xe7izme ve ilgin\xe7 kitaplardan ho\u015flan\u0131r.\n\n"," - Sa\u011fl\u0131\u011f\u0131na ve hijyenine d\xfc\u015fk\xfcn Ba\u015fak bur\xe7lar\u0131 daha \xe7ok fonksiyonel hediyelerden ho\u015flan\u0131r.\n\n - En sevdi\u011fi hediyeler aras\u0131nda parf\xfcmler \xf6n plana \xe7\u0131k\u0131yor. Hafif kokulu, \u015fekerli, limon ve portakal esansl\u0131 parf\xfcmler alabilirsiniz\n\n - Titiz, kuralc\u0131 ve d\xfczenli ba\u015fak burcu kad\u0131n\u0131 i\xe7in antika e\u015fyalar, parf\xfcm ya da heykel iyi bir hediye se\xe7ene\u011fi olabilir.\n\n - Okumay\u0131 seven ba\u015fak erkeklerine ise ki\u015fisel geli\u015fim kitaplar\u0131, bornoz, havlu, tra\u015f makinesi, bilgisayar, masa lambalar\u0131 ve tablolar hediye edilebilir.\n\n"," - Onun m\xfckemmel olma tutkusu y\xfcz\xfcnden, k\xf6t\xfc bir \xe7al\u0131\u015fma arkada\u015f\u0131 olabilir.\n\n - Dikkat ve metot ki\u015fisidir.Yan\u0131nda \xe7al\u0131\u015fanlardan s\xfcrekli ayr\u0131nt\u0131 bekleyebilir.\n\n - Bir Ba\u015fakla \xe7al\u0131\u015fmak istiyorsan\u0131z, onu oldu\u011fu gibi kabul etmelisiniz. Ba\u015faktan yaralanmak ve onu kullanmak \xe7ok zordur.\n\n - Ak\u0131ll\u0131 ve zeki bak\u0131\u015flar\u0131yla sizi hemen yakalar. Zaman ve enerji a\xe7\u0131s\u0131ndan c\xf6mert olmakla birlikte, a\u015f\u0131r\u0131 talepleri hemen sezer.\n\n - Onun a\u011fz\u0131ndan \xf6vg\xfc dolu bir s\xf6z duyamazs\u0131n\u0131z. Kriz anlar\u0131nda so\u011fuk kanl\u0131 davran\u0131\u015flar\u0131yla sizi en iyi rahatlatan yine Ba\u015fakt\u0131r. \n\n - Organizasyon i\u015flerde kesin ba\u015far\u0131 bekler ve ba\u015far\u0131s\u0131z kal\u0131rsan\u0131z su\xe7lamaya haz\u0131rd\u0131r.\n\n"," - Bir Ba\u015fak burcu k\u0131z olarak \xe7al\u0131\u015fkan ve pratiksin.. Kuruntulu ve geleneksel yap\u0131n\u0131 y\xfcz\xfcnden her \u015feyi kafana fazla takar ve kendini her hastal\u0131\u011fa aday g\xf6r\xfcrs\xfcn.\n\n - Doktorlarda ve hastanelerde en \xe7ok Ba\u015fak burcu ki\u015filerine rastlars\u0131n\u0131z. \n\n - M\u0131zm\u0131z ve kaprisli yap\u0131n\u0131 \xe7evrendeki herkesi can\u0131ndan bezdirebilir. \n\n - Kolay inanmad\u0131\u011f\u0131n i\xe7inde s\xfcrekli doktor de\u011fi\u015ftirirsin. Pratik zekan ve \xf6nlemci yap\u0131n sa\u011fl\u0131k ko\u015fullar\u0131na \xe7abuk uyum sa\u011flaman\u0131 sa\u011flar. \n\n - E\u011fer doktorlar iyile\u015ftirme y\xf6ntemlerini a\xe7\u0131klarlarsa anlay\u0131\u015fl\u0131 ve uyumlu bir hasta olursun. \n\n - Ba\u015fak Burcu sinir sistemi ve ba\u011f\u0131rsaklar\u0131 temsil eder. Mide hastal\u0131klar\u0131na yatk\u0131ns\u0131n.. \n\n - Dengeli beslenmek zorundas\u0131n.. Yoksa, ya\u015fam\u0131n boyunca bir \xe7ok sindirim hastal\u0131klar\u0131 pe\u015fini b\u0131rakmaz.\n\n - Bir\xe7ok Ba\u015fak vejeteryan olup, \xf6m\xfcr boyu sa\u011fl\u0131kl\u0131 beslenirler. Ba\u015fak Burcu titiz yap\u0131s\u0131n\u0131 sa\u011fl\u0131\u011f\u0131na \xf6zellikle yans\u0131t\u0131r.\n\n - Ya\u011fl\u0131 ve baharatl\u0131 yiyeceklerden uzak kalmal\u0131s\u0131n. Ni\u015fasta ve kahve ba\u011f\u0131rsaklar\u0131n i\xe7in sorun olur. \n\n - Beyaz et, peynir, bol meyve, bal\u0131k, yo\u011furt b\xfcnyenin ger\xe7ek dostlar\u0131d\u0131r. Stres en \xe7ok senin burcunun ki\u015filerini etkiler.\n\n - Ne\u015feli ve ruh haline uygun yerlerde kalmaya \xf6zen g\xf6stermelisin.\n\n"," - Y\xfckselen burcu Ba\u015fak olan ki\u015filerin en belirgin \xf6zellikleri aras\u0131nda disiplinli olmalar\u0131, yarg\u0131lama yetene\u011fi ve diplomat olmalar\u0131 vard\u0131r.\n\n - Adaletli olmas\u0131 ve al\xe7akg\xf6n\xfcll\xfc olmas\u0131 en \xf6nemli \xf6zellikleri aras\u0131nda bulunmaktad\u0131r. Son derece \xe7ekici insanlard\u0131r. \n\n - Kafalar\u0131 \xe7ok iyi \xe7al\u0131\u015f\u0131r. Her \u015feyi birbirinden ay\u0131rt etme \xf6zellikleri vard\u0131r.\n\n - \xc7al\u0131\u015fkan olmalar\u0131 ile hayatlar\u0131nda s\xfcrekli olarak y\xfckselmeye meyillidirler.\n\n - Her ayr\u0131nt\u0131ya fazla tak\u0131l\u0131 olmalar\u0131, as\u0131l odaklanmalar\u0131 gereken noktadan uzakla\u015fmalar\u0131na neden olur.\n\n - Biraz bak\u0131\u015f a\xe7\u0131lar\u0131n\u0131 de\u011fi\u015ftirmeleri gerekir.\n\n"]),t.s)
