B.LP=A.b(s(["Astrolojide ili\u015fkiler ve a\u015fk uyumu en ilgi \xe7ekici alanlardan biridir. Zira her birimiz farkl\u0131 zaman ve co\u011frafyalarda g\xf6ky\xfcz\xfcndeki o ana \xf6zg\xfc s\u0131ra d\u0131\u015f\u0131 gezegen, G\xfcne\u015f ve Ay dizilimleri alt\u0131nda do\u011far\u0131z ve ba\u015fka biriyle kar\u015f\u0131la\u015ft\u0131\u011f\u0131m\u0131zda ve bir araya geldi\u011fimizde o ki\u015finin de g\xf6ksel dizilimlerimi aram\u0131zdaki ili\u015fkinin s\u0131rr\u0131n\u0131 ve t\u0131ls\u0131m\u0131n\u0131 olu\u015fturur. Do\u011fum haritalar\u0131m\u0131z\u0131n kar\u015f\u0131l\u0131kl\u0131 uyumunu inceleyen dala astrolojide sinastri ad\u0131 verilmektedir. En do\u011fru sinastri analizini yapabilmek i\xe7in her iki ki\u015finin do\u011fum haritalar\u0131, do\u011fduklar\u0131 yere ve zamana g\xf6re \xe7\u0131kar\u0131lm\u0131\u015f olmal\u0131d\u0131r.","Elbette bu analizler her zaman m\xfcmk\xfcn olmad\u0131\u011f\u0131nda en tan\u0131d\u0131k ve bilinen bilgiler olan bur\xe7lar ili\u015fkisel uyum i\xe7in bize en do\u011fru bilgileri verebilir. S\xf6zgelimi bir ki\u015fi Akrep burcuysa onu en iyi tamamlayan bur\xe7 kar\u015f\u0131t burcu Bo\u011fa olabilir. Ayn\u0131 \u015feyi Terazi-Ko\xe7, \u0130kizler-Yay, Yenge\xe7-O\u011flak, Kova-Aslan, Ba\u015fak-Bal\u0131k i\xe7in de s\xf6ylemek m\xfcmk\xfcnd\xfcr. Her ne kadar bu biraz a\u015f\u0131r\u0131 bir genelleme olsa da bu iki ki\u015finin bur\xe7lar\u0131n\u0131n yani haritalar\u0131ndaki G\xfcne\u015f\u2019lerinin birbiriyle kar\u015f\u0131l\u0131kl\u0131 \u015fekilde konu\u015ftuklar\u0131n\u0131 varsayabiliriz.","M\xfckemmel uyum i\xe7in do\u011fum haritalar\u0131nda gezegenlerin birbirleriyle uyumu yan\u0131nda baz\u0131 uyumsuzluklar da aran\u0131r. Aksi halde birbiriyle bire bir \xf6rten iki harita zaman i\xe7inde s\u0131k\u0131c\u0131 bir ili\u015fkiyi beraberinde getirebilir. Z\u0131tl\u0131klar bu ili\u015fkinin tuzu biberi ve ate\u015fleyicisi olarak yer almak zorundad\u0131r","Elementler ve bur\xe7lar\u0131n temel nitelikleri de a\u015fk uyumunda kilit rol oynayabilir. Yine \xf6zellikle do\u011fru sinastriye var\u0131labilecek do\u011fum haritalar\u0131 \xe7\u0131kart\u0131lam\u0131yorsa bu daha da \xf6nemli hale gelecektir. Hava grubu bur\xe7lar kendi aralar\u0131nda, toprak, ate\u015f ve su grubu bur\xe7lar kendi aralar\u0131nda g\xfczel bir uyuma sahiptir. Terazi-\u0130kizler-Kova (Hava \xfc\xe7l\xfcs\xfc), Ba\u015fak-Bo\u011fa-O\u011flak (Toprak \xfc\xe7l\xfcs\xfc), Yay-Aslan-Ko\xe7 (Ate\u015f \xfc\xe7l\xfcs\xfc), Bal\u0131k-Yenge\xe7-Akrep (Su \xdc\xe7l\xfcs\xfc) kendi i\xe7inde olduk\xe7a uyumlu gruplard\u0131r. Bunun yan\u0131nda toprak bur\xe7lar\u0131 su bur\xe7lar\u0131yla, hava bur\xe7lar\u0131 ate\u015f bur\xe7lar\u0131yla g\xfczel bir uyumu yakalayabilir. Bur\xe7lar\u0131n sabit, \xf6nc\xfc ve de\u011fi\u015fken nitelikleri de benzer \u015fekilde de\u011ferlendirmeye al\u0131nabilir. Elementlerin aksine iki sabit, \xf6nc\xfc veya de\u011fi\u015fkenin birlikteli\u011fi zorlay\u0131c\u0131 olabilirken bir sabit bur\xe7la kendi elementinden uyumlu bir de\u011fi\u015fken bur\xe7 \xe7ok daha fazla uyumu olan bir ili\u015fkiyi vaat edebilir."]),t.s)
