B.LT=A.b(s([" - Siz a\u015f\u0131r\u0131l\u0131klar\u0131n ve a\u015f\u0131r\u0131 u\xe7lar\u0131n insanlar\u0131d\u0131r.. \n\n - Bu \xf6zelliklerini bildikleri i\xe7in, kendileriyle ilgili yorum yapma ihtiyac\u0131 bile duymazlar.\n\n - Bir Akrep olarak; asla g\xfc\xe7s\xfcz biriyle evlenmez, ancak \xfcst\xfcn ki\u015filikte birine teslim olurlar. \n\n - G\xfc\xe7l\xfc karakterleri, ve garip adalet duygular\u0131yla onlar\u0131 anlayabilecekleri bir e\u015f olabilmek de herkesin harc\u0131 de\u011fildir Zevkli ve se\xe7ici zevkleri vard\u0131r.\n\n - G\xfczellikler hep karanl\u0131klarda gizli oldu\u011fu i\xe7in, imkans\u0131z olan \u015feylerden ho\u015flan\u0131rlar.. \n\n - S\u0131n\u0131rlar\u0131n\u0131z \xe7ok geni\u015f olup, sevdi\u011finiz \u015feyleri \xf6zel olarak ke\u015ffetmek gerekir.\n\n"," - Derin bir duygu insan\u0131d\u0131rlar. Olaylara g\xfc\xe7l\xfc bir mant\u0131kla yakla\u015ft\u0131klar\u0131 i\xe7in, onlara her konuda g\xfcvenilir. \n\n - Haf\u0131zalar\u0131 \xe7ok kuvvetlidir. Bir konuyu bir kez s\xf6ylemek yeterlidir. Hat\u0131rlat\u0131lmaktan nefret ederler. \n\n - Asla y\xfczeysel bir ki\u015fi olamazlar. \xc7ocuklar\u0131 ile ileti\u015fim kurma konusunda, ketumdur. \n\n - Onlardan g\xfc\xe7l\xfc bir ki\u015filik, ya\u015fama kar\u015f\u0131 dayan\u0131kl\u0131 olmalar\u0131n\u0131 bekler. \n\n - Bir av t\xfcfe\u011fi, deri bir evrak \xe7antas\u0131, sert bir tra\u015f losyonu, g\xfczel bir ajanda. \n\n - Deriden yap\u0131lm\u0131\u015f her t\xfcrl\xfc e\u015fyay\u0131 sever.\n\n","Bur\xe7lar ku\u015fa\u011f\u0131n\u0131n en gizemli ki\u015fisi olan Akrepler, ya\u015fam\u0131 hi\xe7te hafife almaz. \n\n - \u0130\xe7lerindeki y\xfcksek duygular\u0131 onlar\u0131 ihtirasl\u0131 ve gizemli yapar. \n\n - Cinsel duygular\u0131n\u0131 \xe7ok yo\u011fun ya\u015farlar.A\u015fk ya\u015fant\u0131lar\u0131 olduk\xe7a gizlidir. \n\n - Kolay kap\u0131lar\u0131n\u0131 kimseye a\xe7mazlar.\u0130nsan\u0131 m\u0131knat\u0131s gibi \xe7eken bak\u0131\u015flar\u0131 vard\u0131r.\n\n - Kar\u015f\u0131s\u0131ndaki ki\u015fi \xe7ok kolay etkileri alt\u0131na al\u0131rlar.Bir ili\u015fkiyi v\xfccutlar\u0131nda ve kalplerinde ayn\u0131 anda ya\u015farlar.\n\n - Bildikleri tek \u015fey vard\u0131r. G\xfc\xe7l\xfc ihtiraslar\u0131 ve a\u015fka olan inan\xe7lar\u0131d\u0131r. Yasaklar\u0131 delen m\xfcthi\u015f bir sevgilidirler.\n\n - Bir Akreple beraberlik \xf6nce sab\u0131rdan ge\xe7er.Birine a\u015f\u0131k olmalar\u0131 kolay olmaz..\n\n - \u0130ncinmekten \xe7ok korkarlar ve kendinizi a\u015fka teslim etmek istemezler.\n\n"," - AKREP KIZI A\u015eKI Tutkuyla seversin. A\u015fk\u0131n \xe7ok \xf6zeldir. \n\n - Kolay a\u015f\u0131k olmazs\u0131n. Senin duygular\u0131n ger\xe7ektir. Biraz da, \xfcrk\xfct\xfcc\xfc bir y\xf6n\xfcn vard\u0131r. \n\n - A\u015f\u0131k oldu\u011fun zaman g\xf6z\xfcn hi\xe7bir \u015fey g\xf6rmez. Derin ve gizemli bir g\xfczelli\u011fin vard\u0131r. \n\n - Erkekler seni g\xf6rd\xfc\u011f\xfc zaman y\u0131ld\u0131r\u0131m \xe7arpm\u0131\u015fa d\xf6nerler. \u0130nan seni tan\u0131madan \xf6nce \xe7ok daha mutluydular. \n\n - Belki de ger\xe7ek anlamda a\u015fk\u0131 bilmiyorlard\u0131.\u2026 \xd6zel bir kad\u0131n olmak nas\u0131l bir duygu ? \u0130\u015fte bu sorunun cevab\u0131n\u0131 seninle kar\u015f\u0131la\u015f\u0131ncaya kadar fark\u0131nda de\u011fillerdi...\n\n - Senden \xf6nceleri vard\u0131.. Senden sonras\u0131 olmayacak bir a\u015fk\u0131n ba\u015flang\u0131c\u0131nda ka\xe7abilirlerse, beklide asla tutkulu bir a\u015fk\u0131 tan\u0131mayacaklard\u0131. \n\n - Ne dersin ? Bu kadar korkutucu muyum demeyin\u2026 Tabii ki de\u011fil. Ama \xe7ook \xf6zelsin\u2026. \n\n - AKREP KIZI PART\u0130 HAVASINDA Zodyak\u2019\u0131n ger\xe7ek di\u015fi olma sorumlulu\u011funu asla unutmaz ve bulundu\u011funuz her ortamda, ba\u015fkalar\u0131na da hat\u0131rlat\u0131rs\u0131n\u0131z. \n\n - Nas\u0131l m\u0131?..Kat\u0131ld\u0131\u011f\u0131n\u0131z partiyi hemen m\u0131knat\u0131s alan\u0131n\u0131za al\u0131r, b\xfcy\xfcleyici bak\u0131\u015flar\u0131n\u0131z\u0131 \xe7evrenize hissettirirsiniz. \n\n - Kadife bir ceket ve ipek g\xf6mlek, inci bir kolye ve vurgulay\u0131c\u0131 bir makyaj, en gizemli baharatlar\u0131n kar\u0131\u015f\u0131m\u0131 egzotik bir parf\xfcm ve ma\u011frur bir y\xfcz\xfcn sizi umursamaz tav\u0131rlar\u0131.\n\n - hangi erke\u011fin ilgisini \xe7ekmez ki. \xdcstelik hem k\u0131\u015fk\u0131rt\u0131c\u0131 hem de k\xfcstah\xe7a ve itici. \n\n - Ona yakla\u015fmak herkesin harc\u0131 olmayabilir fakat bir Bo\u011fa asla pes etmez.\n\n - Ba\u015fak ciddi tav\u0131rlar\u0131yla size tuzak haz\u0131rlayabilir. O\u011flakla s\u0131ra d\u0131\u015f\u0131 bir tart\u0131\u015fma ba\u015flatabilirsiniz. \n\n - Yenge\xe7 dostluk duygular\u0131n\u0131 size sunarken, onu incitmek akl\u0131n\u0131zdan bile ge\xe7mez.\n\n - Aslan\u2019a ders vermek isteyebilirsiniz.\n\n"," - Billur Kalkavan, Do\u011fa Rutkay, , Y\u0131lmaz Erdo\u011fan, Helin Av\u015far Hz. Muhammed, Alain Delon, Rock Hudson, Martin Luther, Alfred Nobel, Pablo Picasso, Marie Curie, Indira Gandhi, Katherine Hep Burn, Mesut Y\u0131lmaz, M. Kemal Atat\xfcrk, Necmettin Erbakan, Nazl\u0131 Il\u0131cak, S\xfcleyman Demirel, Dostoyevski, Tro\xe7ki, Albert Camus, Voltaire, Theodore Roosevelt. Arzum Onan, Emel Say\u0131n, Zerrin \xd6zer, Demirel , Meltem Cumbul, Muazzez Abac\u0131, Ediz Hun\n\n"," - D\xfcnyan\u0131n en ilgin\xe7 \xe7ocuklar\u0131d\u0131r diyebiliriz. Sessiz ve sakin denizlerde kopan f\u0131rt\u0131nalara benzerler.\n\n - Ya her \u015feyi silip g\xf6t\xfcr\xfcler, ya da bir limana s\u0131\u011f\u0131n\u0131rlar. G\xf6zlerinin ard\u0131nda neler ya\u015fand\u0131\u011f\u0131n\u0131 bulmak neredeyse imkans\u0131zd\u0131r. \n\n - Yaln\u0131zl\u0131\u011f\u0131 severler. Kendilerini oyalamaya bay\u0131l\u0131rlar. S\xfcrekli sevgiye ihtiya\xe7 duyarlar fakat bunu itiraf edemeyecek kadar gururludurlar. \n\n - Sezgileri o kadar g\xfc\xe7l\xfcd\xfcr ki g\xf6zleriyle sizi takip ederek hislerinizi ve d\xfc\u015f\xfcnceleriniz anlarlar. \n\n - Har\xe7l\u0131klar\u0131na d\xfc\u015fk\xfcn olup, onu asla paras\u0131z b\u0131rakmamal\u0131s\u0131n\u0131z. Kendisini g\xfcvensiz ve mutsuz hisseder.  \n\n - Fakat asla kendi paras\u0131n\u0131 harcamaz ve sizin harcaman\u0131z\u0131 bekler. Okul y\u0131llar\u0131nda okumaya d\xfc\u015fk\xfcnd\xfcr. \n\n - Disiplinli \xe7al\u0131\u015f\u0131r ve ba\u015far\u0131l\u0131 bir \xf6\u011frencidir. Al\u0131\u015f veri\u015fte en \xe7ok zevk ald\u0131\u011f\u0131 \u015feyler, polisiye romanlar, blue jean, spor ayakkab\u0131lar ve rock m\xfcz\xfc\u011fi dinleyebilece\u011fi CD ler. \n\n - Kol saatinden asla vazge\xe7mez. Derileri sevdi\u011fi i\xe7in, okul \xe7antas\u0131n\u0131 en pahal\u0131s\u0131ndan se\xe7ecektir. \n\n - Ayr\u0131ca k\u0131rm\u0131z\u0131 \xe7izmeler ,tokalar, kazaklar ve ti\u015f\xf6rtleri sever.. Erkek \xe7ocuklar\u0131 i\xe7in, tak\u0131m formalar\u0131 \xe7ok \xf6nemlidir.\n\n"," - Hediye almay\u0131 seven Akrepler, gizemli ve \u015fa\u015f\u0131rt\u0131c\u0131 hediyelerden ho\u015flan\u0131rlar. \n\n - Sezgilerine \xf6nem veren Akrepler \xf6zel \xe7aba gerektiren hediyeler haz\u0131rlanmas\u0131n\u0131 ister. \n\n - G\xfczel bir ak\u015fam yeme\u011fi, konser bileti, tiyatro ya da sinema aktivitesi, bir gece kul\xfcb\xfcnde bir e\u011flence d\xfczenlenebilir. \n\n - Ayn\u0131 zamanda tarz\u0131na uygun se\xe7ilmi\u015f olan trend giysiler, parf\xfcmler, kamera, korku ve polisiye filmleri, \u015f\u0131k c\xfczdanlar, el eme\u011fiyle yap\u0131lm\u0131\u015f \xf6zel tak\u0131lar, ah\u015fap sanatlar ve ev dekorasyonuyla ilgili aksesuarlar Akreplere verebilece\u011finiz di\u011fer hediye se\xe7enekleridir.\n\n"," - \xd6fkesi ve ya\u015fam enerjisi g\xf6zlerinde toplanm\u0131\u015ft\u0131r. \n\n - Sessiz ve sakin yakla\u015f\u0131mlar\u0131 bile \xfcrk\xfct\xfcc\xfcd\xfcr. Her \u015feyi inceleyen bak\u0131\u015flar\u0131 ile sorunlar\u0131 \xe7\xf6zme konusunda son derece ba\u015far\u0131l\u0131d\u0131rlar. \n\n - K\u0131skan\xe7l\u0131klar\u0131 \xe7o\u011fu zaman zararl\u0131d\u0131r. Kendileri de bu \xf6zelliklerini iyi bildikleri i\xe7in, s\xfcrekli denetleme ihtiyac\u0131n\u0131 duyarlar. \n\n - Akrep birlikte \xe7al\u0131\u015f\u0131lmas\u0131 \xe7ok zor biridir. \n\n - Ya\u015fant\u0131s\u0131na herkesi almazlar.Y\xf6netmeyi, y\xf6nlendirmeyi, problemleri radikal bir \u015fekilde \xe7\xf6zmeyi seven Akreplerin, \xf6fkeleriniz kontrol etmek i\xe7in olduk\xe7a zorland\u0131klar\u0131 bir ger\xe7ektir.\n\n - Sadakati ve kal\u0131c\u0131l\u0131\u011f\u0131 tercih eder. Kaybetmekten nefret etse de, kendini yenileme konusunda son derece h\u0131zl\u0131d\u0131r. \n\n - Yan\u0131p k\xfcl olan k\xfcllerinin aras\u0131ndan, b\xfcy\xfck bir g\xfc\xe7le aya\u011fa kalkar ve yoluna devam eder.\n\n - Ya\u015fam\u0131n derin sorgulay\u0131c\u0131s\u0131 ve derin bir gezginidir.\n\n"," - Zodyak\u2019\u0131n en anla\u015f\u0131lmaz burcudurlar. \xc7o\u011fu kez ele\u015ftiriye maruz kald\u0131\u011f\u0131n\u0131 i\xe7in, kendini savunmaktan vazge\xe7mi\u015fsindir.\n\n - Duygular\u0131n \xe7ok derindir. Gizemli yap\u0131n bulundu\u011fun ortamda seni farkl\u0131 yerlere getirir.\n\n - Duyumsaman yak\u0131c\u0131d\u0131r. Yo\u011fun duygular\u0131n, k\u0131skan\xe7l\u0131\u011f\u0131n\u0131 s\xfcrekli k\xf6r\xfckler. \n\n - H\u0131rsl\u0131 yap\u0131n y\xfcz\xfcnden en zor hastal\u0131klar gelip seni bulur. \n\n - Bir Akrep hastaland\u0131\u011f\u0131 zaman, te\u015fhis edilmesi zor tahlillere gerek duyulabilir. \n\n - Uzun ara\u015ft\u0131rmalar sonucu hastal\u0131\u011f\u0131n\u0131n nedeni genelde psikosomatik k\xf6kenli oldu\u011fu anla\u015f\u0131l\u0131r.. \n\n - A\xe7\u0131\u011fa \xe7\u0131karamad\u0131\u011f\u0131n duygular\u0131n y\xfcz\xfcnden bedenini harap edersin. \n\n - Cinsiyet hormonlar\u0131n\u0131z herkesten \xe7ok daha fazla \xe7al\u0131\u015f\u0131r. \n\n - V\xfccudundaki elektriksel potansiyel nedeniyle, bulundu\u011funuz ortamda insanlar\u0131 kendine m\u0131knat\u0131s gibi \xe7ekersinz.. \n\n - Hastal\u0131k konusunda sab\u0131rs\u0131zs\u0131n.. Ac\u0131ya senin kadar dayan\u0131kl\u0131 \xe7ok az ki\u015fi g\xf6r\xfcl\xfcr. \n\n - Al\u0131nabilecek en etkili ila\xe7lar\u0131 hi\xe7 \xe7ekinmeden al\u0131rs\u0131n. \u0130radene \xe7ok g\xfcvenir ve beyin g\xfcc\xfc ile kendini iyile\u015ftirirsin.\n\n - Akrepler mide ve \xfcreme organlar\u0131n\u0131 temsil etti\u011fi i\xe7in, bu organlar\u0131n hassast\u0131r fakat her t\xfcrl\xfc rahats\u0131zl\u0131\u011f\u0131n \xfcstesinden kolay gelirsin.\n\n"," - Y\xfckselen burcu Akrep olan ki\u015filer huy olarak a\u015f\u0131r\u0131l\u0131k g\xf6steren ki\u015filerdir. \n\n - Odakland\u0131klar\u0131 bir tarz\u0131 veya olay\u0131 ya\u015famlar\u0131n\u0131n merkezine haline getirebilirler. \n\n - Odak noktas\u0131n\u0131 da kolay kolay de\u011fi\u015ftirmezler. G\xfc\xe7l\xfc iradesi olan, k\u0131r\u0131c\u0131 ve sert ki\u015filerdir. \n\n - Ele\u015ftirisel davran\u0131\u015flar\u0131, kar\u015f\u0131s\u0131nda bulunan insan\u0131 \xfczebilecek derecededir. \n\n - Yanl\u0131\u015f anla\u015f\u0131lmak istemiyor, insanlar\u0131n\u0131n onu do\u011fru anlamas\u0131n\u0131 istiyorsa, iradeli bir \u015fekilde olumsuz davran\u0131\u015flar\u0131n\u0131 dengelemeleri gerekir.  - Y\xfckselen burcu Akrep olanlar do\u011fu\u015ftan y\xf6netici olan insanlard\u0131r. \n\n - Y\xf6netimini a\xe7\u0131k bir \u015fekilde yapmaz, gizli bir \u015fekilde y\xfcr\xfct\xfcrler ve bundan da fazlaca keyif al\u0131rlar.\n\n - Y\xfckselen burcu Akrep olan ki\u015filer fiziksel ili\u015fkinin sembol\xfc olarak g\xf6sterilebilir. \n\n - Geleneklere ba\u011fl\u0131 de\u011fildir, s\xfcrekli de\u011fi\u015fimin pe\u015finden ko\u015farlar. \n\n - G\xf6zlem yetene\u011fi \xe7ok iyidir, hi\xe7bir \u015fey bundan kurtulamaz. Her \u015feyi g\xf6zlemler ve yorumlar, i\u015fine gelmeyenlerden uzakla\u015f\u0131r. \n\n - Y\xfckselen burcu Akrep olan ki\u015filer son derece h\u0131rsl\u0131 insanlard\u0131r. \xc7o\u011fu Akrep insan\u0131 tek ba\u015f\u0131na olan insand\u0131r. \n\n - A\u015fk konusunda gizli maceralardan ho\u015flan\u0131rlar.\n\n"]),t.s)
